INSERT INTO `sigman_help` VALUES (1,'/sigman/status.html','Status Summary: PBX Status','Xaccel PBX Status','<h3>System Information</h3>\r\n\r\n<p>This pane displays information about the management server. There\r\nis no user interaction in this pane.</p>\r\n\r\n<dl>\r\n<dt><b>Management Server</b></dt>\r\n\r\n<dt>Company Name<dt><dd>Can be set in the config.sigman.php file\r\nlocated under /var/www/html/conf/config.sigman.php. This name can be\r\nanything.</dd>\r\n\r\n<dt>System Name<dt><dd>Can be set in the config.sigman.php file\r\nlocated under /var/www/html/conf/config.sigman.php. This name can be\r\nanything.</dd>\r\n\r\n<dt>Xaccel Version</dt><dd>This displays the version number of the\r\nXaccel installation.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Xaccel PBX Status</h3>\r\n\r\n<p>This pane displays status information about the PBX or PBX\'s\r\nmanaged by Xaccel, including active channels. </p>\r\n\r\n<dl>\r\n\r\n<dt><b>Local Server</b></dt>\r\n\r\n<dt>IP Address</dt><dd>The IP address of the server.</dd>\r\n\r\n<dt>Status</dt><dd>Possible values for this field are \"running,\" if\r\nthe PBX is running, and \"n/a,\" if the PBX can\'t be found.</dd>\r\n\r\n<dt>Version</dt><dd>The version of Asterisk running on the local\r\nserver.</dd>\r\n\r\n<dt>Uptime.</dt><dd>How long has the PBX been running?</dd>\r\n\r\n<dt>IAX Channels</dt><dd>Lists active IAX channels.</dd>\r\n\r\n<dt>SIP Channels</dt><dd>Lists active SIP channels.</dd>\r\n\r\n<dt><element class=\"linktext\">Active Channels</element></dt><dd>Link\r\nto listing of active channels (see below).</dd>\r\n\r\n</dl>\r\n\r\n<p>The <b>Active Channels</b> page lists the state of each\r\nchannel. There are three possible status displays: down %red-led%, up\r\n%green-led%, and ring or ringing %orange-led%. This page can be\r\nautomatically reloaded every five seconds by ticking the checkbox so\r\nlabeled.</p>\r\n\r\n'),(2,'/sigman/users.html','PBX: Users > Users > Users','Users List','<p>This interaction displays all users on the system. Use this\r\ninteraction to edit and delete user information.</p>\r\n\r\n<dl>\r\n\r\n<dt>Edit: %pen-icon%</dt><dd>Opens an Edit User interaction. See the\r\n\"PBX: Users > Users > Edit User\" help page for a description of the\r\nfields in this form.</dd>\r\n\r\n<dt>Edit: %X-icon%</dt><dd>Deletes the user\'s entry, including any\r\nassociated channels and/or Voicemail boxes.</dd>\r\n\r\n<dt>ID</dt><dd>The user\'s unique user ID. This is created\r\nautomatically when the user is added to the system.</dd>\r\n\r\n<dt>Name</dt><dd>The user\'s name. This can be anything. (Do not\r\nconfuse this with the \"User Name\" used for channel authentication).</dd>\r\n\r\n<dt>SIP</dt><dd>The SIP channel or channels associated with the\r\nuser. Clicking on the link opens an Edit Channel interaction, which\r\ncan also be accessed via \"PBX: Channels > SIP Channels > Channels >\r\nEdit %pen-icon%\".</dd> <!-- PM: does sigman really support multiple\r\nsip channels here? -->\r\n\r\n<dt>IAX</dt><dd>The IAX channel or channels associated with the\r\nuser. Clicking on the link opens an Edit Channel interaction, which\r\ncan also be accessed via \"PBX: Channels > IAX Channels > Channels >\r\nEdit %pen-icon%\".</dd> <!-- PM: does sigman really support multiple\r\niax channels here? -->\r\n\r\n<dt>Voicemail</dt><dd>The Voicemail box or boxes associated with the\r\nuser. Clicking on the link opens an Edit Mailbox interaction, which\r\ncan also be accessed via \"PBX: Users > Voicemail > Mailboxes > Edit\r\n%pen-icon%\". The format of this entry is\r\n<i>mailboxname@context</i>. The default context will be assumed if\r\nno context is chosen.</dd>\r\n\r\n</dl>'),(3,'/sigman/users-edit.html','PBX: Users > Users > Add User','Add User','<p>This interaction adds a user to the system.</p>\r\n\r\n\r\n<dl>\r\n\r\n<dt><b>Add User</b></dt>\r\n\r\n<dt>Name</dt><dd>The user\'s actual name. This can be anything. This\r\nshould not be confused with the \"User Name\" used for channel\r\nauthentication.</dd>\r\n\r\n<dt>Operator Console</dt><dd>This field is reserved for future\r\nfunctionality.</dd>\r\n\r\n<dt><b>Add</b></dt><dd>Click this button to enter the user information\r\nspecified on this page into the Xaccel system.</dd>\r\n\r\n<dt><b>Voicemail Mailboxes</b></dt>\r\n\r\n<dt>Associate Existing</dt><dd>Choose an existing Voicemail box for\r\nthis user. If an existing mailbox is selected, and a new mailbox is\r\ndefined as well (see below), both mailboxes will be associated with\r\nthe user.</dd>\r\n\r\n<dt>create new</dt><dd>Ticking this checkbox enables the following\r\nfive fields. A new mailbox will be created for the user.</dd>\r\n<blockquote>\r\n<dt>Mailbox</dt><dd>The new mailbox name. A typical value for this\r\nfield is the extension associated with the mailbox (for example,\r\n4027). Once created, a mailbox name cannot be changed. </dd>\r\n\r\n<dt>Full Name</dt><dd>The user\'s name. This is used as mailbox\r\nidentifier, and also used in the PBX directory for dial-by-name. This\r\nshould not be confused with the \"User Name\" used for channel\r\nauthentication.</dd>\r\n\r\n<dt>PIN</dt><dd>The Voicemail mailbox PIN</dd>\r\n\r\n<dt>E-Mail Address</dt><dd>If e-mail delivery of voice mail messages\r\nis enabled, this is the e-mail address to which Voicemail\r\nnotifications will be delivered.</dd>\r\n\r\n<dt>Context</dt><dd>The Voicemail context for the new mailbox.</dd>\r\n</blockquote>\r\n\r\n<dt><b>SIP Channels</b></dt>\r\n\r\n<dt>Associate Existing</dt><dd>Choose an existing SIP channel for\r\nthis user. If an existing channel is selected, and a new channel is\r\ndefined as well (see below), both channel will be associated with\r\nthe user.</dd>\r\n\r\n<dt>create new</dt><dd>Ticking this checkbox enables the following\r\neight fields. A new channel will be created for the user. Xaccel will\r\ntry to guess the values for Channel Name, Caller ID, and mailbox.</dd>\r\n\r\n<!-- it would be cool if the next eight items were indented -->\r\n<blockquote>\r\n<dt>Channel Name</dt><dd>The SIP channel name. This name can\'t have\r\nany spaces in it.</dd>\r\n\r\n<dt>Template</dt><dd>The template on which the new channel will be\r\nbased. You MUST choose a template when creating a new channel via this\r\ninteraction.</dd>\r\n\r\n<dt>User Name</dt><dd>The SIP username. This field can be left blank.</dd>\r\n\r\n<dt>Secret</dt><dd>The SIP secret. This field can be left blank.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>What is displayed in the Caller ID name\r\nfield on the recipient\'s device when this user makes a call. This\r\nfield can be left blank.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>What is displayed in the Caller ID number\r\nfield on the recipient\'s device when this user makes a call. This\r\nfield can be left blank.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox to enable the MWI (Message Waiting\r\nIndicator) display on the telephone. If no Voicemail context is\r\nspecified (e.g. 455@mycontext) the default Voicemail context is\r\nassumed.</dd>\r\n\r\n<dt>MAC Address</dt><dd>The MAC address of the telephone or ATA\r\ndevice. This field is only applicable if you are using a template that\r\ngenerates end-user device configuration files. See \"PBX: Channels >\r\nSIP Channels > Templates\" for further details.</dd> </blockquote>\r\n<dt><b>IAX Channels</b></dt>\r\n\r\n<dt>Associate Existing</dt><dd>Choose an existing IAX channel for\r\nthis user. If an existing channel is selected, and a new channel is\r\ndefined as well (see below), both channel will be associated with\r\nthe user.</dd>\r\n\r\n<dt>create new</dt><dd>Ticking this checkbox enables the following\r\neight fields. A new channel will be created for the user. Xaccel will\r\ntry to guess the values for Channel Name, Caller ID, and Mailbox.</dd>\r\n\r\n<!-- better if next eight fields were indented -->\r\n<blockquote>\r\n<dt>Channel Name</dt><dd>The IAX channel name. This name can\'t have\r\nany spaces in it.</dd>\r\n\r\n<dt>Template</dt><dd>The template on which the new channel will be\r\nbased. You MUST choose a template when creating a new channel via this\r\ninteraction.</dd>\r\n\r\n<dt>User Name</dt><dd>The IAX username. This field can be left blank.</dd>\r\n\r\n<dt>Secret</dt><dd>The IAX secret. While this field can be left blank,\r\nyou should always provide a password to help insure the security of\r\nyour system. </dd>\r\n\r\n<dt>Caller ID Name</dt><dd>What is displayed in the Caller ID name\r\nfield on the recipient\'s device when this user makes a call. This\r\nfield can be left blank.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>What is displayed in the Caller ID number\r\nfield on the recipient\'s device when this user makes a call. This\r\nfield can be left blank.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox to enable MWI (Message Waiting\r\nIndicator) display on the telephone. If no Voicemail context is\r\nspecified (e.g. 455@mycontext) the default Voicemail context is\r\nassumed.</dd>\r\n\r\n<dt>MAC Address</dt><dd>The MAC address of the telephone or ATA\r\ndevice. This field is only applicable if you are using a template that\r\ngenerates end-user device configuration files. See \"PBX: Channels >\r\nIAX Channels > Templates\" for further details.</dd> </blockquote>\r\n</dl>'),(4,'/sigman/users-edit.html','PBX: Users > Users > Users > Edit','Edit User','<p>This interaction edits information for a user already in the\r\nXaccel system.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Edit User</b></dt>\r\n\r\n<dt>Name</dt><dd>The user\'s actual name. This can be anything. This\r\nfield should not be confused with the \"User Name\" used for channel\r\nauthentication.<dd>\r\n\r\n<dt>Operator Console</dt><dd>This field is reserved for future\r\nfunctionality.</dd>\r\n\r\n<dt><b>Update</b></dt><dd>Click this button to save the changes made\r\non this page.</dd>\r\n\r\n<dt><b>Voicemail Mailboxes</b></dt>\r\n\r\n<dt>Associated Mailboxes</dt><dd>The mailboxes already associated with\r\nthe user. Clicking on a mailbox address will open an Edit Mailbox\r\ninteraction, also available under \"PBX: Users > Voicemail > Mailboxes\r\n> Edit: %pen-icon%\". Clicking on the %angle-icon% will disassociate\r\nthat mailbox from the user. (It will not delete the mailbox).</dd>\r\n\r\n<dt>Associate Existing</dt><dd>Choose an existing Voicemail box for\r\nthis user. If an existing mailbox is selected, and a new mailbox is\r\ndefined as well (see below), both mailboxes will be associated with\r\nthe user.</dd>\r\n\r\n<dt>create new</dt><dd>Ticking this checkbox enables the following\r\nfive fields. A new mailbox will be created for the user.</dd>\r\n\r\n<!-- It would be better if the five items below were indented -->\r\n<blockquote>\r\n<dt>Mailbox</dt><dd>The new mailbox name. A typical value for this\r\nfield is the extension associated with the mailbox (for example,\r\n4027). Once created, a mailbox name cannot be changed. </dd>\r\n\r\n<dt>Full Name</dt><dd>The user\'s name. This is used as mailbox\r\nidentifier, and also used in the PBX directory for dial-by-name. This\r\nshould not be confused with the \"User Name\" used for channel\r\nauthentication.</dd>\r\n\r\n<dt>PIN</dt><dd>The Voicemail mailbox PIN</dd>\r\n\r\n<dt>E-Mail Address</dt><dd>If e-mail delivery is enabled, this is the\r\ne-mail address to which voice mail will be delivered.</dd>\r\n\r\n<dt>Context</dt><dd>The Voicemail context for the new mailbox.</dd>\r\n</blockquote>\r\n<dt><b>SIP Channels</b></dt>\r\n\r\n<dt>Associated Channels</dt><dd>The SIP channels already associated\r\nwith the user. Clicking on a channel address will open an Edit Channel\r\ninteraction, also available under \"PBX: Channels > SIP Channels >\r\nChannels > Edit: %pen-icon%\". Clicking on the %angle-icon% will\r\ndisassociate that channel from the user.</dd>\r\n\r\n<dt>Associate Existing</dt><dd>Choose an existing SIP channel for\r\nthis user. If an existing channel is selected, and a new channel is\r\ndefined as well (see below), both channels will be associated with\r\nthe user.</dd>\r\n\r\n<dt>create new</dt><dd>Ticking this checkbox enables the following\r\neight fields. A new channel will be created for the user. Xaccel will\r\ntry to guess the values for Channel Name, Caller ID, and mailbox.</dd>\r\n\r\n<!-- it would be cool if the next eight items were indented -->\r\n<blockquote>\r\n<dt>Channel Name</dt><dd>The SIP channel name. This name can\'t have\r\nany spaces in it.</dd>\r\n\r\n<dt>Template</dt><dd>The template on which the new channel will be\r\nbased. You MUST choose a template when creating a new channel via this\r\ninteraction.</dd>\r\n\r\n<dt>User Name</dt><dd>The SIP username. This field can be left blank.</dd>\r\n\r\n<dt>Secret</dt><dd>The SIP secret. While this field can be left blank,\r\nyou should always provide a password to help insure the security of\r\nyour system. .</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>What is displayed in the Caller ID name\r\nfield on the recipient\'s device when this user makes a call. This\r\nfield can be left blank.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>What is displayed in the Caller ID number\r\nfield on the recipient\'s device when this user makes a call. This\r\nfield can be left blank.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox to enable the MWI (Message Waiting\r\nIndicator) display on the telephone. If no Voicemail context is\r\nspecified (e.g. 455@mycontext) the default Voicemail context is\r\nassumed.</dd>\r\n\r\n<dt>MAC Address</dt><dd>The MAC address of the telephone or ATA\r\ndevice. This field is only applicable if you are using a template that\r\ngenerates end-user device configuration files. See \"PBX: Channels >\r\nSIP Channels > Templates\" for further details.</dd> </blockquote>\r\n<dt><b>IAX Channels</b></dt>\r\n\r\n<dt>Associated Channels</dt><dd>The IAX channels already associated\r\nwith the user. Clicking on a channel address will open an Edit Channel\r\ninteraction, also available under \"PBX: Channels > IAX Channels >\r\nChannels > Edit: %pen-icon%\". Clicking on the %angle-icon% will\r\ndisassociate that channel from the user.</dd>\r\n\r\n<dt>Associate Existing</dt><dd>Choose an existing IAX channel for\r\nthis user. If an existing channel is selected, and a new channel is\r\ndefined as well (see below), both channel will be associated with\r\nthe user.</dd>\r\n\r\n<dt>create new</dt><dd>Ticking this checkbox enables the following\r\neight fields. A new channel will be created for the user. Xaccel will\r\ntry to guess the values for Channel Name, Caller ID, and Mailbox.</dd>\r\n\r\n<!-- it would be cool if the following eight fields were indented -->\r\n<blockquote>\r\n<dt>Channel Name</dt><dd>The IAX channel name. This name can\'t have\r\nany spaces in it.</dd>\r\n\r\n<dt>Template</dt><dd>The template on which the new channel will be\r\nbased. You MUST choose a template when creating a new channel via this\r\ninteraction.</dd>\r\n\r\n<dt>User Name</dt><dd>The IAX username. This field can be left\r\nblank.</dd>\r\n\r\n<dt>Secret</dt><dd>The IAX secret. While this field can be left blank,\r\nyou should always provide a password to help insure the security of\r\nyour system.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>What is displayed in the Caller ID name\r\nfield on the recipient\'s device when this user makes a call. This\r\nfield can be left blank.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>What is displayed in the Caller ID number\r\nfield on the recipient\'s device when this user makes a call. This\r\nfield can be left blank.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox to enable the MWI (Message Waiting\r\nIndicator) display on the telephone. If no Voicemail context is specified\r\n(e.g. 455@mycontext) the default Voicemail context is assumed.</dd>\r\n\r\n<dt>MAC Address</dt><dd>The MAC address of the telephone or ATA\r\ndevice. This field is only applicable if you are using a template that\r\ngenerates end-user device configuration files. See \"PBX: Channels >\r\nIAX Channels > Templates\" for further details.</dd> </blockquote>\r\n</dl>\r\n'),(5,'/sigman/voicemail.html','PBX: Users > Voicemail > Mailboxes','Mailbox List','<p>This interaction lists information about Voicemail mailboxes, and\r\nprovides access to edit and delete functions.</p>\r\n\r\n<dl>\r\n\r\n<dt>Edit: %pen-icon%</dt><dd>Opens an Edit Mailbox interaction. See\r\nthe \"PBX: Users > Voicemail > Edit Mailbox\" help page for a description\r\nof the fields in this form.</dd> \r\n\r\n<dt>Edit: %X-icon%</dt><dd>Deletes the selected mailbox. The contents\r\nof the mailbox stay on disk, and can be accessed again by creating a\r\nmailbox with the same name (typically a number).</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox name (typically a number). This may\r\ninclude a context.</dd>\r\n\r\n<dt>PIN</dt><dd>The Voicemail mailbox\'s PIN.</dd>\r\n\r\n<dt>E-Mail</dt><dd>The e-mail address for Voicemail to e-mail\r\ndelivery. If this field is blank, no delivery has been specified.</dd>\r\n\r\n<dt>Fullname</dt><dd>The name of the user associated with the\r\nVoicemail mailbox.</dd>\r\n\r\n<dt>Context</dt><dd>The Voicemail context for the Voicemail\r\nmailbox.</dd>\r\n\r\n</dl>'),(6,'/sigman/voicemail-edit.html','PBX: Users > Voicemail > Mailboxes > Edit','Edit Mailbox','<p>The Edit Mailbox interaction lets you change Voicemail mailbox\r\nsettings for a particular mailbox.</p>\r\n\r\n<dl>\r\n\r\n<dt>Full Name</dt><dd>Specifies the full name of the Voicemail mailbox\r\nowner. This is also used for the PBX directory.</dd>\r\n\r\n<dt>PIN</dt><dd>The Voicemail mailbox PIN.</dd>\r\n\r\n<dt>E-Mail Address</dt><dd>The e-mail address for Voicemail to e-mail\r\ndelivery. For no delivery, leave blank.</dd>\r\n\r\n<dt>Context</dt><dd>The Voicemail context for the Voicemail\r\nMailbox. If omitted, the default context is assumed (e.g\r\n455@default).</dd>\r\n\r\n<dt>Attach Voicemail File</dt><dd>Whether or not to attach a WAV file\r\nto Voicemail to e-mail delivery. Options are <b>yes</b> and\r\n<b>no</b>. The default (no selection) is <b>yes</b>.</dd>\r\n\r\n<dt>Say Caller ID</dt><dd>Whether or not to identify the caller ID\r\nwhen picking up voice mail. Options are <b>yes</b> and <b>no</b>. The\r\ndefault (no selection) is <b>no</b>.</dd>\r\n\r\n<dt>Hide from Directory</dt><dd>Whether or not to hide this Voicemail\r\nuser from the PBX directory (see Full Name setting). Options are\r\n<b>yes</b> and <b>no</b>. The default (no selection) is\r\n<b>no</b>.</dd>\r\n\r\n<dt>Pager</dt><dd>A pager address for notification.</dd>\r\n\r\n<dt>Delete after Notification</dt><dd>After notification, the voicemail is deleted \r\nfrom the server. This is intended for use with users who wish to receive their voicemail \r\nONLY by email. The default (no selection) is\r\n<b>no</b>.</dd>\r\n\r\n</dl>'),(7,'/sigman/voicemail-edit.html','PBX: Users > Voicemail > Add Mailbox','Add Mailbox','<p>This interaction lets you create and specify settings for a new\r\nVoicemail mailbox.</p>\r\n\r\n<dl>\r\n\r\n<dt>Full Name</dt><dd>Specifies the full name of the Voicemail mailbox\r\nowner. This is also used for the PBX directory.</dd>\r\n\r\n<dt>PIN</dt><dd>The Voicemail mailbox PIN</dd>\r\n\r\n<dt>E-Mail Address</dt><dd>The e-mail address for Voicemail to e-mail\r\ndelivery. For no delivery, leave blank.</dd>\r\n\r\n<dt>Context</dt><dd>The Voicemail context for the Voicemail\r\nmailbox. If omitted, the default context is assumed (e.g\r\n455@default).</dd>\r\n\r\n<dt>Attach Voicemail File</dt><dd>Whether or not to attach a WAV file\r\nto Voicemail to e-mail delivery. Options are <b>yes</b> and\r\n<b>no</b>. The default (no selection) is <b>yes</b>.</dd>\r\n\r\n<dt>Say Caller ID</dt><dd>Whether or not to identify the caller ID\r\nwhen picking up voice mail. Options are <b>yes</b> and <b>no</b>. The\r\ndefault (no selection) is <b>no</b>.</dd>\r\n\r\n<dt>Hide from Directory</dt><dd>Whether or not to hide this Voicemail\r\nuser from the PBX directory (see Full Name setting). Options are\r\n<b>yes</b> and <b>no</b>. The default (no selection) is\r\n<b>no</b>.</dd>\r\n\r\n<dt>Pager</dt><dd>A pager address for notification.</dd>\r\n\r\n<dt>Delete after Notification</dt><dd>After notification, the voicemail is deleted \r\nfrom the server. This is intended for use with users who wish to receive their voicemail \r\nONLY by email. The default (no selection) is\r\n<b>no</b>.</dd>\r\n\r\n</dl>'),(8,'/sigman/voicemail-general.html','PBX: Users > Voicemail > General Settings','Voicemail General Settings','<p>This interaction specifies the values of Voicemail parameters, and\r\nprovides access to add, edit, and delete functions. Voicemail\r\nparameters are presented as name-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting (not visible if there are no\r\nsettings defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %c-icon% to change the variable name to a custom name\r\n(not included in the pulldown menu). Use the %check-icon% to enter the\r\nedited pair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the selected name (shown in the\r\npulldown menu) and value (entered in the text field). See below for a\r\nlisting of pulldown menu items.</dd>\r\n\r\n<dt>%c-icon%</dt><dd>Enables a custom setting. Click on the %c-icon%\r\nand then enter the name and value in the two fields at left. Click\r\n<b>Add</b> to enter the new pair.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<!-- true that any of these fields can be left blank? -->\r\n\r\n<dl>\r\n\r\n<dt>adsifdn</dt><dd>The Analog Display Services Interface (ADSI)\r\nsecurity lock code.</dd>\r\n\r\n<dt>adsisec</dt><dd>The ADSI Voicemail application version number.</dd>\r\n\r\n<dt>adsiver</dt><dd>The ADSI voicemail application version number.</dd>\r\n\r\n <dt>attach</dt><dd>Should the e-mail contain the voice mail as an\r\nattachment. Options are <b>yes</b> and <b>no</b>. <!--what is default?--> </dd>\r\n\r\n<dt>backupdeleted</dt><dd>Maximum number of messages allowed in the <b>Deleted</b> folder.  If set to <b>0</b> or <b>no</b> then no deleted messages will be moved.  Default is <b>0</b>.</dd>\r\n\r\n<dt>callback</dt><dd>The context to call back from. If this is left\r\nblank, calling the sender back will not be supported.</dd>\r\n\r\n<dt>charset</dt><dd>The character set for Voicemail messages. A\r\ntypical value is <b>ISO-8859-1</b>.<dd>\r\n\r\n<dt>cidinternalcontexts</dt><dd>Internal Context for Name Playback instead of extension digits when saying caller id.</dd>\r\n\r\n<dt>dialout</dt><dd>Context to dial out from [option 4 from mailbox\'s advanced menu].  If not specified, option4 will not be listed and dialing out from within VoiceMailMain() will not be permitted.</dd>\r\n\r\n<dt>directoryintro</dt><dd>The file name of a custom directory\r\ngreeting. A typical value would be <b>directory-intro</b>.</dd>\r\n<!-- I think this is right.  is there a .wav extension? -->\r\n\r\n<dt>emailbody</dt><dd>The body of a Voicemail notification\r\ne-mail. Variables that can be included in this text include:<br><br>\r\n\r\n<b>VM_CALLERID</b> - the caller ID of the person who left the message<br>\r\n<b>VM_DATE</b> - the date of the message<br>\r\n<b>VM_DUR</b> - the duration of the message<br>\r\n<b>VM_MAILBOX</b> - the mailbox name (typically its number)<br>\r\n<b>VM_MSGNUM</b> - the number of messages in the mailbox<br>\r\n<b>VM_NAME</b> - the full name associated with the mailbox<br><br>\r\n\r\nA typical value for this field might be: <b>Dear ${VM_NAME}:\\n\\n\\tjust\r\nwanted to let you know you were just left a ${VM_DUR} long Voicemail\r\nmessage.</b> <br>\r\n\r\nNote: This configuration can\'t be longer than 512 characters.</dd>\r\n\r\n<dt>emaildateformat</dt><dd>Set the date format on outgoing mails.  Valid arguments can be found on the strftime(3) man page.</dd>\r\n\r\n<dt>emailsubject</dt><dd>The subject line of a Voicemail notification\r\nemail. A typical subject line would be: <b>[PBX]: New message\r\n${VM_MSGNUM} in mailbox ${VM_MAILBOX}</b>. See the entry above under\r\n\"emailbody\" for an explanation of variables.</dd>\r\n\r\n<dt>envelope</dt><dd>Turns on or off automatic envelope playback\r\nbefore message playback. Options are <b>on</b> or <b>off</b>. The\r\ndefault value is <b>on</b>.</dd>\r\n\r\n<dt>exitcontext</dt><dd>iContext to go to on user exit such as * or 0.  The default is the current context.</dd>\r\n\r\n<dt>externnotify</dt><dd>The name/location of an external program to\r\nbe called when a voice mail is left or delivered, or a Voicemail\r\nmailbox is checked. A typical format is <b>/usr/bin/myapp</b>.</dd>\r\n\r\n<dt>externpass</dt><dd>The name/location of an external program to be\r\ncalled when a Voicemail password is changed. A typical format is\r\n<b>/usr/bin/myapp</b>.</dd>\r\n\r\n<dt>externpasscheck</dt><dd>The name/location of an external program to be\r\ncalled when a Voicemail password is changed. Arguments for this script are:\r\n<b>mailbox context oldpass newpass</b>.</dd>\r\n\r\n<dt>externpassnotify</dt><dd>The name/location of an external program to be\r\ncalled when a Voicemail password is changed. A typical format is\r\n<b>/usr/bin/myapp</b>.Note that this will also change the password in voicemail.conf.</dd>\r\n\r\n<dt>forcegreetings</dt><dd>Forces greeting play when a caller accesses\r\nthe mailbox.</dd> <!-- I assume it\'s the caller and not the mailbox\r\nowner Is it \"on\" and \"off\" or \"yes\" and \"no\"?-->\r\n\r\n<dt>forcename</dt><dd>Forces name recording when a caller accesses the\r\nmailbox.</dd> <!-- the caller or the user? Is it \"on\" and \"off\" or\r\n\"yes\" and \"no\"?-->\r\n\r\n<dt>format</dt><dd>The default file format for writing voice\r\nmail. Typical values are <b>g723sf</b>, <b>gsm</b>, <b>wav</b>,\r\n<B>wav49</b>, or <b>wav49</b>.</dd>\r\n\r\n<dt>forward_urgent_auto</dt><dd>Forward an urgent message.  Default to no so sender can set the urgency on the envelope of the forwarded message.</dd>\r\n\r\n<dt>locale</dt><dd>Set the locale for generation of the date/time strings.</dd>\r\n\r\n<dt>mailcmd</dt><dd>The mail command used to send a Voicemail\r\nnotification e-mail. A typical value is <b>/usr/sbin/sendmail\r\n-t</b>.</dd>\r\n\r\n<dt>maxgreet</dt><dd>The maximum greeting length, in seconds. A\r\ntypical value is <b>60</b>.</dd>\r\n\r\n<dt>maxlogins</dt><dd>The maximum number of failed Voicemail login\r\nattempts permitted by the system. A typical value is <b>3</b>.</dd>\r\n\r\n<dt>maxmsg</dt><dd>The maximum number of messages per folder.  If not specified, a default value of <b>100</b> is used.  Maximum value for this option is <b>9999</b>.</dd>\r\n\r\n<dt>maxsecs</dt><dd>The maximum length of a Voicemail message, in\r\nseconds. A typical value is <b>180</b>.</dd>\r\n\r\n<dt>maxsilence</dt><dd>The number of seconds of silence to wait before\r\nautomatically ending a Voicemail recording. A typical value is\r\n<b>10</b>. (See silencethreshold). </dd>\r\n\r\n<dt>messagewrap</dt><dd>Enable next/last message to wrap around to first (from last) and last (from first message).  The default is <b>no</b>.</dd>\r\n\r\n<dt>minsecs</dt><dd>The minimum length of a Voicemail message, in\r\nseconds. A typical value is <b>3</b>.</dd>\r\n\r\n<dt>minpassword</dt><dd>Enforce minimum password length.</dd>\r\n\r\n<dt>moveheard</dt><dd>Move heard message to the <b>Old</b> folder automatically.  Default to <b>on</b>.</dd>\r\n\r\n<dt>nextaftercmd</dt><dd>Should the Voicemail system skip to the next\r\nmessage after hitting 7 or 9 to delete/save the current\r\nmessage. Options are <b>yes</b> or <b>no</b>. <!-- default? --> </dd>\r\n\r\n<dt>operator</dt><dd>Can a caller reach an operator by pressing 0\r\nbefore, after, or during leaving a Voicemail message. Options are\r\n<b>on</b> or <b>off</b>. The default is <b>off</b>.</dd>\r\n\r\n<dt>pagerbody</dt><dd>The body of the Voicemail notification pager email.</dd>\r\n\r\n<dt>pagerdateformat</dt><dd>Set the date format on outgoing pager email.  Valid arguments can be found on the strftime(3) man page.</dd>\r\n\r\n<dt>pagerfromstring</dt><dd>The \"From:\" string for pager\r\nmessages. </dd>\r\n\r\n<dt>pagersubject</dt><dd>The \"Subject:\" string for pager messages.</dd>\r\n\r\n<dt>pbxskip</dt><dd>Should the \"[PBX]:\" in the \"From:\" string of a\r\nVoicemail notification e-mail be skipped. Options are <b>yes</b> and\r\n<b>no</b>. The default is <b>yes</b>. (See emailsubject).</dd>\r\n\r\n<dt>pollfreq</dt><dd>If the <b>pollmailboxes</b> option is enabled, this option sets the polling frequency.  The default is once every <b>30</b> seconds.</dd>\r\n\r\n<dt>pollmailboxes</dt><dd>If mailboxes are changed anywhere outside of app_voicemail, then this option must be enabled for MWI to work.  This enables polling mailboxes for changes.  Normally, it will expect that changes are only made when someone called in to one of the voicemail applications.<br>Examples of situations that would require this option are web interfaces to voicemail or email client in the case of using IMAP storage.</dd>\r\n\r\n<dt>review</dt><dd>Can a caller review/re-record their message before\r\nsaving it. Options are <b>on</b> or <b>off</b>. The default is\r\n<b>off</b>.</dd>\r\n\r\n<dt>saycid</dt><dd>Say the caller id information before the message.  If not described or set to <b>no</b>, it will be in the envelope.</dd>\r\n\r\n<dt>sayduration</dt><dd>Turn on/off the duration information before the message.  Options are <b>yes</b> and <b>no</b>.  The default is <b>yes</b>.</dd>\r\n\r\n<dt>saydurationm</dt><dd>Specify the minimum duration to say.  Default is 2 minutes.</dd>\r\n\r\n<dt>searchcontexts</dt><dd>Whether the search the mailbox from all contexts. Options are <b>yes</b> or <b>no</b>.  The default is <b>no</b>.</dd>\r\n\r\n<dt>sendvoicemail</dt><dd>The context from which to send voice mail\r\n(option 5 from the advanced menu). If not specified, sending messages\r\nfrom inside Voicemail will not be permitted.</dd>\r\n\r\n<dt>serveremail</dt><dd>What sender a Voicemail notification e-mail\r\nshould appear to come from. A typical value would be\r\n<b>asterisk@<i>yourdomain.com</i></b>.</dd>\r\n\r\n<dt>silencethreshold</dt><dd>The silence threshold (what the Voicemail\r\nsystem considers to be silence). The lower the number, the more\r\nsensitive. A typical value would be <b>180</b>. (See maxsilence).</dd>\r\n\r\n<dt>skipms</dt><dd>How many milliseconds to skip forward or backward\r\nwhen using fast forward or rewind during message playback. A typical\r\nvalue is <b>3000</b>.</dd>\r\n\r\n<dt>smdienable</dt><dd>If you would like to enable SMDI notication then set smdienable to <b>yes</b>.  You will also need to make sure smdiport is set to a valid port as specified in smdi.conf.</dd>\r\n\r\n<dt>smdiport</dt><dd>SMDI port to be used if <b>smdienable</b> is set to <b>yes</b>.  For example, <b>/dev/ttyS0</b>.</dd>\r\n\r\n<dt>tempgreetwarn</dt><dd>Remind the user that their temporary greeting is set.</dd>\r\n\r\n<dt>usedirectory</dt><dd>Should users be able to find entries for\r\nforward and compose in the directory?.</dd>  <!--Is it \"on\" and \"off\" or\r\n\"yes\" and \"no\"?  default? -->\r\n\r\n<dt>userscontext</dt><dd>User context is where entries from users.conf are registered.  The default value is <b>default</b>.</dd>\r\n\r\n<dt>volgain</dt><dd>Emails bearing the voicemail may arrive in a volume too quiet to be heard.  This parameter allows you to specify how much gain to add to the message when sending a voicemail.<br>Note that <b>sox</b> must be installed for this option to work.</dd>\r\n\r\n </dl>'),(71,'/sigman/voicemail-zones.html','Voicemail','Voicemail Zones','<p>Use this interface to add new voicemail time zones to the system</p>'),(70,'/sigman/voicemail-clear.html','Voicemail','Clear Voicemail boxes','<p>This interaction is used to clear all voicemail boxes from the database - this is irreversible. Please confirm\r\nby entering \"I agree\" into the input box</p>'),(9,'/sigman/channels.html','PBX: Channels > Overview','Channel Overview','<p>This non-interactive page provides a quick overview of the\r\nconfigured channels associated with the Xaccel system.</p>'),(10,'/sigman/channels-sip.html','PBX: Channels > SIP Channels > Channels','SIP Channels','<p>This interaction provides an overview of available SIP channels, as\r\nwell as access to editing and delete functions.</p>\r\n\r\n<dl>\r\n<dt>Edit: %pen-icon%</dt><dd>Opens an Edit Channel interaction. See\r\nthe \"PBX: Channels > SIP Channels > Edit Channel\" help page for a\r\ndescription of the fields in this form.</dd>\r\n\r\n<dt>Edit: %X-icon%</dt><dd>Deletes the channel entry.</dd>\r\n\r\n<dt>Channel</dt><dd>The name of the channel.</dd>\r\n\r\n<dt>Type</dt><dd>The channel type. (Options are peer, user, or friend).</dd>\r\n\r\n<dt>Username</dt><dd>The user name associated with the channel. <!-- SIP\r\nusername? --> </dd>\r\n\r\n<dt>Caller ID</dt><dd>The name and number associated with that\r\nchannel\'s caller ID.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox name, including context.</dd>\r\n\r\n\r\n</dl>'),(11,'/sigman/channels-sip-edit.html','PBX: Channels > SIP Channels > Channels > Edit','Edit SIP Channels','<p>This interaction edits a SIP channel that has been previously\r\ncreated.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Edit SIP Channel <i>channelname</i></b></dt>\r\n\r\n<dt>User Name</dt><dd>The user name for the SIP channel. This is used\r\nfor authentication. <!-- should decide if its username or user name\r\n--></dd>\r\n\r\n<dt>Secret</dt><dd>The SIP secret (password) used to authenticate a SIP\r\nchannel. If The PBX is acting as a SIP server, then this SIP\r\nclient must login with this password (a shared secret). If The PBX is\r\nacting as a SIP client to a remote SIP server that requires SIP INVITE\r\nauthentication, then this field is used to authenticate SIP INVITEs\r\nthat The PBX sends to the remote SIP server.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>The Caller ID name for the channel.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>The Caller ID number for the channel.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox, including the Voicemail context for\r\nthe MWI (Message Waiting Indicator) on the end-user device.</dd>\r\n\r\n<dt>SetVar</dt><dd>Channel variable to be set for all calls from or to this device.</dd>\r\n\r\n<dt>Type</dt><dd>There are three possible types:<br> \r\n\r\na <b>peer</b> is a SIP entity to which the PBX only sends calls (a SIP\r\nprovider, for example). If you want a user (extension) to have\r\nmultiple phones, define an extension that calls two SIP peers. The\r\npeer authenticates at registration.<br> \r\na <b>user</b> is SIP entity\r\nthat places calls through the PBX (a phone that can place calls only,\r\nfor example). Users authenticate to reach services with their\r\ncontext. <br>\r\na <b>friend</b> is an entity that is both a user and a\r\npeer. This is the logical choice for most desk handsets, and other\r\ndevices. When you select \"friend,\" The PBX will create two objects,\r\none peer and one user, with the same name.</dd>\r\n\r\n<dt>Host</dt><dd>The host IP number or host name that will be used to\r\nfind the client. If you want the phone to register itself, use the\r\nkeyword \"dynamic\" instead of the host IP.</dd>\r\n\r\n<dt>Context</dt><dd>The context in the dialplan used for for outbound\r\ncalls from this channel.</dd>\r\n\r\n<dt>Language</dt><dd>The language code that specifies the language for\r\nprompts and specific local phone signals (language codes are defined\r\nin \"Configuration: PBX configuration > Advanced > Indications\").</dd>\r\n\r\n<dt>NAT</dt><dd>Depending on the nat settings, Asterisk may override the address/port information specified in the SIP/SDP messages, and use the information (sender address) supplied by the network stck instead.  Valid options are <b>no</b> (User rport if the remote side says to use it), <b>yes</b> (Force rport to always be on and perform comedia RTP handling), <b>force_rport</b> (Force rport to always be on), and <b>comedia</b> (use rport if the remote side says to use it and perform comedia RTP handling).  Default to <b>no</b>.</dd>\r\n\r\n<dt>Qualify</dt><dd>Periodically check if the client is reachable. Options are\r\n<b><i>xxx</i></b>, <b>no</b>, and <b>yes</b>, where <i>xxx</i> is the\r\nnumber of milliseconds before timeout. If yes is entered, the default\r\ntimeout is used, which is two seconds.<br><br>\r\n\r\nIf you turn on qualify in the configuration of a SIP device, the PBX\r\nwill send a SIP OPTIONS command regularly to check that the device is\r\nstill online. If the device does not answer within the configured (or\r\ndefault) period (in milliseconds) the PBX considers the device\r\noff-line for future calls.<br><br>\r\n\r\nThis feature can also be used to keep a UDP session open to a device\r\nthat is located behind a network address translator (NAT). By sending\r\nthe OPTIONS request, the UDP port binding in the NAT (on the outside\r\naddress of the NAT/firewall device) is maintained, by sending traffic\r\nthrough it. If the binding were to expire, there would be no way for\r\nthe PBX to initiate a call to the SIP device. This can be used in\r\nconjunction with the NAT=yes setting.</dd>\r\n\r\n<dt>Default IP</dt><dd>The default IP for the channel. <br><br>\r\n\r\nIf a peer is configured to register automatically (dynamic = yes), it\r\nwon\'t be possible to place calls to the phone until it registers, ie.,\r\ntells us where it is to be reached. If you know where the phone is,\r\nyou can configure the Default IP to be the IP address of the phone,\r\nand User Name to be the username used on the phone. This configuration\r\nwill be used to place calls to the phone until there is\r\nregistration. In the registration process, the phone provides the PBX\r\nwith a username, and an address where it can be reached. <br><br>\r\n\r\nIt is also possible to specify a host name instead of an IP address,\r\nwhich can be useful if you do not know your (dynamic) IP Address, but\r\nrather use a dynamic DNS like dyndns.org.</dd>\r\n\r\n<dt>Qualify Freq</dt><dd>How often to check for the host to be up in seconds and reported in milliseconds with sip show settings.  Set to low value if you use low timeout for NAT of UDP sessions.  Default to <b>60</b>.</dd>\r\n\r\n<dt>Parking Lot</dt><dd>Set the default parking lot for call parking. </dd>\r\n\r\n<dt>Direct Media</dt><dd> This peer option is used to tell the PBX\r\nserver to never issue a reinvite to the client. When SIP initiates the\r\ncall, the INVITE message contains the information about where to send\r\nthe media streams. The PBX uses itself as the end-points of media\r\nstreams when setting up the call. Once the call has been accepted, the\r\nPBX sends another (re)INVITE message to the clients, with the\r\ninformation necessary to have the two clients send the media streams\r\ndirectly to each other. Allowing re-invites will result in the PBX\r\nlosing control of the call. </dd>\r\n\r\n<dt>MOH Interpret</dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>MOH Suggest</dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes. This field, if defined, is used to\r\npopulate the \"accountcode\" field of the CDR. This field can be\r\nanything.</dd>\r\n\r\n<dt>Amaflags</dt><dd>Categorization for CDR records. The options are\r\n<b>default</b>, <b>omit</b>, <b>billing</b>, and\r\n<b>documentation</b>.</dd>\r\n\r\n<dt>DTMF Mode</dt><dd>How the client handles DTMF signaling. Choices\r\nare <b>inband</b>, <b>rfc2833</b>, or <b>info</b>. If inband is\r\nspecified, the device that a user presses the key on will generate the\r\nDTMF tones. If the codec is not ulaw or alaw, then the DTMF tones will\r\nbe distorted by the audio compression, and will not be recognized. If\r\nthe phone is set for RFC2833 and the PBX is set for inband, then you\r\nmay not hear anything. For more information about rfc2833, see\r\nhttp://www.ietf.org/rfc/rfc2833.</dd>\r\n\r\n<dt>Insecure</dt><dd>Tells the system to not check for Host IP and\r\nport for a peer (not a user).</dd>\r\n\r\n<dt>RFC2833 Compensate</dt><dd>Compensate for pre-1.4 DTMF transmission from another Asterisk machine.  You must have this turned on or DTMF reception will work improperly.</dd>\r\n\r\n<dt>Outbound Proxy</dt><dd>iSend outbound signalling to this proxy, not directly to the devices.</dd>\r\n\r\n<dt>Call Group</dt><dd>Defines the call group for calls to this\r\ndevice/channel.</dd>\r\n\r\n<dt>Pickup Group</dt><dd>The group of fellow users that can pick up\r\nthis users\' calls, using *8 and the Pickup() application on the *8\r\nextension.</dd>\r\n\r\n<dt>Disallow Codec</dt><dd>Disallows the listed codecs. The option\r\n<b>all</b> will disallow all codecs. This is useful when combined with\r\n\"allow codecs.\"  </dd>\r\n\r\n<dt>Allow Codec</dt><dd>The list of allowed codecs.</dd>\r\n\r\n<dt>From User</dt><dd>Specifies a name to put in the \"from\" field\r\ninstead of the caller ID (overrides the caller ID) when placing calls\r\n<i>to</i> a peer (another SIP proxy).</dd>\r\n\r\n<dt>From Domain</dt><dd>Sets the default \"From:\" domain in SIP\r\nmessages when placing calls <i>to</i> a peer.<dd>\r\n\r\n<dt>Calling Pres</dt><dd>Set the Caller ID presentation for this user.  Valid values are: <b>allowed_not_screen</b> (presentation allowed, not screened), <b>allowed_passed_screen</b> (presentation allowed, passed screen), <b>allowed_failed_screen</b> (presentation allowed, failed screen), <b>allowed</b> (presentation allowed, network number), <b>prohib_not_screened</b> (presentation prohibited, not screened), <b>prohib_passed_screen</b> (presentation prohibited, passed screen), <b>prohib_failed_screen</b> (presentation prohibited, failed screen), <b>prohib</b> (presentation prohibited, network number), <b>unavailable</b> (number unavailable).</dd>\r\n\r\n<dt>Default User</dt><dd>Username to use in INVITE until peer registers.</dd>\r\n\r\n<dt>Port</dt><dd>The SIP port of the client. The default port is 5060. </dd>\r\n\r\n<dt>MD5 SecretM</dt><dd>The MD5-Hash of \"<i>user</i>:the\r\nPBX:<i>secret</i>\" (can be used instead of secret).</dd>\r\n\r\n<dt>Transport</dt><dd>Set the default transport type for outgoing call.  The default transport type is only used for outbound messages until a registration takes place.  During the peer registration the transport type may change to another supported type if the peer requests so.  Valid values are <b>udp</b> and <b>tcp</b>.</dd>\r\n\r\n<dt>Remote Secret</dt><dd>Our password to their service.</dd>\r\n\r\n<dt>Call Limit</dt><dd>Limit for the number of simultaneous active\r\ncalls for a SIP client.</dd>\r\n\r\n<dt>Busy Level</dt><dd>Set the number of call threshold before the system indicate busy.</dd>\r\n\r\n<dt>Permit</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Deny</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>RTP Timeout</dt><dd>How many seconds of no RTP activity before the\r\ncall is terminated, when not on hold.</dd>\r\n\r\n<dt>RTP Hold Timeout</dt><dd><dd>How many seconds of no RTP activity\r\nbefore the call is terminated, when on hold. This must be larger than\r\nRTP Timeout.</dd> \r\n\r\n<dt>Video Support</dt><dd>Turn on support for SIP video for this device.</dd>\r\n\r\n<dt>Max Bitrate (kbps)</dt><dd>Maximum bitrate for video calls (default to <b>384 kb/s</b>.</dd>\r\n\r\n<dt>T38 Support</dt><dd>Enable T.38 Fax support on SIP calls.  It defaults to <b>off</b>.  Valid values are <b>yes,fec</b> (Enables T.38 with FEC error correction), <b>yes,redundancy</b> (Enables T.38 with redundnacy error correction), <b>yes,none</b> (Enables T.38 with no error correction), and <b>no</b> (Disables T.38 support).</dd>\r\n\r\n<dt>T38 Use RTP Src</dt><dd>Use the source IP address of RTP as the destination IP address for UDPTL packets if the nat option is enabled.  If a single packet is received, Asterisk will know the external IP address of the remote device.  If port forwarding is done at the client side, then UDPTL will flow to the remote device.</dd>\r\n\r\n<dt>RTP Keep Alive</dt><dd>Send Keepalives in the RTP stream to keep NAT open.  Default is <b>off</b> (0).</dd>\r\n\r\n<dt>G726 nonstandard</dt><dd>If the peer negotiates G726-32 audio, use AAL2 packing order instead of RFC3551 packing order (this is required for Sipura and Grandstream ATAs, amongh others).  This is contrary to the RFC3551 specification, the peer shoud be negotiating AAL2-G726-32 instead.</dd>\r\n\r\n<dt>Fax Detect</dt><dd>Fax detection will cause the SIP channel to jump to the \'fax\' extension (if it exists) based one or more events being detected.  The events that can be detected are an incoming CNG tone or an incoming T.38 re-INVITE request.  Valid options are <b>yes</b>, <b>no</b>, <b>cng</b>, and <b>t38</b>. Default to <b>no</b>.</dd>\r\n\r\n<dt>Text Support</dt><dd>Whether SIP text is supported.</dd>\r\n\r\n<dt>Progress InBand</dt><dd>Whether we should generate in-band ringing.  Always use \'never\' to never use in-band signaling.  Valid values are <b>yes</b>, <b>no</b>, and <b>never</b>.  Default to <b>never</b>.</dd>\r\n\r\n<dt>Promisc Redirect</dt><dd>Whether to allow 302 or REDIR to non-local SIP address.</dd>\r\n\r\n<dt>Allow Transfer</dt><dd>Whether SIP transfers are allowed or not.  Default is <b>enabled</b>.</dd>\r\n\r\n<dt>Allow Overlap</dt><dd>Whether to allow overlap dial support. Default to <b>yes</b>.</dd>\r\n\r\n<dt>Allow Subscribe</dt><dd>Whether to support SIP subscription.</dd>\r\n\r\n<dt>Subscribe Context</dt><dd>Set a specific context for SUBSCRIBE requests.  Useful to limit subscriptions to local extensions.</dd>\r\n\r\n<dt>Use Client Code</dt><dd>Whether to use client code.</dd>\r\n\r\n<dt>Use Reqphone</dt><dd>This provider requires \";user=phone\" on URL.</dd>\r\n\r\n<dt>Ignore SDP Version</dt><dd>By default, Asterisk will honour the session version number in SDP packets and will only modify the SDP session if the version number changes.  This option will force asterisk to ignroe the SDP session version number and treat all SDP data as new data.  This is required for devices that send us on non-standard SDP packets (observed with Microsoft OCS).  By default, this option is <b>off</b>.</dd>\r\n\r\n<dt>Registry Tring</dt><dd>Send a 100 Trying when the device registers.</dd>\r\n\r\n<dt>Trust RPID</dt><dd>If Remote-Party-ID shoud be trusted.</dd>\r\n\r\n<dt>Send RPID</dt><dd>If Remote-Party-ID shoudl be sent (defualt to <b>no</b>).  Valid values are <b>rpid</b> (use the Remote-Party-ID header to send the identify of the remote party), <b>pai</b> (Use the P-Asserted-Identify header to send the identify of the remote party, and <b>yes</b> (same as <b>rpid</b>).</dd>\r\n\r\n</dl>\r\n\r\n<ul>\r\n\r\n<li><b>Update Channel</b> Edits the channel that has been defined\r\nabove in the configuration database.</li>\r\n\r\n<li><b>Reset</b> Resets the fields to default settings.</li>\r\n\r\n<li><b>after edit Channel</b> Select <b>continue editing</b> to continue\r\nediting this channel, or <b>add new</b> to add another channel after\r\nthis one has been edited.</li>\r\n\r\n</ul>\r\n'),(12,'/sigman/channels-sip-edit.html','PBX: Channels > SIP Channels > Add Channel','Add SIP Channels','<p>This interaction adds a SIP channel to the system.</p>\r\n		\r\n<dl>\r\n\r\n<dt><b>Add SIP Channel Channel</b></dt>\r\n\r\n<dt>Channel Name</dt><dd>The channel name. This name can\'t contain\r\nspaces.</dd>\r\n\r\n<dt>Load Template</dt><dd>Use this pulldown menu to select a template,\r\nand click the load template button to load it. This will fill the rest\r\nof the form with values previously defined in the named SIP\r\ntemplate.</dd>\r\n\r\n<dt>User Name</dt><dd>The user name for the SIP channel. This is used\r\nfor authentication. <!-- should decide if its username or user name\r\n--></dd>\r\n\r\n<dt>Secret</dt><dd>The SIP secret (password) used to authenticate a SIP\r\nchannel. If The PBX is acting as a SIP server, then this SIP\r\nclient must login with this password (a shared secret). If The PBX is\r\nacting as a SIP client to a remote SIP server that requires SIP INVITE\r\nauthentication, then this field is used to authenticate SIP INVITEs\r\nthat The PBX sends to the remote SIP server.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>The caller ID name for the channel.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>The caller ID number for the channel.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox, including the Voicemail context for\r\nMWI (Message Waiting Indicator) on the end-user device.</dd>\r\n\r\n<dt>SetVar</dt><dd>Channel variable to be set for all calls from or to this device.</dd>\r\n\r\n<dt>Type</dt><dd>There are three possible types:<br> \r\n\r\na <b>peer</b> is a SIP entity to which the PBX only sends calls (a SIP\r\nprovider, for example). If you want a user (extension) to have\r\nmultiple phones, define an extension that calls two SIP peers. The\r\npeer authenticates at registration.<br> \r\na <b>user</b> is SIP entity\r\nthat places calls through the PBX (a phone that can place calls only,\r\nfor example). Users authenticate to reach services with their\r\ncontext. <br>\r\na <b>friend</b> is an entity that is both a user and a\r\npeer. This is the logical choice for most desk handsets, and other\r\ndevices. When you select \"friend,\" The PBX will create two objects,\r\none peer and one user, with the same name.</dd>\r\n\r\n<dt>Host</dt><dd>The host IP number or host name that will be used to\r\nfind the client. If you want the phone to register itself, use the\r\nkeyword \"dynamic\" instead of the host IP.</dd>\r\n\r\n<dt>Context</dt><dd>The context in the dialplan used for outbound calls\r\nfrom this channel.</dd>\r\n\r\n<dt>Language</dt><dd>The language code that specifies the language for\r\nprompts and specific local phone signals (language codes are defined\r\nin \"Configuration: PBX configuration > Advanced > Indications\").</dd>\r\n\r\n<dt>NAT</dt><dd>Depending on the nat settings, Asterisk may override the address/port information specified in the SIP/SDP messages, and use the information (sender address) supplied by the network stck instead.  Valid options are <b>no</b> (User rport if the remote side says to use it), <b>yes</b> (Force rport to always be on and perform comedia RTP handling), <b>force_rport</b> (Force rport to always be on), and <b>comedia</b> (use rport if the remote side says to use it and perform comedia RTP handling).  Default to <b>no</b>.</dd>\r\n\r\n<dt>Qualify</dt><dd>Periodically check if the client is\r\nreachable. Options are\r\n<b><i>xxx</i></b>, <b>no</b>, and <b>yes</b>, where <i>xxx</i> is the\r\nnumber of milliseconds before timeout. If yes is entered, the default\r\ntimeout is used, which is two seconds.<br><br>\r\n\r\nIf you turn on qualify in the configuration of a SIP device, the PBX\r\nwill send a SIP OPTIONS command regularly to check that the device is\r\nstill online. If the device does not answer within the configured (or\r\ndefault) period (in milliseconds) the PBX considers the device\r\noff-line for future calls.<br><br>\r\n\r\nThis feature can also be used to keep a UDP session open to a device\r\nthat is located behind a network address translator (NAT). By sending\r\nthe OPTIONS request, the UDP port binding in the NAT (on the outside\r\naddress of the NAT/firewall device) is maintained, by sending traffic\r\nthrough it. If the binding were to expire, there would be no way for\r\nthe PBX to initiate a call to the SIP device. This can be used in\r\nconjunction with the NAT=yes setting.</dd>\r\n\r\n<dt>Default IP</dt><dd>The default IP for the channel. <br><br>\r\n\r\nIf a peer is configured to register automatically (dynamic = yes), it\r\nwon\'t be possible to place calls to the phone until it registers, ie.,\r\ntells us where it is to be reached. If you know where the phone is,\r\nyou can configure the Default IP to be the IP address of the phone,\r\nand User Name to be the username used on the phone. This configuration\r\nwill be used to place calls to the phone until there is\r\nregistration. In the registration process, the phone provides the PBX\r\nwith a username, and an address where it can be reached. <br><br>\r\n\r\nIt is also possible to specify a host name instead of an IP address,\r\nwhich can be useful if you do not know your (dynamic) IP Address, but\r\nrather use a dynamic DNS like dyndns.org.</dd>\r\n\r\n<dt>Qualify Freq</dt><dd>How often to check for the host to be up in seconds and reported in milliseconds with sip show settings.  Set to low value if you use low timeout for NAT of UDP sessions.  Default to <b>60</b>.</dd>\r\n\r\n<dt>Parking Lot</dt><dd>Set the default parking lot for call parking. </dd>\r\n\r\n<dt>Direct Media</dt><dd> This peer option is used to tell the PBX\r\nserver to never issue areinvite to the client. When SIP initiates the\r\ncall, the INVITE message contains the information about where to send\r\nthe media streams. The PBX uses itself as the end-points of media\r\nstreams when setting up the call. Once the call has been accepted, the\r\nPBX sends another (re)INVITE message to the clients, with the\r\ninformation necessary to have the two clients send the media streams\r\ndirectly to each other. Allowing re-invites will result in the PBX\r\nlosing control of the call. </dd>\r\n\r\n<dt>MOH Interpret</dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>MOH Suggest</dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes. This field, if defined, is used to\r\npopulate the \"accountcode\" field of the CDR. This field can be\r\nanything.</dd>\r\n\r\n<dt>Amaflags</dt><dd>Categorization for CDR records. The options are\r\n<b>default</b>, <b>omit</b>, <b>billing</b>, and\r\n<b>documentation</b>.</dd>\r\n\r\n<dt>DTMF Mode</dt><dd>How the client handles DTMF signaling. Choices\r\nare <b>inband</b>, <b>rfc2833</b>, or <b>info</b>. If inband is\r\nspecified, the device that a user presses the key on will generate the\r\nDTMF tones. If the codec is not ulaw or alaw, then the DTMF tones will\r\nbe distorted by the audio compression, and will not be recognized. If\r\nthe phone is set for RFC2833 and the PBX is set for inband, then you\r\nmay not hear anything. For more information about rfc2833, see\r\nhttp://www.ietf.org/rfc/rfc2833.</dd> <!-- PM - what exactly are the\r\nthree modes? -->\r\n\r\n<dt>Insecure</dt><dd>Tells the system to not check for host IP and\r\nport for a peer (not a user).</dd>\r\n\r\n<dt>RFC2833 Compensate</dt><dd>Compensate for pre-1.4 DTMF transmission from another Asterisk machine.  You must have this turned on or DTMF reception will work improperly.</dd>\r\n\r\n<dt>Outbound Proxy</dt><dd>iSend outbound signalling to this proxy, not directly to the devices.</dd>\r\n\r\n<dt>Call Group</dt><dd>Defines the call group for calls to this\r\ndevice/channel.</dd>\r\n\r\n<dt>Pickup Group</dt><dd>The group of fellow users that can pick up\r\nthis users\' calls, using *8 and the Pickup() application on the *8\r\nextension.</dd>\r\n\r\n<dt>Disallow Codec</dt><dd>Disallows the listed codecs. The option\r\n<b>all</b> will disallow all codecs. This is useful when combined with\r\n\"allow codecs.\"  </dd>\r\n\r\n<dt>Allow Codec</dt><dd>The list of allowed codecs.</dd>\r\n\r\n<dt>From User</dt><dd>Specifies a name to put in the \"from\" field\r\ninstead of the caller ID (overrides the caller ID) when placing calls\r\n<i>to</i> a peer (another SIP proxy).</dd>\r\n\r\n<dt>From Domain</dt><dd>Sets the default \"From:\" domain in SIP\r\nmessages when placing calls <i>to</i> a peer.<dd>\r\n\r\n<dt>Calling Pres</dt><dd>Set the Caller ID presentation for this user.  Valid values are: <b>allowed_not_screen</b> (presentation allowed, not screened), <b>allowed_passed_screen</b> (presentation allowed, passed screen), <b>allowed_failed_screen</b> (presentation allowed, failed screen), <b>allowed</b> (presentation allowed, network number), <b>prohib_not_screened</b> (presentation prohibited, not screened), <b>prohib_passed_screen</b> (presentation prohibited, passed screen), <b>prohib_failed_screen</b> (presentation prohibited, failed screen), <b>prohib</b> (presentation prohibited, network number), <b>unavailable</b> (number unavailable).</dd>\r\n\r\n<dt>Default User</dt><dd>Username to use in INVITE until peer registers.</dd>\r\n\r\n<dt>Port</dt><dd>The SIP port of the client. The default port is 5060. </dd>\r\n\r\n<dt>MD5 Secret</dt><dd>The MD5-Hash of \"<i>user</i>:the\r\nPBX:<i>secret</i>\" (can be used instead of secret).</dd>\r\n\r\n<dt>Transport</dt><dd>Set the default transport type for outgoing call.  The default transport type is only used for outbound messages until a registration takes place.  During the peer registration the transport type may change to another supported type if the peer requests so.  Valid values are <b>udp</b> and <b>tcp</b>.</dd>\r\n\r\n<dt>Remote Secret</dt><dd>Our password to their service.</dd>\r\n\r\n<dt>Call Limit</dt><dd>Limit for the number of simultaneous active\r\ncalls for a SIP client.</dd>\r\n\r\n<dt>Busy Level</dt><dd>Set the number of call threshold before the system indicate busy.</dd>\r\n\r\n<dt>Permit</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Deny</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>RTP Timeout</dt><dd>How many seconds of no RTP activity before the\r\ncall is terminated, when not on hold.</dd>\r\n\r\n<dt>RTP Hold Timeout</dt><dd><dd>How many seconds of no RTP activity\r\nbefore the call is terminated, when on hold. This must be larger than\r\nRTP Timeout.</dd>\r\n\r\n<dt>Video Support</dt><dd>Turn on support for SIP video for this device.</dd>\r\n\r\n<dt>Max Bitrate (kbps)</dt><dd>Maximum bitrate for video calls (default to <b>384 kb/s</b>.</dd>\r\n\r\n<dt>T38 Support</dt><dd>Enable T.38 Fax support on SIP calls.  It defaults to <b>off</b>.  Valid values are <b>yes,fec</b> (Enables T.38 with FEC error correction), <b>yes,redundancy</b> (Enables T.38 with redundnacy error correction), <b>yes,none</b> (Enables T.38 with no error correction), and <b>no</b> (Disables T.38 support).</dd>\r\n\r\n<dt>T38 Use RTP Src</dt><dd>Use the source IP address of RTP as the destination IP address for UDPTL packets if the nat option is enabled.  If a single packet is received, Asterisk will know the external IP address of the remote device.  If port forwarding is done at the client side, then UDPTL will flow to the remote device.</dd>\r\n\r\n<dt>RTP Timeout</dt><dd>How many seconds of no RTP activity before the\r\ncall is terminated, when not on hold.</dd>\r\n\r\n<dt>RTP Hold Timeout</dt><dd><dd>How many seconds of no RTP activity\r\nbefore the call is terminated, when on hold. This must be larger than\r\nRTP Timeout.</dd> \r\n\r\n<dt>Video Support</dt><dd>Turn on support for SIP video for this device.</dd>\r\n\r\n<dt>Max Bitrate (kbps)</dt><dd>Maximum bitrate for video calls (default to <b>384 kb/s</b>.</dd>\r\n\r\n<dt>T38 Support</dt><dd>Enable T.38 Fax support on SIP calls.  It defaults to <b>off</b>.  Valid values are <b>yes,fec</b> (Enables T.38 with FEC error correction), <b>yes,redundancy</b> (Enables T.38 with redundnacy error correction), <b>yes,none</b> (Enables T.38 with no error correction), and <b>no</b> (Disables T.38 support).</dd>\r\n\r\n<dt>T38 Use RTP Src</dt><dd>Use the source IP address of RTP as the destination IP address for UDPTL packets if the nat option is enabled.  If a single packet is received, Asterisk will know the external IP address of the remote device.  If port forwarding is done at the client side, then UDPTL will flow to the remote device.</dd>\r\n\r\n<dt>RTP Keep Alive</dt><dd>Send Keepalives in the RTP stream to keep NAT open.  Default is <b>off</b> (0).</dd>\r\n\r\n<dt>G726 nonstandard</dt><dd>If the peer negotiates G726-32 audio, use AAL2 packing order instead of RFC3551 packing order (this is required for Sipura and Grandstream ATAs, amongh others).  This is contrary to the RFC3551 specification, the peer shoud be negotiating AAL2-G726-32 instead.</dd>\r\n\r\n<dt>Fax Detect</dt><dd>Fax detection will cause the SIP channel to jump to the \'fax\' extension (if it exists) based one or more events being detected.  The events that can be detected are an incoming CNG tone or an incoming T.38 re-INVITE request.  Valid options are <b>yes</b>, <b>no</b>, <b>cng</b>, and <b>t38</b>. Default to <b>no</b>.</dd>\r\n\r\n<dt>Text Support</dt><dd>Whether SIP text is supported.</dd>\r\n\r\n<dt>Progress InBand</dt><dd>Whether we should generate in-band ringing.  Always use \'never\' to never use in-band signaling.  Valid values are <b>yes</b>, <b>no</b>, and <b>never</b>.  Default to <b>never</b>.</dd>\r\n\r\n<dt>Promisc Redirect</dt><dd>Whether to allow 302 or REDIR to non-local SIP address.</dd>\r\n\r\n<dt>Allow Transfer</dt><dd>Whether SIP transfers are allowed or not.  Default is <b>enabled</b>.</dd>\r\n\r\n<dt>Allow Overlap</dt><dd>Whether to allow overlap dial support. Default to <b>yes</b>.</dd>\r\n\r\n<dt>Allow Subscribe</dt><dd>Whether to support SIP subscription.</dd>\r\n\r\n<dt>Subscribe Context</dt><dd>Set a specific context for SUBSCRIBE requests.  Useful to limit subscriptions to local extensions.</dd>\r\n\r\n<dt>Use Client Code</dt><dd>Whether to use client code.</dd>\r\n\r\n<dt>Use Reqphone</dt><dd>This provider requires \";user=phone\" on URL.</dd>\r\n\r\n<dt>Ignore SDP Version</dt><dd>By default, Asterisk will honour the session version number in SDP packets and will only modify the SDP session if the version number changes.  This option will force asterisk to ignroe the SDP session version number and treat all SDP data as new data.  This is required for devices that send us on non-standard SDP packets (observed with Microsoft OCS).  By default, this option is <b>off</b>.</dd>\r\n\r\n<dt>Registry Tring</dt><dd>Send a 100 Trying when the device registers.</dd>\r\n\r\n<dt>Trust RPID</dt><dd>If Remote-Party-ID shoud be trusted.</dd>\r\n\r\n<dt>Send RPID</dt><dd>If Remote-Party-ID shoudl be sent (defualt to <b>no</b>).  Valid values are <b>rpid</b> (use the Remote-Party-ID header to send the identify of the remote party), <b>pai</b> (Use the P-Asserted-Identify header to send the identify of the remote party, and <b>yes</b> (same as <b>rpid</b>).</dd>\r\n\r\n</dl>\r\n\r\n<ul>\r\n<li><b>Add Channel</b> Adds the channel that has been defined above to\r\nthe configuration database.</li>\r\n\r\n<li><b>Reset</b> Resets the fields to default settings.</li>\r\n\r\n<li><b>after add Channel</b> Select <b>continue editing</b> to continue\r\nediting this channel, or <b>add new</b> to add another channel after\r\nthis one has been added.</li>\r\n\r\n</ul>\r\n'),(13,'/sigman/channels-sip-general.html','PBX: Channels > SIP Channels > General Settings','SIP General Settings','<p>This interaction presents a list of settings in the \"[general]\"\r\nsection of sip.conf, and provides access to add, edit, and delete\r\nfunctions. It is presented as a collection of name-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting (not visible if there are no\r\nsettings defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %c-icon% to change the variable name to a custom name\r\n(not included in the pulldown menu). Use the %check-icon% to enter the\r\nedited pair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the selected name (shown in the\r\npulldown menu) and value (entered in the text field). See below for a\r\nlisting of pulldown menu items.</dd>\r\n\r\n<dt>%c-icon%</dt><dd>Enables a custom setting. Click on the %c-icon%\r\nand then enter the name and value in the two fields at left. Click\r\n<b>Add</b> to enter the new pair.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<p>The [general] section of sip.conf includes the following variables,\r\nwhich are listed in the pulldown menu:</p>\r\n\r\n<!-- doesn\'t match demo????  -->\r\n\r\n<dl>\r\n\r\n<dt>accept_outofcall_message</dt><dd>Disable this option to reject all MESSAGE requests outside of a call.  By default, this option is enabled.  When enabled, MESSAGE requests are passed in to the dialplan.</dd>\r\n\r\n<dt>allow</dt><dd><dd>Allow codecs, in order of preference. Options\r\nare the names of codecs. (use DISALLOW=ALL first, before allowing\r\nother codecs). <!-- multiple entries, or single list? --> </dd>\r\n\r\n<dt>allowexternaldomains</dt><dd>Allow INVITE and REFER to non-local domain.  Default is <b>yes</b>.</dd>\r\n\r\n<dt>allowguest</dt><dd>Allow or reject guest calls.  Default is <b>yes</b>.</dd>\r\n\r\n<dt>allowoverlap</dt><dd>Allow overlap dialing support.  Default is <b>yes</b>.</dd>\r\n\r\n<dt>allowsubscribe</dt><dd>Enable support for subscription.  Default is <b>yes</b></dd>\r\n\r\n<dt>allowtransfer</dt><dd>Allow transfer support.  Default is <b>enabled</b>.  The Dial() options \'t\' and \'T\' are not related as to whether SIP transfes are allowed or not.</dd>\r\n\r\n<dt>alwaysauthreject</dt><dd>When an incoming INVITE or REGISTER is to be rejected, for any reason, always reject with an identical response equivalent to valid username and invalid password/hash instead of letting the requester know whether there was a matching user or peer for their request.  This reduces the ability of an attacker to scan for valid SIP usernames.</dd>\r\n\r\n<dt>authfailureevents</dt><dd>Generate manager <b>peerstatus</b> events when peer can\'t authenticate with Asterisk.  Peerstatus will be <b>rejected</b>.</dd>\r\n\r\n<dt>auth_messages_requests</dt><dd>Enabling this option will authenticate MESSAGE requests.  By default this option is enabled.  However, it can be disabled should an application desire to not load the Asterisk Server with doing authentication and implement end to end security in the message body.</dd>\r\n\r\n<dt>autocreatepeer</dt><dd>Possible values are <b>yes</b> and\r\n<b>no</b>. If set to \"yes,\" anyone will be able to log in as a peer\r\n(with no check of credentials). This is useful for operation with\r\nSER (SIP Express Router).</dd>\r\n\r\n<dt>autodomain</dt><dd>All the default domains associated with a server should be added if incoming request filtering is desired.</dd>\r\n\r\n<dt>bindaddr</dt><dd>Possible values are of the form\r\n<b>0.0.0.0</b>. This is the IP address to bind to (listen on).</dd>\r\n\r\n<dt>callcounter</dt><dd>Enable/disable call counter.</dd>\r\n\r\n<dt>callevents</dt><dd>Generate manager events when SIP UA perform events</dd>\r\n\r\n<dt>compactheaders</dt><dd>Send compact SIP headers.</dd>\r\n\r\n<dt>contactdeny</dt><dd>Restrict IP address range from registering their phones.</dd>\r\n\r\n<dt>contactpermit</dt><dd>Permit IP address range to register their phones.</dd>\r\n\r\n<dt>context</dt><dd>Value is <i>contextname</i>. This is the default\r\ncontext for incoming calls (in extensions.conf).</dd>\r\n\r\n<dt>cos_audio</dt><dd>Sets 802.1p priority for RTP audio packets..</dd>\r\n\r\n<dt>cos_sip</dt><dd>Sets 802.1p priority for SIP packets..</dd>\r\n\r\n<dt>cos_text</dt><dd>Sets 802.1p priority for RTP text packets..</dd>\r\n\r\n<dt>cos_video</dt><dd>Sets 802.1p priority for RTP video packets..</dd>\r\n\r\n<dt>defaultexpirey</dt><dd> The default length of incoming/outgoing\r\nregistration. A typical value is <b>120</b></dd>\r\n\r\n<dt>disallow</dt><dd>Disallow all codecs (global configuration). The\r\nvalue <b>all</b> will be automatically entered.</dd>\r\n\r\n<dt>directmedia<dt><dd>Used to tell the PBX server to never issue a\r\nre-invite to the client. Possible values are\r\n<b>update</b>, <b>yes</b>, and <b>no</b>, and <b>nonat</b> (global setting). Setting\r\ncanre-invite to yes may cause the PBX to lose control over the\r\ncall. For example, a three-way call could no longer be\r\ninitiated. </dd>\r\n\r\n<dt>directrtpsetup<dt><dd>Enable the direct RTP setup.  This sets up the call directly with media peer-2-peer without re-invites.  It will not work for video and cases where the callee sends RTP payloads and fmtp headers in the 200 OK that does not match the callers INVITE.  This will also fail if directmedia is enabled when the device is actually behind NAT.  Additional this option does not disable all reINVITE operations.  It only controls Asterisk generating reINVITEs for the specific purpose of setting up a direct media path.  If a reINVITE is needed to switch a media stream to inactive (when placed on hold) or to T.38, it will still be done, regardless of this settings.  Note that direct T.38 is not supported.</dd>\r\n\r\n<dt>disallowed_methods</dt><dd>If you know that your SIP endpoint does not provide support for a specific method, then you may provide a comma-separated list of methods that your endpoint does not implement.  Note that if your endpoint is truthful with its Allow header, then there is no need to set this option.</dd>\r\n\r\n<dt>domain</dt><dd>Comma separated list of domains which Asterisk is responsible for.</dd>\r\n\r\n<dt>domainasrealm</dt><dd>Use domain lists as realms.  You can serve multiple realms specifying serval \'domain=...\' direcives.  In this case, realm will be based on request \'From\'/\'To\' header and should match one of the domain names.  Otherwise default \'realm=...\' will be used.</dd>\r\n\r\n<dt>dtmfmode</dt><dd>How the client handles DTMF signaling. Possible\r\nvalues are <b>inband</b>, <b>info</b>, and <b>rfc2833</b> (global\r\nsetting).</dd>\r\n\r\n<dt>externhost</dt><dd>Values are of the form\r\n<b>hostname.tld</b>. This is new in PBX 1.2.x.</dd>\r\n\r\n<dt>externip</dt><dd>Values are of the form\r\n<b>200.201.202.203</b>. This is the address put in SIP messages if the\r\nclient is behind a NAT.</dd>\r\n\r\n<dt>externrefresh</dt><dd>Specifies how often a hostname DNS lookup\r\nshould be performed for the value entered in externhost. This is new\r\nin PBX 1.2.x.</dd>\r\n\r\n<dt>externtcpport</dt><dd>The externally mapped tcp port when Asterisk is behind a static NAT or PAT.  The externtcpport will default to the externaddr or externhost port if either one is set.</dd>\r\n\r\n<dt>externtlsport</dt><dd>The externally mapped tls port when Asterisk is behind a static NAT or PAT.  It defaults to the RFC designated port of 5061.</dd>\r\n\r\n<dt>faxdetect</dt><dd>Fax detection will cause the SIP channel to jump to the <b>fax</b> extension (if it exists) based on one or more events being detected.  The events that can be detected are an incoming CNG tone or an incoming T.38 re-INVITE request.  Valid options are <b>yes</b> (detect both CNG and T.38), <b>cng</b> (enable only CNG detection), <b>t38</b> (enable only T.38 detection), <b>both</b> (enable both CNG and T.38) and <b>no</b> (disable fax detection).  Default value is <b>no</b>.</dd>\r\n\r\n<dt>fromdomain</dt><dd>Sets the default \"From:\" domain in SIP messages\r\nwhen acting as a SIP User Agent that is the remote client.</dd>\r\n\r\n<dt>g726nonstandard</dt><dd>If the peer negotiates G726-32 audio, use AAL2 packing order instead of RFC3551 packing order (this is required for Sipura and Grandstream ATAs, among others).  This is contrary to the RFC3551 specification, the peer shoudl be negotiating AAL2-G726-32 instead.</dd>\r\n\r\n<dt>ignoreregexpire</dt><dd>Enabling this setting has two functions.<br />For non-realtime peers, when their registration expires, the information will not be removed from memory or the Asterisk database.  If you attempt to place a call to the peer, the existing information will be used in spite of it having expired.  For realtime peers, when the peer is retrieved from realtime storage, the registration information will be used regardless of whether it has expired or not.  If it expires while the realtime peer is still in memory (due to caching or other reasons), the information will not be removed from realtime storage.</dd>\r\n\r\n<dt>ignoresdpversion</dt><dd>By default, Asterisk will honor the session version number in SDP packets and will only modify the SDP session if the version number changes.  This option will force asterisk to ignore the SDP session version number and treat all SDP data as new data.  This is required for devices that send us non standard SDP packets (observed with Microsoft OCS).  By default this is <b>off</b>.</dd>\r\n\r\n<dt>language</dt><dd>A global default language. The default default is\r\nEnglish (<b>en</b>). Other possible values are:<br>\r\n\r\n<b>at</b> (Austria)<br>\r\n<b>au</b> (Australia)<br>\r\n<b>br</b> Brazil)<br>\r\n<b>be</b> (Belgium)<br>\r\n<b>ch</b> (Switzerland)<br>\r\n<b>cl</b> (Chile)<br>\r\n<b>cn</b> (China)<br>\r\n<b>cz</b> (Czech Republic)<br>\r\n<b>de</b> (Germany)<br>\r\n<b>dk</b> (Denmark)<br>\r\n<b>ee</b> (Estonia)<br>\r\n<b>fi</b> (Finland)<br>\r\n<b>fr</b> (France)<br>\r\n<b>gr</b> (Greece)<br>\r\n<b>hu</b> (Hungary)<br>\r\n<b>it</b> (Italy)<br>\r\n<b>lt</b> (Lithuania)<br>\r\n<b>mx</b> (Mexico)<br>\r\n<b>nl</b> (Netherlands)<br>\r\n<b>no</b> (Norway)<br>\r\n<b>nz</b> (New Zealand)<br>\r\n<b>pl</b> (Poland)<br>\r\n<b>pt</b> (Portugal)<br>\r\n<b>ru</b> (Russia)<br>\r\n<b>se</b> (Sweden)<br>\r\n<b>sg</b> (Singapore)<br>\r\n<b>uk</b> (United Kingdom)<br>\r\n<b>us</b> (United States)<br>\r\n<b>us-old</b> (US old)<br>\r\n<b>tw</b> (Taiwan)<br>\r\n<b>za</b> (South Africa)<br>\r\n\r\n<!-- can a custom indication be used here? -->\r\n\r\n</dd>\r\n\r\n<dt>legacy_useroption_parsing</dt><dd>Default to <b>no</b>.</dd>\r\n\r\n<dt>localnet</dt><dd>Values are of the form\r\n<b>192.168.1.0/255.255.255.0</b>. This specifies the local network and\r\nmask.</dd>\r\n\r\n<dt>match_auth_username></dt><dd>Match user entry using the <b>username</b> field from the authentication line instead of the From: field.</dd>\r\n\r\n<dt>matchexterniplocally</dt><dd>Only substitute the externaddr or externhost setting if it matches your localnet settings. Unless you have some sort of strange network setup, you will not need to enable this.</dd>\r\n\r\n<dt>maxcallbitrate></dt><dd>Maximum bitrate for video calls.  Default is <b>384</b> kb/s.</dd>\r\n\r\n<dt>maxexpirey</dt><dd>The maximum length of incoming registration\r\nthat is supported. <!-- example? --></dd>\r\n\r\n<dt>media_address</dt><dd>The IP address used for media inthe SDP.</dd>\r\n\r\n<dt>minexpirey></dt><dd>Minimum length of registration/subscriptions.  Default is <b>60</b> seconds.</dd>\r\n\r\n<dt>mohinterpret></dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>mohsuggest></dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.  It may be specified globally or on a per-user or per-peer basis.</dd>\r\n\r\n<dt>mwi_from</dt><dd>When sending MWI NOTIFY requests, use this settings in the From: header as the \"name\" portion.  Also fill the \"user\" option of the URI in the From: header with this value if no fromuser is set.  Default to <b>empty</b>.</dd>\r\n\r\n<dt>mwi</dt><dd>Asterisk can subscribe to receive the MWI from another SIP server and store it locally for retrieval by other phones.  You may only subscribe using UDP as the transport.  \r\nFormat for the register statement is:\r\n 	 mwi => user[:secret[:authuser]@host[:port]/mailbox</dd>\r\n\r\n<dt>mwiexpiry</dt><dd>Expiry time for outgoing MWI subscriptions.</dt>\r\n\r\n<dt>nat</dt><dd>Options are <b>yes</b> or <b>no</b> (per connection\r\nsetting). Select <b>yes</b> to change the behavior of the PBX to\r\naccommodate clients behind a firewall. This does not solve the problem\r\nof a PBX is behind a firewall and a client on the outside. Default is\r\n<b>no</b>. Note that in PBX 1.0.x, nat can now have the values\r\n<b>no</b>, <b>never</b>, <b>route</b>, and <b>yes</b>.</dd>\r\n\r\n<dt>notifycid</dt><dd>Control whether caller ID information is sent along with dialog-info+xml notifications (supported by snom phones).  Note that this feature will only work properly when the incoming call is using the same extension and context that is being used as the hint for the called extension.  This means that it won\'t work when using subscribecontext for your sip user or peer (if subscribecontext is different than context).  This is also limited to a single caller, meaning that if an extension is ringing because multiple calls are incoming, only one will be used as the source of caller ID.  Specify <b>ignore-context</b> to ignore the called context when looking for the caller\'s channel.  The default value is <b>no</b>.  Setting <b>notifycid</b> to <b>ignore-context</b> also causes call-pickups attempted via SNOM\'s NOTIFY mechanism to set the context for the call pickup to PICKUPMARK.</dd>\r\n\r\n<dt>notifyhold</dt><dd>Notify subscriptions are <b>HOLD</b> state (default to <b>no</b>).  Turning on notifyringing and notifyhold will add a lot more database transactions if you are using realtime.</dd>\r\n\r\n<dt>notifymimetype</dt><dd>Options are <b>text</b> or\r\n<b>plain</b>. Allows overriding of mime type in MWI NOTIFY, used in\r\nonline Voicemail messages.</dd>\r\n\r\n<dt>notifyringing</dt><dd>Control whether subscriptions already INUSE get sent RINGING when another call is sent.  Default to <b>yes</b>.</dd>\r\n\r\n<dt>outboundproxy</dt><dd>Send outbound signalling to this proxy, not directly to the peer.</dd>\r\n\r\n<dt>outofcall_message_context</dt><dd>Context all out of dialog msgs are sent to.  When this option is not set, the context used during peer matching is used. </dd>\r\n\r\n<dt>pedantic</dt><dd>Options are <b>yes</b> or <b>no</b>. Enables slow,\r\npedantic checking of Call-ID:s, multiline SIP headers, and URI-encoded\r\nheaders.</dd>\r\n\r\n<dt>preferred_codec_only</dt><dd>Respond to a SIP invite with the single most preferred codec rather than advertising all joint codec capabilities.  This limits the other side\'s codec choice to exactly what we prefer.</dd>\r\n\r\n<dt>prematuremedia</dt><dd>Some ISDN links send empty media frames before the call is in ringing or progress state.  The SIP channel will then send 183 indicating early media which will be empty - thus users get no ring signal.  Setting this to <b>no</b> will stop any media before call progress.  Default to <b>yes</b></dd>\r\n\r\n<dt>progressinband></dt><dd>If we should generate in-band ringing always, use <b>never</b> to never use in-band signalling, even in cases where some bugging devices might not render it.  Valid values are <b>yes</b>, <b>no</b>, and <b>never</b>.  Default is <b>never</b>.</dd>\r\n\r\n<dt>promiscredir</dt><dd>Options are <b>yes</b> or <b>no</b>. Allows\r\nsupport for 302 Redirects. <b>no</b> will redirect them all to the\r\nlocal extension returned in Contact, rather than to that extension at\r\nthe destination.</dd>\r\n\r\n<dt>qualify</dt><dd>Consider the device is down if it does not reply within the specific time in ms.</dd>\r\n\r\n<dt>qualifyfreq</dt><dd>How often to check for the host to be up in seconds.  Set to low value if you use low timeout for NAT or UDP session.</dd>\r\n\r\n<dt>qualifygap</dt><dd>Number of milliseconds between each group of peers being qualified.</dd>\r\n\r\n<dt>qualifypeers</dt><dd>Number of peers in a group to be qualified at the same time.</dd>\r\n\r\n<dt>realm</dt><dd>Realm for digest authentication.  Default to <b>asterisk</b>.  If you set a system name in asterisk.conf, it defaults to that system name.  Realms must be globally unique according to RFC3261.  Set this to your host name or domain name.</dd>\r\n\r\n<dt>recordhistory</dt><dd>Record SIP history by default.</dd>\r\n\r\n<dt>regcontext</dt><dd>If regcontext is specified, Asterisk will dynamically create and destroy a NoOp priority 1 extension for a give peer who registers or unregisters with us and have a <b>regexten=</b> configuration item.</dd>\r\n\r\n<dt>regextenqualify</dt><dd>Default to <b>no</b>.  If you have qualify on and the peer becomes unreachable, this settings will enforce inactivation of the regexten extension for the peer.</dd>\r\n\r\n<dt>register</dt><dd>Value is <i>username</i>@<i>sip client/peer id in\r\nsip.conf/extension</i>. Register with a SIP provider.</dd>\r\n\r\n<dt>registerattempts</dt><dd>Number of registration attempts before we give up.  0 = continue forever, hammering the other server until it accepts the registration.  Default is 0 tries, continue forever.</dd>\r\n\r\n<dt>registertimeout</dt><dd>Retry registration call every x seconds.  Default to <b>60</b>.</dd>\r\n\r\n<dt>relaxdtmf</dt><dd>Relax dtmf handling.</dd>\r\n\r\n<dt>rtautoclear</dt><dd>Auto-expire friends created on the fly on the same schedule as if it had just registered? (yes|no|<seconds>).  If set to yes, when the registration expires, the friend will vanish from the configuration until requested again.  If set to an integer, friends expire within this number of seconds instead of the registration interval.</dd>\r\n\r\n<dt>rtcachefriends</dt><dd>Cache realtime friends by adding them to the internal list just like friends added from the config file only on a as-needed basis.  Valid values are <b>yes</b> or <b>no</b>.</dd>\r\n\r\n<dt>rtpkeepalive</dt><dd>iSedn keepalives in the RTP stream to keep NAT open.  Default is <b>off</b>.</dd>\r\n\r\n<dt>rtsavesysname</dt><dd>Save systemname in realtime database at registration.  Default to <b>no</b>.</dd>\r\n\r\n<dt>rtptimeout</dt><dd>Terminate call if no RTP or RTCP activity on the audio channel.</dd>\r\n\r\n<dt>rtupdate</dt><dd>Send registry updates to database using realtime.</dd>\r\n\r\n<dt>sdpowner</dt><dd>Allow you to chane the username field in the SDP owner string.  This field must not contain spaces.</dd>\r\n\r\n<dt>sdpsession</dt><dd>Allows you to change the SDP session name string.</dd>\r\n\r\n<dt>shrinkcallerid</dt><dd>Remove special characters and keep only numbers in the callerid.</dd>\r\n\r\n<dt>snom_aoc_enabled</dt><dd>This option turns on and off support for sending AOC-D and AOC-E to snom endpoints.  Default to <b>no</b>.</dd>\r\n\r\n<dt>srvlookup</dt><dd>Enable DNS SRV lookups on calls. Options are\r\n<b>yes</b> or <b>no</b>.</dd>\r\n\r\n<dt>subscribe_network_change_event</dt><dd>If res_stun_monitor is enabled and you wish not to generate all outbound registrations on a network change, use the option to disable this feature.</dd>\r\n\r\n<dt>subscribecontext</dt><dd>Set a specific context for SUBSCRIBE requests.  Useful to limit subscriptions to local extensions.</dd>\r\n\r\n<dt>t1min</dt><dd>Minimum roundtrip time for messages to monitored hosts.  Defaults to 100ms.</dd>\r\n\r\n<dt>t38pt_udptl</dt><dd>Enable T.38 Fax support on SIP calls.  It defaults to <b>off</b>.  Valid values are <b>yes,fec</b> (Enables T.38 with FEC error correction), <b>yes,redundancy</b> (Enables T.38 with redundnacy error correction), <b>yes,none</b> (Enables T.38 with no error correction), and <b>no</b> (Disables T.38 support).</dd>\r\n\r\n<dt>tcpauthlimit</dt><dd>Specify the maximum number unauthenticated sessions that will be allow to connect at any given time.  Default to 100.</dd>\r\n\r\n<dt>tcpauthtimeout</dt><dd>Specify the maximum number of seconds a client has to authenticate.  If the client does not authenticate before this timeout expires, the client will be disconnected.  Default to 30 seconds.</dd>\r\n\r\n<dt>tcpbindaddr</dt><dd>IP address for TCP server to bind to. (0.0.0.0 binds to all interfaces).  An optional port number (default to 5060) may be specified.</dd>\r\n\r\n<dt>tcpenable</dt><dd>Enable server for incoming TCP connections.  Default is <b>no</b>.</dd>\r\n\r\n<dt>timerb</dt><dd>Call setup timer.  If a provisional response is not received in this amount of time, the call will autocongest.  Defaults to 64 * timert1.</dd>\r\n\r\n<dt>timert1</dt><dd>Default T1 timer.  Default to 500 ms or the measured round-trip time to a peer (qualify=yes).</dd>\r\n\r\n<dt>tlsbindaddr</dt><dd>IP address for TLS server to bind to (0.0.0.0 binds to all interfaces).  An optional port number (default to 5061) may be specified.</dd>\r\n\r\n<dt>tlscadir</dt><dd>A directory full of CA certificates. The files must be named with the CA subject name hash value.</dd>\r\n\r\n<dt>tlscafile</dt><dd>If the server you are connecting to uses a self signed certificate, you should have their certificate installed here so the code can verify the authenticity of their certificate.</dd>\r\n\r\n<dt>tlscertfile</dt><dd>Certificate file (*.pem only) to use for TLS connections.  Default is to look for asterisk.pem in current directory.</dd>\r\n\r\n<dt>tlscipher</dt><dd>A string specifying which SSL ciphers to use or not use.</dd>\r\n\r\n<dt>tlsdontverifyserver</dt><dd>If set to <b>yes</b>, don\'t verify the servers certificate when acting as a client.  If you don\'t have the server\'s CA certificate you can set this and it will connect without requiring tlscafile to be set.  Default is <b>no</b>.</dd>\r\n\r\n<dt>tlsenable</dt><dd>Enable server for incoming TLS (secure) connections.  Default is <b>no</b>.</dd>\r\n\r\n<dt>tos_audio</dt><dd>Set TOS for RTP audio packet.</dd>\r\n\r\n<dt>tos_sip</dt><dd>Set TOS for SIP packet.</dd>\r\n\r\n<dt>tos_text</dt><dd>Set TOS for RTP text packet.</dd>\r\n\r\n<dt>tos_video</dt><dd>Set TOS for RTP video packet.</dd>\r\n\r\n<dt>transport</dt><dd>Sets the default transport type for outgoing and incoming connections.  The default transport type is only used for outbound messages until a Registration takes place.  During the peeer registration, the transport type may change to another supported type if the peer requests so. </dd>\r\n\r\n<dt>trustrpid</dt><dd>Specifies if Remote-Party-ID should be\r\ntrusted. Options are <b>yes</b> or <b>no</b>.</dd>\r\n\r\n<dt>udpbindaddr</dt><dd>IP address to bind UDP listen socket to (0.0.0.0 binds to all).  An optional port number may be specified.</dd>\r\n\r\n<dt>useragent</dt><dd>Customize the SIP header \"User-Agent\".</dd>\r\n\r\n<dt>usereqphone</dt><dd>If <b>yes</b>, <b>user=phone</b> is added to uri that contains a valid phone number.</dd>\r\n\r\n<dt>use_q850_reason</dt><dd>Default to <b>no</b>.  Set to <b>yes</b> add Reason header and use Reason header if it is available.</dd>\r\n\r\n<dt>videosupport</dt><dd>Turn on support for SIP video. Options are\r\n<b>yes</b> or <b>no</b>.</dd>\r\n\r\n<dt>vmexten</dt><dd>Dialplan extension to reach mailbox.</dd>\r\n\r\n\r\n</dl>\r\n'),(14,'/sigman/channels-sip-templates.html','PBX: Channels > SIP Channels > Templates','SIP Channel Templates','<p>This interaction presents a list of SIP channel templates, and\r\nprovides access to editing and delete functions.</p>\r\n\r\n<dl>\r\n\r\n<dt>Edit: %pen-icon%</dt><dd>Opens an Edit Template interaction. See\r\nthe \"PBX: Channels > SIP Channels > Templates > Edit Template\" help\r\npage for a description of the fields in this form.</dd>\r\n\r\n<dt>Edit: %X-icon%</dt><dd>Deletes the template entry.</dd>\r\n\r\n<dt>Name</dt><dd>The name of the template.</dd>\r\n\r\n<dt>Type</dt><dd>The channel type. (Options are <b>peer</b>, <b>user</b>, or\r\n<b>friend</b>).</dd>\r\n\r\n<dt>NAT</dt><dd><b>yes</b> if the channel will communicate with remote\r\nclients that are behind a firewall. Otherwise <b>no</b>.</dd> \r\n\r\n<dt>Context</dt><dd>The channel context.</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes.</dd>\r\n\r\n</dl>'),(15,'/sigman/channels-sip-templates-edit.html','PBX: Channels > SIP Channels > Templates > Edit','Edit SIP Channel Template','<p>This interaction edits a SIP channel template that has been\r\npreviously created.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Edit SIP Template <i>templatename</i></b></dt>\r\n\r\n<dt>User Name</dt><dd>The user name for the SIP channel. This is used\r\nfor authentication. <!-- should decide if its username or user name\r\n--></dd>\r\n\r\n<dt>Secret</dt><dd>The SIP secret (password) used to authenticate a SIP\r\nchannel. If The PBX is acting as a SIP server, then this SIP\r\nclient must login with this password (a shared secret). If The PBX is\r\nacting as a SIP client to a remote SIP server that requires SIP INVITE\r\nauthentication, then this field is used to authenticate SIP INVITEs\r\nthat The PBX sends to the remote SIP server.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>The Caller ID name for the channel.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>The Caller ID number for the channel.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox, including the Voicemail context for\r\nthe MWI (Message Waiting Indicator) on the end-user device.</dd>\r\n\r\n<dt>SetVar</dt><dd>Channel variable to be set for all calls from or to this device.</dd>\r\n\r\n<dt>Type</dt><dd>There are three possible types:<br> \r\n\r\na <b>peer</b> is a SIP entity to which the PBX only sends calls (a SIP\r\nprovider, for example). If you want a user (extension) to have\r\nmultiple phones, define an extension that calls two SIP peers. The\r\npeer authenticates at registration.<br> \r\na <b>user</b> is SIP entity\r\nthat places calls through the PBX (a phone that can place calls only,\r\nfor example). Users authenticate to reach services with their\r\ncontext. <br>\r\na <b>friend</b> is an entity that is both a user and a\r\npeer. This is the logical choice for most desk handsets, and other\r\ndevices. When you select \"friend,\" The PBX will create two objects,\r\none peer and one user, with the same name.</dd>\r\n\r\n<dt>Host</dt><dd>The host IP number or host name that will be used to\r\nfind the client. If you want the phone to register itself, use the\r\nkeyword \"dynamic\" instead of the host IP.</dd>\r\n\r\n<dt>Context</dt><dd>The context in the dialplan used for for outbound\r\ncalls from this channel.</dd>\r\n\r\n<dt>Language</dt><dd>The language code that specifies the language for\r\nprompts and specific local phone signals (language codes are defined\r\nin \"Configuration: PBX configuration > Advanced > Indications\").</dd>\r\n\r\n<dt>NAT</dt><dd>Depending on the nat settings, Asterisk may override the address/port information specified in the SIP/SDP messages, and use the information (sender address) supplied by the network stck instead.  Valid options are <b>no</b> (User rport if the remote side says to use it), <b>yes</b> (Force rport to always be on and perform comedia RTP handling), <b>force_rport</b> (Force rport to always be on), and <b>comedia</b> (use rport if the remote side says to use it and perform comedia RTP handling).  Default to <b>no</b>.</dd>\r\n\r\n<dt>Qualify</dt><dd>Periodically check if the client is reachable. Options are\r\n<b><i>xxx</i></b>, <b>no</b>, and <b>yes</b>, where <i>xxx</i> is the\r\nnumber of milliseconds before timeout. If yes is entered, the default\r\ntimeout is used, which is two seconds.<br><br>\r\n\r\nIf you turn on qualify in the configuration of a SIP device, the PBX\r\nwill send a SIP OPTIONS command regularly to check that the device is\r\nstill online. If the device does not answer within the configured (or\r\ndefault) period (in milliseconds) the PBX considers the device\r\noff-line for future calls.<br><br>\r\n\r\nThis feature can also be used to keep a UDP session open to a device\r\nthat is located behind a network address translator (NAT). By sending\r\nthe OPTIONS request, the UDP port binding in the NAT (on the outside\r\naddress of the NAT/firewall device) is maintained, by sending traffic\r\nthrough it. If the binding were to expire, there would be no way for\r\nthe PBX to initiate a call to the SIP device. This can be used in\r\nconjunction with the NAT=yes setting.</dd>\r\n\r\n<dt>Default IP</dt><dd>The default IP for the channel. <br><br>\r\n\r\nIf a peer is configured to register automatically (dynamic = yes), it\r\nwon\'t be possible to place calls to the phone until it registers, ie.,\r\ntells us where it is to be reached. If you know where the phone is,\r\nyou can configure the Default IP to be the IP address of the phone,\r\nand User Name to be the username used on the phone. This configuration\r\nwill be used to place calls to the phone until there is\r\nregistration. In the registration process, the phone provides the PBX\r\nwith a username, and an address where it can be reached. <br><br>\r\n\r\nIt is also possible to specify a host name instead of an IP address,\r\nwhich can be useful if you do not know your (dynamic) IP Address, but\r\nrather use a dynamic DNS like dyndns.org.</dd>\r\n\r\n<dt>Qualify Freq</dt><dd>How often to check for the host to be up in seconds and reported in milliseconds with sip show settings.  Set to low value if you use low timeout for NAT of UDP sessions.  Default to <b>60</b>.</dd>\r\n\r\n<dt>Parking Lot</dt><dd>Set the default parking lot for call parking. </dd>\r\n\r\n<dt>Direct Media</dt><dd> This peer option is used to tell the PBX\r\nserver to never issue a reinvite to the client. When SIP initiates the\r\ncall, the INVITE message contains the information about where to send\r\nthe media streams. The PBX uses itself as the end-points of media\r\nstreams when setting up the call. Once the call has been accepted, the\r\nPBX sends another (re)INVITE message to the clients, with the\r\ninformation necessary to have the two clients send the media streams\r\ndirectly to each other. Allowing re-invites will result in the PBX\r\nlosing control of the call. </dd>\r\n\r\n<dt>MOH Interpret</dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>MOH Suggest</dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes. This field, if defined, is used to\r\npopulate the \"accountcode\" field of the CDR. This field can be\r\nanything.</dd>\r\n\r\n<dt>Amaflags</dt><dd>Categorization for CDR records. The options are\r\n<b>default</b>, <b>omit</b>, <b>billing</b>, and\r\n<b>documentation</b>.</dd>\r\n\r\n<dt>DTMF Mode</dt><dd>How the client handles DTMF signaling. Choices\r\nare <b>inband</b>, <b>rfc2833</b>, or <b>info</b>. If inband is\r\nspecified, the device that a user presses the key on will generate the\r\nDTMF tones. If the codec is not ulaw or alaw, then the DTMF tones will\r\nbe distorted by the audio compression, and will not be recognized. If\r\nthe phone is set for RFC2833 and the PBX is set for inband, then you\r\nmay not hear anything. For more information about rfc2833, see\r\nhttp://www.ietf.org/rfc/rfc2833.</dd>\r\n\r\n<dt>Insecure</dt><dd>Tells the system to not check for Host IP and\r\nport for a peer (not a user).</dd>\r\n\r\n<dt>RFC2833 Compensate</dt><dd>Compensate for pre-1.4 DTMF transmission from another Asterisk machine.  You must have this turned on or DTMF reception will work improperly.</dd>\r\n\r\n<dt>Outbound Proxy</dt><dd>iSend outbound signalling to this proxy, not directly to the devices.</dd>\r\n\r\n<dt>Call Group</dt><dd>Defines the call group for calls to this\r\ndevice/channel.</dd>\r\n\r\n<dt>Pickup Group</dt><dd>The group of fellow users that can pick up\r\nthis users\' calls, using *8 and the Pickup() application on the *8\r\nextension.</dd>\r\n\r\n<dt>Disallow Codec</dt><dd>Disallows the listed codecs. The option\r\n<b>all</b> will disallow all codecs. This is useful when combined with\r\n\"allow codecs.\"  </dd>\r\n\r\n<dt>Allow Codec</dt><dd>The list of allowed codecs.</dd>\r\n\r\n<dt>From User</dt><dd>Specifies a name to put in the \"from\" field\r\ninstead of the caller ID (overrides the caller ID) when placing calls\r\n<i>to</i> a peer (another SIP proxy).</dd>\r\n\r\n<dt>From Domain</dt><dd>Sets the default \"From:\" domain in SIP\r\nmessages when placing calls <i>to</i> a peer.<dd>\r\n\r\n<dt>Calling Pres</dt><dd>Set the Caller ID presentation for this user.  Valid values are: <b>allowed_not_screen</b> (presentation allowed, not screened), <b>allowed_passed_screen</b> (presentation allowed, passed screen), <b>allowed_failed_screen</b> (presentation allowed, failed screen), <b>allowed</b> (presentation allowed, network number), <b>prohib_not_screened</b> (presentation prohibited, not screened), <b>prohib_passed_screen</b> (presentation prohibited, passed screen), <b>prohib_failed_screen</b> (presentation prohibited, failed screen), <b>prohib</b> (presentation prohibited, network number), <b>unavailable</b> (number unavailable).</dd>\r\n\r\n<dt>Default User</dt><dd>Username to use in INVITE until peer registers.</dd>\r\n\r\n<dt>Port</dt><dd>The SIP port of the client. The default port is 5060. </dd>\r\n\r\n<dt>MD5 SecretM</dt><dd>The MD5-Hash of \"<i>user</i>:the\r\nPBX:<i>secret</i>\" (can be used instead of secret).</dd>\r\n\r\n<dt>Transport</dt><dd>Set the default transport type for outgoing call.  The default transport type is only used for outbound messages until a registration takes place.  During the peer registration the transport type may change to another supported type if the peer requests so.  Valid values are <b>udp</b> and <b>tcp</b>.</dd>\r\n\r\n<dt>Remote Secret</dt><dd>Our password to their service.</dd>\r\n\r\n<dt>Call Limit</dt><dd>Limit for the number of simultaneous active\r\ncalls for a SIP client.</dd>\r\n\r\n<dt>Busy Level</dt><dd>Set the number of call threshold before the system indicate busy.</dd>\r\n\r\n<dt>Permit</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Deny</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>RTP Timeout</dt><dd>How many seconds of no RTP activity before the\r\ncall is terminated, when not on hold.</dd>\r\n\r\n<dt>RTP Hold Timeout</dt><dd><dd>How many seconds of no RTP activity\r\nbefore the call is terminated, when on hold. This must be larger than\r\nRTP Timeout.</dd> \r\n\r\n<dt>Video Support</dt><dd>Turn on support for SIP video for this device.</dd>\r\n\r\n<dt>Max Bitrate (kbps)</dt><dd>Maximum bitrate for video calls (default to <b>384 kb/s</b>.</dd>\r\n\r\n<dt>T38 Support</dt><dd>Enable T.38 Fax support on SIP calls.  It defaults to <b>off</b>.  Valid values are <b>yes,fec</b> (Enables T.38 with FEC error correction), <b>yes,redundancy</b> (Enables T.38 with redundnacy error correction), <b>yes,none</b> (Enables T.38 with no error correction), and <b>no</b> (Disables T.38 support).</dd>\r\n\r\n<dt>T38 Use RTP Src</dt><dd>Use the source IP address of RTP as the destination IP address for UDPTL packets if the nat option is enabled.  If a single packet is received, Asterisk will know the external IP address of the remote device.  If port forwarding is done at the client side, then UDPTL will flow to the remote device.</dd>\r\n\r\n<dt>RTP Keep Alive</dt><dd>Send Keepalives in the RTP stream to keep NAT open.  Default is <b>off</b> (0).</dd>\r\n\r\n<dt>G726 nonstandard</dt><dd>If the peer negotiates G726-32 audio, use AAL2 packing order instead of RFC3551 packing order (this is required for Sipura and Grandstream ATAs, amongh others).  This is contrary to the RFC3551 specification, the peer shoud be negotiating AAL2-G726-32 instead.</dd>\r\n\r\n<dt>Fax Detect</dt><dd>Fax detection will cause the SIP channel to jump to the \'fax\' extension (if it exists) based one or more events being detected.  The events that can be detected are an incoming CNG tone or an incoming T.38 re-INVITE request.  Valid options are <b>yes</b>, <b>no</b>, <b>cng</b>, and <b>t38</b>. Default to <b>no</b>.</dd>\r\n\r\n<dt>Text Support</dt><dd>Whether SIP text is supported.</dd>\r\n\r\n<dt>Progress InBand</dt><dd>Whether we should generate in-band ringing.  Always use \'never\' to never use in-band signaling.  Valid values are <b>yes</b>, <b>no</b>, and <b>never</b>.  Default to <b>never</b>.</dd>\r\n\r\n<dt>Promisc Redirect</dt><dd>Whether to allow 302 or REDIR to non-local SIP address.</dd>\r\n\r\n<dt>Allow Transfer</dt><dd>Whether SIP transfers are allowed or not.  Default is <b>enabled</b>.</dd>\r\n\r\n<dt>Allow Overlap</dt><dd>Whether to allow overlap dial support. Default to <b>yes</b>.</dd>\r\n\r\n<dt>Allow Subscribe</dt><dd>Whether to support SIP subscription.</dd>\r\n\r\n<dt>Subscribe Context</dt><dd>Set a specific context for SUBSCRIBE requests.  Useful to limit subscriptions to local extensions.</dd>\r\n\r\n<dt>Use Client Code</dt><dd>Whether to use client code.</dd>\r\n\r\n<dt>Use Reqphone</dt><dd>This provider requires \";user=phone\" on URL.</dd>\r\n\r\n<dt>Ignore SDP Version</dt><dd>By default, Asterisk will honour the session version number in SDP packets and will only modify the SDP session if the version number changes.  This option will force asterisk to ignroe the SDP session version number and treat all SDP data as new data.  This is required for devices that send us on non-standard SDP packets (observed with Microsoft OCS).  By default, this option is <b>off</b>.</dd>\r\n\r\n<dt>Registry Tring</dt><dd>Send a 100 Trying when the device registers.</dd>\r\n\r\n<dt>Trust RPID</dt><dd>If Remote-Party-ID shoud be trusted.</dd>\r\n\r\n<dt>Send RPID</dt><dd>If Remote-Party-ID shoudl be sent (defualt to <b>no</b>).  Valid values are <b>rpid</b> (use the Remote-Party-ID header to send the identify of the remote party), <b>pai</b> (Use the P-Asserted-Identify header to send the identify of the remote party, and <b>yes</b> (same as <b>rpid</b>).</dd>\r\n\r\n</dl>\r\n\r\n<dl>\r\n\r\n<dt><b>Device Configuration</b></dt>\r\n\r\n<dt>Description</dt><dd>Any text that will help identify a device\r\nconfiguration. A device configuration is always attached to a\r\nSIP template.</dd>\r\n\r\n<dt>Template</dt><dd>A template is a text file with place holders for\r\nvarious configuration strings. In a text-based configuration file for\r\na specific device you can replace strings with the following place\r\nholders:<br>\r\n\r\n%%mac%% - the MAC address of the device<br>\r\n%%name%% -  Name (SIP name)<br>\r\n%%username%% - username (SIP username)\r\n%%secret%% - secret (SIP secret)\r\n%%callerid%% - callerid (SIP calleridname and number)<br>\r\n%%nat%% - NAT yes/no (SIP nat yes/no)<br>\r\n%%accountcode%% - (SIP account code)<br>\r\n%%mailbox%%  - (SIP mailbox)<br>\r\n\r\nThis file will be used as template when adding a new SIP channel based\r\non this template and written to \"destination\".</dd>\r\n\r\n<dt>Destination</dt><dd>Where to write a device configuration\r\nfile. The path can contain any of the above mentioned\r\nplace-holders.</dd>\r\n\r\n</dl>\r\n\r\n<ul>\r\n\r\n<li><b>Update Template</b>Enters the changes defined above.</li>\r\n\r\n<li><b>Reset</b>Resets the fields to default settings.</li>\r\n\r\n<li><b>after edit Template</b> Select <b>continue editing</b> to\r\ncontinue editing this template, or <b>add new</b> to add another\r\ntemplate after this one has been edited.</li>\r\n\r\n</ul>\r\n'),(16,'/sigman/channels-sip-templates-edit.html','PBX: Channels > SIP Channels > Add Template','Add SIP Channel Template','<p>This interaction creates a new SIP channel template.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Add SIP Template</b></dt>\r\n\r\n<dt>Template Name</dt><dd>The name of the new template. This can be\r\nanything.</dd>\r\n\r\n<dt>Load Template</dt><dd>Fills the fields below with values\r\npreviously defined in the selected template.</dd>\r\n\r\n<dt>User Name</dt><dd>The user name for the SIP channel. This is used\r\nfor authentication. <!-- should decide if its username or user name\r\n--></dd>\r\n\r\n<dt>Secret</dt><dd>The SIP secret (password) used to authenticate a SIP\r\nchannel. If The PBX is acting as a SIP server, then this SIP\r\nclient must login with this password (a shared secret). If The PBX is\r\nacting as a SIP client to a remote SIP server that requires SIP INVITE\r\nauthentication, then this field is used to authenticate SIP INVITEs\r\nthat The PBX sends to the remote SIP server.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>The Caller ID name for the channel.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>The Caller ID number for the channel.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox, including the Voicemail context for\r\nthe MWI (Message Waiting Indicator) on the end-user device.</dd>\r\n\r\n<dt>SetVar</dt><dd>Channel variable to be set for all calls from or to this device.</dd>\r\n\r\n<dt>Type</dt><dd>There are three possible types:<br> \r\n\r\na <b>peer</b> is a SIP entity to which the PBX only sends calls (a SIP\r\nprovider, for example). If you want a user (extension) to have\r\nmultiple phones, define an extension that calls two SIP peers. The\r\npeer authenticates at registration.<br> \r\na <b>user</b> is SIP entity\r\nthat places calls through the PBX (a phone that can place calls only,\r\nfor example). Users authenticate to reach services with their\r\ncontext. <br>\r\na <b>friend</b> is an entity that is both a user and a\r\npeer. This is the logical choice for most desk handsets, and other\r\ndevices. When you select \"friend,\" The PBX will create two objects,\r\none peer and one user, with the same name.</dd>\r\n\r\n<dt>Host</dt><dd>The host IP number or host name that will be used to\r\nfind the client. If you want the phone to register itself, use the\r\nkeyword \"dynamic\" instead of the host IP.</dd>\r\n\r\n<dt>Context</dt><dd>The context in the dialplan used for for outbound\r\ncalls from this channel.</dd>\r\n\r\n<dt>Language</dt><dd>The language code that specifies the language for\r\nprompts and specific local phone signals (language codes are defined\r\nin \"Configuration: PBX configuration > Advanced > Indications\").</dd>\r\n\r\n<dt>NAT</dt><dd>Depending on the nat settings, Asterisk may override the address/port information specified in the SIP/SDP messages, and use the information (sender address) supplied by the network stck instead.  Valid options are <b>no</b> (User rport if the remote side says to use it), <b>yes</b> (Force rport to always be on and perform comedia RTP handling), <b>force_rport</b> (Force rport to always be on), and <b>comedia</b> (use rport if the remote side says to use it and perform comedia RTP handling).  Default to <b>no</b>.</dd>\r\n\r\n<dt>Qualify</dt><dd>Periodically check if the client is reachable. Options are\r\n<b><i>xxx</i></b>, <b>no</b>, and <b>yes</b>, where <i>xxx</i> is the\r\nnumber of milliseconds before timeout. If yes is entered, the default\r\ntimeout is used, which is two seconds.<br><br>\r\n\r\nIf you turn on qualify in the configuration of a SIP device, the PBX\r\nwill send a SIP OPTIONS command regularly to check that the device is\r\nstill online. If the device does not answer within the configured (or\r\ndefault) period (in milliseconds) the PBX considers the device\r\noff-line for future calls.<br><br>\r\n\r\nThis feature can also be used to keep a UDP session open to a device\r\nthat is located behind a network address translator (NAT). By sending\r\nthe OPTIONS request, the UDP port binding in the NAT (on the outside\r\naddress of the NAT/firewall device) is maintained, by sending traffic\r\nthrough it. If the binding were to expire, there would be no way for\r\nthe PBX to initiate a call to the SIP device. This can be used in\r\nconjunction with the NAT=yes setting.</dd>\r\n\r\n<dt>Default IP</dt><dd>The default IP for the channel. <br><br>\r\n\r\nIf a peer is configured to register automatically (dynamic = yes), it\r\nwon\'t be possible to place calls to the phone until it registers, ie.,\r\ntells us where it is to be reached. If you know where the phone is,\r\nyou can configure the Default IP to be the IP address of the phone,\r\nand User Name to be the username used on the phone. This configuration\r\nwill be used to place calls to the phone until there is\r\nregistration. In the registration process, the phone provides the PBX\r\nwith a username, and an address where it can be reached. <br><br>\r\n\r\nIt is also possible to specify a host name instead of an IP address,\r\nwhich can be useful if you do not know your (dynamic) IP Address, but\r\nrather use a dynamic DNS like dyndns.org.</dd>\r\n\r\n<dt>Qualify Freq</dt><dd>How often to check for the host to be up in seconds and reported in milliseconds with sip show settings.  Set to low value if you use low timeout for NAT of UDP sessions.  Default to <b>60</b>.</dd>\r\n\r\n<dt>Parking Lot</dt><dd>Set the default parking lot for call parking. </dd>\r\n\r\n<dt>Direct Media</dt><dd> This peer option is used to tell the PBX\r\nserver to never issue a reinvite to the client. When SIP initiates the\r\ncall, the INVITE message contains the information about where to send\r\nthe media streams. The PBX uses itself as the end-points of media\r\nstreams when setting up the call. Once the call has been accepted, the\r\nPBX sends another (re)INVITE message to the clients, with the\r\ninformation necessary to have the two clients send the media streams\r\ndirectly to each other. Allowing re-invites will result in the PBX\r\nlosing control of the call. </dd>\r\n\r\n<dt>MOH Interpret</dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>MOH Suggest</dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes. This field, if defined, is used to\r\npopulate the \"accountcode\" field of the CDR. This field can be\r\nanything.</dd>\r\n\r\n<dt>Amaflags</dt><dd>Categorization for CDR records. The options are\r\n<b>default</b>, <b>omit</b>, <b>billing</b>, and\r\n<b>documentation</b>.</dd>\r\n\r\n<dt>DTMF Mode</dt><dd>How the client handles DTMF signaling. Choices\r\nare <b>inband</b>, <b>rfc2833</b>, or <b>info</b>. If inband is\r\nspecified, the device that a user presses the key on will generate the\r\nDTMF tones. If the codec is not ulaw or alaw, then the DTMF tones will\r\nbe distorted by the audio compression, and will not be recognized. If\r\nthe phone is set for RFC2833 and the PBX is set for inband, then you\r\nmay not hear anything. For more information about rfc2833, see\r\nhttp://www.ietf.org/rfc/rfc2833.</dd>\r\n\r\n<dt>Insecure</dt><dd>Tells the system to not check for Host IP and\r\nport for a peer (not a user).</dd>\r\n\r\n<dt>RFC2833 Compensate</dt><dd>Compensate for pre-1.4 DTMF transmission from another Asterisk machine.  You must have this turned on or DTMF reception will work improperly.</dd>\r\n\r\n<dt>Outbound Proxy</dt><dd>iSend outbound signalling to this proxy, not directly to the devices.</dd>\r\n\r\n<dt>Call Group</dt><dd>Defines the call group for calls to this\r\ndevice/channel.</dd>\r\n\r\n<dt>Pickup Group</dt><dd>The group of fellow users that can pick up\r\nthis users\' calls, using *8 and the Pickup() application on the *8\r\nextension.</dd>\r\n\r\n<dt>Disallow Codec</dt><dd>Disallows the listed codecs. The option\r\n<b>all</b> will disallow all codecs. This is useful when combined with\r\n\"allow codecs.\"  </dd>\r\n\r\n<dt>Allow Codec</dt><dd>The list of allowed codecs.</dd>\r\n\r\n<dt>From User</dt><dd>Specifies a name to put in the \"from\" field\r\ninstead of the caller ID (overrides the caller ID) when placing calls\r\n<i>to</i> a peer (another SIP proxy).</dd>\r\n\r\n<dt>From Domain</dt><dd>Sets the default \"From:\" domain in SIP\r\nmessages when placing calls <i>to</i> a peer.<dd>\r\n\r\n<dt>Calling Pres</dt><dd>Set the Caller ID presentation for this user.  Valid values are: <b>allowed_not_screen</b> (presentation allowed, not screened), <b>allowed_passed_screen</b> (presentation allowed, passed screen), <b>allowed_failed_screen</b> (presentation allowed, failed screen), <b>allowed</b> (presentation allowed, network number), <b>prohib_not_screened</b> (presentation prohibited, not screened), <b>prohib_passed_screen</b> (presentation prohibited, passed screen), <b>prohib_failed_screen</b> (presentation prohibited, failed screen), <b>prohib</b> (presentation prohibited, network number), <b>unavailable</b> (number unavailable).</dd>\r\n\r\n<dt>Default User</dt><dd>Username to use in INVITE until peer registers.</dd>\r\n\r\n<dt>Port</dt><dd>The SIP port of the client. The default port is 5060. </dd>\r\n\r\n<dt>MD5 SecretM</dt><dd>The MD5-Hash of \"<i>user</i>:the\r\nPBX:<i>secret</i>\" (can be used instead of secret).</dd>\r\n\r\n<dt>Transport</dt><dd>Set the default transport type for outgoing call.  The default transport type is only used for outbound messages until a registration takes place.  During the peer registration the transport type may change to another supported type if the peer requests so.  Valid values are <b>udp</b> and <b>tcp</b>.</dd>\r\n\r\n<dt>Remote Secret</dt><dd>Our password to their service.</dd>\r\n\r\n<dt>Call Limit</dt><dd>Limit for the number of simultaneous active\r\ncalls for a SIP client.</dd>\r\n\r\n<dt>Busy Level</dt><dd>Set the number of call threshold before the system indicate busy.</dd>\r\n\r\n<dt>Permit</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Deny</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>RTP Timeout</dt><dd>How many seconds of no RTP activity before the\r\ncall is terminated, when not on hold.</dd>\r\n\r\n<dt>RTP Hold Timeout</dt><dd><dd>How many seconds of no RTP activity\r\nbefore the call is terminated, when on hold. This must be larger than\r\nRTP Timeout.</dd> \r\n\r\n<dt>Video Support</dt><dd>Turn on support for SIP video for this device.</dd>\r\n\r\n<dt>Max Bitrate (kbps)</dt><dd>Maximum bitrate for video calls (default to <b>384 kb/s</b>.</dd>\r\n\r\n<dt>T38 Support</dt><dd>Enable T.38 Fax support on SIP calls.  It defaults to <b>off</b>.  Valid values are <b>yes,fec</b> (Enables T.38 with FEC error correction), <b>yes,redundancy</b> (Enables T.38 with redundnacy error correction), <b>yes,none</b> (Enables T.38 with no error correction), and <b>no</b> (Disables T.38 support).</dd>\r\n\r\n<dt>T38 Use RTP Src</dt><dd>Use the source IP address of RTP as the destination IP address for UDPTL packets if the nat option is enabled.  If a single packet is received, Asterisk will know the external IP address of the remote device.  If port forwarding is done at the client side, then UDPTL will flow to the remote device.</dd>\r\n\r\n<dt>RTP Keep Alive</dt><dd>Send Keepalives in the RTP stream to keep NAT open.  Default is <b>off</b> (0).</dd>\r\n\r\n<dt>G726 nonstandard</dt><dd>If the peer negotiates G726-32 audio, use AAL2 packing order instead of RFC3551 packing order (this is required for Sipura and Grandstream ATAs, amongh others).  This is contrary to the RFC3551 specification, the peer shoud be negotiating AAL2-G726-32 instead.</dd>\r\n\r\n<dt>Fax Detect</dt><dd>Fax detection will cause the SIP channel to jump to the \'fax\' extension (if it exists) based one or more events being detected.  The events that can be detected are an incoming CNG tone or an incoming T.38 re-INVITE request.  Valid options are <b>yes</b>, <b>no</b>, <b>cng</b>, and <b>t38</b>. Default to <b>no</b>.</dd>\r\n\r\n<dt>Text Support</dt><dd>Whether SIP text is supported.</dd>\r\n\r\n<dt>Progress InBand</dt><dd>Whether we should generate in-band ringing.  Always use \'never\' to never use in-band signaling.  Valid values are <b>yes</b>, <b>no</b>, and <b>never</b>.  Default to <b>never</b>.</dd>\r\n\r\n<dt>Promisc Redirect</dt><dd>Whether to allow 302 or REDIR to non-local SIP address.</dd>\r\n\r\n<dt>Allow Transfer</dt><dd>Whether SIP transfers are allowed or not.  Default is <b>enabled</b>.</dd>\r\n\r\n<dt>Allow Overlap</dt><dd>Whether to allow overlap dial support. Default to <b>yes</b>.</dd>\r\n\r\n<dt>Allow Subscribe</dt><dd>Whether to support SIP subscription.</dd>\r\n\r\n<dt>Subscribe Context</dt><dd>Set a specific context for SUBSCRIBE requests.  Useful to limit subscriptions to local extensions.</dd>\r\n\r\n<dt>Use Client Code</dt><dd>Whether to use client code.</dd>\r\n\r\n<dt>Use Reqphone</dt><dd>This provider requires \";user=phone\" on URL.</dd>\r\n\r\n<dt>Ignore SDP Version</dt><dd>By default, Asterisk will honour the session version number in SDP packets and will only modify the SDP session if the version number changes.  This option will force asterisk to ignroe the SDP session version number and treat all SDP data as new data.  This is required for devices that send us on non-standard SDP packets (observed with Microsoft OCS).  By default, this option is <b>off</b>.</dd>\r\n\r\n<dt>Registry Tring</dt><dd>Send a 100 Trying when the device registers.</dd>\r\n\r\n<dt>Trust RPID</dt><dd>If Remote-Party-ID shoud be trusted.</dd>\r\n\r\n<dt>Send RPID</dt><dd>If Remote-Party-ID shoudl be sent (defualt to <b>no</b>).  Valid values are <b>rpid</b> (use the Remote-Party-ID header to send the identify of the remote party), <b>pai</b> (Use the P-Asserted-Identify header to send the identify of the remote party, and <b>yes</b> (same as <b>rpid</b>).</dd>\r\n\r\n</dl>\r\n\r\n<dl>\r\n\r\n<dt><b>Device Configuration</b></dt>\r\n\r\n<dt>Description</dt><dd>Any text that will help identify a device\r\nconfiguration. A device configuration is always attached to a\r\nSIP template.</dd>\r\n\r\n<dt>Template</dt><dd>A template is a text file with place holders for\r\nvarious configuration strings. In a text-based configuration file for\r\na specific device you can replace strings with the following place\r\nholders:<br> <!-- I wish we could distinguish \"device template\" -->\r\n\r\n%%mac%% - the MAC address of the device<br>\r\n%%name%% -  Name (SIP name)<br>\r\n%%username%% - username (SIP username)\r\n%%secret%% - secret (SIP secret)\r\n%%callerid%% - callerid (SIP calleridname and number)<br>\r\n%%nat%% - NAT yes/no (SIP nat yes/no)<br>\r\n%%accountcode%% - (SIP account code)<br>\r\n%%mailbox%%  - (SIP mailbox)<br>\r\n\r\nThis file will be used as template when adding a new SIP channel based\r\non this template and written to \"destination\".</dd>\r\n\r\n<dt>Destination</dt><dd>Where to write a device configuration\r\nfile. The path can contain any of the above mentioned\r\nplace-holders.</dd>\r\n\r\n</dl>\r\n\r\n<ul>\r\n\r\n<li><b>Add Template</b> Saves the template defined above.</li>\r\n\r\n<li><b>Reset</b> Resets the fields to default settings.</li>\r\n\r\n<li><b>after Add Template</b> Select <b>continue editing</b> to continue\r\nediting this template, and <b>add new</b> to add another template after\r\nthis one has been added.</li>\r\n\r\n</ul>'),(68,'/sigman/channels-sip-advanced.html','Channels: SIP Channels','SIP Advanced Channel Settings','<p>\r\nAllows you to clear all SIP channels (delete from configuration or reload the current configuration (activate changes)\r\n</p>'),(66,'/sigman/channels-sip-clear.html','Channels: SIP Channels','Clear SIP Channels','<p>This interaction is used to clear all SIP channels from the database - this is irreversible. Please confirm\r\nby entering \"I agree\" into the input box</p>'),(17,'/sigman/channels-iax.html','PBX: Channels > IAX Channels > Channels','IAX Channels','<p>This interaction presents a list of IAX channels, and provides\r\naccess to editing and delete functions.</p>\r\n\r\n<dl>\r\n\r\n<dt>Edit: %pen-icon%</dt><dd>Opens an Edit Channel interaction. See\r\nthe \"PBX: Channels > IAX Channels > Channels > Edit Channel\" help page for a\r\ndescription of the fields in this form.</dd>\r\n\r\n<dt>Edit: %X-icon%</dt><dd>Deletes the channel entry.</dd>\r\n\r\n<dt>Channel</dt><dd>The name of the channel.</dd>\r\n\r\n<dt>Type</dt><dd>The channel type. (Options are peer, user, or friend).</dd>\r\n\r\n<dt>Username</dt><dd>The user name associated with the channel. <!-- IAX\r\nusername? --> </dd>\r\n\r\n<dt>Caller ID</dt><dd>The name and number associated with that\r\nchannel\'s Caller ID.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox name, including context.</dd>\r\n\r\n</dl>'),(18,'/sigman/channels-iax-edit.html','PBX: Channels > IAX Channels > Edit Channel','Edit IAX Channel','<p>This interaction edits an already-existing IAX channel.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Edit IAX Channel <i>channelname</i></b></dt>\r\n\r\n<dt>User Name</dt><dd>The optional user name for the IAX channel. This is used\r\nfor authentication. </dd>\r\n\r\n<dt>Secret</dt><dd>The optional IAX secret (password) used to\r\nauthenticate an IAX channel. If The PBX is acting as an IAX server,\r\nthen this IAX client must login with this password (a shared\r\nsecret). If The PBX is acting as an IAX client to a remote IAX server\r\nthat requires IAX INVITE authentication, then this field is used to\r\nauthenticate IAX INVITEs that The PBX sends to the remote IAX\r\nserver.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>The Caller ID name for the channel.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>The Caller ID number for the channel.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox associated with the channel, including\r\nthe Voicemail context for MWI (Message Waiting Indicator) on the\r\nend-user device.</dd>\r\n\r\n<dt>SetVar</dt><dd>Channel variable to be set for all calls from or to this device.</dd>\r\n\r\n<dt>Type</dt><dd>There are three possible types:<br> \r\n\r\na <b>peer</b> is an IAX entity to which the PBX only sends calls (an\r\nIAX provider, for example). If you want a user (extension) to have\r\nmultiple phones, define an extension that calls two IAX peers. The\r\npeer authenticates at registration.<br> \r\na <b>user</b> is an IAX entity\r\nthat places calls through the PBX (a phone that can place calls only,\r\nfor example). Users authenticate to reach services with their\r\ncontext. <br> \r\na <b>friend</b> is an entity that is both a user and a\r\npeer. This is the logical choice for most desk handsets, and other\r\ndevices. When you select \"friend,\" The PBX will create two objects,\r\none peer and one user, with the same name.</dd>\r\n\r\n<dt>Host</dt><dd>The host IP number or host name that will be used to\r\nfind the client. If you want the phone to register itself, use the\r\nkeyword \"dynamic\" instead of the host IP.</dd>\r\n\r\n<dt>Context</dt><dd>The context in the dialplan used for outbound calls\r\nfrom this channel.</dd>\r\n\r\n<dt>Language</dt><dd>The language code that specifies the language for\r\nprompts and specific local phone signals (language codes are defined\r\nin \"Configuration: PBX configuration > Advanced > Indications\".)</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes. This field, if defined, is used to\r\npopulate the \"accountcode\" field of the CDR. This field can be\r\nanything.</dd>\r\n\r\n<dt>Amaflags</dt><dd>Categorization for CDR records. The options are\r\n<b>default</b>, <b>omit</b>, <b>billing</b>, and\r\n<b>documentation</b>.</dd>\r\n\r\n<dt>Call Group</dt><dd>Defines the call group for calls to this\r\ndevice/channel.</dd>\r\n\r\n<dt>Pickup Group</dt><dd>The group of fellow users that can pick up\r\nthis users\' calls, using *8 and the Pickup() application on the *8\r\nextension.</dd>\r\n\r\n<dt>Disallow Codec</dt><dd>Disallows the listed codecs. The option\r\n<b>all</b> will disallow all codecs. This is useful when combined with\r\n\"allow codecs.\"  </dd>\r\n\r\n<dt>Allow Codec</dt><dd>The list of allowed codecs.</dd>\r\n\r\n<dt>Send ANI</dt><dd>Options\r\nare <b>yes</b>, to send the caller ID, and\r\n<b>no</b> to have the caller ID restricted (sent as ANI). The default is <b>yes</b>.</dd>\r\n\r\n<dt>Codec Priority</dt><dd>The codec priority controls the codec negotiation of an inbound IAX call.  This option is inherited to all user entities.  It can also be defined in each user entity separately which will override the settings in general.<br />The valid values are:<br />caller   - consider the callers perferred order ahead of the host\'s.<br />host     - consider the host\'s preferred order ahead of the caller\'s.<br />disabled - Disable the consideration of codec preference altogether.<br />reqonly  - same as disabled, only do not consider capabilities if the requested format is not available the call will only be accepted if the requested format is available.<br />The default value is <b>host</b>.</dd>\r\n\r\n<dt>Port</dt><dd>The IAX port of the client.</dd>\r\n\r\n<dt>MD5 Secret</dt><dd>The MD5-Hash of \"<i>user</i>:the\r\nPBX:<i>secret</i>\" (can be used instead of the secret).</dd>\r\n\r\n<dt>Max Call Numbers</dt><dd>Limit for the number of simultaneous active\r\ncalls for an IAX client.</dd>\r\n\r\n<dt>Immediate</dt><dd>Go immediately to s extension when picked up.</dd>\r\n\r\n<dt>Permit</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Deny</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Auth Method</dt><dd>Sets the authentication method. Typical values\r\nare <b>md5</b>, <b>plain</b>.</dd>\r\n\r\n<dt>Transfer</dt><dd>Allow IAX transfers.</dd> <!-- default? yes/no\r\nor on/off?? -->\r\n\r\n<dt>InKeys</dt><dd>A list of acceptable public keys on the local system that can be used to authenticate the remote peer, separated by the <b>colon</b> character. Public keys are named /var/lib/asterisk/keys/<name>.pub.</dd>\r\n\r\n<dt>Outkeys</dt><dd>A single, private key to use to authenticate to the other side. Private keys are named /var/lib/asterisk/keys/<name>.key.  Private keys should always be 3DES encrypted.</dd>\r\n\r\n<dt>Encryption</dt><dd>Enable IAX2 encryption.  The default is <b>no</b>.</dd>\r\n\r\n<dt>Require Call Token</dt><dd>Whether to validates the call token or not.  Valid values are <b>yes</b>, <b>no</b>, and <b>auto</b>.  If set to <b>auto</b>, call token validation is optional until a call token supporting peer registers successfully using call otken validation.  Default to <b>yes</b>.</dd>\r\n\r\n<dt>Default IP</dt><dd>Default IP address of the device.</dd>\r\n\r\n<dt>Mask</dt><dd>Net mask of the device.</dd>\r\n\r\n<dt>MOH Interpret</dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>MOH Suggest</dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.</dd>\r\n\r\n<dt>Qualify Smoothing</dt><dd>Use an average of the last two PING results to reduce falsely detected LAGGED hosts.  Default is <b>no</b>.</dd>\r\n\r\n<dt>Qualify Freq OK</dt><dd>How freqnentyly to ping the peer when everything seems to be ok, in milliseconds.</dd>\r\n\r\n<dt>Qualify Freq NOT OK</dt><dd>How frequently to ping the peer when it is either LAGGED or UNAVAILABLE, in milliseconds.</dd>\r\n\r\n</dl>\r\n\r\n<ul>\r\n\r\n<li><b>Update Channel</b> Enters the changes defined above into the\r\nconfiguration database.</li>\r\n\r\n<li><b>Reset</b> Resets the fields to default settings.</li>\r\n\r\n<li><b>after edit Channel</b> Select <b>continue editing</b> to\r\ncontinue editing this channel, or <b>add new</b> to add another\r\nchannel after this one has been edited.</li>\r\n\r\n</ul>'),(19,'/sigman/channels-iax-edit.html','PBX: Channels > IAX Channels > Add Channel','Add IAX Channel','<p>This interaction adds an IAX channel to the system</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Add IAX Channel</b></dt>\r\n\r\n<dt>Channel Name</dt><dd>The channel name. This name can\'t contain\r\nspaces.</dd> <!-- PM - what about including special characters? -->\r\n\r\n<dt>Load Template</dt><dd>Use this pulldown menu to select a template,\r\nand click the load template button to load it. This will fill the rest\r\nof the form with values previously defined in the selected IAX\r\ntemplate.</dd>\r\n\r\n<dt>User Name</dt><dd>The optional user name for the IAX channel. This\r\nis used for authentication. </dd>\r\n\r\n<dt>Secret</dt><dd>The optional IAX secret (password) used to\r\nauthenticate an IAX channel. If The PBX is acting as an IAX server,\r\nthen this IAX client must login with this password (a shared\r\nsecret). If The PBX is acting as an IAX client to a remote IAX server\r\nthat requires IAX INVITE authentication, then this field is used to\r\nauthenticate IAX INVITEs that The PBX sends to the remote IAX\r\nserver.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>The Caller ID name for the channel.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>The Caller ID number for the channel.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox associated with the channel, including\r\nthe Voicemail context for MWI (Message Waiting Indicator) on the\r\nend-user device.</dd>\r\n\r\n<dt>SetVar</dt><dd>Channel variable to be set for all calls from or to this device.</dd>\r\n\r\n<dt>Type</dt><dd>There are three possible types:<br> \r\n\r\na <b>peer</b> is an IAX entity to which the PBX only sends calls (an\r\nIAX provider, for example). If you want a user (extension) to have\r\nmultiple phones, define an extension that calls two IAX peers. The\r\npeer authenticates at registration.<br> \r\na <b>user</b> is an IAX entity\r\nthat places calls through the PBX (a phone that can place calls only,\r\nfor example). Users authenticate to reach services with their\r\ncontext. <br> \r\na <b>friend</b> is an entity that is both a user and a\r\npeer. This is the logical choice for most desk handsets, and other\r\ndevices. When you select \"friend,\" The PBX will create two objects,\r\none peer and one user, with the same name.</dd>\r\n\r\n<dt>Host</dt><dd>The host IP number or host name that will be used to\r\nfind the client. If you want the phone to register itself, use the\r\nkeyword \"dynamic\" instead of the host IP.</dd>\r\n\r\n<dt>Context</dt><dd>The context in the dialplan used for outbound calls\r\nfrom this channel.</dd>\r\n\r\n<dt>Language</dt><dd>The language code that specifies the language for\r\nprompts and specific local phone signals (language codes are defined\r\nin \"Configuration: PBX configuration > Advanced > Indications\".)</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes. This field, if defined, is used to\r\npopulate the \"accountcode\" field of the CDR. This field can be\r\nanything.</dd>\r\n\r\n<dt>Amaflags</dt><dd>Categorization for CDR records. The options are\r\n<b>default</b>, <b>omit</b>, <b>billing</b>, and\r\n<b>documentation</b>.</dd>\r\n\r\n<dt>Call Group</dt><dd>Defines the call group for calls to this\r\ndevice/channel.</dd>\r\n\r\n<dt>Pickup Group</dt><dd>The group of fellow users that can pick up\r\nthis users\' calls, using *8 and the Pickup() application on the *8\r\nextension.</dd>\r\n\r\n<dt>Disallow Codec</dt><dd>Disallows the listed codecs. The option\r\n<b>all</b> will disallow all codecs. This is useful when combined with\r\n\"allow codecs.\"  </dd>\r\n\r\n<dt>Allow Codec</dt><dd>The list of allowed codecs.</dd>\r\n\r\n<dt>Send ANI</dt><dd>Options\r\nare <b>yes</b>, to send the caller ID, and\r\n<b>no</b> to have the caller ID restricted (sent as ANI). The default is <b>yes</b>.</dd>\r\n\r\n<dt>Codec Priority</dt><dd>The codec priority controls the codec negotiation of an inbound IAX call.  This option is inherited to all user entities.  It can also be defined in each user entity separately which will override the settings in general.<br />The valid values are:<br />caller   - consider the callers perferred order ahead of the host\'s.<br />host     - consider the host\'s preferred order ahead of the caller\'s.<br />disabled - Disable the consideration of codec preference altogether.<br />reqonly  - same as disabled, only do not consider capabilities if the requested format is not available the call will only be accepted if the requested format is available.<br />The default value is <b>host</b>.</dd>\r\n\r\n<dt>Port</dt><dd>The IAX port of the client.</dd>\r\n\r\n<dt>MD5 Secret</dt><dd>The MD5-Hash of \"<i>user</i>:the\r\nPBX:<i>secret</i>\" (can be used instead of the secret).</dd>\r\n\r\n<dt>Max Call Numbers</dt><dd>Limit for the number of simultaneous active\r\ncalls for an IAX client.</dd>\r\n\r\n<dt>Immediate</dt><dd>Go immediately to s extension when picked up.</dd>\r\n\r\n<dt>Permit</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Deny</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Auth Method</dt><dd>Sets the authentication method. Typical values\r\nare <b>md5</b>, <b>plain</b>.</dd>\r\n\r\n<dt>Transfer</dt><dd>Allow IAX transfers.</dd> <!-- default? yes/no\r\nor on/off?? -->\r\n\r\n<dt>InKeys</dt><dd>A list of acceptable public keys on the local system that can be used to authenticate the remote peer, separated by the <b>colon</b> character. Public keys are named /var/lib/asterisk/keys/<name>.pub.</dd>\r\n\r\n<dt>Outkeys</dt><dd>A single, private key to use to authenticate to the other side. Private keys are named /var/lib/asterisk/keys/<name>.key.  Private keys should always be 3DES encrypted.</dd>\r\n\r\n<dt>Encryption</dt><dd>Enable IAX2 encryption.  The default is <b>no</b>.</dd>\r\n\r\n<dt>Require Call Token</dt><dd>Whether to validates the call token or not.  Valid values are <b>yes</b>, <b>no</b>, and <b>auto</b>.  If set to <b>auto</b>, call token validation is optional until a call token supporting peer registers successfully using call otken validation.  Default to <b>yes</b>.</dd>\r\n\r\n<dt>Default IP</dt><dd>Default IP address of the device.</dd>\r\n\r\n<dt>Mask</dt><dd>Net mask of the device.</dd>\r\n\r\n<dt>MOH Interpret</dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>MOH Suggest</dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.</dd>\r\n\r\n<dt>Qualify Smoothing</dt><dd>Use an average of the last two PING results to reduce falsely detected LAGGED hosts.  Default is <b>no</b>.</dd>\r\n\r\n<dt>Qualify Freq OK</dt><dd>How freqnentyly to ping the peer when everything seems to be ok, in milliseconds.</dd>\r\n\r\n<dt>Qualify Freq NOT OK</dt><dd>How frequently to ping the peer when it is either LAGGED or UNAVAILABLE, in milliseconds.</dd>\r\n\r\n</dl>\r\n\r\n<ul>\r\n\r\n<li><b>Add Channel</b> Enters the channel defined above into the\r\nconfiguration database.</li>\r\n\r\n<li><b>Reset</b> Resets the fields to default settings.</li>\r\n\r\n<li><b>after add Channel</b> Select <b>continue editing</b> to\r\ncontinue editing this channel, or <b>add new</b> to add another\r\nchannel after this one has been edited.</li>\r\n\r\n</ul>\r\n'),(20,'/sigman/channels-iax-general.html','Channels > IAX Channels > General','IAX Channels General','<p>This interaction presents a list of settings in the \"[general]\"\r\nsection of iax.conf, and provides access to add, edit, and delete\r\nfunctions. The settings are presented as name-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting (not visible if there are no\r\nsettings defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %c-icon% to change the variable name to a custom name\r\n(not included in the pulldown menu). Use the %check-icon% to enter the\r\nedited pair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the selected name (shown in the\r\npulldown menu) and value (entered in the text field). See below for a\r\nlisting of pulldown menu items.</dd>\r\n\r\n<dt>%c-icon%</dt><dd>Enables a custom setting. Click on the %c-icon%\r\nand then enter the name and value in the two fields at left. Click\r\n<b>Add</b> to enter the new pair.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<dl>\r\n\r\n<dt>accountcode</dt><dd>A default account code for CDRs (Call Detail\r\nRecords).</dd>\r\n\r\n<dt>adsi</dt><dd>ADSI (analog display services interface) can be enabled if you have ADSI compatible CPE equipment.</dd>\r\n\r\n<dt>allow</dt><dd>Allows a specific codec, for example <b>gsm</b>. The\r\nvalue <b>all</b> is the equivalent of setting bandwidth to\r\n<b>high</b>.</dd>\r\n\r\n<dt>allowfwdownload</dt><dd>Controls whether this host will serve out firmware to IAX clietns which request it.  This has only been used for the IAXy, and it has been recently proven that this firmware distribution method can be used as a source of traiffic amplification attacks. Also, the IAXy firmware has not been updated for at least 18 months, so unless you are provisioning IAXys in a secure network, we recommend that you leave this option to the default <b>off</b>.</dd>\r\n\r\n<dt>amaflags</dt><dd>A global default AMA flag for iaxtel\r\ncalls. Permitted values are <b>default</b>, <b>omit</b>,\r\n<b>billing</b>, and <b>documentation</b>. These flags are used in the\r\ngeneration of call detail records.</dd>\r\n	\r\n<dt>authdebug</dt><dd>Enables and disables authentication\r\ndebugging. Options are <b>yes</b> and <b>no</b>. Disabling debugging\r\nreduce the amount of debugging traffic.</dd> <!-- default?? -->\r\n\r\n<dt>autokill</dt><dd>If we don\'t get ACK to our NEW within 2000ms, and autokill is set to yes, then we cancel the whole thing (that\'s enough for one retransmission only).  This is used to keep things from stalling for a long time for a host that is not available, but would be ill advised for bad connections.  In additon to <b>yes</b> or <b>no</b>, you can also specify a number of milliseconds.</dd>\r\n	\r\n<dt>bandwidth</dt><dd>Controls which general codecs are used. Possible\r\nvalues are <b>low</b>, <b>medium</b>, and <b>high</b>. You can also\r\nfine-tune which codecs to use using \"allow\" and \"disallow\".</dd>\r\n	\r\n<dt>bindaddr</dt><dd>The address to bind to (the default is to bind to\r\nall local addresses).</dd>\r\n	\r\n<dt>bindport</dt><dd>The port number to bind to.</dd>\r\n	\r\n<dt>calltokenoptional</dt><dd>Call token validation can be set as optional for a single IP address or IP address range.</dd>\r\n\r\n<dt>codecpriority</dt><dd>The codec priority controls the codec negotiation of an inbound IAX call.  This option is inherited to all user entities.  It can also be defined in each user entity separately which will override the settings in general.<br />The valid values are:<br />caller   - consider the callers perferred order ahead of the host\'s.<br />host     - consider the host\'s preferred order ahead of the caller\'s.<br />disabled - Disable the consideration of codec preference altogether.<br />reqonly  - same as disabled, only do not consider capabilities if the requested format is not available the call will only be accepted if the requested format is available.<br />The default value is <b>host</b>.</dd>\r\n\r\n<dt>cos</dt><dd>Sets 802.1p priority for IAX packets.</dd>\r\n\r\n<dt>delayreject</dt><dd>Options are <b>yes</b> and\r\n<b>no</b>. Selecting <b>yes</b> will provide increased security\r\nagainst brute force password attacks, by delaying the sending of an\r\nauthentication reject for REGREQ or AUTHREP if there is a\r\npassword.</dd>\r\n	\r\n<dt>disallow</dt><dd>Disallows a specific codec. See \"allow\" and\r\n\"bandwidth\".</dd>\r\n\r\n<dt>dropcount</dt><dd>The jitter buffer will be sized such that no\r\nmore than \"dropcount\" frames would have been \"too late\" over the last\r\n2 seconds. A setting of <b>3</b> indicates 1.5% of frames\r\ndropped. This should be set to a small number. See\r\n\"jitterbuffer\".</dd>\r\n\r\n<dt>encryption</dt><dd>Enable IAX2 encryption.  Default is <b>no</b>.</dd>\r\n\r\n<dt>forceencryption</dt><dd>Force encryption on all connections.</dd>\r\n\r\n<dt>forcejitterbuffer</dt><dd>In the ideal world, when we bridge VoIP channels, we don\'t want to do jitterbuffering on the switch, since the endpoints can each handle this.  However, some endpoints may have poor jitterbuffers themselves, so this option will force the system to always jitterbuffer, even in this case.</dd>\r\n\r\n<dt>iaxcompat</dt><dd>Options are <b>yes</b> and <b>no</b>. Set this\r\nto <b>yes</b> if you plan to use layered switches. This will incurs a\r\nsmall performance penalty.</dd>\r\n\r\n<dt>iaxmaxthreadcount</dt><dd>Established the number of extra dynamic threads that may be spawned to handle I/O.</dd>\r\n\r\n<dt>iaxthreadcount</dt><dd>Establishes the number of iax helper thread to handle I/O.</dd>\r\n\r\n<dt>jitterbuffer</dt><dd>Whether or not any jitterbuffer is\r\nused. Options are <b>yes</b> and <b>no</b>. The jitter buffer\'s\r\nfunction is to compensate for varying network delay.</dd>\r\n\r\n<dt>jittertargetextra</dt><dd>Number of milliseconds by which the new jitter buffer will pad its size.  The default is <b>40</b>.  So without modification, the new jitter buffer will set its size to the jitter value plus 40 milliseconds.  Increasing this value may help if your network normally has low jitter, but occasionally has spikes.</dd>\r\n\r\n<dt>language</dt><dd>A global default language. The default default is\r\nEnglish (<b>en</b>). Other possible values are:<br>\r\n\r\n<b>at</b> (Austria)<br>\r\n<b>au</b> (Australia)<br>\r\n<b>br</b> Brazil)<br>\r\n<b>be</b> (Belgium)<br>\r\n<b>ch</b> (Switzerland)<br>\r\n<b>cl</b> (Chile)<br>\r\n<b>cn</b> (China)<br>\r\n<b>cz</b> (Czech Republic)<br>\r\n<b>de</b> (Germany)<br>\r\n<b>dk</b> (Denmark)<br>\r\n<b>ee</b> (Estonia)<br>\r\n<b>fi</b> (Finland)<br>\r\n<b>fr</b> (France)<br>\r\n<b>gr</b> (Greece)<br>\r\n<b>hu</b> (Hungary)<br>\r\n<b>it</b> (Italy)<br>\r\n<b>lt</b> (Lithuania)<br>\r\n<b>mx</b> (Mexico)<br>\r\n<b>nl</b> (Netherlands)<br>\r\n<b>no</b> (Norway)<br>\r\n<b>nz</b> (New Zealand)<br>\r\n<b>pl</b> (Poland)<br>\r\n<b>pt</b> (Portugal)<br>\r\n<b>ru</b> (Russia)<br>\r\n<b>se</b> (Sweden)<br>\r\n<b>sg</b> (Singapore)<br>\r\n<b>uk</b> (United Kingdom)<br>\r\n<b>us</b> (United States)<br>\r\n<b>us-old</b> (US old)<br>\r\n<b>tw</b> (Taiwan)<br>\r\n<b>za</b> (South Africa)<br>\r\n\r\n<!-- can a custom indication be used here? -->\r\n\r\n</dd>\r\n 	\r\n<dt>mailboxdetail</dt><dd>Sets the level of detail for mailbox\r\ninformation. If mailboxdetail is set to <b>yes</b>, the user receives\r\nactual new/old message counts, not just yes/no information about\r\nwhether or not they have messages. This can also be set on a per-peer\r\nbasis.</dd>\r\n	\r\n<dt>maxauthreq</dt><dd>Set maximum number of outstanding AUTHREQS waiting for replies.  Any further authentication attempts will be blocked if this limit is reached until they expire or a reply is received.</dd>\r\n\r\n<dt>maxcallnumbers</dt><dd>Limits the amount of call numbers allowed for each individual remote IP address.  Once an IP address reaches it\'s call number limit, no more new connections are allowed until the previous ones close.</dt>\r\n\r\n<dt>maxcallnumbers_nonvalidated</dt><dd>Set the combined number of call numbers that can be allocated for connections where call token validation has been disabled.  Default is <b>8192</b></dd>\r\n\r\n<dt>maxjitterbuffer</dt><dd>A maximum size for the jitter buffer, in\r\nmilliseconds. Setting a reasonable value here will prevent the call\r\ndelay from rising to unreasonable values in extreme situations, as the\r\njitterbuffer is over-enlarged to try to insure quality. Instead, the\r\nuser will hear SOMETHING, even though it will be jittery. See\r\n\"jitterbuffer\". </dd>\r\n	\r\n<dt>maxjitterinterps</dt><dd>The maximum number of interpolation frames the jitterbuffer should return in a row.  Since some clients do not send CNG/DTX frames to indicate silence, the jitterbuffer will assume silence has begun after returning this many interpolations.  This prevents interpolation throughout a long silence.</dt>\r\n\r\n<dt>maxregexpire</dt><dd>Maximum amount of time that IAX peers can request as a registration expiration interval (in seconds).</dt>\r\n\r\n<dt>minregexpire</dt><dd>Minimum amount of time that IAX peers can request as a registration expiration interval (in seconds).</dt>\r\n\r\n<dt>mohinterpret></dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>mohsuggest></dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.  It may be specified globally or on a per-user or per-peer basis.</dd>\r\n\r\n<dt>nochecksums</dt><dd>Disable UDP checksums (if nochecksum is set, then no checksums will be calculated/checked on systems supporting this feature).</dt>\r\n\r\n<dt>parkinglot</dt><dd>Default parkinglot for IAX peers and users.</dd>\r\n\r\n<dt>regcontext</dt><dd>If a regcontext is specified, Asterisk will\r\ndynamically create and destroy a NoOp priority 1 extension for a given\r\npeer who registers or unregisters with us. The actual extension is the\r\n\"regexten\" parameter of the registering peer, or its name if\r\n\"regexten\" is not provided. More than one regexten may be supplied, if\r\nthey are separated by \"&\".  Patterns can be used in regexten. A\r\ntypical value for this setting would be <b>iaxregistrations</b>.</dd>\r\n<!-- Who is \"us\"??  Value is a context name?? -->\r\n	\r\n<dt>register</dt><dd>If a user has a dynamic IP address, they can be\r\nregister with another IAX server to keep it informed of their\r\nlocation. The format for this field is\r\n<b><i>username</i>@<i>hostaddress</i></b>,\r\n<b><i>username</i>:<i>password</i>@<i>hostaddress</i></b>, or\r\n<b><i>username</i>:[<i>RSAkey</i>]@<i>hostaddress</i></b>.<br><br>\r\n\r\nTo register with tormenta using username marko and password\r\nsecretpass, for example, use\r\n<b>marko:secretpass@tormenta.linux-support.net</b>. To register marko\r\nat tormenta.linux-support.net using the qRSA key \"torkey\", use <b>\r\nmarko:[torkey]@tormenta.linux-support.net</b>\r\n\r\n<!-- iax.conf has sample registrations for iaxtel and fwdnet.net.  I\'m\r\nnot sure these belong here. maybe as a second-level. --></dd>\r\n\r\n<dt>requirecalltoken</dt><dd>Controls whether call token validation is required or not.  Valid values are <b>yes></b>, <b>no</b>, and <b>auto</b>.  If it is set to <b>auto</b>, call token validation is optional until a call token supporting peer registers successfully using call token validation.</dd>\r\n\r\n<dt>resyncthreshold</dt><dd>When the jitterbuffer notices a significant change in delay that continues over a few frames, it will resync, assuming that the change in delay was caused by a timestamping mix-up.  The threshold for noticing a change in delay is measured as twice the measured jitter plus this resync threshold.  Resyncing can be disabled by setting this parameter to -1.</dd>\r\n\r\n<dt>rtautoclear</dt><dd>Auto-expire friends created on the fly on the same schedule as if it had just registered? (yes|no|<seconds>).  If set to yes, when the registration expires, the friend will vanish from the configuration until requested again.  If set to an integer, friends expire within this number of seconds instead of the registration interval.</dd>\r\n\r\n<dt>rtcachefriends</dt><dd>Cache realtime friends by adding them to the internal list just like friends added from the config file only on a as-needed basis.  Valid values are <b>yes</b> or <b>no</b>.</dd>\r\n\r\n<dt>rtupdate</dt><dd>Send registry updates to database using realtime.  If set to <b>yes</b>, when an IAX2 peer registers successfully, the IP address, the origination port, the registration period, and the username of the peer will be set to database vai realtime.  Default is <b>yes</b>.</dd>\r\n\r\n<dt>rtsavesysname</dt><dd>Save systemname in realtime database at registration.  Default is <b>no</b>.</dd>\r\n\r\n<dt>shrinkcallerid</dt><dd>Remove special characters and keep only numbers in the callerid.</dd>\r\n\r\n<dt>srvlookup</dt><dd>Enable DNS SRV lookups on calls. Options are\r\n<b>yes</b> or <b>no</b>.</dd>\r\n\r\n<dt>subscribe_network_change_event</dt><dd>Through the use of the res_stun_monitor module, Asterisk has the ability to detect when the perceived external network address has changed.  When the stun_monitor is installed and configured, chan_iax will renew all outbound registrations when the monitor detects any sort of network change has occured.  By default this option is enabled, but only takes effect once res_stun_monitor is configured.  If res_stn_monitor is enabled and you wish to not generate all outbound registrations on a network change, use the option below to disable this feature.</dd>\r\n\r\n<dt>tos</dt><dd>TOS can be set to customize performance. Possible\r\nvalues for this setting are <b>lowdelay</b> (minimize delay),\r\n<b>throughput</b> (maximize throughput), <b>reliability</b> (maximize\r\nreliability), <b>mincost</b> (minimize cost), and <b>none</b> (no\r\nflags). </dd> <!-- default? -->\r\n\r\n<dt>transfer</dt><dd>Whether to enable IAX transfer.  Valid options are <b>yes</b>, <b>no</b>, and <b>mediaonly</b> (transfer only media stream when doing IAX transfers).</dd>\r\n\r\n<dt>trunkfreq</dt><dd>How frequently to send trunk messages, in\r\nmilliseconds.</dd><!-- example?, default? -->\r\n\r\n<dt>trunkmaxsize</dt><dd>This option defines the maximum payload in bytes an IAX2 trunk can support at a given time.  Default to 128000 bytes, which supports up to 800 calls of ulaw at 20ms a frame.</dd>\r\n\r\n<dt>trunkmtu</dt><dd>With a large amount of traffic on IAX2 trunks, there is a risk of bad voice quality when allowing the Linux system to handle fragmentation of UDP packets.  Depending on the size of each payload, allowing the O/S to handle fragmentation may not be very efficient.  This setting sets the maximum transmission unit for IAX2 UDP trunking.  The default is <b>1240</b> bytes, which means if a trunk\'s payload is over 1240 bytes for every 20 ms it will be broken into multiple 1240 byte messages.  Zero disables this functionality and let the OS handle fragmentation.</dd>\r\n\r\n<dt>trunktimestamps</dt><dd>Should we send timestamps for the individual sub-frames within trunk frames?  There is a small bandwidth use for these (less than 1kbps/call), but they ensure that frame timestamps get sent end-to-end properly.  If both ends of all your trunks go directly to TDM, and your trunkfreq equals the frame length for your codecs, you can probably suppress these.  The receiver must also support this feature, although they do not also need to have it enabled.</dd>\r\n\r\n</dl>'),(21,'/sigman/channels-iax-templates.html','PBX: Channels > IAX Channels > Templates','IAX Channel Templates','<p>This interaction presents a list of IAX channel templates, and\r\nprovides access to editing and delete functions.</p>\r\n	\r\n<dl>\r\n\r\n<dt>Edit: %pen-icon%</dt><dd>Opens an Edit Template interaction. See\r\nthe \"PBX: Channels > IAX Channels > Templates > Edit Template\" help\r\npage for a description of the fields in this form.</dd>\r\n\r\n<dt>Edit: %X-icon%</dt><dd>Deletes the template entry.</dd>\r\n\r\n<dt>Name</dt><dd>The name of the template.</dd>\r\n\r\n<dt>Type</dt><dd>The channel type. (Options are peer, user, or\r\nfriend).</dd>\r\n\r\n<dt>Context</dt><dd>The channel context.</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes.</dd>\r\n\r\n</dl>'),(22,'/sigman/channels-iax-templates-edit.html','PBX: Channels > IAX Channels > Templates > Edit','Edit IAX Channel Templates','<p>This interaction edits an IAX channel template that has been\r\npreviously created.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Edit IAX Template <i>templatename</i></b></dt>\r\n\r\n<dt>User Name</dt><dd>The user name associate with the IAX\r\nchannel. This is used for authentication. <!-- should decide if its\r\nusername or user name --></dd>\r\n\r\n<dt>Secret</dt><dd>The IAX secret (password) used to authenticate an IAX\r\nchannel. If The PBX is acting as an IAX server, then this IAX client\r\nmust login with this password (a shared secret). If The PBX is acting\r\nas an IAX client to a remote IAX server that requires IAX INVITE\r\nauthentication, then this field is used to authenticate IAX INVITEs\r\nthat The PBX sends to the remote IAX server.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>The Caller ID name for the channel.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>The Caller ID number for the channel.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox, including the Voicemail context for\r\nMWI (Message Waiting Indicator) on the end-user device.</dd>\r\n\r\n<dt>SetVar</dt><dd>Channel variable to be set for all calls from or to this device.</dd>\r\n\r\n<dt>Type</dt><dd>There are three possible types:<br> \r\n\r\na <b>peer</b> is an IAX entity to which the PBX only sends calls (an\r\nIAX provider, for example). If you want a user (extension) to have\r\nmultiple phones, define an extension that calls two IAX peers. The\r\npeer authenticates at registration.<br> \r\na <b>user</b> is an IAX entity\r\nthat places calls through the PBX (a phone that can place calls only,\r\nfor example). Users authenticate to reach services with their\r\ncontext. <br> \r\na <b>friend</b> is an entity that is both a user and a\r\npeer. This is the logical choice for most desk handsets, and other\r\ndevices. When you select \"friend,\" The PBX will create two objects,\r\none peer and one user, with the same name.</dd>\r\n\r\n<dt>Host</dt><dd>The host IP number or host name that will be used to\r\nfind the client. If you want the phone to register itself, use the\r\nkeyword \"dynamic\" instead of the host IP.</dd>\r\n\r\n<dt>Context</dt><dd>The context in the dialplan used for outbound calls\r\nfrom this channel.</dd>\r\n\r\n<dt>Language</dt><dd>The language code that specifies the language for\r\nprompts and specific local phone signals (language codes are defined\r\nin \"Configuration: PBX configuration > Advanced > Indications\".)</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes. This field, if defined, is used to\r\npopulate the \"accountcode\" field of the CDR. This field can be\r\nanything.</dd>\r\n\r\n<dt>Amaflags</dt><dd>Categorization for CDR records. The options are\r\n<b>default</b>, <b>omit</b>, <b>billing</b>, and\r\n<b>documentation</b>.</dd>\r\n\r\n<dt>Call Group</dt><dd>Defines the call group for calls to this\r\ndevice/channel.</dd>\r\n\r\n<dt>Pickup Group</dt><dd>The group of fellow users that can pick up\r\nthis users\' calls, using *8 and the Pickup() application on the *8\r\nextension.</dd>\r\n\r\n<dt>Disallow Codec</dt><dd>Disallows the listed codecs. The option\r\n<b>all</b> will disallow all codecs. This is useful when combined with\r\n\"allow codecs.\"  </dd>\r\n\r\n<dt>Allow Codec</dt><dd>The list of allowed codecs.</dd>\r\n\r\n<dt>Send ANI</dt><dd>Options\r\nare <b>yes</b>, to send the caller ID, and\r\n<b>no</b> to have the caller ID restricted (sent as ANI). The default is <b>yes</b>.</dd>\r\n\r\n<dt>Codec Priority</dt><dd>The codec priority controls the codec negotiation of an inbound IAX call.  This option is inherited to all user entities.  It can also be defined in each user entity separately which will override the settings in general.<br />The valid values are:<br />caller   - consider the callers perferred order ahead of the host\'s.<br />host     - consider the host\'s preferred order ahead of the caller\'s.<br />disabled - Disable the consideration of codec preference altogether.<br />reqonly  - same as disabled, only do not consider capabilities if the requested format is not available the call will only be accepted if the requested format is available.<br />The default value is <b>host</b>.</dd>\r\n\r\n<dt>Port</dt><dd>The IAX port of the client.</dd>\r\n\r\n<dt>MD5 Secret</dt><dd>The MD5-Hash of \"<i>user</i>:the\r\nPBX:<i>secret</i>\" (can be used instead of the secret).</dd>\r\n\r\n<dt>Max Call Numbers</dt><dd>Limit for the number of simultaneous active\r\ncalls for an IAX client.</dd>\r\n\r\n<dt>Immediate</dt><dd>Go immediately to s extension when picked up.</dd>\r\n\r\n<dt>Permit</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Deny</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Auth Method</dt><dd>Sets the authentication method. Typical values\r\nare <b>md5</b>, <b>plain</b>.</dd>\r\n\r\n<dt>Transfer</dt><dd>Allow IAX transfers.</dd> <!-- default? yes/no\r\nor on/off?? -->\r\n\r\n<dt>InKeys</dt><dd>A list of acceptable public keys on the local system that can be used to authenticate the remote peer, separated by the <b>colon</b> character. Public keys are named /var/lib/asterisk/keys/<name>.pub.</dd>\r\n\r\n<dt>Outkeys</dt><dd>A single, private key to use to authenticate to the other side. Private keys are named /var/lib/asterisk/keys/<name>.key.  Private keys should always be 3DES encrypted.</dd>\r\n\r\n<dt>Encryption</dt><dd>Enable IAX2 encryption.  The default is <b>no</b>.</dd>\r\n\r\n<dt>Require Call Token</dt><dd>Whether to validates the call token or not.  Valid values are <b>yes</b>, <b>no</b>, and <b>auto</b>.  If set to <b>auto</b>, call token validation is optional until a call token supporting peer registers successfully using call otken validation.  Default to <b>yes</b>.</dd>\r\n\r\n<dt>Default IP</dt><dd>Default IP address of the device.</dd>\r\n\r\n<dt>Mask</dt><dd>Net mask of the device.</dd>\r\n\r\n<dt>MOH Interpret</dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>MOH Suggest</dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.</dd>\r\n\r\n<dt>Qualify Smoothing</dt><dd>Use an average of the last two PING results to reduce falsely detected LAGGED hosts.  Default is <b>no</b>.</dd>\r\n\r\n<dt>Qualify Freq OK</dt><dd>How freqnentyly to ping the peer when everything seems to be ok, in milliseconds.</dd>\r\n\r\n<dt>Qualify Freq NOT OK</dt><dd>How frequently to ping the peer when it is either LAGGED or UNAVAILABLE, in milliseconds.</dd>\r\n\r\n</dl>\r\n\r\n<dl>\r\n\r\n<dt><b>Device Configuration</b></dt>\r\n\r\n<dt>Description</dt><dd>Any text that will help identify a device\r\nconfiguration. A device configuration is always attached to an IAX\r\ntemplate.</dd>\r\n\r\n<dt>Template</dt><dd>A template is a text file with place holders for\r\nvarious configuration strings. In a text-based configuration file for\r\na specific device you can replace strings with the following place\r\nholders:<br>\r\n\r\n%%mac%% - the MAC address of the device<br>\r\n%%name%% -  Name (IAX name)<br>\r\n%%username%% - username (IAX username)\r\n%%secret%% - secret (IAX secret)\r\n%%callerid%% - callerid (IAX calleridname and number)<br>\r\n%%nat%% - NAT yes/no (IAX nat yes/no)<br>\r\n%%accountcode%% - (IAX account code)<br>\r\n%%mailbox%%  - (IAX mailbox)<br>\r\n\r\nThis file will be used as template when adding a new IAX channel based\r\non this template and written to \"destination\".</dd>\r\n\r\n<dt>Destination</dt><dd>Where to write a device configuration\r\nfile. The path can contain any of the above mentioned\r\nplace-holders.</dd>\r\n\r\n</dl>\r\n\r\n<ul>\r\n\r\n<li><b>Update Template</b> Saves the changes defined above.</li>\r\n\r\n<li><b>Reset</b> Resets the fields to default settings.</li>\r\n\r\n<li><b>after edit Template</b> Select <b>continue editing</b> to\r\ncontinue editing this template, or <b>add new</b> to add another\r\ntemplate after this one has been edited.</li>\r\n\r\n</ul>\r\n'),(23,'/sigman/channels-iax-templates-edit.html','PBX: Channels > IAX Channels > Add Template','Add IAX Channel Templates','<p>This interaction creates a new IAX channel template.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Add IAX Template</b></dt>\r\n\r\n<dt>Template Name</dt><dd>The name of the new template. This can be\r\nanything.</dd>\r\n\r\n<dt>Load Template</dt><dd>Fills the fields below with values\r\npreviously defined in the selected template.</dd>\r\n\r\n<dt>User Name</dt><dd>The user name associate with the IAX\r\nchannel. This is used for authentication. <!-- should decide if its\r\nusername or user name --></dd>\r\n\r\n<dt>Secret</dt><dd>The IAX secret (password) used to authenticate an IAX\r\nchannel. If The PBX is acting as an IAX server, then this IAX client\r\nmust login with this password (a shared secret). If The PBX is acting\r\nas an IAX client to a remote IAX server that requires IAX INVITE\r\nauthentication, then this field is used to authenticate IAX INVITEs\r\nthat The PBX sends to the remote IAX server.</dd>\r\n\r\n<dt>Caller ID Name</dt><dd>The Caller ID name for the channel.</dd>\r\n\r\n<dt>Caller ID Number</dt><dd>The Caller ID number for the\r\nchannel.</dd>\r\n\r\n<dt>Mailbox</dt><dd>The mailbox, including the Voicemail context for\r\nMWI (Message Waiting Indicator) on the end-user device.</dd>\r\n\r\n<dt>SetVar</dt><dd>Channel variable to be set for all calls from or to this device.</dd>\r\n\r\n<dt>Type</dt><dd>There are three possible types:<br> \r\n\r\na <b>peer</b> is an IAX entity to which the PBX only sends calls (an\r\nIAX provider, for example). If you want a user (extension) to have\r\nmultiple phones, define an extension that calls two IAX peers. The\r\npeer authenticates at registration.<br> \r\na <b>user</b> is an IAX entity\r\nthat places calls through the PBX (a phone that can place calls only,\r\nfor example). Users authenticate to reach services with their\r\ncontext. <br> \r\na <b>friend</b> is an entity that is both a user and a\r\npeer. This is the logical choice for most desk handsets, and other\r\ndevices. When you select \"friend,\" The PBX will create two objects,\r\none peer and one user, with the same name.</dd>\r\n\r\n<dt>Host</dt><dd>The host IP number or host name that will be used to\r\nfind the client. If you want the phone to register itself, use the\r\nkeyword \"dynamic\" instead of the host IP.</dd>\r\n\r\n<dt>Context</dt><dd>The context in the dialplan used for outbound calls\r\nfrom this channel.</dd>\r\n\r\n<dt>Language</dt><dd>The language code that specifies the language for\r\nprompts and specific local phone signals (language codes are defined\r\nin \"Configuration: PBX configuration > Advanced > Indications\".)</dd>\r\n\r\n<dt>Account Code</dt><dd>The account code to associate with the\r\nchannel, for CDR/billing purposes. This field, if defined, is used to\r\npopulate the \"accountcode\" field of the CDR. This field can be\r\nanything.</dd>\r\n\r\n<dt>Amaflags</dt><dd>Categorization for CDR records. The options are\r\n<b>default</b>, <b>omit</b>, <b>billing</b>, and\r\n<b>documentation</b>.</dd>\r\n\r\n<dt>Call Group</dt><dd>Defines the call group for calls to this\r\ndevice/channel.</dd>\r\n\r\n<dt>Pickup Group</dt><dd>The group of fellow users that can pick up\r\nthis users\' calls, using *8 and the Pickup() application on the *8\r\nextension.</dd>\r\n\r\n<dt>Disallow Codec</dt><dd>Disallows the listed codecs. The option\r\n<b>all</b> will disallow all codecs. This is useful when combined with\r\n\"allow codecs.\"  </dd>\r\n\r\n<dt>Allow Codec</dt><dd>The list of allowed codecs.</dd>\r\n\r\n<dt>Send ANI</dt><dd>Options\r\nare <b>yes</b>, to send the caller ID, and\r\n<b>no</b> to have the caller ID restricted (sent as ANI). The default is <b>yes</b>.</dd>\r\n\r\n<dt>Codec Priority</dt><dd>The codec priority controls the codec negotiation of an inbound IAX call.  This option is inherited to all user entities.  It can also be defined in each user entity separately which will override the settings in general.<br />The valid values are:<br />caller   - consider the callers perferred order ahead of the host\'s.<br />host     - consider the host\'s preferred order ahead of the caller\'s.<br />disabled - Disable the consideration of codec preference altogether.<br />reqonly  - same as disabled, only do not consider capabilities if the requested format is not available the call will only be accepted if the requested format is available.<br />The default value is <b>host</b>.</dd>\r\n\r\n<dt>Port</dt><dd>The IAX port of the client.</dd>\r\n\r\n<dt>MD5 Secret</dt><dd>The MD5-Hash of \"<i>user</i>:the\r\nPBX:<i>secret</i>\" (can be used instead of the secret).</dd>\r\n\r\n<dt>Max Call Numbers</dt><dd>Limit for the number of simultaneous active\r\ncalls for an IAX client.</dd>\r\n\r\n<dt>Immediate</dt><dd>Go immediately to s extension when picked up.</dd>\r\n\r\n<dt>Permit</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Deny</dt><dd>IP address and network restriction.</dd>\r\n\r\n<dt>Auth Method</dt><dd>Sets the authentication method. Typical values\r\nare <b>md5</b>, <b>plain</b>.</dd>\r\n\r\n<dt>Transfer</dt><dd>Allow IAX transfers.</dd> <!-- default? yes/no\r\nor on/off?? -->\r\n\r\n<dt>InKeys</dt><dd>A list of acceptable public keys on the local system that can be used to authenticate the remote peer, separated by the <b>colon</b> character. Public keys are named /var/lib/asterisk/keys/<name>.pub.</dd>\r\n\r\n<dt>Outkeys</dt><dd>A single, private key to use to authenticate to the other side. Private keys are named /var/lib/asterisk/keys/<name>.key.  Private keys should always be 3DES encrypted.</dd>\r\n\r\n<dt>Encryption</dt><dd>Enable IAX2 encryption.  The default is <b>no</b>.</dd>\r\n\r\n<dt>Require Call Token</dt><dd>Whether to validates the call token or not.  Valid values are <b>yes</b>, <b>no</b>, and <b>auto</b>.  If set to <b>auto</b>, call token validation is optional until a call token supporting peer registers successfully using call otken validation.  Default to <b>yes</b>.</dd>\r\n\r\n<dt>Default IP</dt><dd>Default IP address of the device.</dd>\r\n\r\n<dt>Mask</dt><dd>Net mask of the device.</dd>\r\n\r\n<dt>MOH Interpret</dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>MOH Suggest</dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.</dd>\r\n\r\n<dt>Qualify Smoothing</dt><dd>Use an average of the last two PING results to reduce falsely detected LAGGED hosts.  Default is <b>no</b>.</dd>\r\n\r\n<dt>Qualify Freq OK</dt><dd>How freqnentyly to ping the peer when everything seems to be ok, in milliseconds.</dd>\r\n\r\n<dt>Qualify Freq NOT OK</dt><dd>How frequently to ping the peer when it is either LAGGED or UNAVAILABLE, in milliseconds.</dd>\r\n\r\n</dl>\r\n\r\n<dl>\r\n\r\n<dt><b>Device Configuration</b></dt>\r\n\r\n<dt>Description</dt><dd>Any text that will help identify a device\r\nconfiguration. A device configuration is always attached to an IAX\r\ntemplate.</dd>\r\n\r\n<dt>Template</dt><dd>A template is a text file with place holders for\r\nvarious configuration strings. In a text-based configuration file for\r\na specific device you can replace strings with the following place\r\nholders:<br><br>\r\n\r\n%%mac%% - the MAC address of the device<br>\r\n%%name%% -  Name (IAX name)<br>\r\n%%username%% - username (IAX username)\r\n%%secret%% - secret (IAX secret)\r\n%%callerid%% - callerid (IAX calleridname and number)<br>\r\n%%nat%% - NAT yes/no (IAX nat yes/no)<br>\r\n%%accountcode%% - (IAX account code)<br>\r\n%%mailbox%%  - (IAX mailbox)<br><br>\r\n\r\nThis file will be used as template when adding a new IAX channel based\r\non this template and written to \"destination\".</dd>\r\n\r\n<dt>Destination</dt><dd>Where to write a device configuration\r\nfile. The path can contain any of the above mentioned\r\nplace-holders.</dd>\r\n\r\n</dl>\r\n\r\n<ul>\r\n\r\n<li><b>Add Template</b> Saves the template defined above.</li>\r\n\r\n<li><b>Reset</b> Resets the fields to default settings.</li>\r\n\r\n<li><b>after add Template</b> Select <b>continue editing</b> to\r\ncontinue editing this template, or <b>add new</b> to add another\r\ntemplate after this one has been created.</li>\r\n\r\n</ul>\r\n'),(69,'/sigman/channels-iax-advanced.html','Channels: SIP Channels','IAX Advanced Channel Settings','<p>\r\nAllows you to clear all IAX channels (delete from configuration or reload the current configuration (activate changes)\r\n</p>'),(24,'/sigman/channels-zap.html','PBX: Channels > Zap Channels > Channel Settings','Zap Channels','<p>This interaction presents a list of settings in the [channels]\r\nsection of chan_dahdi.conf, and provides access to add, edit, and delete\r\nfunctions. It is presented as a collection of name-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting (not visible if there are no\r\nsettings defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %c-icon% to change the variable name to a custom name\r\n(not included in the pulldown menu). Use the %check-icon% to enter the\r\nedited pair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the selected name (shown in the\r\npulldown menu) and value (entered in the text field). See below for a\r\nlisting of pulldown menu items.</dd>\r\n\r\n<dt>%c-icon%</dt><dd>Enables a custom setting. Click on the %c-icon%\r\nand then enter the name and value in the two fields at left. Click\r\n<b>Add</b> to enter the new pair.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Default pulldown menu items</h3>\r\n\r\n<dl>\r\n\r\n<dt>accountcode</dt><dd>A default account code for CDRs (Call Detail\r\nRecords).</dd>\r\n\r\n<dt>adjpointcode></dt><dd>Point code of node adjacent to this signalling link (Possibly the STP between you and your destination).  Point code format follows the same rules as above.</dd>\r\n\r\n<dt>adsi</dt><dd>Enables Analog Display Services Interface (ADSI) for\r\nADSI-compatible CPE equipment. Options are <b>yes</b> and\r\n<b>no</b>. </dd>\r\n\r\n<dt>allow_call_waiting_calls</dt><dd>Allow incoming ISDN call waiting calls.</dd>\r\n\r\n<dt>amaflags</dt><dd>These flags are used in the generation of call\r\ndetail records. Permitted values are <b>default</b>, <b>omit</b>,\r\n<b>billing</b>, and <b>documentation</b>. </dd>\r\n\r\n<dt>answeronpolarityswitch</dt><dd>Use a polarity reversal to mark when an outgoing call is answered by the remote party.</dd>\r\n\r\n<dt>aoc_enable</dt><dd>This option enables Advice of Charge pass-through between the ISDN PRI and Asterisk.  This option can be set to any combination of \'s\', \'d\', and \'e\' which represent the different variants of Advice of Charge, AOC-S, AOC-D, and AOC-E.  Advice of charge pass-through is currently only supported for ETSI.  Since most AOC messages are sent on facility messages, the facilityenable option must also be enabled to fully support AOC pass-through.</dd>\r\n\r\n<dt>aoce_delayhangup</dt><dd>When this option is enabled, a hangup initiated by the ISDN PRI side of the asterisk channel will result in the channel delaying its hangup in an attempt to receive the final AOC-E message from its bridge.  The delay period is configured as one half the T305 timer length.  If the channel is not bridged the hangup will occur immediately without delay.</dd>\r\n\r\n<dt>append_msn_to_cid_tag</dt><dd>With this set, you can automatically append the MSN of a party to the cid_tag.  An \'_\' is used to separate the tag from the MSN.  Applies to ISDN spans.  Default is <b>no</b>.</dd>\r\n\r\n<dt>busycount</dt><dd>How many busy tones to wait before hanging up\r\n(if \"busydetect\" is enabled). The default is <b>4</b>. Better results\r\ncan be achieved if the value is set to <b>6</b> or even <b>8</b>. Note\r\nthat the higher the value, the more time is needed to hang up a\r\nchannel, however, lower values are more likely to generate random\r\nhangups. See \"busydetect\".</dd>\r\n\r\n<dt>busydetect</dt><dd>Enables busy detection. Options are <b>yes</b>\r\nand <b>no</b>. The default is <b>yes</b>. On trunk interfaces (FXS)\r\nand E&M interfaces (E&M, Wink, Feature Group D, and so on), it can be\r\nuseful to perform busy detection, either to detect hang ups or for\r\ndetecting busy signals.</dd>\r\n\r\n<dt>busypattern</dt><dd>If busydetect is enabled, it is also possible to specify cadence of your busy signal.  In many countries, it is 500msec on, 500 msec off.  Without busypattern specified, we\'ll accept any regular sound-silence pattern that repeats <busycount> times as a busy signal.  If you specify busypattern, then system will further check the length of the sound (tone) and silence, which will further reduce the chance of a false positive.</dd>\r\n\r\n<dt>cadence</dt><dd>A custom ring cadence. The syntax for this\r\ndefinition is\r\n<b><i>ring-length</i>,<i>silence-length</i>[,<i>ring-length</i>,<i>silence-len\r\ngth</i>[...]]</b>. Length is measured in milliseconds. Up to eight\r\nring,silence pairs can be included. If the silence is negative, it\r\nindicates where the callerid spill is to be placed. If a custom\r\ncadence is defined, the default cadences will be turned off. A typical\r\nvalue for this field would be\r\n<b>250,250,500,1000,250,250,500,-4000</b>.</dd>\r\n\r\n<dt>callerid</dt><dd>The caller ID associated with the channel. This\r\ncan be set to <b>asreceived</b>, or to a specific number to override\r\nthe actual number. Note that <b>asreceived</b> only applies to trunk\r\ninterfaces. A typical value might be <b>2564286000</b>.</dd>\r\n\r\n<dt>callgroup</dt><dd>Defines the channel\'s call group. A typical\r\nvalue would be <b>1</b>. Members of the same call group (also known as\r\nring group) can answer other group member\'s calls by picking up and\r\npressing \"*8#\". See pickupgroup.</dd>\r\n\r\n<dt>callprogress</dt><dd>Whether or not the system will try to follow\r\nthe progress of a call, RINGING, BUSY, and ANSWERING. Possible values\r\nare <b>yes</b> and <b>no</b>.<br>\r\n\r\nOn trunk interfaces (FXS) it can be useful to attempt to follow the\r\nprogress of a call. If turned on, call callprogress attempts to\r\ndetermine answer, busy, and ringing on phone lines. This feature is\r\nHIGHLY EXPERIMENTAL, and can easily detect false answers and false\r\nhang ups, the latter resulting in being disconnected in the middle of\r\na call for no reason. See progzone.</dd>\r\n\r\n<dt>callreturn</dt><dd>Whether or not to support Call Return\r\n(*69). Options are <b>yes</b> and <b>no</b>. <!-- default? --></dd>\r\n	\r\n<dt>callwaiting</dt><dd>Whether or not to enable Call Waiting on FXO\r\nlines. Options are <b>yes</b> and <b>no</b>. <!-- default? --></dd>\r\n 	\r\n<dt>callwaitingcallerid</dt><dd>Whether or not to support Caller*ID on\r\nCall Waiting. Options are <b>yes</b> and <b>no</b>. <!-- default?\r\n--></dd>\r\n	\r\n<dt>cancallforward</dt><dd>Whether or not to support Call\r\nForward. Options are <b>yes</b> and <b>no</b>. <!-- default? --></dd>\r\n\r\n<dt>canpark</dt><dd>Allow call parking.</dd>\r\n\r\n<dt>cc_ptmp_recall_mode</dt><dd>If set to <b>specific</b>, only the CC original party A can participate in the CC callback.  If set to <b>global</b>, other compatible endpoints on the PTMP line can be party A in the CC callback.</dd>\r\n\r\n<dt>cc_qsig_signaling_link_req</dt><dd>CC Q.SIG Party A (requester) retain signaling link option.  Valid values are <b>retain</b> (require that the signaling link be retained, <b>release</b> (request that the signaling link be released), and <b>do_not_card</b> (the responder is free to choose if the signaling link will be retained).</dd>\r\n\r\n<dt>cid_number</dt><dd>Caller ID Number.</dd>\r\n\r\n<dt>cid_tag</dt><dd>Calls will have the party id user tag set to this string value.</dd>\r\n\r\n<dt>cicbeginswith</dt><dd>Begin CIC (circuit indication codes) count with this number.</dd>\r\n\r\n<dt>cidsignalling</dt><dd>The type of caller ID signalling in\r\nuse. Options are <b>bell</b> (bell202), as used in the US; <b>v23</b>\r\n(v23), as used in the UK; and <b>dtmf</b> (dual tone multi frequency),\r\nas used in Denmark, Sweden and the Netherlands. </dd>\r\n\r\n<dt>cidstart</dt><dd>How to signal the start of caller ID. Options are\r\n<b>ring</b> (a ring signals the start), and <b>polarity</b> (polarity\r\nreversal signals the start).</dd>\r\n	\r\n<dt>context</dt><dd>The context for this channel. A typical value is\r\n<b>default</b></dd>\r\n	\r\n<dt>crv</dt><dd>Defines a CRV. A channel is defined by a channel\r\nnumber or range, and inherits the parameters that were specified above\r\nits declaration. For GR-303, CRV\'s are created like channels, except\r\nthey must start with the trunk group followed by a colon. Typical\r\nvalues would be <b>1:1</b>, or <b>2:1-2,5-8</b>. <!-- I\'m taking this\r\non faith -->\r\n\r\n<dt>datetime_send</dt><dd>Send ISDN date/time IE in CONNECT message option.  Only valid on NT spans.  Valid values are <b>no</b>, <b>date</b>, <b>date_hh</b>, <b>date_hhmm</b>, and <b>date_hhmmss</b>.  Default is an empty string which lets libpri pick the default date/time IE send policy.</dd>\r\n\r\n<dt>defaultcic</dt><dd>Default CIC for Feature Group D tandem access.</dd>\r\n\r\n<dt>defaultdpc</dt><dd>Default point code that you would like to assign to outgoing messages (in case of routing through STPs, or using A links).  Point code format follows the same rules as above.</dd>\r\n\r\n<dt>defaultozz</dt><dd>Default OZZ for Feature Group D tandem access.</dd>\r\n\r\n<dt>description</dt><dd>Add a description for the channel which can be shown through the Asterisk console when executing the \'dahdi show channels\' command is run.</dd>\r\n\r\n<dt>discardremoteholdretrieval</dt><dd>Control whether to ignore remote hold indications</dd>\r\n\r\n<dt>dtmfcidlevel</dt><dd>When cidstart=dtmf, the energy level on the line used to trigger dtmf cid acquisition.  This number is compared to the average over a packet of audio of the absoulte values of 16 bit signed linear samples.  The default is set to 256. The choice of 256 is arbitrary.  The value you should select should be high enough to prevent false detections while low enough to insure that no dtmf spills are missed.</dd>\r\n\r\n<dt>echocancel</dt><dd>Enables echo cancellation. Possible values are\r\neither <b>yes</b> or <b>no</b>, or a power of 2 from 32 to 256 (to\r\nactually set the number of taps of cancellation).</dd>\r\n	\r\n<dt>echocancelwhenbridged</dt><dd>Enables echo cancel during pure TDM\r\nbridging. Generally, it is not necessary (and in fact undesirable) to\r\necho cancel when the circuit path is entirely TDM. Options are\r\n<b>yes</b> and <b>no</b>. Default is <b>no</b>.</dd>\r\n\r\n<dt>echotraining</dt><dd>Causes Asterisk to briefly mute the channel,\r\nsend an impulse, and use the impulse response to pre-train the echo\r\ncanceller so it can start out with a much closer idea of the actual\r\necho. This is useful in cases where the echo canceller doesn\'t train\r\nquickly enough, and there is echo at the beginning of the\r\ncall. Options are <b>yes</b>, <b>no</b>, or the number of milliseconds\r\nto delay before training (the default is <b>400</b>).</dd>\r\n\r\n<dt>facilityenable</dt><dd>To enable transmission of facility-based ISDN supplementary services (such as caller name from CPE over facility), enable this option.</dd>\r\n\r\n<dt>faxbuffer</dt><dd>When <b>faxdetect</b> is used, one could use <b>faxbuffers</b> to configure the DAHDI transmit buffer policy.  The default is <b>OFF</b>.  When this configuration option is used, the faxbuffer policy is reverted after the call is torn down. For example, <b>6,full</b> will result in 6 buffers and a full buffer policy.</dd>\r\n\r\n<dt>faxdetect</dt><dd>Enables fax detection. Possible values are\r\n<b>both</b>, <b>incoming</b>, <b>outgoing</b>, and <b>no</b>. The\r\ndefault is <b>no</b>.</dd>\r\n	\r\n<dt>fullname</dt><dd>Caller ID name.</dd>\r\n\r\n<dt>group</dt><dd>Defines the channel\'s logical group, to allow\r\noutgoing rollover. Possible values range from <b>0</b> to\r\n<b>31</b>. Multiple groups can be specified.</dd>\r\n\r\n<dt>hanguponpolarityswitch</dt><dd>In some countries, a polarity reversal is used to signal the disconnect of a phone line.</dd>\r\n\r\n<dt>hasvoicemail</dt><dd>Whether the channel has voicemail.</dd>\r\n\r\n<dt>hidecallerid</dt><dd>Whether or not to hide outgoing caller\r\nID. This can be overridden at the phone with \"*67\" or \"*82\". Options\r\nare <b>yes</b> and <b>no</b>. Default is <b>no</b>.</dd>\r\n\r\n<dt>hidecalleridname</dt><dd>Hide just the name and not the number for legacy PBX use.  Only applies to PRI channels.</dd>\r\n\r\n<dt>idledial</dt><dd>Defines an idle extension. A typical value would\r\nbe <b>6999</b>.<br><br>\r\n\r\nPRI channels can have an idle extension and a minunused number.  So\r\nlong as at least \"minunused\" channels are idle, chan_zap will try to\r\ncall \"idledial\" on them, and then dump them into the PBX in the\r\n\"idleext\" extension (which is of the form exten@context).  When\r\nchannels are needed, the \"idle\" calls are disconnected (so long as\r\nthere are at least \"minidle\" calls still running, of course) to make\r\nmore channels available.  The primary use of this is to create a\r\ndynamic service, where idle channels are bundled through multilink\r\nPPP, thus more efficiently utilizing combined voice/data services than\r\nconventional fixed mappings/muxings. See also idleext, minunused, and\r\nminidle.</dd>\r\n\r\n<dt>idleext</dt><dd>Defines an idle extension, in the form\r\n<b><i>number</i>@<i>congtext</i></b>. A typical value would be\r\n<b>6999@dialout</b>.</dd>\r\n	\r\n<dt>ignore_failed_channels</dt><dd>Continue even if some channels failed to configure.  False by default, as if even a single channel failed to configured, it might mean other channels are misplaced and having them work may not be a good idea.  If enabled (set to true), chan_dahdi will nevertheless attempt to configure other channels rather than giving up.  This normally makes sense only if you use names for DAHDI channels.</dd>\r\n\r\n<dt>immediate</dt><dd>Specifies whether or not the channel should be\r\nanswered immediately, or if the simple switch should provide a\r\ndialtone, read digits, etc. Options are <b>yes</b> and <b>no</b>. The\r\ndefault is <b>no</b>.</dd>\r\n	\r\n<dt>inbanddisconnect</dt><dd>Allow inband audio (progress) when a call is released by the far end of a PRI</dd>\r\n\r\n<dt>internationalprefix</dt><dd>International prefix for PRI.</dd>\r\n\r\n<dt>jbenabled</dt><dd>iEnables the use of a jitterbuffer on the receiving side of a DAHDI channel.  Default to <b>no</b>.  An enabled jitterbuffer will be used only if the sending side can create and the receiving side cannot accept jitter.  The DAHDI channel can\'t accept jitter, thus an enabled jitterbuffer on the received DAHDI side will always be used if the sending side can create jitter.<dd>\r\n\r\n<dt>jbimpl</dt><dd>Jitterbuffer implementation, used on the receiving side of a DAHDI channel.  Two implementations are currently available - <b>fixed</b> (with size always equals to jbmax-size) and <b>adaptive</b> (with variable size, actually the new jb of IAX2).  Default to <b>fixed</b>.</dd>\r\n\r\n<dt>jblog</dt><dd>Enables jitterbuffer frame logging.  Default to <b>no</b></dd>\r\n\r\n<dt>jbmaxsize</dt><dd>Max length of the jitterbuffer in milliseconds.</dd>\r\n\r\n<dt>jbresyncthreshold</dt><dd>Jump in the frame timestamps over which the jitterbuffer is resynchorized.  Useful to improve the quality of the voice, with big jumps in/broken timestamps, usually sent from exotic devices and programs.  Default to <b>1000</b>.</dd>\r\n\r\n<dt>jbtargetextra</dt><dd>This option only affects the jb when <b>jbimpl=adaptive</b> is set.  The option represents the number of milliseconds by which the new jitter buffer will pad its size.  The default is <b>40</b>, so without modification, the new jitter buffer will set its size to the jitter value plus 40 milliseconds.  Increasing this value may help if your network normally has low jitter, but occasionally has spikes.</dd>\r\n\r\n<dt>jitterbuffers</dt><dd>Configures the number of 20 millisecond\r\njitter buffers in chan_dahdi. The default is <b>4</b>.</dd>\r\n\r\n<dt>language</dt><dd>The channel\'s default language. The default is\r\n<b>en</b> (English). <!-- same as zone?  us and british are different\r\n--> </dd>\r\n	\r\n<dt>linkset</dt><dd>Link set of an SS7 link.</dd>\r\n\r\n<dt>localprefix</dt><dd>Local prefix of PRI.</dd>\r\n\r\n<dt>mailbox</dt><dd>Defines a mailbox number for the channel. Syntax\r\nis <i>mailboxnumber</i>[@<i>context</i>]. A typical value would be\r\n<b>1234</b>. <br> <br>\r\n\r\nThe inclusion of the context determines if a stutter dialtone will be\r\nheard if the Voicemail mailbox contains a message. For mailboxes in\r\nthe default Voicemail context, it is not necessary to include a\r\ncontext to generate a stutter dialtone if a voice mail message has\r\nbeen recieved. For mailboxes that are not in the default context, it\r\nis necessary to include the context to get the stutter. <!-- very\r\nconfusing --> </dd>\r\n\r\n<dt>max_call_waiting_calls</dt><dd>Configure the number of outstanding call waiting calls for internal ISDN endpoints before bouncing the calls as busy.  The option is equivalent to the callwaiting option for analog ports.  A call waiting call is a SETUP message with no B channel selected.  The default is zero to disable call waiting for ISDN endpoints.</dd>\r\n\r\n<dt>minidle</dt><dd>Defines a minimum number of idle calls. A typical\r\nvalue is <b>1</b>. See \"idledial\".</dd>\r\n	\r\n<dt>minunused</dt><dd>Defines a minimum number of used channels. A\r\ntypical value is <b>2</b>. See \"idledial\".</dd>\r\n\r\n<dt>mohinterpret></dt><dd>This option specifies a preference for which music on hold class this channel should listen to when put on hold if the music class has not been set on the channel with Set(CHANNEL(musicclass)=whatever) in the dialplan, and the peer channel putting this one on hold did not suggest a music class.</dd>\r\n\r\n<dt>mohsuggest></dt><dd>This option specifies which music on hold class to suggest to the peer channel when this channel places the peer on hold.  It may be specified globally or on a per-user or per-peer basis.</dd>\r\n\r\n<dt>msn</dt><dd>MSNs for ISDN spans.  Asterisk will listen for the listed numbers on incoming calls and ignore any calls not listed.  Here you can give a comma separated list of numbers or dialplan extension patterns.  An empty list disables MSN matching to allow any incoming call.  Only set on PTMP CPE side of ISDN span if needed.  The default is an empty list.</dd>\r\n\r\n<dt>mwi_mailboxes</dt><dd>Configure the ISDN span to indicate MWI for the list of mailboxes.  You can give a comma separated list of up to 8 mailboxes per span.  An empty list disables MWI.  The default is an empty list.</dd>\r\n\r\n<dt>mwilevel</dt><dd>The energy level that must be seen before starting the MWI detection process for FSK MWI spills.</dd>\r\n\r\n<dt>mwimonitor</dt><dd>Enable receiving MWI on FXO lines.  Valid values are: <br />no - No MWI monitoring occurs (default)<br />yes - the same as specifying fsk<br />fsk - the FXO line is monitored for MWI FSK spills preceded by a ring pulse alert signal.<br />neon - the fxo line is monitored for the presence of NEON pulses indicating MWI.</dd>\r\n\r\n<dt>mwimonitornotify</dt><dd>This option is used in conjunction with mwimonitor.  This will get executed when incoming MWI state changes.  The script is passed 2 arguments.  The first is the corresponding mailbox, and the second is <b>1</b> or <b>0</b>, indicating if there are messages waiting or not.</dd>\r\n\r\n<dt>mwisendtype</dt><dd>Enables various VMWI methods on FXS lines (if supported).  The default is to send FSK only.  The following options are available:<br />rpas - Ring Pulse Alert Signal, alerts intelligent phones that a FSK message is about to be sent.<br />lrev - Line reversed to indicate messages waiting.<br />hvdc - 90Vdc OnHook DC voltage to indicate messages waiting.<br />hvac or neon - 90Vac OnHook AC voltage to light Neon bulb.<br />nofsk - Disables FSK MWI spills from being sent out.<br />It is feasible that multiple options can be enabled.</dd>\r\n\r\n<dt>nationalprefix</dt><dd>national prefix of PRI</dd>\r\n\r\n<dt>networkindicator</dt><dd>What the MTP3 network indicator bits should be set to.  Choices are <b>national</b>, <b>national_spare</b>, <b>international</b>, <b>international_spare</b>.</dd>\r\n\r\n<dt>nsf</dt><dd>Some switches (AT&T especially) require network specific\r\nfacility IE. Supported values are currently <b>none</b>, <b>sdn</b>,\r\n<b>megacom</b>, and <b>accunet</b>. The default is <b>none</b>.</dd>\r\n\r\n<dt>outsignalling</dt><dd> If you have an outbound signalling format that is different from format specified above (but compatible), you can specify outbound signalling format, (see below). The \'signalling\' format specified will be the inbound signalling format. If you only specify \'signalling\', then it will be the format for both inbound and outbound. <br />outsignalling can only be one of: <br />   em, em_e1, em_w, sf, sf_w, sf_featd, sf_featdmf, sf_featb, featd, featdmf, featdmf_ta, e911, fgccama, fgccamamf.  outsignalling cannot be changed on a reload.</dd>\r\n\r\n<dt>overlapdial</dt><dd>Enables overlap dialing mode (sending overlap\r\ndigits). Options are <b>yes</b> and <b>no</b>. <!-- default?  --></dd>\r\n\r\n<dt>parkinglot</dt><dd>Set the default parking lot for call parking.</dd>\r\n\r\n<dt>pickupgroup</dt><dd>Defines the channel\'s pickup group. A typical\r\nvalue would be <b>1</b>. Members of the same pickup group can answer\r\nother group member\'s calls by picking up and pressing \"*8#\". See\r\ncallgroup.</dd>\r\n\r\n<dt>pointcode</dt><dd>Point code of the linkset.  For ITU, this is the decimal number format of the point code.  For ANSI, this can either be in decimal number format or in the xxx-xxx-xxx format.</dd>\r\n\r\n<dt>polarityonanswerdelay</dt><dd>Minimal time period (ms) between the answer polarity switch and hangup polarity switch. (default: 600ms).</dd>\r\n\r\n<dt>pricpndialplan</dt><dd>PRI Connected Line dialplan.  Sets the connected party number\'s numbering plan.  Valid values are <b>unknown</b>, <b>private</b>, <b>local</b>, <b>national</b>, <b>international</b>, <b>from_channel</b>, <b>dynamic</b>, <b>redundant</b>.</dd>\r\n\r\n<dt>pridialplan</dt><dd>Sets the calling numbers numbering plan (only\r\nRARELY used for PRI). Options are <b>unknown</b> (unknown),\r\n<b>private</b> (private ISDN), <b>local</b> (local ISDN),\r\n<b>national</b> (national ISDN), and <b>international</b>\r\n(international ISDN).</dd>\r\n\r\n<dt>priexclusive</dt><dd>If you need to override the existing channels selection routine and force all PRI channels to be marked as exclusively selected, set this to <b>yes</b>.</dd>\r\n\r\n<dt>priindication</dt><dd>Sets the PRI out of band indications. Enable\r\nthis to report Busy and Congestion on a PRI using out-of-band\r\nnotification. Inband indication, as used by Asterisk, doesn\'t seem to\r\nwork with all telcos. Options are <b>outofband</b> (signal\r\nBusy/Congestion out of band with RELEASE/DISCONNECT) and <b>inband</b>\r\n(signal Busy/Congestion using in-band tones). <!-- default? --></dd>\r\n\r\n<dt>prilocaldialplan</dt><dd>Sets the calling number\'s numbering\r\nplan. Only RARELY used for PRI. Options are <b>unknown</b> (unknown),\r\n<b>private</b> (private ISDN), <b>local</b> (local ISDN),\r\n<b>national</b> (national ISDN), and <b>international</b>\r\n(international ISDN).  <!-- how is this different from pridialplan?\r\n--></dd>\r\n\r\n<dt>pritimer</dt><dd>ISDN Timers. All of the ISDN timers and counters that are used are configurable.  Specify the timer name, and its value (in ms for timers).<br />K:    Layer 2 max number of outstanding unacknowledged I frames (default 7)<br />N200: Layer 2 max number of retransmissions of a frame (default 3)<br />T200: Layer 2 max time before retransmission of a frame (default 1000 ms)<br />T203: Layer 2 max time without frames being exchanged (default 10000 ms)<br />T305: Wait for DISCONNECT acknowledge (default 30000 ms)<br />T308: Wait for RELEASE acknowledge (default 4000 ms)<br />T309: Maintain active calls on Layer 2 disconnection (default -1,<br />       Asterisk clears calls)<br />       EuroISDN: 6000 to 12000 ms, according to (N200 + 1) x T200 + 2s<br />       May vary in other ISDN standards (Q.931 1993 : 90000 ms)<br />T313: Wait for CONNECT acknowledge, CPE side only (default 3000 ms).</dd>\r\n\r\n<dt>privateprefix</dt><dd><!-- not in zap.conf --> </dd>	\r\n\r\n<dt>progzone</dt><dd>Defines zones to be used with callprogress. A\r\ntypical value would be <b>us</b>. Few zones are supported at this\r\ntime. See callprogress.\r\n\r\n<dt>pulsedial</dt><dd>For FXO (FXS signalled) devices, whether to use\r\npulse dial instead of DTMF. Options are <b>yes</b> and <b>no</b>.</dd>\r\n\r\n<dt>relaxdtmf</dt><dd>If the system is having trouble with DTMF\r\ndetection, you can relax the DTMF detection parameters. Relaxing them\r\nmay make the DTMF detector more likely to have \"talkoff,\" where DTMF\r\nis detected when it shouldn\'t be. Options are <b>yes</b> and\r\n<b>no</b>. See also rxgain and txgain. <!-- default? --></dd>\r\n\r\n<dt>reportalarms</dt><dd>AMI alarm event reporting.  Possible values are <b>channels</b> (report each channel alarms), <b>spans</b> (report an SpanAlarm event when the span of any configured channel is alarmed), <b>all</b> (report channel and span alarms), and <b>none</b> (do not report any alarms).</dd>\r\n\r\n<dt>resetinterval</dt><dd>Set the time in seconds between restart of unused B channels.  Default to <b>never</b>.</dd>\r\n\r\n<dt>restrictcid</dt><dd>Whether or not restrict the outgoing caller ID\r\n(will be sent as ANI only, not available for the user). This is mostly\r\nused with FXS ports. Options are <b>yes</b> and <b>no</b>. The default\r\nis <b>no</b>.\r\n\r\n<dt>ringtimeout</dt><dd>FXO (FXS signalled) devices must have a timeout to determine if there was a hangup before the line was answered.  This value can be tweaked to shorten how long it takes before DAHDI considers a non-ringing line to be hungup.</dd>\r\n\r\n<dt>rxdrc</dt><dd>Dynamic range compression for the rx channel.</dd>\r\n\r\n<dt>rxgain</dt><dd>To address DTMF detection issues, you can set the\r\ndefault receive and transmit gains (in dB). A typical value would be\r\n<b>0.0</b>. See also relaxdtmf.</dd>\r\n\r\n<dt>rxwink</dt><dd>Receiver wink time, in milliseconds. The default is\r\n<b>300</b>. (See signalling).</dd>\r\n\r\n<dt>sendcalleridafter</dt><dd>When to send the caller ID. Some\r\ncountries (UK) have ring tones with different cadences (ring-ring),\r\nwhich means the callerid needs to be sent later, and not just after\r\nthe first ring. The default is <b>1</b>.</dd>\r\n\r\n<dt>service_message_support</dt><dd>Enable servcie message support for channel.  Must be set after switchtype.</dd>\r\n\r\n<dt>setvar</dt><dd>Channel variable to be set for all calls from this channel.</dd>\r\n\r\n<dt>signalling</dt><dd>The signalling method. The default is\r\n<b>fxs</b>. Valid values are:<br>\r\n\r\n<b>em</b> (E & M)<br>\r\n\r\n<b>em_w</b> (E & M Wink)<br>\r\n\r\n<b>featd</b> (Feature Group D (The fake, Adtran style, DTMF))<br>\r\n\r\n<b>featdmf</b> (Feature Group D (The real thing, MF (domestic, US)))<br>\r\n\r\n<b>featb</b> (Feature Group B (MF (domestic, US)))<br>\r\n\r\n<b>fxs_ls</b> (FXS (Loop Start))<br>\r\n\r\n<b>fxs_gs</b> (FXS (Ground Start))<br>\r\n\r\n<b>fxs_ks</b> (FXS (Kewl Start))<br>\r\n\r\n<b>fxo_ls</b> (FXO (Loop Start))<br>\r\n\r\n<b>fxo_gs</b> (FXO (Ground Start))<br>\r\n\r\n<b>fxo_ks</b> (FXO (Kewl Start))<br>\r\n\r\n<b>pri_cpe</b> (PRI signalling, CPE side)<br>\r\n\r\n<b>pri_net</b> (PRI signalling, Network side)<br>\r\n\r\n<b>gr303fxoks_net</b> (GR-303 Signalling, FXO Loopstart, Network side)<br>\r\n\r\n<b>gr303fxsks_cpe</b> (GR-303 Signalling, FXS Loopstart, CPE side)<br>\r\n\r\n<b>sf</b> (SF (Inband Tone) Signalling)<br>\r\n\r\n<b>sf_w</b> (SF Wink)<br>\r\n\r\n<b>sf_featd</b> (SF Feature Group D (The fake, Adtran style, DTMF))<br>\r\n\r\n<b>sf_featdmf</b> (SF Feature Group D (The real thing, MF (domestic, US)))<br>\r\n\r\n<b>sf_featb</b> (SF Feature Group B (MF (domestic, US)))<br>\r\n\r\nThe following are used for Radio interfaces:<br>\r\n\r\n<b>fxs_rx</b> (Receive audio/COR on an FXS kewlstart interface (FXO at the\r\nchannel bank))<br>\r\n\r\n<b>fxs_tx</b> (Transmit audio/PTT on an FXS loopstart interface (FXO at the\r\nchannel bank))<br>\r\n\r\n<b>fxo_rx</b> (Receive audio/COR on an FXO loopstart interface (FXS at the\r\nchannel bank))<br>\r\n\r\n<b>fxo_tx</b> (Transmit audio/PTT on an FXO groundstart interface (FXS at the\r\nchannel bank)\r\n\r\n<b>em_rx</b> (Receive audio/COR on an E&M interface (1-way))<br>\r\n\r\n<b>em_tx</b> (Transmit audio/PTT on an E&M interface (1-way))<br>\r\n\r\n<b>em_txrx</b> (Receive audio/COR AND Transmit audio/PTT on an E&M interface\r\n(2-way))<br>\r\n\r\n<b>em_rxtx</b> (same as em_txrxx)<br>\r\n\r\n<b>sf_rx</b> (Receive audio/COR on an SF interface (1-way))<br>\r\n\r\n<b>sf_tx</b> (Transmit audio/PTT on an SF interface (1-way))<br>\r\n\r\n<b>sf_txrx</b> (Receive audio/COR AND Transmit audio/PTT on an SF interface\r\n(2-way))<br>\r\n\r\n<b>sf_rxtx</b> (same as sf_txrx (for our dyslexic friends))<br>\r\n\r\n\r\nA variety of timing parameters can be set as well. <!-- but they\'re\r\nnot in the menu -->\r\n\r\n</dd>\r\n\r\n<dt>smdiport</dt><dd>SMDI port used.</dd>\r\n\r\n<dt>ss7type</dt><dd>SS7 signalling type.  Valid options are <b>itu</b> and <b>ansi</b></dd>\r\n\r\n<dt>ss7_called_nai</dt><dd>SS7 called nature of address indicator.  Valid values are <b>unknown</b>, <b>subscriber</b>, <b>national</b>, <b>international</b>, and <b>dynamic</b> (dynamically selects the appropriate dialplan).</dd>\r\n\r\n<dt>ss7_calling_nai</dt><dd>SS7 calling nature of address indicator.  Valid values are <b>unknown</b>, <b>subscriber</b>, <b>national</b>, <b>international</b>, and <b>dynamic</b> (dynamically selects the appropriate dialplan).</dd>\r\n\r\n<dt>ss7_explicitacm</dt><dd>This option is used to disable automatic sending of ACM when the call is started in the dialplan.  If you do use this option, you will need to use the Proceeding application in the dialplan to send ACM.</dd>\r\n\r\n<dt>ss7_internationalprefix></dt><dd>international prefix for SS7</dd>\r\n\r\n<dt>ss7_nationalprefix></dt><dd>rnational prefix for SS7</dd>\r\n\r\n<dt>ss7_subscriberprefix></dt><dd>subscriber prefix for SS7</dd>\r\n\r\n<dt>ss7_unknownprefix></dt><dd>unknown prefix for SS7</dd>\r\n\r\n<dt>stripmsd</dt><dd>STrip most significant digit (9) before sending.</dd>\r\n\r\n<dt>switchtype</dt><dd>The switchtype. Only used for PRI. Possible\r\nvalues are: <b>national</b> (National ISDN 2, the default),\r\n<b>dms100</b> (Nortel DMS100), <b>4ess</b> (AT&T 4ESS), <b>5ess</b>\r\n(Lucent 5ESS), <b>euroisdn</b> (EuroISDN), <b>ni1</b> (Old National\r\nISDN 1). See nsf. </dd>\r\n\r\n<dt>threewaycalling</dt><dd>Support three-way calling. Options are\r\n<b>yes</b> and <b>no</b>. <!-- default? --></dd>\r\n\r\n<dt>toneduration</dt>How long generated tones (DTMF and MF) will be played on the channel (in milliseconds).</dd>\r\n\r\n<dt>tonezone</dt><dd>Set the tonezone. Equivalent of the defaultzone settings in /etc/dahdi/system.conf. This sets the tone zone by number.  Note that you\'d still need to load tonezones (loadzone in /etc/dahdi/system.conf). The default is -1: not to set anything.</dd>\r\n\r\n<dt>transfer</dt><dd>Support flash-hook call transfer (requires three\r\nway calling). Options are <b>yes</b> and <b>no</b>. <!-- default?\r\n--></dd>\r\n\r\n<dt>transfertobusy</dt><dd>Specify whether flash-hook transfers to busy channels should complete or return to the caller preforming the transfer.  Default is <b>yes</b>.</dd>\r\n\r\n<dt>txdrc</dt><dd>Dynamic range compression for the tx channel.  Default to <b>0.0</b>.</dd>\r\n\r\n<dt>txgain</dt><dd>To address DTMF detection issues, you can set the\r\ndefault receive and transmit gains (in dB). A typical value would be\r\n<b>0.0</b>. See also relaxdtmf.</dd>\r\n\r\n<dt>unknownprefix</dt><dd> <!-- not in zap.conf --></dd>\r\n\r\n<dt>usecallerid</dt><dd>Whether or not to use caller ID. Options are\r\n<b>yes</b> and <b>no</b>. <!-- default? --></dd>\r\n\r\n<dt>usecallingpres</dt><dd>Whether or not to use the caller ID\r\npresentation for the outgoing call that the calling switch is\r\nsending. Options are <b>yes</b> and <b>no</b>. <!-- default? --></dd>\r\n\r\n<dt>usedistinctiveringaftercid</dt><dd>Enable dring detection after caller ID for those countries like Australia where the ring cadence is changed after caller ID spill.</dd>\r\n\r\n<dt>usedistinctiveringdetection</dt><dd>Whether or not to do distinctive ring detection on FXO lines.</dd>\r\n\r\n<dt>useincomingcalleridondahditransfer</dt><dd>Should we use the caller ID from incoming call on DAHDI transfer?</dd>\r\n\r\n<dt>usesmdi</dt><dd>Whether or not to enable SMDI.</dd>\r\n\r\n<dt>waitfordialtone</dt><dd>On UK analog lines, the caller hanging up determines the end of calls.  So Asterisk hanging up the line may or may not end a call (DAHDI could just as easily be re-attaching to a prior incoming call that was not yet hung up). This option changes the hangup to wait for a dialtone on the line, before marking the line as once again available for use with outgoing calls.</dd>\r\n\r\n</dl>\r\n\r\n'),(25,'/sigman/dialplan.html','PBX: Dialplan > Extensions > Contexts','Dialplan Contexts','<p>This interaction lists available contexts, and provides access to\r\nediting and delete functions. You can also create a new context via\r\nthis interaction, by copying an existing context using the\r\n%copycat-icon%. </p>\r\n\r\n<p>This interaction is a two-tiered edit</p>\r\n\r\n<h3>Context Editor</h3>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the context name (not visible if there are\r\nno contexts defined). Clicking on this icon opens the context name in\r\na text box for editing. Use the %check-icon% to enter the edited\r\nname.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the context (not visible if there are no\r\ncontexts defined).</dd>\r\n\r\n<dt>%show-icon%</dt><dd>Opens the context definition for\r\nediting. See below for a description of the Show Context\r\ninteraction.</dd>\r\n\r\n<dt>%copycat-icon%</dt><dd>Opens the Add Context interaction with the\r\ncurrent context selected as a template. See \"PBX: Dialplan >\r\nExtensions > Add Context\".</dd>\r\n\r\n</dl>\r\n\r\n<h3>Show Context</h3>\r\n\r\n<p>This interaction displays the entries in the selected context, and\r\nprovides access to add, edit, and delete functions.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the entry. Use the %up-arrow% and\r\n%down-arrow% to position the entry. Use the %check-icon% to enter the\r\nedited entry. See below for a description of the default entry\r\ntypes, including the fields associated with an \"exten\" entry. <!--\r\nwhat does the C-icon do in this case??--></dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the entry (not visible if there are no\r\nentries defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add an entry. The type of entry is\r\nselected via the pulldown menu, and its value is entered in the text\r\nfield (selecting \"exten\" will open multiple fields). Use the %c-icon%\r\nto enter a custom entry type. A list of default entry types is\r\nbelow.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Entry types</h3>\r\n\r\n<dl>\r\n\r\n<dt>exten</dt><dd>exten entries are used to define an extension. The\r\nfields in a extension definition are:<br>\r\n\r\n<b><i>extension</i>,<i>priority</i>,<i>application</i>,[<i>arguments</i>]</b>.<br><br>\r\n\r\n<b>extension</b> is an alphanumeric extension identifier, for example\r\n<b>1234</b>.<br>\r\n\r\n<b>priority</b> determines the execution order of the entry, starting\r\nwith the lowest priority.<br>\r\n\r\n<b>application</b> is the name of an application, for example\r\n<b>Dial</b>. To get more information about a particular application,\r\nselect the application from the pulldown menu, and hover the mouse\r\ncursor over the %questionmark-icon%.<br>\r\n\r\n<b>args</b> are optional arguments for the named application. </dd>\r\n\r\n<!-- this could be pages by itself -->\r\n\r\n\r\n\r\n<dt>ignorepat</dt><dd>Causes a number (or pattern) to be ignored when\r\ndialing. Specifically, this can be used to insure that a dialtone is\r\nstill heard after the digit to obtain an outside line is pressed\r\n(typically <b>9</b>). This is needed only on zap phones.\r\n\r\n<dt>include</dt><dd>Includes another context in the present\r\ncontext. The value is the name of another context.</dd>\r\n\r\n<dt>switch</dt><dd>Used to connect dialplans between an IAX client and\r\nan IAX server - the connection will be held permanently open. The\r\nsyntax for this entry is <b><i>client</i>/<i>server</i></b>. </dd><!--\r\ncould use several examples here -->\r\n\r\n\r\n</dl>\r\n'),(26,'/sigman/dialplan-add.html','PBX: Dialplan > Extensions > Add Context','Add Dialplan Context','<p>This interaction adds a context to the dialplan.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Add</b> button</dt><dd>Adds the context named in the \"New\r\nContext\" text box.</dd>\r\n\r\n<dt>New Context</dt><dd>The name of the new context.</dd>\r\n\r\n<dt>use template</dt><dd>Select an existing context to use as a\r\ntemplate. Once the new context is created, you will be able to edit it\r\nin the Contexts interaction.</dd>\r\n\r\n</dl>\r\n'),(27,'/sigman/dialplan-clear.html','PBX: Dialplan > Extensions > Clear Context','Clear Dialplan Context','<p>This interaction clears all contexts from the dialplan. <b>Once\r\ncleared, the contexts cannot be retrieved.</b></p>'),(28,'/sigman/macros.html','PBX: Dialplan > Macros > Macros','Dialplan Macros','<p>This interaction lists available macros, and provides access to\r\nediting and delete functions. You can also create a new macro via\r\nthis interaction, by copying an existing macro using the\r\n%copycat-icon%.</p>\r\n\r\n<p>This interaction is a two-tiered edit.</p>\r\n\r\n<h3>Macro Editor</h3>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the macro name (not visible if there are\r\nno macros defined). Clicking on this icon opens the macro name in\r\na text box for editing. Use the %check-icon% to enter the edited\r\nname.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the macro (not visible if there are no\r\nmacros defined).</dd>\r\n\r\n<dt>%show-icon%</dt><dd>Opens the macro definition for\r\nediting. See below for a description of the Show Macro\r\ninteraction.</dd>\r\n\r\n<dt>%copycat-icon%</dt><dd>Opens the Add Macro interaction with the\r\ncurrent macro selected as a template. See \"PBX: Dialplan >\r\nMacros > Add Macro\".</dd>\r\n\r\n</dl>\r\n\r\n<h3>Show Macro</h3>\r\n\r\n<p>This interaction displays the entries in the selected macro, and\r\nprovides access to add, edit, and delete functions.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the entry. Use the %up-arrow% and\r\n%down-arrow% to position the entry. Use the %check-icon% to enter the\r\nedited entry. See below for a description of the default entry\r\ntypes, including the fields associated with an \"exten\" entry. <!--\r\nwhat does the C-icon do in this case??--></dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the entry (not visible if there are no\r\nentries defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add an entry. The type of entry is\r\nselected via the pulldown menu, and its value is entered in the text\r\nfield (selecting \"exten\" will open multiple fields). Use the %c-icon%\r\nto enter a custom entry type. A list of default entry types is\r\nbelow.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Entry types</h3>\r\n\r\n<dl>\r\n\r\n<dt>exten</dt><dd>exten entries are used to define an extension. The\r\nfields in a extension definition are:<br>\r\n\r\n<b><i>extension</i>,<i>priority</i>,<i>application</i>,[<i>arguments</i>]</b>.<br><br>\r\n\r\n<b>extension</b> is an alphanumeric extension identifier, for example\r\n<b>1234</b>.<br>\r\n\r\n<b>priority</b> determines the execution order of the entry, starting\r\nwith the lowest priority.<br>\r\n\r\n<b>application</b> is the name of an application, for example\r\n<b>Dial</b>. To get more information about a particular application,\r\nselect the application from the pulldown menu, and hover the mouse\r\ncursor over the %questionmark-icon%.<br>\r\n\r\n<b>args</b> are optional arguments for the named application.<br> </dd>\r\n\r\n<!-- this could be pages by itself -->\r\n\r\n\r\n\r\n<dt>ignorepat</dt><dd>Causes a number (or pattern) to be ignored when\r\ndialing. Specifically, this can be used to insure that a dialtone is\r\nstill heard after the digit to obtain an outside line is pressed\r\n(typically <b>9</b>). This is needed only on zap phones.\r\n\r\n<dt>include</dt><dd>Includes another macro in the present\r\nmacro. The value is the name of another macro.</dd>\r\n\r\n<dt>switch</dt><dd>Used to connect dialplans between an IAX client and\r\nan IAX server - the connection will be held permanently open. The\r\nsyntax for this entry is <b><i>client</i>/<i>server</i></b>.</dd> <!--\r\ncould use several examples here -->\r\n\r\n\r\n</dl>\r\n'),(29,'/sigman/macros-add.html','PBX: Dialplan > Macros > Add Macro','Add Dialplan Macros','<p>This interaction adds a macro to the dialplan.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Add</b> button</dt><dd>Adds the macro named in the \"New Macro\"\r\ntext box.</dd>\r\n\r\n<dt>New Macro</dt><dd>The name of the new macro.</dd>\r\n\r\n<dt>use template</dt><dd>Select an existing macro to use as a\r\ntemplate. Once the new macro is created, you will be able to edit it\r\nin the Macros interaction. </dd><!-- or is this a list of contexts?-->\r\n\r\n</dl>'),(30,'/sigman/macros-clear.html','PBX: Dialplan > Macros > Clear Macro','Clear Dialplan Macro','<p>This interaction clears all macros from the dialplan.</p>\r\n\r\n<p>This interaction clears all macros from the dialplan. <b>Once\r\ncleared, the macros cannot be retrieved.</b></p>\r\n'),(31,'/sigman/globalvars.html','PBX: Dialplan > Global Variables > Global','Dialplan Variables','<p>This interaction presents a list of global variables and their\r\nvalues, and provides access to editing and delete functions. It is\r\npresented as a list of name-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the variable (not visible if there are no\r\nvariables defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %check-icon% to enter the edited pair. You can also edit\r\nthe name and value of the variable. </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the variable (not visible if there are no\r\nvariables defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the variable (entered in the first\r\ntext field) and value (entered in the text field).</dd>\r\n\r\n<!-- c-icons make no sense here -->\r\n\r\n</dl>'),(32,'/sigman/dialplan-advanced.html','PBX: Dialplan > Advanced > Text Editor','Dialplan Advanced Editor','<p>This interaction allows you to edit the dialplan as if it were a\r\nplain text configuration file. It allows you to copy and paste or\r\nimport and export entire dialplans, or elements thereof.</p>\r\n'),(33,'/sigman/applications.html','PBX: Applications > Applications','Applications','<p>This screen list the number of Conference Bridge profiles, conference User profiles, Conference Menus, Call Queues, and\r\nAgents currently configured. There is no interaction via this\r\nscreen.</p>'),(73,'/sigman/confbridge.html','PBX: Application > Conferencing','Conferencing','<p> The conference bridge consists of bridge profile, user profile, conference menu, and conference number.<br><br>A <b>Bridge Profile</b> is a named set of options that control the behavior of a particular conference bridge.  Each bridge must have its own profile.<br><br>A <b>User Profile</b> is a named set of options that control the user experience as a member of a particular conference bridge.  Each user participating in a bridge can have their own individual user profile.<br><br>A <b>Conference Menu</b> is a named set of options that are provided to a user when they present DTMF keys while connected to the bridge.  Each user participating in a bridge can have thier own individual conference menu.<br><br>A <b>Conference Number</b> is a numerical representation for an instance of the bridge.  Callers joined to the same conference number will be in the same conference bridge, they are connected.  Caller joined to a difference conference numbers are not in the same conference bridge; they are separated.  Conference number are assigned inthe dialplan instead of pre-reserved.</p>'),(74,'/sigman/confbridge-bridge.html','PBX: Applications > Conferencing > Bridge Profile','Bridge Profiles','<p>This interaction lists available conference bridge profile, and lets you specify and\r\ndelete options for these bridge profiles, as well as delete or rename the\r\nbridge profile themselves. You can also create a new bridge profile via this\r\ninteraction, by copying an existing bridge profile using the %copycat-icon%</p>\r\n\r\n<p>The editing interaction is two-tiered:</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Bridge Profile Name</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the bridge profile name (not visible if there\r\nare no bridge profile defined). Clicking on this icon opens the\r\nbridge profile name in a text box for editing. Use the %check-icon% to\r\nenter the edited name. </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the bridge profile (not visible if there are\r\nno bridge profile defined).</dd>\r\n\r\n<dt>%copycat-icon%</dt><dd>Opens the Add bridge profile interaction with the\r\ncurrent bridge profile selected as a template. See \"PBX: Applications >\r\nConferencing > Add Bridge Profile\".</dd>\r\n\r\n<dt><b>Settings</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting. Use the %up-arrow% and\r\n%down-arrow% to position the setting. Use the %c-icon% to open the\r\nsetting name in a text box for editing, or select a new setting name\r\nusing the pulldown menu. (See the list of pulldown menu items\r\nbelow). Use the %check-icon% to enter the edited pair. </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add a setting. The type of setting is\r\nselected via the pulldown menu, and its value is entered in the text\r\nfield. Use the %c-icon% to enter a custom setting. Once the name and\r\nsetting are entered, click <b>Add</b> to add the setting to the\r\nbridge profile.</dd>\r\n\r\n</dl>\r\n\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<dl>\r\n\r\n<dt>internal_sample_rate</dt><dd>Sets the internal native sample rate the conference is mixed at.  This is set to automatically adjust the sample rate to the best quality by default.  Other values can be anything from 8000-192000.  If a sample rate is set that Asterisk does not support, the closest sample rate Asterisk does support to the one requested will be used.</dd>\r\n\r\n<dt>max_members</dt><dd>This option limits the number of participants for a single conference to a specific number. By default conferences have no participant limit.  After the limit is reached, the conference will be locked until someone leaves.  Note however that an admin user will always be allowed to join the conference regarless if this limit is reached or not.</dd>\r\n\r\n<dt>mixing_interval<dt><dd>Set the internal mixing interval in milliseconds for the bridge.  This number reflects how tight or loose the mixing will be for the conference.  In order to improve performance a larger mixing interval such as 40ms may be choosen.  Using a larger mixing interval comes at the cost of introducing larger amount of delay into the bridge.  Valid values are <b>10</b>, <b>20</b>, <b>40</b>, or <b>80</b>.  By default 20ms is used.</dd>\r\n\r\n<dt>record_conference</dt><dd>Records the conference call starting when the first user enters the room, and ending when the last user exists the room.  The default recorded filename is \'confbridge-<name of conference bridge>-<start-time>.wav\' and the default format is 8khz slinear.</dd>\r\n\r\n<dt>record_file</dt><dd>When record_conference is set to yes, the specific name of the record file can be set using this option.  Note that since multiple conferences may use the same bridge profile, this may cause issues depending on the configuration.  It is recommended to only use this option dynamically with the CONFBRIDGE() dialplan function.  This allows the record name to be specified and a unique name to be chosen.  By default, the record_file is stored in Asterisk\'s spool/monitor directory with a unique filename starting with the \'confbridge\' prefix.</dd>\r\n\r\n<dt>video_mode</dt><dd>Sets how confbridge handles video distribution to the conference participants.  Note that participants wanting to view and be the source of a video feed must be sharing the same video codec. Valid values are <b>none</b>, <b>follow_talker</b> (the video feed will follow whoever is talking and providing video), <b>last_marked</b> (the last marked user to join the conference with video capabilities will be the single source of video distributed to all participants), <b>first_marked</b> (the first marked user to join the conference with video capabilities is the single source of video distribution among all participants). </dd>\r\n\r\n</dl>'),(75,'/sigman/confbridge-bridge-add.html','PBX: Applications > Conferencing > Add Bridge Profile','Add Bridge Profile','<p>This interaction adds a bridge profile to the system.</p>\r\n\r\n<dt><b>Add</b> button</dt><dd>Adds the bridge profile named in the \"New Bridge\"\r\ntext box.</dd>\r\n\r\n<dt>New Bridge</dt><dd>The name of the new bridge profile.</dd>\r\n\r\n<dt>use template</dt><dd>Select an existing bridge profile to use as a\r\ntemplate. Once the new bridge profile is created, you will be able to edit it\r\nin the Bridge Profile interaction.</dd>'),(76,'/sigman/confbridge-user.html','PBX: Applications > Conferencing > User Profile','Bridge User Profiles','<p>This interaction lists available conference user profile, and lets you specify and\r\ndelete options for these user profiles, as well as delete or rename the\r\nuser profile themselves. You can also create a new user profile via this\r\ninteraction, by copying an existing user profile using the %copycat-icon%</p>\r\n\r\n<p>The editing interaction is two-tiered:</p>\r\n\r\n<dl>\r\n\r\n<dt><b>User Profile Name</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the user profile name (not visible if there\r\nare no user profile defined). Clicking on this icon opens the\r\nuser profile name in a text box for editing. Use the %check-icon% to\r\nenter the edited name. </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the user profile (not visible if there are\r\nno user profile defined).</dd>\r\n\r\n<dt>%copycat-icon%</dt><dd>Opens the Add user profile interaction with the\r\ncurrent user profile selected as a template. See \"PBX: Applications >\r\nConferencing > Add User Profile\".</dd>\r\n\r\n<dt><b>Settings</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting. Use the %up-arrow% and\r\n%down-arrow% to position the setting. Use the %c-icon% to open the\r\nsetting name in a text box for editing, or select a new setting name\r\nusing the pulldown menu. (See the list of pulldown menu items\r\nbelow). Use the %check-icon% to enter the edited pair. </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add a setting. The type of setting is\r\nselected via the pulldown menu, and its value is entered in the text\r\nfield. Use the %c-icon% to enter a custom setting. Once the name and\r\nsetting are entered, click <b>Add</b> to add the setting to the\r\nuser profile.</dd>\r\n\r\n</dl>\r\n\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<dl>\r\n\r\n<dt>admin</dt><dd>Set if the user is an admin or not.  Default to <b>no</b>.</dd>\r\n\r\n<dt>announce_join_leave</dt><dd>When enabled, this option will prompt the user for a name when entering the conference.  After the name is recorded, it will be played as the user enters and exits the conference.  Default to </b>no</b>.</dd>\r\n\r\n<dt>announce_only_user</dt><dd>Set if the only user announcement should be played when a channel enters a empty conference.  Default to <b>yes</b>.</dd>\r\n\r\n<dt>announce_user_count</dt><dd>Set if the number of users should be annouced to the caller.  Default to <b>no</b>.</dd>\r\n\r\n<dt>announce_user_count_all</dt><dd>Set if the number of users should be announced to all the other users in the conference when someone joins.  This option can be either set to <b>yes</b> or a number.  When set to a number, the announcement will only occur once the user count is above the specified number.</dd>\r\n\r\n<dt>denoise</dt><dd>Set whether or not a denoise filter should be applied to the audio before mixing or not.  Default to <b>no</b>.  This feature requires codec_speex to be built and installed.</dd>\r\n\r\n<dt>dsp_drop_silence</dt><dd>This option drops silence from entering into the bridge.  Enabling this option will drastically improve performance and help remove the buildup of background noise from the conference.  Highly recommended for large conferences due to its performance enhancements.</dd>\r\n\r\n<dt>dsp_silence_threshold</dt><dd>The time in milliseconds of sound falling within what the dsp has established as baseline silence before a user is considered be silent. By default, this value is 2500ms.  Valid values are 1 through 2^31.</dd>\r\n\r\n<dt>dsp_talking_threshold</dt><dd>The time in milliseconds of sound above what the dsp has established as base line silence for a user before a user is considered to be talking.  By default, this value is 160ms.  Valid values are 1 through 2^31.</dd>\r\n\r\n<dt>dtmf_passthrough</dt><dd>Set whether or not DTMF should pass through the conference.  Default to <b>no</b>.</dd>\r\n\r\n<dt>end_marked</dt><dd>This option will kick every user with this option set in their user profile after the last Marked user exits the conference.</dd>\r\n\r\n<dt>jitterbuffer</dt><dd>Enabling this option places a jitterbuffer on the user\'s audio stream before audio mixing is performed.  This is highly recommended but will add a slight delay to the audio.  This option is using the JITTERBUFFER dialplan function\'s default adaptive jitterbuffer.  For a more fine tuned jitterbuffer, disable this option and use the JITTERBUFFER dialplan function on the user before entering the ConfBridge application.</dd>\r\n\r\n<dt>marked</dt><dd>Set if this is a marked user or not.  Default to <b>no</b>.</dd>\r\n\r\n<dt>music_on_hold_class</dt><dd>The MOH class for this user.</dd>\r\n\r\n<dt>music_on_hold_when_empty</dt><dd>Whether MOH should be played when only one person is in the conference or when the user is waiting on a marked user to enter the conference.  Default to <b>no</b>.</dd>\r\n\r\n<dt>pin</dt><dd>Set if this user must enter a PIN number before entering the conference.</dd>\r\n\r\n<dt>quiet</dt><dd>When enabled, enter/leave prompts are user intros are not played.  Default to <b>no</b>.</dd>\r\n\r\n<dt>startmuted</dt><dd>Set if all users should start out muted.  Default to <b>no</b>.</dd>\r\n\r\n<dt>talk_detection_events</dt><dd>This option sets whether or not notifications of when a user begins and ends talking should be sent out as events over AMI.  Default to <b>no</b>.</dd>\r\n\r\n<dt>wait_marked</dt><dd>Set if the user must wait for a marked user to enter before joining the conference.  Default to <b>no</b>.</dd>\r\n\r\n</dl>'),(77,'/sigman/confbridge-user-add.html','PBX: Applications > Conferencing > Add User Profile','Add User Profile','<p>This interaction adds a user profile to the system.</p>\r\n\r\n<dt><b>Add</b> button</dt><dd>Adds the user profile named in the \"New User Profile\"\r\ntext box.</dd>\r\n\r\n<dt>New User Profile</dt><dd>The name of the new user profile.</dd>\r\n\r\n<dt>use template</dt><dd>Select an existing user profile to use as a\r\ntemplate. Once the new user profile is created, you will be able to edit it\r\nin the User Profile interaction.</dd>'),(78,'/sigman/confbridge-menu.html','PBX: Applications > Conferencing > Menu','Bridge Menu','<p>This interaction lists available conference menus, and lets you specify and\r\ndelete options for these conference menu, as well as delete or rename the\r\nconference menu themselves. You can also create a new conference menu via this\r\ninteraction, by copying an existing conference menu using the %copycat-icon%</p>\r\n\r\n<p>The editing interaction is two-tiered:</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Conference Menu Name</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the conference menu name (not visible if there\r\nare no conference menu defined). Clicking on this icon opens the\r\nconference menu name in a text box for editing. Use the %check-icon% to\r\nenter the edited name. </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the conference menu (not visible if there are\r\nno conference menu defined).</dd>\r\n\r\n<dt>%copycat-icon%</dt><dd>Opens the Add conference menu interaction with the\r\ncurrent conference menu selected as a template. See \"PBX: Applications >\r\nConferencing > Add Menu\".</dd>\r\n\r\n<dt><b>Settings</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting. Use the %up-arrow% and\r\n%down-arrow% to position the setting. Use the %c-icon% to open the\r\nsetting name in a text box for editing, or select a new setting name\r\nusing the pulldown menu. (See the list of pulldown menu items\r\nbelow). Use the %check-icon% to enter the edited pair. </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add a setting. The type of setting is\r\nselected via the pulldown menu, and its value is entered in the text\r\nfield. Use the %c-icon% to enter a custom setting. Once the name and\r\nsetting are entered, click <b>Add</b> to add the setting to the\r\nconference menu.</dd>\r\n\r\n</dl>\r\n\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<dl>\r\n\r\n<dt>menu key<dt><dd>Custom DTMF menus may be defined to each channel using the application.  Note that a single DTMF sequence can have multiple actions associated with it.  This is accomplished by stringing the actions together and using a \',\' as the delimiter.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Valid actions are listed as follows:</h3>\r\n\r\n<dl>\r\n\r\n<dt>playback([name of audio file]&[name of audio file])</dt><dd>Playback will play back an audio file to a channel and then immediately return to the confrence.  This file can not be interrupted by DTMF.  Multiple files can be chained together using the \'&\' character.</dd>\r\n\r\n<dt>playback_and_continue ([name of playback prompt]&[name of playback prompt])</dt><dd>Play back a prompt while continuing to collect the dtmf sequence.  This is useful when using a menu prompt that describes all the menu options.  Note however that any DTMF duing this action will terminate the prompts playback.  Prompt files can be chained together using the \'&\' character as a delimiter.</dd>\r\n\r\n<dt>toggle_mute</dt><dd>Toggle turning on and off mute.  Mute will make the user silent to everyone else, but the user will still be able to listen and continue to collect the dtmf sequence.</dd>\r\n\r\n<dt>no_op</dt><dd>This action does nothing (no operation). </dd>\r\n\r\n<dt>decrease_listening_volume</dt><dd>Decreases the channel listening volume.<dd>\r\n\r\n<dt>increase_listening_volume</dt><dd>Increases the channel listening volume.</dd>\r\n\r\n<dt>reset_listening_volume</dt><dd>Reset channel listening volume to default level.</dd>\r\n\r\n<dt>dialplan_exec(context,exten,priority)</dt><dd>Allows a user to escape from the conference and execute commands in the dialplan.  Once the dialplan exits, the user will be put back into the conference.</dd>\r\n\r\n<dt>leave_conference</dt><dd>This action allows a user to exit the conference and continue execution in the dialplan.</dd>\r\n\r\n<dt>admin_kick_last</dt><dd>This action allows an Admin to kick the last participant from the conference.  This action will only work for admins which allows a single menu to be used for both users and admins.</dd>\r\n\r\n<dt>admin_toggle_conference_lock</dt><dd>This action allows an admin to toggle locking and unlocking the conference.  Non admins cannot use this action even if it is in their menu.</dd>\r\n\r\n<dt>set_as_single_video_src</dt><dd>This action allows any user to set themselves as the single video source distributed to all participants.  This will make the video feed stick to them regardless of what the video_mode is set to.</dd>\r\n\r\n<dt>release_as_single_video_src</dt><dd>This action allows a user to release themselves as the video source.</dd>\r\n\r\n</dl>'),(79,'/sigman/confbridge-menu-add.html','PBX: Applications > Conferencing > Add Menu','Add Conferencing Menu','<p>This interaction adds a conferencing menu to the system.</p>\r\n\r\n<dt><b>Add</b> button</dt><dd>Adds the conference menu named in the \"New Conference Menu\"\r\ntext box.</dd>\r\n\r\n<dt>New Conference Menu</dt><dd>The name of the new conference menu.</dd>\r\n\r\n<dt>use template</dt><dd>Select an existing conference menu to use as a\r\ntemplate. Once the new conference menu is created, you will be able to edit it\r\nin the Menu interaction.</dd>'),(35,'/sigman/queues.html','PBX: Applications > Queues > Queues','Call Queues','<p>This interaction lists available queues, and lets you specify and\r\ndelete options for these queues, as well as delete or rename the\r\nqueues themselves. You can also create a new queue via this\r\ninteraction, by copying an existing queue using the %copycat-icon%</p>\r\n\r\n<p>The editing interaction is two-tiered:</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Queue Name</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the queue name (not visible if there\r\nare no queues defined). Clicking on this icon opens the\r\nqueue name in a text box for editing. Use the %check-icon% to\r\nenter the edited name. </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the queue (not visible if there are\r\nno indications defined).</dd>\r\n\r\n<dt>%copycat-icon%</dt><dd>Opens the Add Queue interaction with the\r\ncurrent indicaton selected as a template. See \"PBX: Applications >\r\nQueues > Add Queue\".</dd>\r\n\r\n<dt><b>Settings</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting. Use the %up-arrow% and\r\n%down-arrow% to position the setting. Use the %c-icon% to open the\r\nsetting name in a text box for editing, or select a new setting name\r\nusing the pulldown menu. (See the list of pulldown menu items\r\nbelow). Use the %check-icon% to enter the edited pair. </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add a setting. The type of setting is\r\nselected via the pulldown menu, and its value is entered in the text\r\nfield. Use the %c-icon% to enter a custom setting. Once the name and\r\nsetting are entered, click <b>Add</b> to add the setting to the\r\nindication.</dd>\r\n\r\n</dl>\r\n\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<dl>\r\n\r\n<dt>announce</dt><dd>Specifies an announcement that is played for the\r\nuser as soon as they answer a call, typically to indicate to them\r\nwhich queue this call belongs to, so that agents or members who are\r\nlistening to more than one queue can determine how they should engage\r\nthe customer. A typical value would be of the form\r\n<b>queue-markq</b>.</dd>\r\n\r\n<dt>announce-frequency</dt><dd>How often to announce queue position and/or estimated holdtime to caller (0=off).  Note that this value is ignored if the caller\'s queue position has changed (see min-announce-frequency).</dd>\r\n\r\n<dt>announce-holdtime</dt><dd>Whether or not to include estimated hold time in position announcements.  Valid values are <b>yes</b>, <b>no</b>, or <b>once</b>.</dd>\r\n\r\n<dt>announce-position</dt><dd>Whether or not to announce queue position.  Valid values are <b>yes</b>, <b>no</b>, <b>limit</b>, or <b>more</b>.  If set to <b>no</b>, then the caller\'s position will never be announced.  If <b>yes</b>, then the caller\'s position in the queue will be announced to the caller.  If set to <b>more</b>, then if the number of callers is more than the number specified by the <b>announce-position-limit</b> option, then the caller will hear that there are more than that many callers waiting.  If set to <b>limit</b>, then only callers within the limit specified by <b>announce-position-limit</b> will have their position announced.</dd>\r\n\r\n<dt>announce-position-limit</dt><dd>If <b>limit</b> or <b>more</b> are specified for the <b>announce-position</b> option, then the <b>announce-position-limit</b> is used to determine what announcement to play to waiting callers.</dd>\r\n\r\n<dt>announce-round-seconds</dt><dd>If this is non-zero, then the announcement will be rounded to the specified seconds.  Valid values are <b>0</b>, <b>5</b>, <b>10</b>, <b>15</b>, <b>20</b>, and <b>30</b>.</dd>\r\n\r\n<dt>autofill</dt><dd>If set to <b>no</b>, the queue will make all waiting callers wait in the queue even if there are more than one available member ready to take the calls until the head caller is connected with the member they were trying to get to.  If set to <b>yes</b>, the waiting callers are connecting with available members in a parallel fashion until there are no more available member or no more waiting callers.</dd>\r\n\r\n<dt>autopause</dt><dd>Automatically pause a queue member if they fail to answer a call.</dd>\r\n\r\n<dt>autopausedelay</dt><dd>Delay autopause for autopausedelay seconds from the last call if a member has not taken a call the delay has no effect.</dd>\r\n\r\n<dt>context</dt><dd>The name of a context for which, if the user types\r\na SINGLE digit extension while they are in the queue, they will be\r\ntaken out of the queue and sent to that extension in this context. A\r\ntypical value would be <b>qoutcon</b>. </dd>\r\n\r\n<dt>defaultrule</dt><dd>If you wish to implement a rule defined in queuerules.conf by default, you may specify this by setting defaultrule to the rule\'s name</dd>\r\n\r\n<dt>eventmemberstatus</dt><dd>Whether the <b>QueueMemberStatus</b> event would be generated.</dd>\r\n\r\n<dt>eventwhencalled</dt><dd>Can Asterisk generate AgentCalled events\r\nwhen an agent is rung. Options are <b>yes</b> or <b>no</b>. (This\r\nfeature may generate a lot of extra manager events).</dd>\r\n\r\n<dt>joinempty</dt><dd>Can queues that have no current members\r\ncurrently be joined. Options are <b>yes</b> or <b>no</b>.</dd>\r\n\r\n<dt>leavewhenempty</dt><dd>Are callers automatically removed from the\r\nqueue if there are no agents present. Options are <b>yes</b> or\r\n<b>no</b>.</dd>\r\n\r\n<dt>maxlen</dt><dd>The maximum number of people that can be waiting in\r\nthe queue. A typical value is <b>5</b>. Use 0 for an unlimited\r\nnumber.</dd>\r\n\r\n<dt>member</dt><dd>Defines a member of the call queue. This definition\r\nis of the form form <i>technology/dialstring</i>. An optional penalty\r\ncan be specified after a comma, such that entries with higher\r\npenalties are considered last. A typical entry could be\r\n<b>Agent/1001,1</b>. <!-- need more detailed list of options--></dd>\r\n\r\n<dt>memberdelay</dt><dd>If you wish to have a delay before the member is connected to the caller (or before the member hears any announcement messages), set this to the number of second to delay.</dd>\r\n\r\n<dt>membergosub</dt><dd>Gosub to run upon member connection.</dd>\r\n\r\n<dt>membermacro</dt><dd>If set, run this macro when connected to the queue member.  You can override this macro by setting the macro option on the queue application.</dd>\r\n\r\n<dt>min-announce-frequency</dt><dd>The absolute minimum time between the start of each queue position and/or estimated holdtime announcement. The is useful for avoiding constant announcements when the caller\'s queue position is changing frequently (see <b>announce-frequency</b>).</dd>\r\n\r\n<dt>monitor-format</dt><dd>Picky any one valid extension for monitor format recording.  Valid values are <b>gsm</b>, <b>wav</b>, and <b>wav49</b>.  If you leave it out, it will not record calls.</dd>\r\n\r\n<dt>monitor-type</dt><dd>Setting it to <b>MixMonitor</b> will use the new MixMonitor application instead of <b>Monitor</b>.  Thus the concept of \"joining/mixing\" the in/out files now geos away when this is enabled.  Default to <b>Monitor</b>.</dd>\r\n\r\n<dt>musicclass</dt><dd>Specifies which music is used for this\r\nparticular call queue. </dd>\r\n\r\n<dt>penaltymemberslimit</dt><dd>A limit can be set to disregard penalty settings when the queue has too few members.  No penalty will be weighed in if there are only X or fewer queue members.  Default to <b>0</b>.</dd>\r\n\r\n<dt>periodic-announce-frequency</dt><dd>How often to make any periodic announcement (see <b>periodic-announce</b>).</dd>\r\n\r\n<dt>random-periodic-announce</dt><dd>Whether the periodic announcements should be played in a random order. Default is <b>no</b>.</dd>\r\n\r\n<dt>relative-periodic-announce</dt><dd>If set to <b>yes</b>, the periodic announcement frequency will be timed from the end of each announcement rather than from the start of each announcement.  Default to <b>no</b>.</dd>\r\n\r\n<dt>reportholdtime</dt><dd>If you wish to report caller\'s hold time to the member before they are connected to the caller, set this to <b>yes</b>.</dd>\r\n\r\n<dt>retry</dt><dd>How long to we wait before trying all the queue\r\nmembers again, in seconds. A typical value is <b>5</b>.</dd>\r\n\r\n<dt>ring-in-use</dt><dd>If you want the queue to avoid sending calls to members whose devices are known to be <b>in use</b>, set this option to <b>no</b>.</dd>\r\n\r\n<dt>servicelevel</dt><dd>Used for service level statistics (call answered within service level time frame in seconds).</dd>\r\n\r\n<dt>setinterfacevar</dt><dd>If set to <b>yes</b>, just prior to the caller being bridged with a queue member, the following variables will be set<br />MEMBERINTERFACE is the interface name (eg. Agent/1234)<br />MEMBERNAME is the member name (eg. Joe Soap)<br />MEMBERCALLS is the number of calls that interface has taken<br />MEMBERLASTCALL is the last time the member took a call.<br />MEMBERPENALTY is the penalty of the member<br />MEMBERDYNAMIC indicates if a member is dynamic or not<br />MEMBERREALTIME indicates if a member is realtime or not.</dd>\r\n\r\n<dt>setqueueentryvar</dt><dd>If set to <b>yes</b>, just prior to the caller being bridged with a queue member, the following variables will be set<br />QEHOLDTIME callers hold time<br />QEORIGINALPOS original position of the caller in the queue</dd>\r\n\r\n<dt>setqueuevar</dt><dd>If set to <b>yes</b>, the following variables will be set just prior to the caller being bridged with a queue member and just prior to the caller leaving the queue<br />QUEUENAME name of the queue<br />QUEUEMAX maxmimum number of calls allowed<br /> QUEUESTRATEGY the strategy of the queue<br />QUEUECALLS number of calls currently in the queue<br />QUEUEHOLDTIME current average hold time<br />QUEUECOMPLETED number of completed calls for the queue<br />QUEUEABANDONED number of abandoned calls<br />QUEUESRVLEVEL queue service level<br />QUEUESRVLEVELPERF current service level performance</dd>\r\n\r\n<dt>strategy</dt><dd>The ringing strategy for the queue. Possible\r\noptions include:<br>\r\n\r\n<b>ringall</b>: rings all the available channels until one answers\r\n(default).<br>\r\n\r\n<b>leastrecent</b>: rings the interface that was least recently called\r\nby this queue.<br>\r\n\r\n<b>fewestcalls</b>: rings the interface with the fewest completed\r\ncalls from this queue.<br>\r\n\r\n<b>random</b>: rings a random interface.<br>\r\n\r\n<b>rrmemory</b>: round robin with memory, remember where the system\r\nleft off at the last ring pass.<br>\r\n\r\n<b>rrordered</b>:same as rrmemory except that queue member order from the config file is preserved.<br>\r\n\r\n<b>linear</b>: rings interface in the order specified in this configuration file.  If you use dynamic members, the members will be rung in the order in which they are added.<br>\r\n\r\n<b>wrandom</b>: rings random interface, but uses the member\'s penalty as a weight when calculating their metric. So a member with penalty 0 will have a metric somewhere between 0 and 1000, and a member with penalty 1 will have a metric between 0 and 2000, and so on.<br>\r\n</dd>\r\n\r\n<dt>timeout</dt><dd>How long to let the phone ring before it is\r\nconsidered a timeout, in seconds. A typical value is <b>15</b>.</dd>\r\n\r\n<dt>timeoutpriority</dt><dd>Which timeout settings are given the priority? <b>app</b> (application settings) or <b>conf</b> (configuration file settings).  Default is <b>app</b>. <dt>timeoutrestart</db><dd>If set to <b>yes</b>, then the timeout for an agent to answer is reset if a <b>BUSY</b> or <b>CONGESTION</b> is received.  This can be useful if agents are able to cancel a call with reject or similar.</dd>\r\n\r\n<dt>weight</dt><dd>The weight of the queue. Higher weighted queues get\r\nthe first chance at available channels when the same channel is\r\nincluded in more than one queue.</dd>\r\n\r\n<dt>wrapuptime</dt><dd>After a successful call, how long to wait\r\nbefore sending a potentially free member another call, in seconds. The\r\ndefault is <b>0</b>, or no delay. A typical value might be\r\n<b>15</b>.  </dd>\r\n\r\n</dl>'),(36,'/sigman/queues-add.html','PBX: Applications > Queues > Add Queue','Add Call Queue','<p>This interaction adds a queue to the system.</p>\r\n\r\n<dt><b>Add</b> button</dt><dd>Adds the queue named in the \"New Queue\"\r\ntext box.</dd>\r\n\r\n<dt>New Queue</dt><dd>The name of the new queue.</dd>\r\n\r\n<dt>use template</dt><dd>Select an existing queue to use as a\r\ntemplate. Once the new queue is created, you will be able to edit it\r\nin the Queues interaction.</dd>'),(37,'/sigman/agents.html','PBX: Applications > Queues > Agents','Agents','<p>This interaction presents a list of agents, and provides access to\r\nadd, edit, and delete functions. It is presented as a collection of\r\nname-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the Agent (not visible if there are no\r\nagents defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %check-icon% to enter the edited pair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the agent (not visible if there are no\r\nagents defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add an agent. To define the agent, enter\r\nthe agent\'s ID, pin, and name in the text box, separated by\r\ncommas.</dd>\r\n\r\n</dl>'),(38,'/sigman/cdr.html','Logs: CDR Viewer > CDR > View','CDR Viewer','<p>This interaction provides customized access to call log\r\ninformation. Hover your mouse pointer over any blue text to get more\r\ninformation about that text.</p>\r\n\r\n<h3>Filter Interaction</h3>\r\n\r\n<p>The filter allows you to list only specific calls.</p>\r\n\r\n<dl>\r\n\r\n<dt>From date</dt><dd>List calls made on or after this date.</dd>\r\n\r\n<dt>To date</dt><dd>List calls up to or on this date.</dd>\r\n\r\n<dt>Caller ID</dt><dd>The Caller ID number of the call\r\noriginator.</dd>\r\n\r\n<dt>Source</dt><dd>The source of the call. <!-- what is this --></dd>\r\n\r\n<dt>Destination</dt><dd>The destination number of the call. </dd>\r\n\r\n<dt>Account</dt><dd>The account associated with the call.</dd>\r\n\r\n<dt>Displaying Rows</dt><dd>How many rows per page to display.</dd>\r\n\r\n</dl>\r\n\r\n<p>The table lists calls as defined by the filter above (the default\r\nis all calls).</p>\r\n\r\n<dl>\r\n\r\n<dt>Date & Time</dt><dd>The date and time the call was made.</dd>\r\n\r\n<dt>Caller ID</dt><dd>The Caller ID number of the call\r\noriginator.</dd>\r\n\r\n<dt>Source</dt><dd>The source of the call. <!-- what is this? --></dd>\r\n\r\n<dt>Destination</dt><dd>The destination number of the call.</dd>\r\n\r\n<dt>Duration</dt><dd>The duration of the call.</dd>\r\n\r\n<dt>Account</dt><dd>The account associated with the call.</dd>\r\n\r\n<dt>Disposition</dt><dd>Possible values are <b>no answer</b>,\r\n<b>busy</b>, or <b>answered</b>.</dd>\r\n\r\n</dl>\r\n\r\n'),(39,'/sigman/cdr-export.html','Logs: CDR Viewer > CDR > Export Records','Export CDR Records','<p>This interaction lets you export up to the last 20,000 CDR records\r\nas a CSV (comma separated value) file. This file can be imported into\r\na variety of applications, for example Excel.</p>'),(40,'/sigman/cdr-clear.html','Logs: CDR Viewer > CDR > Clear Records','Clear CDR Records','<p>This interaction <b>erases</b> all existing CDR records. You must\r\nenter the words \"I Agree\" in the text field to enable this\r\ndeletion. <b>This erasure is not reversible</b>.</p>\r\n'),(41,'/sigman/moh.html','Configuration: PBX Configuration > Music on Hold > Music On Hold','Music On Hold Configuration','<p>This interaction presents a list of settings to configure Music on\r\nHold, and provides access to add, edit, and delete functions. It is\r\npresented as a collection of name-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting (not visible if there are no\r\nsettings defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %c-icon% to change the class name to a custom name\r\n(not included in the pulldown menu). Use the %check-icon% to enter the\r\nedited pair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the selected option (shown in the\r\npulldown menu) and value (entered in the text field). See below for a\r\nlisting of pulldown menu items.</dd>\r\n\r\n<dt>%c-icon%</dt><dd>Enables a custom setting. Click on the %c-icon%\r\nand then enter the name and value in the two fields at left. Click\r\n<b>Add</b> to enter the new pair.</dd>\r\n</dl>\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<dl>\r\n\r\n<dt>application</dt><dd>The application (together with the options) to play the music on hold</dd>\r\n\r\n<dt>digit</dt><dd>If this option is set for a class, then when callers are listening to music on hold, they can press this digit, and they will switch to listening to this music class.</dd>\r\n\r\n<dt>directory</dt><dd>The directory where the music files are located.</dd>\r\n\r\n<dt>format</dt><dd>The file media format.(e.g. <b>ulaw</b>).</dd>\r\n\r\n<dt>mode</dt><dd>Valid options are <br><b>files</b>: read files from a directory in any Asterisk supported media format.<br><b>quietmpe</b>: default<br><b>mp3</b>: loud<br><b>mp3nb</b>: unbuffered<br><b>quietmp3nb</b>: quiet unbuffered<br><b>custom</b>: run a custom application</dd>\r\n\r\n</dl>'),(42,'/sigman/moh-add.html','Configuration: PBX Configuration > Music On Hold > Add Music On Hold','Add Music On Hold','<p>This interaction adds a music on hold class to the system.</p>\r\n\r\n<dt><b>Add</b> button</dt><dd>Adds the musiconhold named in the \"New Music On Hold\"\r\ntext box.</dd>\r\n\r\n<dt>New Music On Hold</dt><dd>The name of the new musiconhold class.</dd>\r\n\r\n<dt>use template</dt><dd>Select an existing musiconhold class to use as a\r\ntemplate. Once the new musiconhold class is created, you will be able to edit it\r\nin the Music On Hold interaction.</dd>'),(43,'/sigman/moh-list.html','Configuration: PBX Configuration > Music on Hold > Music on Hold Files','Music on Hold Files','<p>This interaction presents a list of available Music on Hold audio\r\nfiles, and provides access to the delete (%X-icon%) function. You can\r\nalso play files via this interaction using the %play-icon%, if\r\nsupporting hardware and software is available (for example,\r\nRealPlayer, a sound card, and a speaker).</p>\r\n'),(44,'/sigman/moh-upload.html','Configuration: PBX Configuration > Music on Hold >Upload Music on Hold','Music On Hold Upload','<p>This interaction uploads a sound file to be played as Music on\r\nHold. The file will be stored on the local PBX server. The file needs\r\nto be a valid MP3 file, and have a .mp3 extension.</p>\r\n'),(45,'/sigman/prompts.html','Configuration: PBX Configuration > Audio Prompts > Prompts','Audio Prompts','<p>This interaction presents a list of available Audio Prompt audio\r\nfiles, and provides access to the delete (%X-icon%) function. You can\r\nalso play files via this interaction using the %play-icon%, if\r\nsupporting hardware and software is available (for example,\r\nRealPlayer, a sound card, and a speaker).</p>'),(46,'/sigman/prompts-upload.html','Configuration: PBX Configuration > Audio Prompts > Upload Prompts','Audio Prompts Upload','<p>This interaction uploads an Audio Prompt file. The file will be\r\nstored on the local PBX server. The file needs to be a valid GSM file,\r\nand have a .gsm extension. To access any uploaded prompt in the\r\ndialplan, use the following path: prompts/myuploadedfile (note the\r\nomission of the .gsm).</p>'),(47,'/sigman/advanced.html','Configuration: PBX Configuration > Advanced','Advanced Configuration','<p> <b>NOTE</b> These are the advanced settings that are used less commonly than other settings.\r\nPlease only change them if you understand the implications.</p>'),(48,'/sigman/indications.html','Configuration: PBX Configuration > Advanced > Indications','Country Indications','<p>This interaction lists available indications (sets of tones to\r\nindicate \"busy, \"ringing,\" and so on). Indications are usually\r\nspecified by country. This interaction lets you specify and delete\r\nsettings for these indications, as well as delete or rename the\r\nindications themselves. You can also create a new indication via this\r\ninteraction, by copying an existing indication using the\r\n%copycat-icon%</p>\r\n\r\n<p>The editing interaction is two-tiered:</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Indications</b> (usually country codes)</dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the indication name (not visible if there\r\nare no indications defined). Clicking on this icon opens the\r\nindication name in a text box for editing. Use the %check-icon% to\r\nenter the edited name. (See the list of pre-defined indications\r\nbelow).</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the indication (not visible if there are\r\nno indications defined).</dd>\r\n\r\n<dt>%copycat-icon%</dt><dd>Opens the Add Indication interaction with\r\nthe current indicaton selected as a template. See \"PBX: Configuration\r\n> Advanced > Add Indication\".</dd>\r\n\r\n<dt><b>Settings</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting. Use the %up-arrow% and\r\n%down-arrow% to position the setting. Use the %check-icon% to enter\r\nthe edited pair. Use the %c-icon% to open the setting name in a text\r\nbox for editing, or select a new setting name using the pulldown\r\nmenu. (See the list of settings below). </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add a setting. The type of setting is\r\nselected via the pulldown menu, and its value is entered in the text\r\nfield. Use the %c-icon% to enter a custom setting. Once the name and\r\nsetting are entered, click <b>Add</b> to add the setting to the\r\nindication.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Pre-defined Indications:</h3>\r\n\r\n<ul>\r\n\r\n<li><b>at</b> (Austria)</li> \r\n\r\n<li><b>au</b> (Australia)</li>\r\n\r\n<li><b>br</b> Brazil)</li>\r\n\r\n<li><b>be</b> (Belgium)</li>\r\n\r\n<li><b>ch</b> (Switzerland)</li>\r\n\r\n<li><b>cl</b> (Chile)</li>\r\n\r\n<li><b>cn</b> (China)</li>\r\n\r\n<li><b>cz</b> (Czech Republic)</li>\r\n\r\n<li><b>de</b> (Germany)</li>\r\n\r\n<li><b>dk</b> (Denmark)</li>\r\n\r\n<li><b>en</b> (English)</li>\r\n\r\n<li><b>ee</b> (Estonia)</li>\r\n\r\n<li><b>fi</b> (Finland)</li>\r\n\r\n<li><b>fr</b> (France)</li>\r\n\r\n<li><b>gr</b> (Greece)</li>\r\n\r\n<li><b>hu</b> (Hungary)</li>\r\n\r\n<li><b>it</b> (Italy)</li>\r\n\r\n<li><b>lt</b> (Lithuania)</li>\r\n\r\n<li><b>mx</b> (Mexico)</li>\r\n\r\n<li><b>nl</b> (Netherlands)</li>\r\n\r\n<li><b>no</b> (Norway)</li>\r\n\r\n<li><b>nz</b> (New Zealand)</li>\r\n\r\n<li><b>pl</b> (Poland)</li>\r\n\r\n<li><b>pt</b> (Portugal)</li>\r\n\r\n<li><b>ru</b> (Russia)</li>\r\n\r\n<li><b>se</b> (Sweden)</li>\r\n\r\n<li><b>sg</b> (Singapore)</li>\r\n\r\n<li><b>uk</b> (United Kingdom)</li>\r\n\r\n<li><b>us</b> (United States)</li>\r\n\r\n<li><b>us-old</b> (US old)</li>\r\n\r\n<li><b>tw</b> (Taiwan)</li>\r\n\r\n<li><b>za</b> (South Africa)</li>\r\n\r\n</ul>\r\n\r\n<h3>Settings</h3>\r\n\r\n<p>Many settings consist of a <i>tonelist</i> - a specific sound or\r\nsequence of specific sounds. </p>\r\n\r\n<dl>\r\n\r\n<dt>alias</dt><dd>Additional two-letter country codes that also use\r\nthis set of tones.</dd>\r\n\r\n<dt>busy</dt><dd><i>tonelist</i> - the sound heard when the number\r\ndialed is busy.</dd>\r\n\r\n<dt>callwaiting</dt><dd><i>tonelist</i> - the sound heard when there\r\nis an incoming call on an engaged line.</dd>\r\n\r\n<dt>congestion</dt><dd><i>tonelist</i> - the sound heard when a call\r\ncan\'t go through because the network is too busy. </dd>\r\n\r\n<dt>description</dt><dd>the full name of the country.</dd>\r\n\r\n<dt>dial</dt><dd><i>tonelist</i> - the \"dialtone\".</dd>\r\n\r\n<dt>dialrecall</dt><dd><i>tonelist</i> - the sound played after a\r\nswitchhook.</dd>\r\n\r\n<dt>facility</dt><dd><!-- what is this? --></dd>\r\n\r\n<dt>info</dt><dd><i>tonelist</i> - often used to define a \"special\r\ninformation tone\".</dd>\r\n\r\n<dt>record</dt><dd><i>tonelist</i> - the tone played to indicate a\r\ncall is being recorded. </dd>\r\n\r\n<dt>ring</dt><dd><i>tonelist</i> - indicates the called number is\r\n\"ringing\". </dd>\r\n\r\n<dt>ringcadance</dt><dd>a sequence of rings and pauses, in\r\nmilliseconds. This is presented as a comma-separated list (for\r\nexample: \"400,200,400,2000\" means \"ring 400 ms, pause 200 ms, ring 400\r\nms, pause 2000 ms\"). This is used to ring the \"mechanical bell\" on a\r\nphone. The list should have no spaces.</dd>\r\n\r\n<dt>ringmobile</dt><dd><!-- I don\'t know --> </dd>\r\n\r\n<dt>specialcallwaiting</dt><dd><!-- I don\'t know --></dd>\r\n\r\n<dt>stutter</dt><dd><i>tonelist</i> - a \"stuttering\" dialtone.</dd> <!--\r\nI\'m guessing -->\r\n\r\n</dl>'),(49,'/sigman/indications-add.html','Configuration: PBX Configuration > Advanced >','Add Country Indication','<p>This interaction adds an indication to the dialplan.</p>\r\n\r\n<dl>\r\n\r\n<dt><b>Add</b> button</dt><dd>Adds the indication named in the \"New\r\nContext\" text box.</dd>\r\n\r\n<dt>New Indication</dt><dd>The name of the new indication.</dd>\r\n\r\n<dt>use template</dt><dd>Select an existing indication to use as a\r\ntemplate. Once the new indication is created, you will be able to edit\r\nit in the Indications interaction.</dd>\r\n\r\n</dl>'),(50,'/sigman/indications-general.html','Configuration: PBX Configuration > Advanced > Indications General','Country Indications General','<p>This interaction allows you to define general indication settings,\r\nand provides access to add, edit, and delete functions. It is\r\npresented as a collection of name-value pairs. </p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting (not visible if there are no\r\nsettings defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %c-icon% to change the setting name to a custom name\r\n(not included in the pulldown menu). Use the %check-icon% to enter the\r\nedited pair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the selected setting (shown in the\r\npulldown menu) and value (entered in the text field). See below for a\r\nlisting of pulldown menu items.</dd>\r\n\r\n<dt>%c-icon%</dt><dd>Enables a custom setting. Click on the %c-icon%\r\nand then enter the name and value in the two fields at left. Click\r\n<b>Add</b> to enter the new pair.</dd>\r\n\r\n\r\n</dl>\r\n\r\n<p>Currently, the only setting available as a general indication is\r\n\"country.\" Possible values are any of the two-letter pairs used as a\r\ncountry code. <b>us</b> is the default.</p>\r\n\r\n<h3>Country Codes</h3>\r\n\r\n<ul>\r\n\r\n<li><b>at</b> (Austria)</li> \r\n\r\n<li><b>au</b> (Australia)</li>\r\n\r\n<li><b>br</b> Brazil)</li>\r\n\r\n<li><b>be</b> (Belgium)</li>\r\n\r\n<li><b>ch</b> (Switzerland)</li>\r\n\r\n<li><b>cl</b> (Chile)</li>\r\n\r\n<li><b>cn</b> (China)</li>\r\n\r\n<li><b>cz</b> (Czech Republic)</li>\r\n\r\n<li><b>de</b> (Germany)</li>\r\n\r\n<li><b>dk</b> (Denmark)</li>\r\n\r\n<li><b>en</b> (English)</li>\r\n\r\n<li><b>ee</b> (Estonia)</li>\r\n\r\n<li><b>fi</b> (Finland)</li>\r\n\r\n<li><b>fr</b> (France)</li>\r\n\r\n<li><b>gr</b> (Greece)</li>\r\n\r\n<li><b>hu</b> (Hungary)</li>\r\n\r\n<li><b>it</b> (Italy)</li>\r\n\r\n<li><b>lt</b> (Lithuania)</li>\r\n\r\n<li><b>mx</b> (Mexico)</li>\r\n\r\n<li><b>nl</b> (Netherlands)</li>\r\n\r\n<li><b>no</b> (Norway)</li>\r\n\r\n<li><b>nz</b> (New Zealand)</li>\r\n\r\n<li><b>pl</b> (Poland)</li>\r\n\r\n<li><b>pt</b> (Portugal)</li>\r\n\r\n<li><b>ru</b> (Russia)</li>\r\n\r\n<li><b>se</b> (Sweden)</li>\r\n\r\n<li><b>sg</b> (Singapore)</li>\r\n\r\n<li><b>uk</b> (United Kingdom)</li>\r\n\r\n<li><b>us</b> (United States)</li>\r\n\r\n<li><b>us-old</b> (US old)</li>\r\n\r\n<li><b>tw</b> (Taiwan)</li>\r\n\r\n<li><b>za</b> (South Africa)</li>\r\n\r\n</ul>\r\n\r\n'),(80,'/sigman/fax.html','Configuration: PBX Configuration > Advanced > FAX','Fax Settings','<p>This interaction presents a list of Fax configuration in the system, and\r\nprovides access to add, edit, and delete functions. It is presented as\r\na collection of name-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting (not visible if there are no\r\nsettings defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %c-icon% to open a text box to edit the variable name to\r\na custom name (not included in the pulldown menu), or change the name\r\nusing the pulldown menu. Use the %check-icon% to enter the edited\r\npair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the selected name (shown in the\r\npulldown menu) and value (entered in the text field). See below for a\r\nlisting of pulldown menu items.</dd>\r\n\r\n<dt>%c-icon%</dt><dd>Enables a custom setting. Click on the %c-icon%\r\nand then enter the name and value in the two fields at left. Click\r\n<b>Add</b> to enter the new pair.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<dl>\r\n\r\n<dt>ecm</dt><dd>Enable/disable T.30 ECM (error correction mode) by default.  Default is <b>yes</b>.</dd>\r\n\r\n<dt>maxrate</dt><dd>Max transmission rate.  Possible values are <b>2400</b>, <b>4800</b>, <b>7200</b>, <b>9600</b>, <b>12000</b>, <b>14400</b>.  Set this value to the maximum desired transfer rate.  Default to <b>14400</b>.</dd>\r\n\r\n<dt>minrate</dt><dd>Minimum transmission rate.  Possible values are <b>2400</b>, <b>4800</b>, <b>7200</b>, <b>9600</b>, <b>14400</b>.  Set this value tot he minium desired transfer rate.  Default to <b>2400</b>.</dd>\r\n\r\n<dt>modems</dt><dd>Modem capabilities.  Possible values are <b>v17</b>, <b>v27</b>, and <b>v29</b>.  Set this value to modify the default modem options.  Default to <b>v17,v27,v29</b>.</dd>\r\n\r\n<dt>statusevents</dt><dd>Send Progress/Status events to manager session.  Manager event with \'call\' claas permissions will receive events indicating the steps to initiate a fax session.  Fax completion events are always sent to manager sessions with \'call\' class permissions, regardless of the value of this option.  Default to <b>no</b>.</dd>\r\n\r\n</dl>'),(51,'/sigman/rtp.html','Configuration: PBX Configuration > Advanced > RTP','RTP Settings','<p>This interaction presents a list of RTPs in the system, and\r\nprovides access to add, edit, and delete functions. It is presented as\r\na collection of name-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting (not visible if there are no\r\nsettings defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %c-icon% to open a text box to edit the variable name to\r\na custom name (not included in the pulldown menu), or change the name\r\nusing the pulldown menu. Use the %check-icon% to enter the edited\r\npair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the selected name (shown in the\r\npulldown menu) and value (entered in the text field). See below for a\r\nlisting of pulldown menu items.</dd>\r\n\r\n<dt>%c-icon%</dt><dd>Enables a custom setting. Click on the %c-icon%\r\nand then enter the name and value in the two fields at left. Click\r\n<b>Add</b> to enter the new pair.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<dl>\r\n\r\n<dt>rtpchecksums</dt><dd>Whether to enable or disable UDP checksums on\r\nRTP traffic. Options are <b>yes</b> and <b>no</b>.</dd>\r\n\r\n<dt>rtpend</dt><dd>The end UDP port for the RTP stream</dd>\r\n\r\n<dt>rtpstart</dt><dd>The start UDP port for the RTP stream</dd>\r\n\r\n</dl>'),(52,'/sigman/udptl.html','Configuration: PBX Configuration > Advanced > UDPTL','UDPTL Settings','<p>This interaction presents a list of UDPTL options in the system, and\r\nprovides access to add, edit, and delete functions. It is presented as\r\na collection of name-value pairs.</p>\r\n\r\n<dl>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting (not visible if there are no\r\nsettings defined). Clicking on this icon displays a set of editing\r\nicons. Use the %up-arrow% and %down-arrow% to position the name-value\r\npair. Use the %c-icon% to open a text box to edit the variable name to\r\na custom name (not included in the pulldown menu), or change the name\r\nusing the pulldown menu. Use the %check-icon% to enter the edited\r\npair.</dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add the selected name (shown in the\r\npulldown menu) and value (entered in the text field). See below for a\r\nlisting of pulldown menu items.</dd>\r\n\r\n<dt>%c-icon%</dt><dd>Enables a custom setting. Click on the %c-icon%\r\nand then enter the name and value in the two fields at left. Click\r\n<b>Add</b> to enter the new pair.</dd>\r\n\r\n</dl>\r\n\r\n<h3>Default Pulldown Menu Items</h3>\r\n\r\n<dl>\r\n\r\n<dt>utpchecksums</dt><dd>Whether to enable or disable UDP checksums on\r\nUDPTL traffic. Options are <b>yes</b> and <b>no</b>.</dd>\r\n\r\n<dt>updtlend</dt><dd>The end UDP port for the UDPTL stream</dd>\r\n\r\n<dt>udptlfecentries</dt><dd>The number of error correction entries in a UDPTL packet.</dd>\r\n\r\n<dt>udptlfecspan</dt><dd>The span over which parity is calculated for FEC in a UDPTL packet.</dd>\r\n\r\n<dt>udptlstart</dt><dd>The start UDP port for the UDPTL stream</dd>\r\n\r\n<dt>use_even_ports</dt><dd>Some VoIP providers will only accept an offer with an even-numbered UDPTL port.  Set this option so that Asterisk will only attempt to use even-numbered ports when negotiating T.38.  Default is <b>no</b>.</dd>\r\n\r\n</dl>'),(53,'/sigman/sipnotify.html','Configuration: PBX Configuration > Advanced > SIP Notify','SIP Notify Settings','<p>This interaction lists available SIP notification events (ways to\r\nsend information to a SIP end user device), and provides access to\r\nediting and delete functions. You can also create a new indication\r\n(event group) via this interaction, by copying an existing group using\r\nthe %copycat-icon%. <!-- copycat doesn\'t seem to do anything. can\'t\r\nedit name either --> </p>\r\n\r\n<p>This is a two-tier edit:</p>\r\n\r\n\r\n<dl>\r\n\r\n<!-- shouldn\'t \"indications\" in this interaction be labelled\r\n\"notifications?  -->\r\n\r\n<dt><b>Indications</b> </dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the indication (event group) name (not\r\nvisible if there are no groups defined). Clicking on this icon opens\r\nthe indication name in a text box for editing. Use the %check-icon% to\r\nenter the edited name. </dd>\r\n\r\n<!-- how do you make a new one?? -->\r\n\r\n<dt>%X-icon%</dt><dd>Delete the indication (not visible if there are\r\nno indications defined).</dd>\r\n\r\n<dt>%copycat-icon%</dt><dd><!-- doesn\'t seem to do anything --></dd>\r\n\r\n<dt><b>Settings</b></dt>\r\n\r\n<dt>%pen-icon%</dt><dd>Edit the setting. Use the %up-arrow% and\r\n%down-arrow% to position the setting. Use the %check-icon% to enter\r\nthe edited pair. Use the %c-icon% to open the setting name in a text\r\nbox for editing, or select a new setting name using the pulldown\r\nmenu. (See the list of settings below). </dd>\r\n\r\n<dt>%X-icon%</dt><dd>Delete the setting (not visible if there are no\r\nsettings defined).</dd>\r\n\r\n<dt><b>Add</b> button</dt><dd>Add a setting. The type of setting is\r\nselected via the pulldown menu, and its value is entered in the text\r\nfield. Use the %c-icon% to enter a custom setting. Once the name and\r\nsetting are entered, click <b>Add</b> to add the setting to the\r\nindication .</dd>\r\n\r\n</dl>\r\n'),(54,'/sigman/manual.html','Configuration: PBX Configuration > Advanced > Manual Editor','Manual Editor','<p>This interaction lets you edit Asterisk config files manually</p>'),(55,'/sigman/command.html','Configuration: PBX Control','PBX Control','<p>This interaction provides access to PBX control functions.</p>\r\n\r\n<dl>\r\n\r\n<dt>Server</dt><dd>Specifies the PBX server to be controlled. This is\r\nususally localhost (127.0.0.1).</dd>\r\n\r\n<dt>Reload Configuration</dt><dd>Clicking the <b>Reload Now</b> button\r\nimmediately reloads the configuration from the database. This is\r\nrequired to activate all changes, except for those to SIP/IAX and\r\nvoicemail. It is also necessary to reload the configurations for\r\nIAX/SIP channels if the rtcachefriends parameter is set in the IAX/SIP\r\ngeneral sections.</dd>\r\n\r\n<dt>Restart</dt><dd>This restarts the PBX. <b>restart when\r\nconvenient</b> will wait until there are no more active channels (the\r\ncall volume is empty). <b>restart gracefully</b> will wait until all\r\nscheduled tasks are finished (for example, writing voice mail to disk,\r\nclosing files). <b>restart now</b> will restart the PBX\r\nimmediately. <br>\r\n\r\nIt is possible to disable restarts by including the line\r\n$cfg[\'PBXFullControl\'] = FALSE in the file\r\n/var/www/html/conf/config.sigman.php. If restarts have been disabled,\r\nthe restart buttons will not be visible.</dd>\r\n\r\n</dl>'),(56,'/sigman/config.html','Configuration: Xaccel Setup > Access Control > Administrator Password','Access Control','<p>This interaction is used to change the administrator password for\r\nthe \"admin\" login.</p>'),(72,'/sigman/data.html','Xaccel Setup','Database Storage Configuration','<p>Choose between static and dynamic realtime configuration for SIP/IAX and Voicemail</p>'),(60,'/sigman/welcome.html','Help: Index','Help Index','Use the search field to search for a keyword. You can choose between Screen Help and Application Help.\r\n<br>\r\n<br>\r\n<br>\r\n<hr>\r\nXaccel Help v.%sigman-version%<br>\r\n&copy 2011 <a class=\"linkster\" href=\"http://www.xaccel.net\" target=\"_sigw\">Xaccel Networks, Inc</a>. All rights reserved.<br>Xaccel and the Xaccel logo are trademarks of\r\nXaccel Networks, Inc in the United States and/or in other countries worldwide.<br><br>'),(59,'/sigman/support.html','Help: Support','Support','<p>Displays remote support pages</p>\r\n');
