  `port` varchar(5) NOT NULL DEFAULT '',
  `qualify` varchar(4) DEFAULT NULL,
  `rtptimeout` char(3) DEFAULT NULL,
  `rtpholdtimeout` char(3) DEFAULT NULL,
  `secret` varchar(100) DEFAULT NULL,
  `type` varchar(6) NOT NULL DEFAULT '',
  `username` varchar(30) NOT NULL DEFAULT '',
  `regseconds` int(11) NOT NULL DEFAULT '0',
  `ipaddr` varchar(45) NOT NULL DEFAULT '',
  `disallow` varchar(100) NOT NULL DEFAULT '',
  `allow` varchar(100) NOT NULL DEFAULT '',
  `fullcontact` varchar(100) NOT NULL DEFAULT '',
  `callingpres` varchar(32) DEFAULT NULL,
  `remotesecret` varchar(100) DEFAULT NULL,
  `transport` varchar(30) DEFAULT NULL,
  `call-limit` char(3) DEFAULT NULL,
  `busylevel` char(3) DEFAULT NULL,
  `videosupport` varchar(4) DEFAULT NULL,
  `maxcallbitrate` varchar(4) DEFAULT NULL,
  `rfc2833compensate` varchar(4) DEFAULT NULL,
  `defaultuser` varchar(50) DEFAULT NULL,
  `outboundproxy` varchar(50) DEFAULT NULL,
  `t38pt_udptl` varchar(30) DEFAULT NULL,
  `t38pt_usertpsource` varchar(50) DEFAULT NULL,
  `useragent` varchar(100) DEFAULT NULL,
  `lastms` int(11) NOT NULL DEFAULT '0',
  `regserver` varchar(100) DEFAULT NULL,
  `setvar` varchar(100) DEFAULT NULL,
