  `progressinband` varchar(6) DEFAULT NULL,
  `promiscredir` varchar(4) DEFAULT NULL,
  `allowtransfer` varchar(4) DEFAULT NULL,
  `allowoverlap` varchar(4) DEFAULT NULL,
  `allowsubscribe` varchar(4) DEFAULT NULL,
  `subscribecontext` varchar(30) DEFAULT NULL,
  `useclientcode` varchar(4) DEFAULT NULL,
  `usereqphone` varchar(4) DEFAULT NULL,
  `ignoresdpversion` varchar(4) DEFAULT NULL,
  `registertrying` varchar(4) DEFAULT NULL,
  `trustrpid` varchar(4) DEFAULT NULL,
  `sendrpid` varchar(5) DEFAULT NULL,
  PRIMARY KEY (`uniqueid`),
  UNIQUE KEY `name` (`name`),
  KEY `name_2` (`name`),
  KEY `ipaddr` (`ipaddr`,`port`),
  KEY `host` (`host`,`port`)
) ENGINE=MyISAM AUTO_INCREMENT=88 DEFAULT CHARSET=latin1;
