INSERT INTO `support_command` VALUES (1,'AddQueueMember','Dynamically adds queue members. ','[Synopsis]\nDynamically adds queue members. \n\n[Description]\nDynamically adds interface to an existing queue. If the interface is already\nin the queue it will return an error.\nThis application sets the following channel variable upon completion:\n${AQMSTATUS}: The status of the attempt to add a queue member as a text\nstring.\n    ADDED\n    MEMBERALREADY\n    NOSUCHQUEUE\n\n[Syntax]\nAddQueueMember(queuename[,interface[,penalty[,options[,membername[,statei\nnterface]]]]])\n\n[Arguments]\nNot available\n\n[See Also]\nQueue(), QueueLog(), AddQueueMember(), RemoveQueueMember(), PauseQueueMember(),UnpauseQueueMember(), QUEUE_VARIABLES, QUEUE_MEMBER, QUEUE_MEMBER_COUNT,QUEUE_EXISTS, QUEUE_WAITING_COUNT, QUEUE_MEMBER_LIST, QUEUE_MEMBER_PENALTY\n',2),(2,'ADSIProg','Load Asterisk ADSI Scripts into phone ','[Synopsis]\nLoad Asterisk ADSI Scripts into phone \n\n[Description]\nThis application programs an ADSI Phone with the given script\n\n[Syntax]\nADSIProg([script])\n\n[Arguments]\nscript\n    adsi script to use. If not given uses the default script \"asteri\n    sk.adsi\"\n\n[See Also]\nGetCPEID(), adsi.conf\n',2),(3,'AELSub','Launch subroutine built with AEL ','[Synopsis]\nLaunch subroutine built with AEL \n\n[Description]\nExecute the named subroutine, defined in AEL, from another dialplan language,\nsuch as extensions.conf, Realtime extensions, or Lua.\nThe purpose of this application is to provide a sane entry point into AEL\nsubroutines, the implementation of which may change from time to time.\n\n[Syntax]\nAELSub(routine[,args])\n\n[Arguments]\nroutine\n    Named subroutine to execute.\n\n[See Also]\nNot available\n',2),(4,'AgentLogin','Call agent login. ','[Synopsis]\nCall agent login. \n\n[Description]\nAsks the agent to login to the system. Always returns \'-1\'. While logged in,\nthe agent can receive calls and will hear a \'beep\' when a new call comes in.\nThe agent can dump the call by pressing the star key.\n\n[Syntax]\nAgentLogin([AgentNo][,options])\n\n[Arguments]\noptions\n    s: silent login - do not announce the login ok segment after agent\n    logged on/off\n\n\n[See Also]\nQueue(), AddQueueMember(), RemoveQueueMember(), PauseQueueMember(),UnpauseQueueMember(), AGENT, agents.conf, queues.conf\n',2),(5,'AgentMonitorOutgoing','Record agent\'s outgoing call. ','[Synopsis]\nRecord agent\'s outgoing call. \n\n[Description]\nTries to figure out the id of the agent who is placing outgoing call based\non comparison of the callerid of the current interface and the global variable\nplaced by the AgentCallbackLogin application. That\'s why it should be used\nonly with the AgentCallbackLogin app. Uses the monitoring functions in\nchan_agent instead of Monitor application. That has to be configured in the\n\"agents.conf\" file.\nNormally the app returns \'0\' unless the options are passed.\n\n[Syntax]\nAgentMonitorOutgoing([options])\n\n[Arguments]\noptions\n    d: make the app return \'-1\' if there is an error condition.\n\n    c: change the CDR so that the source of the call is \'Agent/agent_id\'\n\n    n: don\'t generate the warnings when there is no callerid or the\n    agentid is not known. It\'s handy if you want to have one context for agent\n    and non-agent calls.\n\n\n[See Also]\nagents.conf\n',2),(6,'AGI','Executes an AGI compliant application. ','[Synopsis]\nExecutes an AGI compliant application. \n\n[Description]\nExecutes an Asterisk Gateway Interface compliant program on a channel. AGI\nallows Asterisk to launch external programs written in any language to control\na telephony channel, play audio, read DTMF digits, etc. by communicating with\nthe AGI protocol on *stdin* and *stdout*. As of \'1.6.0\', this channel will\nnot stop dialplan execution on hangup inside of this application. Dialplan\nexecution will continue normally, even upon hangup until the AGI application\nsignals a desire to stop (either by exiting or, in the case of a net script,\nby closing the connection). A locally executed AGI script will receive SIGHUP\non hangup from the channel except when using DeadAGI. A fast AGI server will\ncorrespondingly receive a HANGUP inline with the command dialog. Both of theses\nsignals may be disabled by setting the ${AGISIGHUP} channel variable to \'no\'\nbefore executing the AGI application.\nUse the CLI command \'agi show commands\' to list available agi commands.\nThis application sets the following channel variable upon completion:\n${AGISTATUS}: The status of the attempt to the run the AGI script text string,\none of:\n    SUCCESS\n    FAILURE\n    NOTFOUND\n    HANGUP\n\n[Syntax]\nAGI(command[,arg1[,arg2[,...]]])\n\n[Arguments]\nNot available\n\n[See Also]\nEAGI(), DeadAGI()\n',2),(7,'AlarmReceiver','Provide support for receiving alarm reports from a burglar or fire alarm panel.','[Synopsis]\nProvide support for receiving alarm reports from a burglar or fire alarm panel.\n\n[Description]\nThis application should be called whenever there is an alarm panel calling\nin to dump its events. The application will handshake with the alarm panel,\nand receive events, validate them, handshake them, and store them until the\npanel hangs up. Once the panel hangs up, the application will run the system\ncommand specified by the eventcmd setting in \"alarmreceiver.conf\" and pipe\nthe events to the standard input of the application. The configuration file\nalso contains settings for DTMF timing, and for the loudness of the\nacknowledgement tones.\nNOTE: Only 1 signalling format is supported at this time: Ademco Contact\nID.\n\n[Syntax]\nAlarmReceiver()\n\n[Arguments]\nNot available\n\n[See Also]\nalarmreceiver.conf\n',2),(8,'AMD','Attempt to detect answering machines. ','[Synopsis]\nAttempt to detect answering machines. \n\n[Description]\nThis application attempts to detect answering machines at the beginning of\noutbound calls. Simply call this application after the call has been answered\n(outbound only, of course).\nWhen loaded, AMD reads amd.conf and uses the parameters specified as default\nvalues. Those default values get overwritten when the calling AMD with\nparameters.\nThis application sets the following channel variables:\n${AMDSTATUS}: This is the status of the answering machine detection\n    MACHINE\n    HUMAN\n    NOTSURE\n    HANGUP\n${AMDCAUSE}: Indicates the cause that led to the conclusion\n    TOOLONG: Total Time.\n    INITIALSILENCE: Silence Duration - Initial Silence.\n    HUMAN: Silence Duration - afterGreetingSilence.\n    LONGGREETING: Voice Duration - Greeting.\n    MAXWORDLENGTH: Word Count - maximum number of words.\n\n[Syntax]\nAMD([initialSilence][,greeting[,afterGreetingSilence[,totalAnalysis Time[\n,miniumWordLength[,betweenWordSilence[,maximumNumberOfWords[,silenceThres\nhold[,maximumWordLength]]]]]]]])\n\n[Arguments]\ninitialSilence\n    Is maximum initial silence duration before greeting.\n    If this is exceeded set as MACHINE\ngreeting\n    is the maximum length of a greeting.\n    If this is exceeded set as MACHINE\nafterGreetingSilence\n    Is the silence after detecting a greeting.\n    If this is exceeded set as HUMAN\ntotalAnalysis Time\n    Is the maximum time allowed for the algorithm\n    to decide HUMAN or MACHINE\nminiumWordLength\n    Is the minimum duration of Voice considered to be a word\nbetweenWordSilence\n    Is the minimum duration of silence after a word to consider the audio\n    that follows to be a new word\nmaximumNumberOfWords\n    Is the maximum number of words in a greeting\n    If this is exceeded set as MACHINE\nsilenceThreshold\n    How long do we consider silence\nmaximumWordLength\n    Is the maximum duration of a word to accept.\n    If exceeded set as MACHINE\n\n[See Also]\nWaitForSilence(), WaitForNoise()\n',2),(9,'Answer','Answer a channel if ringing. ','[Synopsis]\nAnswer a channel if ringing. \n\n[Description]\nIf the call has not been answered, this application will answer it. Otherwise,\nit has no effect on the call.\n\n[Syntax]\nAnswer([delay][,nocdr])\n\n[Arguments]\ndelay\n    Asterisk will wait this number of milliseconds before returning to\n    the dialplan after answering the call.\nnocdr\n    Asterisk will send an answer signal to the calling phone, but will\n    not set the disposition or answer time in the CDR for this call.\n\n[See Also]\nHangup()\n',2),(10,'Authenticate','Authenticate a user ','[Synopsis]\nAuthenticate a user \n\n[Description]\nThis application asks the caller to enter a given password in order to continue\ndialplan execution.\nIf the password begins with the \'/\' character,  it is interpreted as a file\nwhich contains a list of valid passwords, listed 1 password per line in the\nfile.\nWhen using a database key, the value associated with the key can be anything.\nUsers have three attempts to authenticate before the channel is hung up.\n\n[Syntax]\nAuthenticate(password[,options[,maxdigits[,prompt]]])\n\n[Arguments]\npassword\n    Password the user should know\noptions\n    a: Set the channels\' account code to the password that is entered\n\n    d: Interpret the given path as database key, not a literal file\n\n    m: Interpret the given path as a file which contains a list of account\n    codes and password hashes delimited with \':\', listed one per line in the\n    file. When one of the passwords is matched, the channel will have its\n    account code set to the corresponding account code in the file.\n\n    r: Remove the database key upon successful entry (valid with \'d\'\n    only)\n\nmaxdigits\n    maximum acceptable number of digits. Stops reading after maxdigits\n    have been entered (without requiring the user to press the \'#\' key).\n    Defaults to 0 - no limit - wait for the user press the \'#\' key.\nprompt\n    Override the agent-pass prompt file.\n\n[See Also]\nVMAuthenticate(), DISA()\n',2),(11,'BackGround','Play an audio file while waiting for digits of an extension to go to. ','[Synopsis]\nPlay an audio file while waiting for digits of an extension to go to. \n\n[Description]\nThis application will play the given list of files *(do not put extension)*\nwhile waiting for an extension to be dialed by the calling channel. To continue\nwaiting for digits after this application has finished playing files, the\n\'WaitExten\' application should be used.\nIf one of the requested sound files does not exist, call processing will\nbe terminated.\nThis application sets the following channel variable upon completion:\n${BACKGROUNDSTATUS}: The status of the background attempt as a text string.\n    SUCCESS\n    FAILED\n\n[Syntax]\nBackGround(filename1[&filename2[&...]][,options[,langoverride[,context]]]\n)\n\n[Arguments]\noptions\n    s: Causes the playback of the message to be skipped if the channel\n    is not in the \'up\' state (i.e. it hasn\'t been answered yet). If this\n    happens, the application will return immediately.\n\n    n: Don\'t answer the channel before playing the files.\n\n    m: Only break if a digit hit matches a one digit extension in the\n    destination context.\n\nlangoverride\n    Explicitly specifies which language to attempt to use for the\n    requested sound files.\ncontext\n    This is the dialplan context that this application will use when\n    exiting to a dialed extension.\n\n[See Also]\nControlPlayback(), WaitExten(), BackgroundDetect(), TIMEOUT\n',2),(12,'BackgroundDetect','Background a file with talk detect. ','[Synopsis]\nBackground a file with talk detect. \n\n[Description]\nPlays back <filename>, waiting for interruption from a given digit (the digit\nmust start the beginning of a valid extension, or it will be ignored). During\nthe playback of the file, audio is monitored in the receive direction, and\nif a period of non-silence which is greater than <min> ms yet less than <max>\nms is followed by silence for at least <sil> ms, which occurs during the first\n<analysistime> ms, then the audio playback is aborted and processing jumps\nto the <talk> extension, if available.\n\n[Syntax]\nBackgroundDetect(filename[,sil[,min[,max[,analysistime]]]])\n\n[Arguments]\nsil\n    If not specified, defaults to \'1000\'.\nmin\n    If not specified, defaults to \'100\'.\nmax\n    If not specified, defaults to \'infinity\'.\nanalysistime\n    If not specified, defaults to \'infinity\'.\n\n[See Also]\nNot available\n',2),(13,'Bridge','Bridge two channels. ','[Synopsis]\nBridge two channels. \n\n[Description]\nAllows the ability to bridge two channels via the dialplan.\nThis application sets the following channel variable upon completion:\n${BRIDGERESULT}: The result of the bridge attempt as a text string.\n    SUCCESS\n    FAILURE\n    LOOP\n    NONEXISTENT\n    INCOMPATIBLE\n\n[Syntax]\nBridge(channel[,options])\n\n[Arguments]\nchannel\n    The current channel is bridged to the specified <channel>.\noptions\n    p: Play a courtesy tone to <channel>.\n\n    h: Allow the called party to hang up by sending the <*> DTMF digit.\n\n    H: Allow the calling party to hang up by pressing the <*> DTMF digit.\n\n    k: Allow the called party to enable parking of the call by sending\n    the DTMF sequence defined for call parking in features.conf.\n\n    K: Allow the calling party to enable parking of the call by sending\n    the DTMF sequence defined for call parking in features.conf.\n\n    L(x[:y][:z]): Limit the call to <x> ms. Play a warning when <y> ms\n    are left. Repeat the warning every <z> ms. The following special variables\n    can be used with this option:\n        ${LIMIT_PLAYAUDIO_CALLER}: Play sounds to the caller. yes|no\n        (default yes)\n        ${LIMIT_PLAYAUDIO_CALLEE}: Play sounds to the callee. yes|no\n        ${LIMIT_TIMEOUT_FILE}: File to play when time is up.\n        ${LIMIT_CONNECT_FILE}: File to play when call begins.\n        ${LIMIT_WARNING_FILE}: File to play as warning if <y> is\n        defined. The default is to say the time remaining.\n\n    S(x): Hang up the call after <x> seconds *after* the called party\n    has answered the call.\n\n    t: Allow the called party to transfer the calling party by sending\n    the DTMF sequence defined in features.conf.\n\n    T: Allow the calling party to transfer the called party by sending\n    the DTMF sequence defined in features.conf.\n\n    w: Allow the called party to enable recording of the call by sending\n    the DTMF sequence defined for one-touch recording in features.conf.\n\n    W: Allow the calling party to enable recording of the call by sending\n    the DTMF sequence defined for one-touch recording in features.conf.\n\n    x: Cause the called party to be hung up after the bridge, instead\n    of being restarted in the dialplan.\n\n\n[See Also]\nNot available\n',2),(14,'Busy','Indicate the Busy condition. ','[Synopsis]\nIndicate the Busy condition. \n\n[Description]\nThis application will indicate the busy condition to the calling channel.\n\n[Syntax]\nBusy([timeout])\n\n[Arguments]\ntimeout\n    If specified, the calling channel will be hung up after the specified\n    number of seconds. Otherwise, this application will wait until the calling\n    channel hangs up.\n\n[See Also]\nCongestion(), Progess(), Playtones(), Hangup()\n',2),(15,'CallCompletionCancel','Cancel call completion service ','[Synopsis]\nCancel call completion service \n\n[Description]\nCancel a Call Completion Request.\nThis application sets the following channel variables:\n${CC_CANCEL_RESULT}: This is the returned status of the cancel.\n    SUCCESS\n    FAIL\n${CC_CANCEL_REASON}: This is the reason the cancel failed.\n    NO_CORE_INSTANCE\n    NOT_GENERIC\n    UNSPECIFIED\n\n[Syntax]\nCallCompletionCancel()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(16,'CallCompletionRequest','Request call completion service for previous call ','[Synopsis]\nRequest call completion service for previous call \n\n[Description]\nRequest call completion service for a previously failed call attempt.\nThis application sets the following channel variables:\n${CC_REQUEST_RESULT}: This is the returned status of the request.\n    SUCCESS\n    FAIL\n${CC_REQUEST_REASON}: This is the reason the request failed.\n    NO_CORE_INSTANCE\n    NOT_GENERIC\n    TOO_MANY_REQUESTS\n    UNSPECIFIED\n\n[Syntax]\nCallCompletionRequest()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(17,'CELGenUserEvent','Generates a CEL User Defined Event. ','[Synopsis]\nGenerates a CEL User Defined Event. \n\n[Description]\nA CEL event will be immediately generated by this channel, with the supplied\nname for a type.\n\n[Syntax]\nCELGenUserEvent(event-name[,extra])\n\n[Arguments]\nextra\n    Extra text to be included with the event.\n\n[See Also]\nNot available\n',2),(18,'ChangeMonitor','Change monitoring filename of a channel. ','[Synopsis]\nChange monitoring filename of a channel. \n\n[Description]\nChanges monitoring filename of a channel. Has no effect if the channel is\nnot monitored.\n\n[Syntax]\nChangeMonitor(filename_base)\n\n[Arguments]\nfilename_base\n    The new filename base to use for monitoring this channel.\n\n[See Also]\nNot available\n',2),(19,'ChanIsAvail','Check channel availability ','[Synopsis]\nCheck channel availability \n\n[Description]\nThis application will check to see if any of the specified channels are\navailable.\nThis application sets the following channel variables:\n${AVAILCHAN}: The name of the available channel, if one exists\n${AVAILORIGCHAN}: The canonical channel name that was used to create the\nchannel\n${AVAILSTATUS}: The device state for the device\n${AVAILCAUSECODE}: The cause code returned when requesting the channel\n\n[Syntax]\nChanIsAvail([Technology2/Resource2[&...]][,options])\n\n[Arguments]\nTechnology2/Resource2\n    Optional extra devices to check\n    If you need more then one enter them as Technology2/Resource2&Te\n    chnology3/Resourse3&.....\nTechnology/Resource\n    Specification of the device(s) to check.  These must be in the format\n    of  \'Technology/Resource\', where <Technology> represents a particular\n    channel driver, and <Resource> represents a resource available to that\n    particular channel driver.\noptions\n    a: Check for all available channels, not only the first one\n\n    s: Consider the channel unavailable if the channel is in use at all\n\n    t: Simply checks if specified channels exist in the channel list\n\n\n[See Also]\nNot available\n',2),(20,'ChannelRedirect','Redirects given channel to a dialplan target ','[Synopsis]\nRedirects given channel to a dialplan target \n\n[Description]\nSends the specified channel to the specified extension priority\nThis application sets the following channel variables upon completion\n${CHANNELREDIRECT_STATUS}: \n    NOCHANNEL\n    SUCCESS\n    Are set to the result of the redirection\n\n[Syntax]\nChannelRedirect(channel,[[context,]extension,]priority)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(21,'ChanSpy','Listen to a channel, and optionally whisper into it. ','[Synopsis]\nListen to a channel, and optionally whisper into it. \n\n[Description]\nThis application is used to listen to the audio from an Asterisk channel.\nThis includes the audio  coming in and out of the channel being spied on.\nIf the \'chanprefix\' parameter is specified, only channels beginning with this\nstring will be spied upon.\nWhile spying, the following actions may be performed:\n - Dialing \'#\' cycles the volume level.\n - Dialing \'*\' will stop spying and look for another channel to spy on.\n - Dialing a series of digits followed by \'#\' builds a channel name to append\n to \'chanprefix\'. For example, executing ChanSpy(Agent) and then dialing the\n digits \'1234#\'  while spying will begin spying on the channel \'Agent/1234\'.\n Note that this feature will be overridden if the \'d\' option is used\nNOTE: The <X> option supersedes the three features above in that if a valid\nsingle digit extension exists in the correct context ChanSpy will exit to\nit. This also disables choosing a channel based on \'chanprefix\' and a digit\nsequence.\n\n[Syntax]\nChanSpy([chanprefix][,options])\n\n[Arguments]\noptions\n    b: Only spy on channels involved in a bridged call.\n\n    B: Instead of whispering on a single channel barge in on both channels\n    involved in the call.\n\n    c(digit): \n        digit - Specify a DTMF digit that can be used to spy on the\n        next available channel.\n\n    d: Override the typical numeric DTMF functionality and instead use\n    DTMF to switch between spy modes.\n        4 - spy mode\n        5 - whisper mode\n        6 - barge mode\n\n    e(ext): Enable *enforced* mode, so the spying channel can only monitor\n    extensions whose name is in the <ext> : delimited  list.\n\n    E: Exit when the spied-on channel hangs up.\n\n    g(grp): \n        grp - Only spy on channels in which one or more of the groups\n        listed in <grp> matches one or more groups from the ${SPYGROUP}\n        variable set on the channel to be spied upon.\n    NOTE: both <grp> and ${SPYGROUP} can contain  either a single group\n    or a colon-delimited list of groups, such as \'sales:support:accounting\'.\n\n    n([mailbox][@context]): Say the name of the person being spied on\n    if that person has recorded his/her name. If a context is specified, then\n    that voicemail context will be searched when retrieving the name, otherwise\n    the \'default\' context be used when searching for the name (i.e. if SIP/1000\n    is the channel being spied on and no mailbox is specified, then \'1000\'\n    will be used when searching for the name).\n\n    o: Only listen to audio coming from this channel.\n\n    q: Don\'t play a beep when beginning to spy on a channel, or speak\n    the selected channel name.\n\n    r([basename]): Record the session to the monitor spool directory.\n    An optional base for the filename  may be specified. The default is\n    \'chanspy\'.\n\n    s: Skip the playback of the channel type (i.e. SIP, IAX, etc) when\n    speaking the selected channel name.\n\n    S: Stop when no more channels are left to spy on.\n\n    v([value]): Adjust the initial volume in the range from \'-4\'  to\n    \'4\'. A negative value refers to a quieter setting.\n\n    w: Enable \'whisper\' mode, so the spying channel can talk to the\n    spied-on channel.\n\n    W: Enable \'private whisper\' mode, so the spying channel can talk\n    to the spied-on channel but cannot listen to that channel.\n\n    x(digit): \n        digit - Specify a DTMF digit that can be used to exit the\n        application.\n\n    X: Allow the user to exit ChanSpy to a valid single digit numeric\n    extension in the current context or the context specified by the\n    ${SPY_EXIT_CONTEXT} channel variable. The name of the last channel that\n    was spied on will be stored in the ${SPY_CHANNEL} variable.\n\n\n[See Also]\nExtenSpy()\n',2),(22,'ClearHash','Clear the keys from a specified hashname. ','[Synopsis]\nClear the keys from a specified hashname. \n\n[Description]\nClears all keys out of the specified <hashname>.\n\n[Syntax]\nClearHash(hashname)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(23,'ConfBridge','Conference bridge application.             ','[Synopsis]\nConference bridge application.             \n\n[Description]\nEnters the user into a specified conference bridge. The user can exit the\nconference by hangup or DTMF menu option.\n\n[Syntax]\nConfBridge([confno][,bridge_profile[,user_profile[,menu]]])\n\n[Arguments]\nconfno\n    The conference number\nbridge_profile\n    The bridge profile name from confbridge.conf.  When left blank, a\n    dynamically built bridge profile created by the CONFBRIDGE dialplan\n    function is searched for on the channel and used.  If no dynamic profile\n    is present, the \'default_bridge\' profile found in confbridge.conf is used.\n    \n    It is important to note that while user profiles may be unique for\n    each participant, mixing bridge profiles on a single conference is _NOT_\n    recommended and will produce undefined results.\nuser_profile\n    The user profile name from confbridge.conf.  When left blank, a\n    dynamically built user profile created by the CONFBRIDGE dialplan function\n    is searched for on the channel and used.  If no dynamic profile is present,\n    the \'default_user\' profile found in confbridge.conf is used.\nmenu\n    The name of the DTMF menu in confbridge.conf to be applied to this\n    channel.  No menu is applied by default if this option is left blank.\n\n[See Also]\nConfBridge(), CONFBRIDGE, CONFBRIDGE_INFO\n',2),(24,'Congestion','Indicate the Congestion condition. ','[Synopsis]\nIndicate the Congestion condition. \n\n[Description]\nThis application will indicate the congestion condition to the calling\nchannel.\n\n[Syntax]\nCongestion([timeout])\n\n[Arguments]\ntimeout\n    If specified, the calling channel will be hung up after the specified\n    number of seconds. Otherwise, this application will wait until the calling\n    channel hangs up.\n\n[See Also]\nBusy(), Progess(), Playtones(), Hangup()\n',2),(25,'ContinueWhile','Restart a While loop. ','[Synopsis]\nRestart a While loop. \n\n[Description]\nReturns to the top of the while loop and re-evaluates the conditional.\n\n[Syntax]\nContinueWhile()\n\n[Arguments]\nNot available\n\n[See Also]\nWhile(), EndWhile(), ExitWhile()\n',2),(26,'ControlPlayback','Play a file with fast forward and rewind. ','[Synopsis]\nPlay a file with fast forward and rewind. \n\n[Description]\nThis application will play back the given <filename>.\nIt sets the following channel variables upon completion:\n${CPLAYBACKSTATUS}: Contains the status of the attempt as a text string\n    SUCCESS\n    USERSTOPPED\n    ERROR\n${CPLAYBACKOFFSET}: Contains the offset in ms into the file where playback\nwas at when it stopped. \'-1\' is end of file.\n${CPLAYBACKSTOPKEY}: If the playback is stopped by the user this variable\ncontains the key that was pressed.\n\n[Syntax]\nControlPlayback(filename[,skipms[,ff[,rew[,stop[,pause[,restart[,options]\n]]]]]])\n\n[Arguments]\nskipms\n    This is number of milliseconds to skip when rewinding or fast-fo\n    rwarding.\nff\n    Fast-forward when this DTMF digit is received. (defaults to \'#\')\nrew\n    Rewind when this DTMF digit is received. (defaults to \'*\')\nstop\n    Stop playback when this DTMF digit is received.\npause\n    Pause playback when this DTMF digit is received.\nrestart\n    Restart playback when this DTMF digit is received.\noptions\n    o(time): \n        time - Start at <time> ms from the beginning of the file.\n\n\n[See Also]\nNot available\n',2),(27,'DAHDIRAS','Executes DAHDI ISDN RAS application. ','[Synopsis]\nExecutes DAHDI ISDN RAS application. \n\n[Description]\nExecutes a RAS server using pppd on the given channel. The channel must be\na clear channel (i.e. PRI source) and a DAHDI channel to be able to use this\nfunction (No modem emulation is included).\nYour pppd must be patched to be DAHDI aware.\n\n[Syntax]\nDAHDIRAS(args)\n\n[Arguments]\nargs\n    A list of parameters to pass to the pppd daemon, separated by \',\'\n    characters.\n\n[See Also]\nNot available\n',2),(28,'DAHDIScan','Scan DAHDI channels to monitor calls. ','[Synopsis]\nScan DAHDI channels to monitor calls. \n\n[Description]\nAllows a call center manager to monitor DAHDI channels in a convenient way.\nUse \'#\' to select the next channel and use \'*\' to exit.\n\n[Syntax]\nDAHDIScan([group])\n\n[Arguments]\ngroup\n    Limit scanning to a channel <group> by setting this option.\n\n[See Also]\nNot available\n',2),(29,'DAHDISendCallreroutingFacility','Send an ISDN call rerouting/deflection facility message. ','[Synopsis]\nSend an ISDN call rerouting/deflection facility message. \n\n[Description]\nThis application will send an ISDN switch specific call rerouting/deflection\nfacility message over the current channel. Supported switches depend upon\nthe version of libpri in use.\n\n[Syntax]\nDAHDISendCallreroutingFacility(destination[,original[,reason]])\n\n[Arguments]\ndestination\n    Destination number.\noriginal\n    Original called number.\nreason\n    Diversion reason, if not specified defaults to \'unknown\'\n\n[See Also]\nNot available\n',2),(30,'DAHDISendKeypadFacility','Send digits out of band over a PRI. ','[Synopsis]\nSend digits out of band over a PRI. \n\n[Description]\nThis application will send the given string of digits in a Keypad Facility\nIE over the current channel.\n\n[Syntax]\nDAHDISendKeypadFacility(digits)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(31,'DateTime','Says a specified time in a custom format. ','[Synopsis]\nSays a specified time in a custom format. \n\n[Description]\nSay the date and time in a specified format.\n\n[Syntax]\nDateTime([unixtime][,timezone[,format]])\n\n[Arguments]\nunixtime\n    time, in seconds since Jan 1, 1970.  May be negative. Defaults to\n    now.\ntimezone\n    timezone, see \"/usr/share/zoneinfo\" for a list. Defaults to machine\n    default.\nformat\n    a format the time is to be said in.  See \"voicemail.conf\". Defaults\n    to \'ABdY \"digits/at\" IMp\'\n\n[See Also]\nNot available\n',2),(32,'DBdel','Delete a key from the asterisk database. ','[Synopsis]\nDelete a key from the asterisk database. \n\n[Description]\nThis application will delete a <key> from the Asterisk database.\nNOTE: This application has been DEPRECATED in favor of the DB_DELETE\nfunction.\n\n[Syntax]\nDBdel(family/key)\n\n[Arguments]\nNot available\n\n[See Also]\nDB_DELETE, DBdeltree(), DB\n',2),(33,'DBdeltree','Delete a family or keytree from the asterisk database. ','[Synopsis]\nDelete a family or keytree from the asterisk database. \n\n[Description]\nThis application will delete a <family> or <keytree> from the Asterisk\ndatabase.\n\n[Syntax]\nDBdeltree(family[/keytree])\n\n[Arguments]\nNot available\n\n[See Also]\nDB_DELETE, DBdel(), DB\n',2),(34,'DeadAGI','Executes AGI on a hungup channel. ','[Synopsis]\nExecutes AGI on a hungup channel. \n\n[Description]\nExecutes an Asterisk Gateway Interface compliant program on a channel. AGI\nallows Asterisk to launch external programs written in any language to control\na telephony channel, play audio, read DTMF digits, etc. by communicating with\nthe AGI protocol on *stdin* and *stdout*. As of \'1.6.0\', this channel will\nnot stop dialplan execution on hangup inside of this application. Dialplan\nexecution will continue normally, even upon hangup until the AGI application\nsignals a desire to stop (either by exiting or, in the case of a net script,\nby closing the connection). A locally executed AGI script will receive SIGHUP\non hangup from the channel except when using DeadAGI. A fast AGI server will\ncorrespondingly receive a HANGUP inline with the command dialog. Both of theses\nsignals may be disabled by setting the ${AGISIGHUP} channel variable to \'no\'\nbefore executing the AGI application.\nUse the CLI command \'agi show commands\' to list available agi commands.\nThis application sets the following channel variable upon completion:\n${AGISTATUS}: The status of the attempt to the run the AGI script text string,\none of:\n    SUCCESS\n    FAILURE\n    NOTFOUND\n    HANGUP\n\n[Syntax]\nDeadAGI(command[,arg1[,arg2[,...]]])\n\n[Arguments]\nNot available\n\n[See Also]\nAGI(), EAGI()\n',2),(35,'Dial','Attempt to connect to another device or endpoint and bridge the call. ','[Synopsis]\nAttempt to connect to another device or endpoint and bridge the call. \n\n[Description]\nThis application will place calls to one or more specified channels. As soon\nas one of the requested channels answers, the originating channel will be\nanswered, if it has not already been answered. These two channels will then\nbe active in a bridged call. All other channels that were requested will then\nbe hung up.\nUnless there is a timeout specified, the Dial application will wait\nindefinitely until one of the called channels answers, the user hangs up,\nor if all of the called channels are busy or unavailable. Dialplan executing\nwill continue if no requested channels can be called, or if the timeout\nexpires. This application will report normal termination if the originating\nchannel hangs up, or if the call is bridged and either of the parties in the\nbridge ends the call.\nIf the ${OUTBOUND_GROUP} variable is set, all peer channels created by this\napplication will be put into that group (as in Set(GROUP()=...). If the\n${OUTBOUND_GROUP_ONCE} variable is set, all peer channels created by this\napplication will be put into that group (as in Set(GROUP()=...). Unlike\nOUTBOUND_GROUP, however, the variable will be unset after use.\nThis application sets the following channel variables:\n${DIALEDTIME}: This is the time from dialing a channel until when it is\ndisconnected.\n${ANSWEREDTIME}: This is the amount of time for actual call.\n${DIALSTATUS}: This is the status of the call\n    CHANUNAVAIL\n    CONGESTION\n    NOANSWER\n    BUSY\n    ANSWER\n    CANCEL\n    DONTCALL: For the Privacy and Screening Modes. Will be set if the\n    called party chooses to send the calling party to the \'Go Away\' script.\n    TORTURE: For the Privacy and Screening Modes. Will be set if the\n    called party chooses to send the calling party to the \'torture\' script.\n    INVALIDARGS\n\n[Syntax]\nDial(Technology/Resource[&Technology2/Resource2[&...]][,timeout[,options[\n,URL]]])\n\n[Arguments]\nTechnology/Resource\n    Specification of the device(s) to dial.  These must be in the format\n    of \'Technology/Resource\', where <Technology> represents a particular\n    channel driver, and <Resource> represents a resource available to that\n    particular channel driver.\nTechnology2/Resource2\n    Optional extra devices to dial in parallel\n    If you need more then one enter them as Technology2/Resource2&Te\n    chnology3/Resourse3&.....\ntimeout\n    Specifies the number of seconds we attempt to dial the specified\n    devices\n    If not specified, this defaults to 136 years.\noptions\n    A(x): \n        x - The file to play to the called party\n    Play an announcement to the called party, where <x> is the prompt\n    to be played\n\n    a: Immediately answer the calling channel when the called channel\n    answers in all cases. Normally, the calling channel is answered when the\n    called channel answers, but when options such as A() and M() are used,\n    the calling channel is not answered until all actions on the called channel\n    (such as playing an announcement) are completed.  This option can be used\n    to answer the calling channel before doing anything on the called channel.\n    You will rarely need to use this option, the default behavior is adequate\n    in most cases.\n\n    C: Reset the call detail record (CDR) for this call.\n\n    c: If the Dial() application cancels this call, always set the flag\n    to tell the channel driver that the call is answered elsewhere.\n\n    d: Allow the calling user to dial a 1 digit extension while waiting\n    for a call to be answered. Exit to that extension if it exists in the\n    current context, or the context defined in the ${EXITCONTEXT} variable,\n    if it exists.\n\n    D([called][:calling[:progress]]): Send the specified DTMF strings\n    *after* the called party has answered, but before the call gets bridged.\n    The  <called> DTMF string is sent to the called party, and the  <calling>\n    DTMF string is sent to the calling party. Both arguments  can be used\n    alone.  If <progress> is specified, its DTMF is sent immediately after\n    receiving a PROGRESS message.\n\n    e: Execute the \'h\' extension for peer after the call ends\n\n    f([x]): If <x> is not provided, force the CallerID sent on a\n    call-forward or deflection to the dialplan extension of this Dial() using\n    a dialplan \'hint\'. For example, some PSTNs do not allow CallerID to be\n    set to anything other than the numbers assigned to you. If <x> is provided,\n    force the CallerID sent to <x>.\n\n    F([[context^]exten^]priority): When the caller hangs up, transfer\n    the called party to the specified destination and continue execution at\n    that location.\n\n    F: Proceed with dialplan execution at the next priority in the current\n    extension if the source channel hangs up.\n\n    g: Proceed with dialplan execution at the next priority in the current\n    extension if the destination channel hangs up.\n\n    G([[context^]exten^]priority): If the call is answered, transfer\n    the calling party to the specified <priority> and the called party to\n    the specified  <priority> plus one.\n    NOTE: You cannot use any additional action post answer options in\n    conjunction with this option.\n\n    h: Allow the called party to hang up by sending the \'*\' DTMF digit.\n\n    H: Allow the calling party to hang up by hitting the \'*\' DTMF digit.\n\n    i: Asterisk will ignore any forwarding requests it may receive on\n    this dial attempt.\n\n    I: Asterisk will ignore any connected line update requests or\n    redirecting party update requests it may receiveon this dial attempt.\n\n    k: Allow the called party to enable parking of the call by sending\n    the DTMF sequence defined for call parking in \"features.conf\".\n\n    K: Allow the calling party to enable parking of the call by sending\n    the DTMF sequence defined for call parking in \"features.conf\".\n\n    L(x[:y[:z]]): \n        x - Maximum call time, in milliseconds\n        y - Warning time, in milliseconds\n        z - Repeat time, in milliseconds\n    Limit the call to <x> milliseconds. Play a warning when <y> mill\n    iseconds are left. Repeat the warning every <z> milliseconds until time\n    expires.\n    This option is affected by the following variables:\n        ${LIMIT_PLAYAUDIO_CALLER}: \n            yes\n            no\n            If set, this variable causes Asterisk to play the\n            prompts to the caller.\n        ${LIMIT_PLAYAUDIO_CALLEE}: \n            yes\n            no\n            If set, this variable causes Asterisk to play the\n            prompts to the callee.\n        ${LIMIT_TIMEOUT_FILE}: \n            filename\n            If specified, <filename> specifies the sound prompt\n            to play when the timeout is reached. If not set, the time remaining\n            will be announced.\n        ${LIMIT_CONNECT_FILE}: \n            filename\n            If specified, <filename> specifies the sound prompt\n            to play when the call begins. If not set, the time remaining will\n            be announced.\n        ${LIMIT_WARNING_FILE}: \n            filename\n            If specified, <filename> specifies the sound prompt\n            to play as a warning when time <x> is reached. If not set, the\n            time remaining will be announced.\n\n    m([class]): Provide hold music to the calling party until a requested\n    channel answers. A specific music on hold <class> (as defined in \"mus\n    iconhold.conf\") can be specified.\n\n    M(macro[^arg[^...]]): \n        macro - Name of the macro that should be executed.\n        arg - Macro arguments\n    Execute the specified <macro> for the *called* channel  before\n    connecting to the calling channel. Arguments can be specified to the Macro\n    using \'^\' as a delimiter. The macro can set the variable ${MACRO_RESULT}\n    to specify the following actions after the macro is finished executing:\n        ${MACRO_RESULT}: If set, this action will be taken after\n        the macro finished executing.\n            ABORT: Hangup both legs of the call\n            CONGESTION: Behave as if line congestion was\n            encountered\n            BUSY: Behave as if a busy signal was encountered\n            CONTINUE: Hangup the called party and allow the\n            calling party to continue dialplan execution at the next priority\n            GOTO:<context>^<exten>^<priority>: Transfer the call\n            to the specified destination.\n    NOTE: You cannot use any additional action post answer options in\n    conjunction with this option. Also, pbx services are not run on the peer\n    (called) channel, so you will not be able to set timeouts via the TIMEOUT()\n    function in this macro.\n    WARNING!!!: Be aware of the limitations that macros have, specifically\n    with regards to use of the \'WaitExten\' application. For more information,\n    see the documentation for Macro()\n\n    n([delete]): \n        delete - With <delete> either not specified or set to \'0\',\n        the recorded introduction will not be deleted if the caller hangs\n        up while the remote party has not yet answered.\n        With <delete> set to \'1\', the introduction will always be\n        deleted.\n    This option is a modifier for the call screening/privacy mode. (See\n    the  \'p\' and \'P\' options.) It specifies that no introductions are to be\n    saved in the \"priv-callerintros\" directory.\n\n    N: This option is a modifier for the call screening/privacy mode.\n    It specifies that if Caller*ID is present, do not screen the call.\n\n    o([x]): If <x> is not provided, specify that the CallerID that was\n    present on the *calling* channel be stored as the CallerID on the *called*\n    channel. This was the behavior of Asterisk 1.0 and earlier. If <x> is\n    provided, specify the CallerID stored on the *called* channel. Note that\n    o(${CALLERID(all)}) is similar to option o without the parameter.\n\n    O([mode]): \n        mode - With <mode> either not specified or set to \'1\', the\n        originator hanging up will cause the phone to ring back immediately.\n        With <mode> set to \'2\', when the operator  flashes the trunk,\n        it will ring their phone back.\n    Enables *operator services* mode.  This option only works when\n    bridging a DAHDI channel to another DAHDI channel only. if specified on\n    non-DAHDI interfaces, it will be ignored. When the destination answers\n    (presumably an operator services station), the originator no longer has\n    control of their line. They may hang up, but the switch will not release\n    their line until the destination party (the operator) hangs up.\n\n    p: This option enables screening mode. This is basically Privacy\n    mode without memory.\n\n    P([x]): Enable privacy mode. Use <x> as the family/key in the AstDB\n    database if it is provided. The current extension is used if a database\n    family/key is not specified.\n\n    r([tone]): Default: Indicate ringing to the calling party, even if\n    the called party isn\'t actually ringing. Pass no audio to the calling\n    party until the called channel has answered.\n        tone - Indicate progress to calling party. Send audio \'tone\'\n        from indications.conf\n\n    S(x): Hang up the call <x> seconds *after* the called party has\n    answered the call.\n\n    s(x): Force the outgoing callerid tag parameter to be set to the\n    string <x>.\n    Works with the f option.\n\n    t: Allow the called party to transfer the calling party by sending\n    the DTMF sequence defined in \"features.conf\". This setting does not perform\n    policy enforcement on transfers initiated by other methods.\n\n    T: Allow the calling party to transfer the called party by sending\n    the DTMF sequence defined in \"features.conf\". This setting does not perform\n    policy enforcement on transfers initiated by other methods.\n\n    U(x[^arg[^...]]): \n        x - Name of the subroutine to execute via Gosub\n        arg - Arguments for the Gosub routine\n    Execute via Gosub the routine <x> for the *called* channel before\n    connecting to the calling channel. Arguments can be specified to the Gosub\n    using \'^\' as a delimiter. The Gosub routine can set the variable\n    ${GOSUB_RESULT} to specify the following actions after the Gosub returns.\n        ${GOSUB_RESULT}: \n            ABORT: Hangup both legs of the call.\n            CONGESTION: Behave as if line congestion was\n            encountered.\n            BUSY: Behave as if a busy signal was encountered.\n            CONTINUE: Hangup the called party and allow the\n            calling party to continue dialplan execution at the next priority.\n            GOTO:<context>^<exten>^<priority>: Transfer the call\n            to the specified priority. Optionally, an extension, or extension\n            and priority can be specified.\n    NOTE: You cannot use any additional action post answer options in\n    conjunction with this option. Also, pbx services are not run on the peer\n    (called) channel, so you will not be able to set timeouts via the TIMEOUT()\n    function in this routine.\n\n    u(x): \n        x - Force the outgoing callerid presentation indicator\n        parameter to be set to one of the values passed in <x>: \'allowed_\n        not_screened\' \'allowed_passed_screen\' \'allowed_failed_screen\' \'allowed\'\n        \'prohib_not_screened\' \'prohib_passed_screen\' \'prohib_failed_screen\'\n        \'prohib\' \'unavailable\'\n    Works with the f option.\n\n    w: Allow the called party to enable recording of the call by sending\n    the DTMF sequence defined for one-touch recording in \"features.conf\".\n\n    W: Allow the calling party to enable recording of the call by sending\n    the DTMF sequence defined for one-touch recording in \"features.conf\".\n\n    x: Allow the called party to enable recording of the call by sending\n    the DTMF sequence defined for one-touch automixmonitor in \"features.conf\".\n\n    X: Allow the calling party to enable recording of the call by sending\n    the DTMF sequence defined for one-touch automixmonitor in \"features.conf\".\n\n    z: On a call forward, cancel any dial timeout which has been set\n    for this call.\n\nURL\n    The optional URL will be sent to the called party if the channel\n    driver supports it.\n\n[See Also]\nNot available\n',2),(36,'Dictate','Virtual Dictation Machine. ','[Synopsis]\nVirtual Dictation Machine. \n\n[Description]\nStart dictation machine using optional <base_dir> for files.\n\n[Syntax]\nDictate([base_dir][,filename])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(37,'Directory','Provide directory of voicemail extensions. ','[Synopsis]\nProvide directory of voicemail extensions. \n\n[Description]\nThis application will present the calling channel with a directory of\nextensions from which they can search by name. The list of names and\ncorresponding extensions is retrieved from the voicemail configuration file,\n\"voicemail.conf\".\nThis application will immediately exit if one of the following DTMF digits\nare received and the extension to jump to exists:\n\'0\' - Jump to the \'o\' extension, if it exists.\n\'*\' - Jump to the \'a\' extension, if it exists.\n\n[Syntax]\nDirectory([vm-context][,dial-context[,options]])\n\n[Arguments]\nvm-context\n    This is the context within voicemail.conf to use for the Directory.\n    If not  specified and \'searchcontexts=no\' in  \"voicemail.conf\", then\n    \'default\'  will be assumed.\ndial-context\n    This is the dialplan context to use when looking for an extension\n    that the user has selected, or when jumping to the \'o\' or \'a\' extension.\n    If not specified, the current context will be used.\noptions\n    e: In addition to the name, also read the extension number to the\n    caller before presenting dialing options.\n\n    f(n): Allow the caller to enter the first name of a user in the\n    directory instead of using the last name.  If specified, the optional\n    number argument will be used for the number of characters the user should\n    enter.\n\n    l(n): Allow the caller to enter the last name of a user in the\n    directory.  This is the default.  If specified, the optional number\n    argument will be used for the number of characters the user should enter.\n\n    b(n):  Allow the caller to enter either the first or the last name\n    of a user in the directory.  If specified, the optional number argument\n    will be used for the number of characters the user should enter.\n\n    m: Instead of reading each name sequentially and asking for\n    confirmation, create a menu of up to 8 names.\n\n    n: Read digits even if the channel is not answered.\n\n    p(n): Pause for n milliseconds after the digits are typed.  This\n    is helpful for people with cellphones, who are not holding the receiver\n    to their ear while entering DTMF.\n\n    NOTE: Only one of the <f>, <l>, or <b> options may be specified.\n    *If more than one is specified*, then Directory will act as  if <b> was\n    specified.  The number of characters for the user to type defaults to\n    \'3\'.\n\n[See Also]\nNot available\n',2),(38,'DISA','Direct Inward System Access. ','[Synopsis]\nDirect Inward System Access. \n\n[Description]\nThe DISA, Direct Inward System Access, application allows someone from outside\nthe telephone switch (PBX) to obtain an *internal* system dialtone and to\nplace calls from it as if they were placing a call from within the switch.\nDISA plays a dialtone. The user enters their numeric passcode, followed by\nthe pound sign \'#\'. If the passcode is correct, the user is then given system\ndialtone within <context> on which a call may be placed. If the user enters\nan invalid extension and extension \'i\' exists in the specified <context>,\nit will be used. \nBe aware that using this may compromise the security of your PBX.\nThe arguments to this application (in \"extensions.conf\") allow either\nspecification of a single global <passcode> (that everyone uses), or individual\npasscodes contained in a file (<filename>).\nThe file that contains the passcodes (if used) allows a complete specification\nof all of the same arguments available on the command line, with the sole\nexception of the options. The file may contain blank lines, or comments\nstarting with \'#\' or \';\'.\n\n[Syntax]\nDISA(passcode|filename[,context[,cid[,mailbox[@context][,options]]]])\n\n[Arguments]\npasscode|filename\n    If you need to present a DISA dialtone without entering a password,\n    simply set <passcode> to \'no-password\'\n    You may specified a <filename> instead of a <passcode>, this filename\n    must contain individual passcodes\ncontext\n    Specifies the dialplan context in which the user-entered extension\n    will be matched. If no context is specified, the DISA application defaults\n    to the \'disa\' context. Presumably a normal system will have a special\n    context set up for DISA use with some or a lot of restrictions.\ncid\n    Specifies a new (different) callerid to be used for this call.\nmailbox\n    Will cause a stutter-dialtone (indication *dialrecall*) to be used,\n    if the specified mailbox contains any new messages.\noptions\n    n: The DISA application will not answer initially.\n\n    p: The extension entered will be considered complete when a \'#\' is\n    entered.\n\n\n[See Also]\nAuthenticate(), VMAuthenticate()\n',2),(39,'DumpChan','Dump Info About The Calling Channel. ','[Synopsis]\nDump Info About The Calling Channel. \n\n[Description]\nDisplays information on channel and listing of all channel variables. If\n<level> is specified, output is only displayed when the verbose level is\ncurrently set to that number or greater.\n\n[Syntax]\nDumpChan([level])\n\n[Arguments]\nlevel\n    Minimun verbose level\n\n[See Also]\nNoOp(), Verbose()\n',2),(40,'EAGI','Executes an EAGI compliant application. ','[Synopsis]\nExecutes an EAGI compliant application. \n\n[Description]\nUsing \'EAGI\' provides enhanced AGI, with incoming audio available out of band\non file descriptor 3.\nExecutes an Asterisk Gateway Interface compliant program on a channel. AGI\nallows Asterisk to launch external programs written in any language to control\na telephony channel, play audio, read DTMF digits, etc. by communicating with\nthe AGI protocol on *stdin* and *stdout*. As of \'1.6.0\', this channel will\nnot stop dialplan execution on hangup inside of this application. Dialplan\nexecution will continue normally, even upon hangup until the AGI application\nsignals a desire to stop (either by exiting or, in the case of a net script,\nby closing the connection). A locally executed AGI script will receive SIGHUP\non hangup from the channel except when using DeadAGI. A fast AGI server will\ncorrespondingly receive a HANGUP inline with the command dialog. Both of theses\nsignals may be disabled by setting the ${AGISIGHUP} channel variable to \'no\'\nbefore executing the AGI application.\nUse the CLI command \'agi show commands\' to list available agi commands.\nThis application sets the following channel variable upon completion:\n${AGISTATUS}: The status of the attempt to the run the AGI script text string,\none of:\n    SUCCESS\n    FAILURE\n    NOTFOUND\n    HANGUP\n\n[Syntax]\nEAGI(command[,arg1[,arg2[,...]]])\n\n[Arguments]\nNot available\n\n[See Also]\nAGI(), DeadAGI()\n',2),(41,'Echo','Echo audio, video, DTMF back to the calling party ','[Synopsis]\nEcho audio, video, DTMF back to the calling party \n\n[Description]\nEchos back any audio, video or DTMF frames read from the calling  channel\nback to itself. Note: If \'#\' detected application exits\n\n[Syntax]\nEcho()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(42,'EndWhile','End a while loop. ','[Synopsis]\nEnd a while loop. \n\n[Description]\nReturn to the previous called \'While()\'.\n\n[Syntax]\nEndWhile()\n\n[Arguments]\nNot available\n\n[See Also]\nWhile(), ExitWhile(), ContinueWhile()\n',2),(43,'Exec','Executes dialplan application. ','[Synopsis]\nExecutes dialplan application. \n\n[Description]\nAllows an arbitrary application to be invoked even when not hard coded into\nthe dialplan.  If the underlying application terminates the dialplan, or if\nthe application cannot be found, Exec will terminate the dialplan.\nTo invoke external applications, see the application System. If you would\nlike to catch any error instead, see TryExec.\n\n[Syntax]\nExec(appname(arguments))\n\n[Arguments]\nappname\n    Application name and arguments of the dialplan application to\n    execute.\n\n[See Also]\nNot available\n',2),(44,'ExecIf','Executes dialplan application, conditionally. ','[Synopsis]\nExecutes dialplan application, conditionally. \n\n[Description]\nIf <expr> is true, execute and return the result of <appiftrue(args)>.\nIf <expr> is true, but <appiftrue> is not found, then the application will\nreturn a non-zero value.\n\n[Syntax]\nExecIf(expression?appiftrue(args)[:appiffalse(args)])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(45,'ExecIfTime','Conditional application execution based on the current time. ','[Synopsis]\nConditional application execution based on the current time. \n\n[Description]\nThis application will execute the specified dialplan application, with optional\narguments, if the current time matches the given time specification.\n\n[Syntax]\nExecIfTime(times,weekdays,mdays,months[,timezone]?appname[(appargs)])\n\n[Arguments]\nNot available\n\n[See Also]\nExec(), TryExec()\n',2),(46,'ExitWhile','End a While loop. ','[Synopsis]\nEnd a While loop. \n\n[Description]\nExits a \'While()\' loop, whether or not the conditional has been satisfied\n.\n\n[Syntax]\nExitWhile()\n\n[Arguments]\nNot available\n\n[See Also]\nWhile(), EndWhile(), ContinueWhile()\n',2),(47,'ExtenSpy','Listen to a channel, and optionally whisper into it. ','[Synopsis]\nListen to a channel, and optionally whisper into it. \n\n[Description]\nThis application is used to listen to the audio from an Asterisk channel.\nThis includes  the audio coming in and out of the channel being spied on.\nOnly channels created by outgoing calls for the specified extension will be\nselected for spying. If the optional context is not supplied,  the current\nchannel\'s context will be used.\nWhile spying, the following actions may be performed:\n - Dialing \'#\' cycles the volume level.\n - Dialing \'*\' will stop spying and look for another channel to spy on.\nNOTE: The <X> option supersedes the three features above in that if a valid\nsingle digit extension exists in the correct context ChanSpy will exit to\nit. This also disables choosing a channel based on \'chanprefix\' and a digit\nsequence.\n\n[Syntax]\nExtenSpy(exten[@context][,options])\n\n[Arguments]\nexten\n    Specify extension.\ncontext\n    Optionally specify a context, defaults to \'default\'.\noptions\n    b: Only spy on channels involved in a bridged call.\n\n    B: Instead of whispering on a single channel barge in on both channels\n    involved in the call.\n\n    c(digit): \n        digit - Specify a DTMF digit that can be used to spy on the\n        next available channel.\n\n    d: Override the typical numeric DTMF functionality and instead use\n    DTMF to switch between spy modes.\n        4 - spy mode\n        5 - whisper mode\n        6 - barge mode\n\n    e(ext): Enable *enforced* mode, so the spying channel can only monitor\n    extensions whose name is in the <ext> : delimited  list.\n\n    E: Exit when the spied-on channel hangs up.\n\n    g(grp): \n        grp - Only spy on channels in which one or more of the groups\n        listed in <grp> matches one or more groups from the ${SPYGROUP}\n        variable set on the channel to be spied upon.\n    NOTE: both <grp> and ${SPYGROUP} can contain  either a single group\n    or a colon-delimited list of groups, such as \'sales:support:accounting\'.\n\n    n([mailbox][@context]): Say the name of the person being spied on\n    if that person has recorded his/her name. If a context is specified, then\n    that voicemail context will be searched when retrieving the name, otherwise\n    the \'default\' context be used when searching for the name (i.e. if SIP/1000\n    is the channel being spied on and no mailbox is specified, then \'1000\'\n    will be used when searching for the name).\n\n    o: Only listen to audio coming from this channel.\n\n    q: Don\'t play a beep when beginning to spy on a channel, or speak\n    the selected channel name.\n\n    r([basename]): Record the session to the monitor spool directory.\n    An optional base for the filename  may be specified. The default is\n    \'chanspy\'.\n\n    s: Skip the playback of the channel type (i.e. SIP, IAX, etc) when\n    speaking the selected channel name.\n\n    S: Stop when there are no more extensions left to spy on.\n\n    v([value]): Adjust the initial volume in the range from \'-4\'  to\n    \'4\'. A negative value refers to a quieter setting.\n\n    w: Enable \'whisper\' mode, so the spying channel can talk to the\n    spied-on channel.\n\n    W: Enable \'private whisper\' mode, so the spying channel can talk\n    to the spied-on channel but cannot listen to that channel.\n\n    x(digit): \n        digit - Specify a DTMF digit that can be used to exit the\n        application.\n\n    X: Allow the user to exit ChanSpy to a valid single digit numeric\n    extension in the current context or the context specified by the\n    ${SPY_EXIT_CONTEXT} channel variable. The name of the last channel that\n    was spied on will be stored in the ${SPY_CHANNEL} variable.\n\n\n[See Also]\nChanSpy()\n',2),(48,'ExternalIVR','Interfaces with an external IVR application. ','[Synopsis]\nInterfaces with an external IVR application. \n\n[Description]\nEither forks a process to run given command or makes a socket to connect to\ngiven host and starts a generator on the channel. The generator\'s play list\nis controlled by the external application, which can add and clear entries\nvia simple commands issued over its stdout. The external application will\nreceive all DTMF events received on the channel, and notification if the\nchannel is hung up. The received on the channel, and notification if the\nchannel is hung up. The application will not be forcibly terminated when the\nchannel is hung up. For more information see \"doc/AST.pdf\".\n\n[Syntax]\nExternalIVR(command|ivr://host([arg1][,arg2[,...]])[,options])\n\n[Arguments]\noptions\n    n: Tells ExternalIVR() not to answer the channel.\n\n    i: Tells ExternalIVR() not to send a hangup and exit when the channel\n    receives a hangup, instead it sends an \'I\' informative message meaning\n    that the external application MUST hang up the call with an \'H\' command.\n\n    d: Tells ExternalIVR() to run on a channel that has been hung up\n    and will not look for hangups. The external application must exit with\n    an \'E\' command.\n\n\n[See Also]\nNot available\n',2),(49,'Festival','Say text to the user. ','[Synopsis]\nSay text to the user. \n\n[Description]\nConnect to Festival, send the argument, get back the waveform, play it to\nthe user, allowing any given interrupt keys to immediately terminate and return\nthe value, or \'any\' to allow any number back (useful in dialplan).\n\n[Syntax]\nFestival(text[,intkeys])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(50,'Flash','Flashes a DAHDI Trunk. ','[Synopsis]\nFlashes a DAHDI Trunk. \n\n[Description]\nPerforms a flash on a DAHDI trunk. This can be used to access features provided\non an incoming analogue circuit such as conference and call waiting. Use with\nSendDTMF() to perform external transfers.\n\n[Syntax]\nFlash()\n\n[Arguments]\nNot available\n\n[See Also]\nSendDTMF()\n',2),(51,'FollowMe','Find-Me/Follow-Me application. ','[Synopsis]\nFind-Me/Follow-Me application. \n\n[Description]\nThis application performs Find-Me/Follow-Me functionality for the caller as\ndefined in the profile matching the <followmeid> parameter in \"followme.conf\".\nIf the specified <followmeid> profile doesn\'t exist in \"followme.conf\",\nexecution will be returned to the dialplan and call execution will continue\nat the next priority.\nReturns -1 on hangup.\n\n[Syntax]\nFollowMe(followmeid[,options])\n\n[Arguments]\noptions\n    s: Playback the incoming status message prior to starting the\n    follow-me step(s)\n\n    a: Record the caller\'s name so it can be announced to the callee\n    on each step.\n\n    n: Playback the unreachable status message if we\'ve run out of steps\n    to reach the or the callee has elected not to be reachable.\n\n    N: Don\'t answer the incoming call until we\'re ready to connect the\n    caller or give up. This will disable all the other options while implicitly\n    turning on the \'d\' option.\n\n    d: Disable the \'Please hold while we try to connect your call\'\n    announcement.\n\n    l: Disable local call optimization so that applications with audio\n    hooks between the local bridge don\'t get dropped when the calls get joined\n    directly.\n\n\n[See Also]\nNot available\n',2),(52,'ForkCDR','Forks the Call Data Record. ','[Synopsis]\nForks the Call Data Record. \n\n[Description]\n Causes the Call Data Record to fork an additional cdr record starting from\n the time of the fork call. This new cdr record will be linked to end of the\n list of cdr records attached to the channel.	The original CDR has a LOCKED\n flag set, which forces most cdr operations to skip it, except for the\n functions that set the answer and end times, which ignore the LOCKED flag.\n This allows all the cdr records in the channel to be \'ended\' together when\n the channel is closed.\nThe CDR() func (when setting CDR values) normally ignores the LOCKED flag\nalso, but has options to vary its behavior. The \'T\' option (described below),\ncan override this behavior, but beware the risks.\nFirst, this app finds the last cdr record in the list, and makes a copy of\nit. This new copy will be the newly forked cdr record. Next, this new record\nis linked to the end of the cdr record list. Next, The new cdr record is RESET\n(unless you use an option to prevent this)\nThis means that:\n   1. All flags are unset on the cdr record\n   2. the start, end, and answer times are all set to zero.\n   3. the billsec and duration fields are set to zero.\n   4. the start time is set to the current time.\n   5. the disposition is set to NULL.\nNext, unless you specified the \'v\' option, all variables will be removed\nfrom the original cdr record. Thus, the \'v\' option allows any CDR variables\nto be replicated to all new forked cdr records. Without the \'v\' option, the\nvariables on the original are effectively moved to the new forked cdr record.\nNext, if the \'s\' option is set, the provided variable and value are set on\nthe original cdr record.\nNext, if the \'a\' option is given, and the original cdr record has an answer\ntime set, then the new forked cdr record will have its answer time set to\nits start time. If the old answer time were carried forward, the answer time\nwould be earlier than the start time, giving strange duration and billsec\ntimes.\nIf the \'d\' option was specified, the disposition is copied from the original\ncdr record to the new forked cdr. If the \'D\' option was specified, the\ndestination channel field in the new forked CDR is erased. If the \'e\' option\nwas specified, the \'end\' time for the original cdr record is set to the current\ntime. Future hang-up or ending events will not override this time stamp. If\nthe \'A\' option is specified, the original cdr record will have it ANS_LOCKED\nflag set, which prevent future answer events from updating the original cdr\nrecord\'s disposition. Normally, an \'ANSWERED\' event would mark all cdr records\nin the chain as \'ANSWERED\'. If the \'T\' option is specified, the original cdr\nrecord will have its \'DONT_TOUCH\' flag set, which will force the cdr_answer,\ncdr_end, and cdr_setvar functions to leave that cdr record alone.\nAnd, last but not least, the original cdr record has its LOCKED flag set.\nAlmost all internal CDR functions (except for the funcs that set the end,\nand answer times, and set a variable) will honor this flag and leave a LOCKED\ncdr record alone. This means that the newly created forked cdr record will\nbe affected by events transpiring within Asterisk, with the previously noted\nexceptions.\n\n[Syntax]\nForkCDR([options])\n\n[Arguments]\noptions\n    a: Update the answer time on the NEW CDR just after it\'s been inited.\n    The new CDR may have been answered already. The reset that forkcdr does\n    will erase the answer time. This will bring it back, but the answer time\n    will be a copy of the fork/start time. It will only do this if the initial\n    cdr was indeed already answered.\n\n    A: Lock the original CDR against the answer time being updated. This\n    will allow the disposition on the original CDR to remain the same.\n\n    d: Copy the disposition forward from the old cdr, after the init.\n\n    D: Clear the \'dstchannel\' on the new CDR after reset.\n\n    e: End the original CDR. Do this after all the necessary data is\n    copied from the original CDR to the new forked CDR.\n\n    r: Do *NOT* reset the new cdr.\n\n    s(name=val): Set the CDR var <name> in the original CDR, with value\n    <val>.\n\n    T: Mark the original CDR with a DONT_TOUCH flag. setvar, answer,\n    and end cdr funcs will obey this flag; normally they don\'t honor the LOCKED\n    flag set on the original CDR record.\n    NOTE: Using this flag may cause CDR\'s not to have their end times\n    updated! It is suggested that if you specify this flag, you might wish\n    to use the \'e\' flag as well!.\n\n    v: When the new CDR is forked, it gets a copy of the vars attached\n    to the current CDR. The vars attached to the original CDR are removed\n    unless this option is specified.\n\n\n[See Also]\nCDR, NoCDR(), ResetCDR()\n',2),(53,'GetCPEID','Get ADSI CPE ID. ','[Synopsis]\nGet ADSI CPE ID. \n\n[Description]\nObtains and displays ADSI CPE ID and other information in order to properly\nsetup \"dahdi.conf\" for on-hook operations.\n\n[Syntax]\nGetCPEID()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(54,'Gosub','Jump to label, saving return address. ','[Synopsis]\nJump to label, saving return address. \n\n[Description]\nJumps to the label specified, saving the return address.\n\n[Syntax]\nGosub([[context,]exten,]priority[(arg1[,...][,argN])])\n\n[Arguments]\nNot available\n\n[See Also]\nGosubIf(), Macro(), Goto(), Return(), StackPop()\n',2),(55,'GosubIf','Conditionally jump to label, saving return address. ','[Synopsis]\nConditionally jump to label, saving return address. \n\n[Description]\nIf the condition is true, then jump to labeliftrue.  If false, jumps to\nlabeliffalse, if specified.  In either case, a jump saves the return point\nin the dialplan, to be returned to with a Return.\n\n[Syntax]\nGosubIf(condition?[labeliftrue[(arg1[,...][,argN])]][:labeliffalse[(arg1[\n,...][,argN])]])\n\n[Arguments]\nNot available\n\n[See Also]\nGosub(), Return(), MacroIf(), IF, GotoIf()\n',2),(56,'Goto','Jump to a particular priority, extension, or context. ','[Synopsis]\nJump to a particular priority, extension, or context. \n\n[Description]\nThis application will set the current context, extension, and priority in\nthe channel structure. After it completes, the pbx engine will continue\ndialplan execution at the specified location. If no specific <extension>,\nor <extension> and <context>, are specified, then this application will just\nset the specified <priority> of the current extension.\nAt least a <priority> is required as an argument, or the goto will return\na \'-1\',	and the channel and call will be terminated.\nIf the location that is put into the channel information is bogus, and\nasterisk cannot find that location in the dialplan, then the execution engine\nwill try to find and execute the code in the \'i\' (invalid) extension in the\ncurrent context. If that does not exist, it will try to execute the \'h\'\nextension. If neither the \'h\' nor \'i\' extensions have been defined, the channel\nis hung up, and the execution of instructions on the channel is terminated.\nWhat this means is that, for example, you specify a context that does not\nexist, then it will not be possible to find the \'h\' or \'i\' extensions, and\nthe call will terminate!\n\n[Syntax]\nGoto([[context,]extensions,]priority)\n\n[Arguments]\nNot available\n\n[See Also]\nGotoIf(), GotoIfTime(), Gosub(), Macro()\n',2),(57,'GotoIf','Conditional goto. ','[Synopsis]\nConditional goto. \n\n[Description]\nThis application will set the current context, extension, and priority in\nthe channel structure based on the evaluation of the given condition. After\nthis application completes, the pbx engine will continue dialplan execution\nat the specified location in the dialplan. The labels are specified with the\nsame syntax as used within the Goto application. If the label chosen by the\ncondition is omitted, no jump is performed, and the execution passes to the\nnext instruction. If the target location is bogus, and does not exist, the\nexecution engine will try to find and execute the code in the \'i\' (invalid)\nextension in the current context. If that does not exist, it will try to\nexecute the \'h\' extension. If neither the \'h\' nor \'i\' extensions have been\ndefined, the channel is hung up, and the execution of instructions on the\nchannel is terminated. Remember that this command can set the current context,\nand if the context specified does not exist, then it will not be able to find\nany \'h\' or \'i\' extensions there, and the channel and call will both be\nterminated!.\n\n[Syntax]\nGotoIf(condition?[labeliftrue][:labeliffalse])\n\n[Arguments]\nlabeliftrue\n    Continue at <labeliftrue> if the condition is true.\nlabeliffalse\n    Continue at <labeliffalse> if the condition is false.\n\n[See Also]\nGoto(), GotoIfTime(), GosubIf(), MacroIf()\n',2),(58,'GotoIfTime','Conditional Goto based on the current time. ','[Synopsis]\nConditional Goto based on the current time. \n\n[Description]\nThis application will set the context, extension, and priority in the channel\nstructure based on the evaluation of the given time specification. After this\napplication completes, the pbx engine will continue dialplan execution at\nthe specified location in the dialplan. If the current time is within the\ngiven time specification, the channel will continue at <labeliftrue>. Otherwise\nthe channel will continue at <labeliffalse>. If the label chosen by the\ncondition is omitted, no jump is performed, and execution passes to the next\ninstruction. If the target jump location is bogus, the same actions would\nbe taken as for \'Goto\'. Further information on the time specification can\nbe found in examples illustrating how to do time-based context includes in\nthe dialplan.\n\n[Syntax]\nGotoIfTime(times,weekdays,mdays,months[,timezone]?[labeliftrue][:labeliff\nalse])\n\n[Arguments]\nNot available\n\n[See Also]\nGotoIf(), IFTIME, TESTTIME\n',2),(59,'Hangup','Hang up the calling channel. ','[Synopsis]\nHang up the calling channel. \n\n[Description]\nThis application will hang up the calling channel.\n\n[Syntax]\nHangup([causecode])\n\n[Arguments]\ncausecode\n    If a <causecode> is given the channel\'s hangup cause will be set\n    to the given value.\n\n[See Also]\nAnswer(), Busy(), Congestion()\n',2),(60,'IAX2Provision','Provision a calling IAXy with a given template. ','[Synopsis]\nProvision a calling IAXy with a given template. \n\n[Description]\nProvisions the calling IAXy (assuming the calling entity is in fact an IAXy)\nwith the given <template>. Returns \'-1\' on error or \'0\' on success.\n\n[Syntax]\nIAX2Provision([template])\n\n[Arguments]\ntemplate\n    If not specified, defaults to \'default\'.\n\n[See Also]\nNot available\n',2),(61,'ICES','Encode and stream using \'ices\'. ','[Synopsis]\nEncode and stream using \'ices\'. \n\n[Description]\nStreams to an icecast server using ices (available separately). A configuration\nfile must be supplied for ices (see contrib/asterisk-ices.xml).\nNOTE: ICES version 2 client and server required.\n\n[Syntax]\nICES(config)\n\n[Arguments]\nconfig\n    ICES configuration file.\n\n[See Also]\nNot available\n',2),(62,'ImportVar','Import a variable from a channel into a new variable. ','[Synopsis]\nImport a variable from a channel into a new variable. \n\n[Description]\nThis application imports a <variable> from the specified <channel> (as opposed\nto the current one) and stores it as a variable (<newvar>) in the current\nchannel (the channel that is calling this application). Variables created\nby this application have the same inheritance properties as those created\nwith the \'Set\' application.\n\n[Syntax]\nImportVar(newvar=channelname,variable)\n\n[Arguments]\nNot available\n\n[See Also]\nSet()\n',2),(63,'Incomplete','Returns AST_PBX_INCOMPLETE value. ','[Synopsis]\nReturns AST_PBX_INCOMPLETE value. \n\n[Description]\nSignals the PBX routines that the previous matched extension is incomplete\nand that further input should be allowed before matching can be considered\nto be complete.  Can be used within a pattern match when certain criteria\nwarrants a longer match.\n\n[Syntax]\nIncomplete([n])\n\n[Arguments]\nn\n    If specified, then Incomplete will not attempt to answer the channel\n    first.\n    NOTE: Most channel types need to be in Answer state in order to\n    receive DTMF.\n\n[See Also]\nNot available\n',2),(64,'Log','Send arbitrary text to a selected log level. ','[Synopsis]\nSend arbitrary text to a selected log level. \n\n[Description]\nSends an arbitrary text message to a selected log level.\n\n[Syntax]\nLog(level,message)\n\n[Arguments]\nlevel\n    Level must be one of \'ERROR\', \'WARNING\', \'NOTICE\', \'DEBUG\', \'VERBOSE\'\n    or \'DTMF\'.\nmessage\n    Output text message.\n\n[See Also]\nNot available\n',2),(65,'Macro','Macro Implementation. ','[Synopsis]\nMacro Implementation. \n\n[Description]\nExecutes a macro using the context macro-<name>, jumping to the \'s\' extension\nof that context and executing each step, then returning when the steps end.\nThe calling extension, context, and priority are stored in ${MACRO_EXTEN},\n${MACRO_CONTEXT} and ${MACRO_PRIORITY} respectively. Arguments become ${ARG1},\n${ARG2}, etc in the macro context.\nIf you Goto out of the Macro context, the Macro will terminate and control\nwill be returned at the location of the Goto.\nIf ${MACRO_OFFSET} is set at termination, Macro will attempt to continue\nat priority MACRO_OFFSET + N + 1 if such a step exists, and N + 1 otherwise.\nWARNING!!!: Because of the way Macro is implemented (it executes the\npriorities contained within it via sub-engine), and a fixed per-thread memory\nstack allowance, macros are limited to 7 levels of nesting (macro calling\nmacro calling macro, etc.); It may be possible that stack-intensive\napplications in deeply nested macros could cause asterisk to crash earlier\nthan this limit. It is advised that if you need to deeply nest macro calls,\nthat you use the Gosub application (now allows arguments like a Macro) with\nexplict Return() calls instead.\nWARNING!!!: Use of the application \'WaitExten\' within a macro will not\nfunction as expected. Please use the \'Read\' application in order to read DTMF\nfrom a channel currently executing a macro.\n\n[Syntax]\nMacro(name[,arg1[,arg2[,...]]])\n\n[Arguments]\nname\n    The name of the macro\n\n[See Also]\nMacroExit(), Goto(), Gosub()\n',2),(66,'MacroExclusive','Exclusive Macro Implementation. ','[Synopsis]\nExclusive Macro Implementation. \n\n[Description]\nExecutes macro defined in the context macro-<name>. Only one call at a time\nmay run the macro. (we\'ll wait if another call is busy executing in the Macro)\nArguments and return values as in application Macro()\nWARNING!!!: Use of the application \'WaitExten\' within a macro will not\nfunction as expected. Please use the \'Read\' application in order to read DTMF\nfrom a channel currently executing a macro.\n\n[Syntax]\nMacroExclusive(name[,arg1[,arg2[,...]]])\n\n[Arguments]\nname\n    The name of the macro\n\n[See Also]\nMacro()\n',2),(67,'MacroExit','Exit from Macro. ','[Synopsis]\nExit from Macro. \n\n[Description]\nCauses the currently running macro to exit as if it had ended normally by\nrunning out of priorities to execute. If used outside a macro, will likely\ncause unexpected behavior.\n\n[Syntax]\nMacroExit()\n\n[Arguments]\nNot available\n\n[See Also]\nMacro()\n',2),(68,'MacroIf','Conditional Macro implementation. ','[Synopsis]\nConditional Macro implementation. \n\n[Description]\nExecutes macro defined in <macroiftrue> if <expr> is true (otherwise <mac\nroiffalse> if provided)\nArguments and return values as in application Macro()\nWARNING!!!: Use of the application \'WaitExten\' within a macro will not\nfunction as expected. Please use the \'Read\' application in order to read DTMF\nfrom a channel currently executing a macro.\n\n[Syntax]\nMacroIf(expr?macroiftrue[,arg1[,...]][:macroiffalse[,arg1[,...]]])\n\n[Arguments]\nNot available\n\n[See Also]\nGotoIf(), GosubIf(), IF\n',2),(69,'MailboxExists','Check to see if Voicemail mailbox exists. ','[Synopsis]\nCheck to see if Voicemail mailbox exists. \n\n[Description]\nCheck to see if the specified <mailbox> exists. If no voicemail <context>\nis specified, the \'default\' context will be used.\nThis application will set the following channel variable upon completion:\n${VMBOXEXISTSSTATUS}: This will contain the status of the execution of the\nMailboxExists application. Possible values include:\n    SUCCESS\n    FAILED\n\n[Syntax]\nMailboxExists(mailbox[@context][,options])\n\n[Arguments]\noptions\n    None options.\n\n[See Also]\nNot available\n',2),(74,'MessageSend','Send a text message. ','[Synopsis]\nSend a text message. \n\n[Description]\nSend a text message.  The body of the message that will be sent is what is\ncurrently set to \'MESSAGE(body)\'.\nThis application sets the following channel variables:\n${MESSAGE_SEND_STATUS}: This is the time from dialing a channel until when\nit is disconnected.\n    INVALID_PROTOCOL: No handler for the technology part of the URI was\n    found.\n    INVALID_URI: The protocol handler reported that the URI was not valid.\n    SUCCESS: Successfully passed on to the protocol handler, but delivery\n    has not necessarily been guaranteed.\n    FAILURE: The protocol handler reported that it was unabled to deliver\n    the message for some reason.\n\n[Syntax]\nMessageSend(to[,from])\n\n[Arguments]\nto\n    A To URI for the message.\nfrom\n    A From URI for the message if needed for the message technology being\n    used to send this message.\n\n[See Also]\nNot available\n',2),(75,'Milliwatt','Generate a Constant 1004Hz tone at 0dbm (mu-law). ','[Synopsis]\nGenerate a Constant 1004Hz tone at 0dbm (mu-law). \n\n[Description]\nPrevious versions of this application generated the tone at 1000Hz.  If for\nsome reason you would prefer that behavior, supply the \'o\' option to get the\nold behavior.\n\n[Syntax]\nMilliwatt([options])\n\n[Arguments]\noptions\n    o: Generate the tone at 1000Hz like previous version.\n\n\n[See Also]\nNot available\n',2),(76,'MinivmAccMess','Record account specific messages. ','[Synopsis]\nRecord account specific messages. \n\n[Description]\nThis application is part of the Mini-Voicemail system, configured in \"min\nivm.conf\".\nUse this application to record account specific audio/video messages for\nbusy, unavailable and temporary messages.\nAccount specific directories will be created if they do not exist.\n${MVM_ACCMESS_STATUS}: This is the result of the attempt to record the\nspecified greeting.\n\'FAILED\' is set if the file can\'t be created.\n    SUCCESS\n    FAILED\n\n[Syntax]\nMinivmAccMess(username@domain[,options])\n\n[Arguments]\nusername\n    Voicemail username\ndomain\n    Voicemail domain\noptions\n    u: Record the \'unavailable\' greeting.\n\n    b: Record the \'busy\' greeting.\n\n    t: Record the temporary greeting.\n\n    n: Account name.\n\n\n[See Also]\nNot available\n',2),(77,'MinivmDelete','Delete Mini-Voicemail voicemail messages. ','[Synopsis]\nDelete Mini-Voicemail voicemail messages. \n\n[Description]\nThis application is part of the Mini-Voicemail system, configured in \"min\nivm.conf\".\nIt deletes voicemail file set in MVM_FILENAME or given filename.\n${MVM_DELETE_STATUS}: This is the status of the delete operation.\n    SUCCESS\n    FAILED\n\n[Syntax]\nMinivmDelete(filename)\n\n[Arguments]\nfilename\n    File to delete\n\n[See Also]\nNot available\n',2),(78,'MinivmGreet','Play Mini-Voicemail prompts. ','[Synopsis]\nPlay Mini-Voicemail prompts. \n\n[Description]\nThis application is part of the Mini-Voicemail system, configured in mini\nvm.conf.\nMinivmGreet() plays default prompts or user specific prompts for an account.\nBusy and unavailable messages can be choosen, but will be overridden if a\ntemporary message exists for the account.\n${MVM_GREET_STATUS}: This is the status of the greeting playback.\n    SUCCESS\n    USEREXIT\n    FAILED\n\n[Syntax]\nMinivmGreet(username@domain[,options])\n\n[Arguments]\nusername\n    Voicemail username\ndomain\n    Voicemail domain\noptions\n    b: Play the \'busy\' greeting to the calling party.\n\n    s: Skip the playback of instructions for leaving a message to the\n    calling party.\n\n    u: Play the \'unavailable\' greeting.\n\n\n[See Also]\nNot available\n',2),(79,'MinivmMWI','Send Message Waiting Notification to subscriber(s) of mailbox. ','[Synopsis]\nSend Message Waiting Notification to subscriber(s) of mailbox. \n\n[Description]\nThis application is part of the Mini-Voicemail system, configured in \"min\nivm.conf\".\nMinivmMWI is used to send message waiting indication to any devices whose\nchannels have subscribed to the mailbox passed in the first parameter.\n\n[Syntax]\nMinivmMWI(username@domain,urgent,new,old)\n\n[Arguments]\nusername\n    Voicemail username\ndomain\n    Voicemail domain\nurgent\n    Number of urgent messages in mailbox.\nnew\n    Number of new messages in mailbox.\nold\n    Number of old messages in mailbox.\n\n[See Also]\nNot available\n',2),(80,'MinivmNotify','Notify voicemail owner about new messages. ','[Synopsis]\nNotify voicemail owner about new messages. \n\n[Description]\nThis application is part of the Mini-Voicemail system, configured in mini\nvm.conf.\nMiniVMnotify forwards messages about new voicemail to e-mail and pager. If\nthere\'s no user account for that address, a temporary account will be used\nwith default options (set in \"minivm.conf\").\nIf the channel variable ${MVM_COUNTER} is set, this will be used in the \nmessage file name and available in the template for the message.\nIf no template is given, the default email template will be used to send\nemail and default pager template to send paging message (if the user account\nis configured with a paging address.\n${MVM_NOTIFY_STATUS}: This is the status of the notification attempt\n    SUCCESS\n    FAILED\n\n[Syntax]\nMinivmNotify(username@domain[,options])\n\n[Arguments]\nusername\n    Voicemail username\ndomain\n    Voicemail domain\noptions\n    template: E-mail template to use for voicemail notification\n\n\n[See Also]\nNot available\n',2),(81,'MinivmRecord','Receive Mini-Voicemail and forward via e-mail. ','[Synopsis]\nReceive Mini-Voicemail and forward via e-mail. \n\n[Description]\nThis application is part of the Mini-Voicemail system, configured in \"min\nivm.conf\"\nMiniVM records audio file in configured format and forwards message to e-mail\nand pager.\nIf there\'s no user account for that address, a temporary account will be\nused with default options.\nThe recorded file name and path will be stored in ${MVM_FILENAME} and the\nduration of the message will be stored in ${MVM_DURATION}\nNOTE: If the caller hangs up after the recording, the only way to send the\nmessage and clean up is to execute in the \'h\' extension. The application will\nexit if any of the following DTMF digits are received and the requested\nextension exist in the current context.\n${MVM_RECORD_STATUS}: This is the status of the record operation\n    SUCCESS\n    USEREXIT\n    FAILED\n\n[Syntax]\nMinivmRecord(username@domain[,options])\n\n[Arguments]\nusername\n    Voicemail username\ndomain\n    Voicemail domain\noptions\n    0: Jump to the \'o\' extension in the current dialplan context.\n\n    *: Jump to the \'a\' extension in the current dialplan context.\n\n    g([gain]): \n        gain - Amount of gain to use\n    Use the specified amount of gain when recording the voicemail message.\n    The units are whole-number decibels (dB).\n\n\n[See Also]\nNot available\n',2),(82,'MixMonitor','Record a call and mix the audio during the recording.  Use of StopMixMonitoris required to guarantee the audio file is available for processing duringdialplan execution. ','[Synopsis]\nRecord a call and mix the audio during the recording.  Use of StopMixMonitoris required to guarantee the audio file is available for processing duringdialplan execution. \n\n[Description]\nRecords the audio on the current channel to the specified file.\n${MIXMONITOR_FILENAME}: Will contain the filename used to record.\n\n[Syntax]\nMixMonitor(filename.extension[,options[,command]])\n\n[Arguments]\nfilename\n    If <filename> is an absolute path, uses that path, otherwise creates\n    the file in the configured monitoring directory from \"asterisk.conf.\"\noptions\n    a: Append to the file instead of overwriting it.\n\n    b: Only save audio to the file while the channel is bridged.\n    NOTE: Does not include conferences or sounds played to each bridged\n    party\n    NOTE: If you utilize this option inside a Local channel, you must\n    make sure the Local channel is not optimized away. To do this, be sure\n    to call your Local channel with the \'/n\' option. For example: Dial(Lo\n    cal/start@mycontext/n)\n\n    v(x): Adjust the *heard* volume by a factor of <x> (range \'-4\' to\n    \'4\')\n\n    V(x): Adjust the *spoken* volume by a factor of <x> (range \'-4\' to\n    \'4\')\n\n    W(x): Adjust both, *heard and spoken* volumes by a factor of <x>\n    (range \'-4\' to \'4\')\n\n    r(file): Use the specified file to record the *receive* audio feed.\n    Like with the basic filename argument, if an absolute path isn\'t given,\n    it will create the file in the configured monitoring directory.\n\n    t(file): Use the specified file to record the *transmit* audio feed.\n    Like with the basic filename argument, if an absolute path isn\'t given,\n    it will create the file in the configured monitoring directory.\n\ncommand\n    Will be executed when the recording is over.\n    Any strings matching \'^{X}\' will be unescaped to ${X}.\n    All variables will be evaluated at the time MixMonitor is called\n    .\n\n[See Also]\nMonitor(), StopMixMonitor(), PauseMonitor(), UnpauseMonitor()\n',2),(83,'Monitor','Monitor a channel. ','[Synopsis]\nMonitor a channel. \n\n[Description]\nUsed to start monitoring a channel. The channel\'s input and output voice\npackets are logged to files until the channel hangs up or monitoring is stopped\nby the StopMonitor application.\nBy default, files are stored to \"/var/spool/asterisk/monitor/\". Returns \'-1\'\nif monitor files can\'t be opened or if the channel is already monitored,\notherwise \'0\'.\n\n[Syntax]\nMonitor([file_format[:urlbase]][,fname_base[,options]])\n\n[Arguments]\nfile_format\n    optional, if not set, defaults to \'wav\'\nfname_base\n    if set, changes the filename used to the one specified.\noptions\n    m: when the recording ends mix the two leg files into one and delete\n    the two leg files. If the variable ${MONITOR_EXEC} is set, the application\n    referenced in it will be executed instead of soxmix/sox and the raw leg\n    files will NOT be deleted automatically. soxmix/sox or ${MONITOR_EXEC}\n    is handed 3 arguments, the two leg files and a target mixed file name\n    which is the same as the leg file names only without the in/out designator.\n    If ${MONITOR_EXEC_ARGS} is set, the contents will be passed on as\n    additional arguments to ${MONITOR_EXEC}. Both ${MONITOR_EXEC} and the\n    Mix flag can be set from the administrator interface.\n\n    b: Don\'t begin recording unless a call is bridged to another channel.\n\n    i: Skip recording of input stream (disables \'m\' option).\n\n    o: Skip recording of output stream (disables \'m\' option).\n\n\n[See Also]\nStopMonitor()\n',2),(84,'Morsecode','Plays morse code. ','[Synopsis]\nPlays morse code. \n\n[Description]\nPlays the Morse code equivalent of the passed string.\nThis application uses the following variables:\n${MORSEDITLEN}: Use this value in (ms) for length of dit\n${MORSETONE}: The pitch of the tone in (Hz), default is 800\n\n[Syntax]\nMorsecode(string)\n\n[Arguments]\nstring\n    String to playback as morse code to channel\n\n[See Also]\nSayAlpha(), SayPhonetic()\n',2),(85,'MP3Player','Play an MP3 file or M3U playlist file or stream. ','[Synopsis]\nPlay an MP3 file or M3U playlist file or stream. \n\n[Description]\nExecutes mpg123 to play the given location, which typically would be a mp3\nfilename or m3u playlist filename or a URL. Please read http://en.wikiped\nia.org/wiki/M3U to see how M3U playlist file format is like, Example usage\nwould be  exten => 1234,1,MP3Player(/var/lib/asterisk/playlist.m3u) User can\nexit by pressing any key on the dialpad, or by hanging up.\n\n[Syntax]\nMP3Player(Location)\n\n[Arguments]\nLocation\n    Location of the file to be played. (argument passed to mpg123)\n\n[See Also]\nNot available\n',2),(86,'MSet','Set channel variable(s) or function value(s). ','[Synopsis]\nSet channel variable(s) or function value(s). \n\n[Description]\nThis function can be used to set the value of channel variables or dialplan\nfunctions. When setting variables, if the variable name is prefixed with \'_\',\nthe variable will be inherited into channels created from the current channel\nIf the variable name is prefixed with \'__\', the variable will be inherited\ninto channels created from the current channel and all children channels.\nMSet behaves in a similar fashion to the way Set worked in 1.2/1.4 and is\nthus prone to doing things that you may not expect. For example, it strips\nsurrounding double-quotes from the right-hand side (value). If you need to\nput a separator character (comma or vert-bar), you will need to escape them\nby inserting a backslash before them. Avoid its use if possible.\n\n[Syntax]\nMSet(name1=value1[,name2=value2[,...]])\n\n[Arguments]\nNot available\n\n[See Also]\nSet()\n',2),(87,'MusicOnHold','Play Music On Hold indefinitely. ','[Synopsis]\nPlay Music On Hold indefinitely. \n\n[Description]\nPlays hold music specified by class. If omitted, the default music source\nfor the channel will be used. Change the default class with Set(CHANNEL(m\nusicclass)=...). If duration is given, hold music will be played specified\nnumber of seconds. If duration is ommited, music plays indefinitely. Returns\n\'0\' when done, \'-1\' on hangup.\n\n[Syntax]\nMusicOnHold(class[,duration])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(88,'NBScat','Play an NBS local stream. ','[Synopsis]\nPlay an NBS local stream. \n\n[Description]\nExecutes nbscat to listen to the local NBS stream. User can exit by pressing\nany key.\n\n[Syntax]\nNBScat()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(89,'NoCDR','Tell Asterisk to not maintain a CDR for the current call ','[Synopsis]\nTell Asterisk to not maintain a CDR for the current call \n\n[Description]\nThis application will tell Asterisk not to maintain a CDR for the current\ncall.\n\n[Syntax]\nNoCDR()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(90,'NoOp','Do Nothing (No Operation). ','[Synopsis]\nDo Nothing (No Operation). \n\n[Description]\nThis application does nothing. However, it is useful for debugging purposes.\nThis method can be used to see the evaluations of variables or functions\nwithout having any effect.\n\n[Syntax]\nNoOp([text])\n\n[Arguments]\ntext\n    Any text provided can be viewed at the Asterisk CLI.\n\n[See Also]\nVerbose(), Log()\n',2),(91,'ODBC_Commit','Commits a currently open database transaction. ','[Synopsis]\nCommits a currently open database transaction. \n\n[Description]\nCommits the database transaction specified by <transaction ID> or the current\nactive transaction, if not specified.\n\n[Syntax]\nODBC_Commit([transaction ID])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(92,'ODBC_Rollback','Rollback a currently open database transaction. ','[Synopsis]\nRollback a currently open database transaction. \n\n[Description]\nRolls back the database transaction specified by <transaction ID> or the\ncurrent active transaction, if not specified.\n\n[Syntax]\nODBC_Rollback([transaction ID])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(93,'ODBCFinish','Clear the resultset of a sucessful multirow query. ','[Synopsis]\nClear the resultset of a sucessful multirow query. \n\n[Description]\nFor queries which are marked as mode=multirow, this will clear  any remaining\nrows of the specified resultset.\n\n[Syntax]\nODBCFinish(result-id)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(94,'Originate','Originate a call. ','[Synopsis]\nOriginate a call. \n\n[Description]\nThis application originates an outbound call and connects it to a specified\nextension or application.  This application will block until the outgoing\ncall fails or gets answered.  At that point, this application will exit with\nthe status variable set and dialplan processing will continue.\nThis application sets the following channel variable before exiting:\n${ORIGINATE_STATUS}: This indicates the result of the call origination.\n    FAILED\n    SUCCESS\n    BUSY\n    CONGESTION\n    HANGUP\n    RINGING\n    UNKNOWN: In practice, you should never see this value.  Please report\n    it to the issue tracker if you ever see it.\n\n[Syntax]\nOriginate(tech_data,type,arg1[,arg2[,arg3]])\n\n[Arguments]\ntech_data\n    Channel technology and data for creating the outbound channel.  \n    For example, SIP/1234.\ntype\n    This should be \'app\' or \'exten\', depending on whether the outbound\n    channel should be connected to an application or extension.\narg1\n    If the type is \'app\', then this is the application name.  If the\n    type is \'exten\', then this is the context that the channel will be sent\n    to.\narg2\n    If the type is \'app\', then this is the data passed as arguments to\n    the application.  If the type is \'exten\', then this is the extension that\n    the channel will be sent to.\narg3\n    If the type is \'exten\', then this is the priority that the channel\n    is sent to.  If the type is \'app\', then this parameter is ignored.\n\n[See Also]\nNot available\n',2),(95,'Page','Page series of phones ','[Synopsis]\nPage series of phones \n\n[Description]\nPlaces outbound calls to the given <technology>/<resource> and dumps them\ninto a conference bridge as muted participants. The original caller is dumped\ninto the conference as a speaker and the room is destroyed when the original\ncallers leaves.\n\n[Syntax]\nPage(Technology/Resource[&Technology2/Resource2[&...]][,options[,timeout]\n])\n\n[Arguments]\nTechnology/Resource\n    Specification of the device(s) to dial. These must be in the format\n    of \'Technology/Resource\', where <Technology> represents a particular\n    channel driver, and <Resource> represents a resource available to that\n    particular channel driver.\nTechnology2/Resource2\n    Optional extra devices to dial inparallel\n    If you need more then one enter them as Technology2/Resource2&\n    Technology3/Resourse3&.....\noptions\n    d: Full duplex audio\n\n    i: Ignore attempts to forward the call\n\n    q: Quiet, do not play beep to caller\n\n    r: Record the page into a file (meetme option \'r\')\n\n    s: Only dial a channel if its device state says that it is \'NOT_INUSE\'\n\n    A(x): \n        x - The announcement to playback in all devices\n    Play an announcement simultaneously to all paged participants\n\n    n: Do not play simultaneous announcement to caller (implies \'A(x)\')\n\ntimeout\n    Specify the length of time that the system will attempt to connect\n    a call. After this duration, any intercom calls that have not been answered\n    will be hung up by the system.\n\n[See Also]\nMeetMe()\n',2),(96,'Park','Park yourself. ','[Synopsis]\nPark yourself. \n\n[Description]\nUsed to park yourself (typically in combination with a supervised transfer\nto know the parking space). This application is always registered internally\nand does not need to be explicitly added into the dialplan, although you should\ninclude the \'parkedcalls\' context (or the context specified in \"features.\nconf\").\nIf you set the ${PARKINGLOT} variable, the call will be parked in the specifed\nparking context. Note setting this variable overrides the ${ PARKINGLOT} set\nby the \'CHANNEL\' function.\nIf you set the ${PARKINGEXTEN} variable to an extension in your parking\ncontext, Park() will park the call on that extension, unless it already exists.\nIn that case, execution will continue at next priority.\nIf you set the ${PARKINGLOT} variable, Park() will park the call in that\nparkinglot.\nIf you set the ${PARKINGDYNAMIC} variable, this parkinglot from features.conf\nwill be used as template for the newly created dynamic lot.\nIf you set the ${PARKINGDYNCONTEXT} variable the newly created dynamic parking\nlot will use this context.\nIf you set the ${PARKINGDYNPOS} variable the newly created dynamic parkinglot\nwill use those parking postitions.\n\n[Syntax]\nPark([timeout][,return_context[,return_exten[,return_priority[,options]]]\n])\n\n[Arguments]\ntimeout\n    A custom parking timeout for this parked call. Value in milliseconds.\nreturn_context\n    The context to return the call to after it times out.\nreturn_exten\n    The extension to return the call to after it times out.\nreturn_priority\n    The priority to return the call to after it times out.\noptions\n    A list of options for this parked call.\n    r: Send ringing instead of MOH to the parked call.\n\n    R: Randomize the selection of a parking space.\n\n    s: Silence announcement of the parking space number.\n\n\n[See Also]\nParkAndAnnounce(), ParkedCall()\n',2),(97,'ParkAndAnnounce','Park and Announce. ','[Synopsis]\nPark and Announce. \n\n[Description]\nPark a call into the parkinglot and announce the call to another channel.\nThe variable ${PARKEDAT} will contain the parking extension into which the\ncall was placed.  Use with the Local channel to allow the dialplan to make\nuse of this information.\n\n[Syntax]\nParkAndAnnounce(announce[:announce1[:...]],timeout,dial[,return_context])\n\n[Arguments]\nannounce\n    Colon-separated list of files to announce. The word \'PARKED\' will\n    be replaced by a say_digits of the extension in which the call is parked.\ntimeout\n    Time in seconds before the call returns into the return context.\ndial\n    The app_dial style resource to call to make the announcement.\n    Console/dsp calls the console.\nreturn_context\n    The goto-style label to jump the call back into after timeout. Default\n    \'priority+1\'.\n\n[See Also]\nPark(), ParkedCall()\n',2),(98,'ParkedCall','Answer a parked call. ','[Synopsis]\nAnswer a parked call. \n\n[Description]\nUsed to connect to a parked call. This application is always registered\ninternally and does not need to be explicitly added into the dialplan, although\nyou should include the \'parkedcalls\' context. If no extension is provided,\nthen the first available parked call will be acquired.  If \'parkinglot\' is\nincluded,the parkinglot with that name will be used to seek the extension\n.\n\n[Syntax]\nParkedCall(exten[@parkinglot])\n\n[Arguments]\nexten\n    Specify extension.\nparkinglot\n    Optionally specify a parkinglot.\'exten\'.\n\n[See Also]\nPark(), ParkAndAnnounce()\n',2),(99,'PauseMonitor','Pause monitoring of a channel. ','[Synopsis]\nPause monitoring of a channel. \n\n[Description]\nPauses monitoring of a channel until it is re-enabled by a call to Unpaus\neMonitor.\n\n[Syntax]\nPauseMonitor()\n\n[Arguments]\nNot available\n\n[See Also]\nUnpauseMonitor()\n',2),(100,'PauseQueueMember','Pauses a queue member. ','[Synopsis]\nPauses a queue member. \n\n[Description]\nPauses (blocks calls for) a queue member. The given interface will be paused\nin the given queue. This prevents any calls from being sent from the queue\nto the interface until it is unpaused with UnpauseQueueMember or the manager\ninterface.  If no queuename is given, the interface is paused in every queue\nit is a member of. The application will fail if the interface is not found.\nThis application sets the following channel variable upon completion:\n${PQMSTATUS}: The status of the attempt to pause a queue member as a text\nstring.\n    PAUSED\n    NOTFOUND\nExample: PauseQueueMember(,SIP/3000)\n\n[Syntax]\nPauseQueueMember([queuename],interface[,options[,reason]])\n\n[Arguments]\nreason\n    Is used to add extra information to the appropriate queue_log entries\n    and manager events.\n\n[See Also]\nQueue(), QueueLog(), AddQueueMember(), RemoveQueueMember(), PauseQueueMember(),UnpauseQueueMember(), QUEUE_VARIABLES, QUEUE_MEMBER, QUEUE_MEMBER_COUNT,QUEUE_EXISTS, QUEUE_WAITING_COUNT, QUEUE_MEMBER_LIST, QUEUE_MEMBER_PENALTY\n',2),(101,'Pickup','Directed extension call pickup. ','[Synopsis]\nDirected extension call pickup. \n\n[Description]\nThis application can pickup any ringing channel that is calling the specified\n<extension>. If no <context> is specified, the current context will be used.\nIf you use the special string \'PICKUPMARK\' for the context parameter, for\nexample 10@PICKUPMARK, this application tries to find a channel which has\ndefined a ${PICKUPMARK} channel variable with the same value as <extension>\n(in this example, \'10\'). When no parameter is specified, the application will\npickup a channel matching the pickup group of the active channel.\n\n[Syntax]\nPickup(extension[@context][&extension2[@context2][&...]])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(102,'PickupChan','Pickup a ringing channel. ','[Synopsis]\nPickup a ringing channel. \n\n[Description]\nThis will pickup a specified <channel> if ringing.\n\n[Syntax]\nPickupChan(Technology/Resource[&Technology2/Resource2[&...]][,options])\n\n[Arguments]\noptions\n    p: Channel name specified partial name. Used when find channel by\n    callid.\n\n\n[See Also]\nNot available\n',2),(103,'Playback','Play a file. ','[Synopsis]\nPlay a file. \n\n[Description]\nPlays back given filenames (do not put extension of wav/alaw etc). The playback\ncommand answer the channel if no options are specified. If the file is\nnon-existant it will fail\nThis application sets the following channel variable upon completion:\n${PLAYBACKSTATUS}: The status of the playback attempt as a text string.\n    SUCCESS\n    FAILED\nSee Also: Background (application) -- for playing sound files that are\ninterruptible\nWaitExten (application) -- wait for digits from caller, optionally play music\non hold\n\n[Syntax]\nPlayback(filename[&filename2[&...]][,options])\n\n[Arguments]\noptions\n    Comma separated list of options\n    skip: Do not play if not answered\n\n    noanswer: Playback without answering, otherwise the channel will\n    be answered before the sound is played.\n    NOTE: Not all channel types support playing messages while still\n    on hook.\n\n\n[See Also]\nNot available\n',2),(104,'PlayTones','Play a tone list. ','[Synopsis]\nPlay a tone list. \n\n[Description]\nPlays a tone list. Execution will continue with the next step in the dialplan\nimmediately while the tones continue to play.\nSee the sample \"indications.conf\" for a description of the specification\nof a tonelist.\n\n[Syntax]\nPlayTones(arg)\n\n[Arguments]\narg\n    Arg is either the tone name defined in the \"indications.conf\"\n    configuration file, or a directly specified list of frequencies and\n    durations.\n\n[See Also]\nStopPlayTones()\n',2),(105,'PrivacyManager','Require phone number to be entered, if no CallerID sent ','[Synopsis]\nRequire phone number to be entered, if no CallerID sent \n\n[Description]\nIf no Caller*ID is sent, PrivacyManager answers the channel and asks the caller\nto enter their phone number. The caller is given <maxretries> attempts to\ndo so. The application does *nothing* if Caller*ID was received on the channel.\nThe application sets the following channel variable upon completion:\n${PRIVACYMGRSTATUS}: The status of the privacy manager\'s attempt to collect\na phone number from the user.\n    SUCCESS\n    FAILED\n\n[Syntax]\nPrivacyManager([maxretries][,minlength[,options[,context]]])\n\n[Arguments]\nmaxretries\n    Total tries caller is allowed to input a callerid. Defaults to \'3\'.\nminlength\n    Minimum allowable digits in the input callerid number. Defaults to\n    \'10\'.\noptions\n    Position reserved for options.\ncontext\n    Context to check the given callerid against patterns.\n\n[See Also]\nZapateller()\n',2),(106,'Proceeding','Indicate proceeding. ','[Synopsis]\nIndicate proceeding. \n\n[Description]\nThis application will request that a proceeding message be provided to the\ncalling channel.\n\n[Syntax]\nProceeding()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(107,'Progress','Indicate progress. ','[Synopsis]\nIndicate progress. \n\n[Description]\nThis application will request that in-band progress information be provided\nto the calling channel.\n\n[Syntax]\nProgress()\n\n[Arguments]\nNot available\n\n[See Also]\nBusy(), Congestion(), Ringing(), Playtones()\n',2),(108,'Queue','Queue a call for a call queue. ','[Synopsis]\nQueue a call for a call queue. \n\n[Description]\nIn addition to transferring the call, a call may be parked and then picked\nup by another user.\nThis application will return to the dialplan if the queue does not exist,\nor any of the join options cause the caller to not enter the queue.\nThis application sets the following channel variable upon completion:\n${QUEUESTATUS}: The status of the call as a text string.\n    TIMEOUT\n    FULL\n    JOINEMPTY\n    LEAVEEMPTY\n    JOINUNAVAIL\n    LEAVEUNAVAIL\n    CONTINUE\n\n[Syntax]\nQueue(queuename[,options[,URL[,announceoverride[,timeout[,AGI[,macro[,gos\nub[,rule[,position]]]]]]]]])\n\n[Arguments]\noptions\n    C: Mark all calls as \"answered elsewhere\" when cancelled.\n\n    c: Continue in the dialplan if the callee hangs up.\n\n    d: data-quality (modem) call (minimum delay).\n\n    h: Allow *callee* to hang up by pressing \'*\'.\n\n    H: Allow *caller* to hang up by pressing \'*\'.\n\n    n: No retries on the timeout; will exit this application and go to\n    the next step.\n\n    i: Ignore call forward requests from queue members and do nothing\n    when they are requested.\n\n    I: Asterisk will ignore any connected line update requests or any\n    redirecting party update requests it may receive on this dial attempt.\n\n    r: Ring instead of playing MOH. Periodic Announcements are still\n    made, if applicable.\n\n    R: Ring instead of playing MOH when a member channel is actually\n    ringing.\n\n    t: Allow the *called* user to transfer the calling user.\n\n    T: Allow the *calling* user to transfer the call.\n\n    w: Allow the *called* user to write the conversation to disk via\n    Monitor.\n\n    W: Allow the *calling* user to write the conversation to disk via\n    Monitor.\n\n    k: Allow the *called* party to enable parking of the call by sending\n    the DTMF sequence defined for call parking in \"features.conf\".\n\n    K: Allow the *calling* party to enable parking of the call by sending\n    the DTMF sequence defined for call parking in \"features.conf\".\n\n    x: Allow the *called* user to write the conversation to disk via\n    MixMonitor.\n\n    X: Allow the *calling* user to write the conversation to disk via\n    MixMonitor.\n\nURL\n    <URL> will be sent to the called party if the channel supports it.\ntimeout\n    Will cause the queue to fail out after a specified number of seconds,\n    checked between each \"queues.conf\" <timeout> and <retry> cycle.\nAGI\n    Will setup an AGI script to be executed on the calling party\'s channel\n    once they are connected to a queue member.\nmacro\n    Will run a macro on the calling party\'s channel once they are\n    connected to a queue member.\ngosub\n    Will run a gosub on the calling party\'s channel once they are\n    connected to a queue member.\nrule\n    Will cause the queue\'s defaultrule to be overridden by the rule\n    specified.\nposition\n    Attempt to enter the caller into the queue at the numerical position\n    specified. \'1\' would attempt to enter the caller at the head of the queue,\n    and \'3\' would attempt to place the caller third in the queue.\n\n[See Also]\nQueue(), QueueLog(), AddQueueMember(), RemoveQueueMember(), PauseQueueMember(),UnpauseQueueMember(), QUEUE_VARIABLES, QUEUE_MEMBER, QUEUE_MEMBER_COUNT,QUEUE_EXISTS, QUEUE_WAITING_COUNT, QUEUE_MEMBER_LIST, QUEUE_MEMBER_PENALTY\n',2),(109,'QueueLog','Writes to the queue_log file. ','[Synopsis]\nWrites to the queue_log file. \n\n[Description]\nAllows you to write your own events into the queue log.\nExample: QueueLog(101,${UNIQUEID},${AGENT},WENTONBREAK,600)\n\n[Syntax]\nQueueLog(queuename,uniqueid,agent,event[,additionalinfo])\n\n[Arguments]\nNot available\n\n[See Also]\nQueue(), QueueLog(), AddQueueMember(), RemoveQueueMember(), PauseQueueMember(),UnpauseQueueMember(), QUEUE_VARIABLES, QUEUE_MEMBER, QUEUE_MEMBER_COUNT,QUEUE_EXISTS, QUEUE_WAITING_COUNT, QUEUE_MEMBER_LIST, QUEUE_MEMBER_PENALTY\n',2),(110,'RaiseException','Handle an exceptional condition. ','[Synopsis]\nHandle an exceptional condition. \n\n[Description]\nThis application will jump to the \'e\' extension in the current context, setting\nthe dialplan function EXCEPTION(). If the \'e\' extension does not exist, the\ncall will hangup.\n\n[Syntax]\nRaiseException(reason)\n\n[Arguments]\nNot available\n\n[See Also]\nException\n',2),(111,'Read','Read a variable. ','[Synopsis]\nRead a variable. \n\n[Description]\nReads a #-terminated string of digits a certain number of times from the user\nin to the given <variable>.\nThis application sets the following channel variable upon completion:\n${READSTATUS}: This is the status of the read operation.\n    OK\n    ERROR\n    HANGUP\n    INTERRUPTED\n    SKIPPED\n    TIMEOUT\n\n[Syntax]\nRead(variable[,filename[&filename2[&...]][,maxdigits[,options[,attempts[,\ntimeout]]]]])\n\n[Arguments]\nvariable\n    The input digits will be stored in the given <variable> name.\nfilename\n    file(s) to play before reading digits or tone with option i\nmaxdigits\n    Maximum acceptable number of digits. Stops reading after <maxdigits>\n    have been entered (without requiring the user to press the \'#\' key).\n    Defaults to \'0\' - no limit - wait for the user press the \'#\' key.\n    Any value below \'0\' means the same. Max accepted value is \'255\'.\noptions\n    s: to return immediately if the line is not up.\n\n    i: to play  filename as an indication tone from your \"indication\n    s.conf\".\n\n    n: to read digits even if the line is not up.\n\nattempts\n    If greater than \'1\', that many <attempts> will be made in the event\n    no data is entered.\ntimeout\n    The number of seconds to wait for a digit response. If greater than\n    \'0\', that value will override the default timeout. Can be floating\n    point.\n\n[See Also]\nSendDTMF()\n',2),(112,'ReadExten','Read an extension into a variable. ','[Synopsis]\nRead an extension into a variable. \n\n[Description]\nReads a \'#\' terminated string of digits from the user into the given variable.\nWill set READEXTENSTATUS on exit with one of the following statuses:\n${READEXTENSTATUS}: \n    OK: A valid extension exists in ${variable}.\n    TIMEOUT: No extension was entered in the specified time.  Also sets\n    ${variable} to \"t\".\n    INVALID: An invalid extension, ${INVALID_EXTEN}, was entered.  Also\n    sets ${variable} to \"i\".\n    SKIP: Line was not up and the option \'s\' was specified.\n    ERROR: Invalid arguments were passed.\n\n[Syntax]\nReadExten(variable[,filename[,context[,option[,timeout]]]])\n\n[Arguments]\nfilename\n    File to play before reading digits or tone with option \'i\'\ncontext\n    Context in which to match extensions.\noption\n    s: Return immediately if the channel is not answered.\n\n    i: Play <filename> as an indication tone from your \"indications.conf\"\n    or a directly specified list of frequencies and durations.\n\n    n: Read digits even if the channel is not answered.\n\ntimeout\n    An integer number of seconds to wait for a digit response. If greater\n    than \'0\', that value will override the default timeout.\n\n[See Also]\nNot available\n',2),(113,'ReceiveFAX','Receive a Fax ','[Synopsis]\nReceive a Fax \n\n[Description]\nReceives a FAX from the channel into the given filename  overwriting the file\nif it already exists.\nFile created will be in TIFF format.\nThis application sets the following channel variables:\n${LOCALSTATIONID}: To identify itself to the remote end\n${LOCALHEADERINFO}: To generate a header line on each page\n${FAXSTATUS}: \n    SUCCESS\n    FAILED\n${FAXERROR}: Cause of failure\n${REMOTESTATIONID}: The CSID of the remote side\n${FAXPAGES}: Number of pages sent\n${FAXBITRATE}: Transmission rate\n${FAXRESOLUTION}: Resolution of sent fax\n\n[Syntax]\nReceiveFAX(filename[,c])\n\n[Arguments]\nfilename\n    Filename of TIFF file save incoming fax\nc\n    Makes the application behave as the calling machine\n    (Default behavior is as answering machine)\n\n[See Also]\nNot available\n',2),(114,'Record','Record to a file. ','[Synopsis]\nRecord to a file. \n\n[Description]\nIf filename contains \'%d\', these characters will be replaced with a number\nincremented by one each time the file is recorded. Use \'core show file formats\'\nto see the available formats on your system User can press \'#\' to terminate\nthe recording and continue to the next priority. If the user hangs up during\na recording, all data will be lost and the application will terminate.\n${RECORDED_FILE}: Will be set to the final filename of the recording.\n${RECORD_STATUS}: This is the final status of the command\n    DTMF:A terminating DTMF was received (\'#\' or \'*\', depending upon\n    option \'t\')\n    SILENCE:The maximum silence occurred in the recording.\n    SKIP:The line was not yet answered and the \'s\' option was specified.\n    TIMEOUT:The maximum length was reached.\n    HANGUP:The channel was hung up.\n    ERROR:An unrecoverable error occurred, which resulted in a WARNING\n    to the logs.\n\n[Syntax]\nRecord(filename.format[,silence[,maxduration[,options]]])\n\n[Arguments]\nformat\n    Is the format of the file type to be recorded (wav, gsm, etc).\nsilence\n    Is the number of seconds of silence to allow before returning.\nmaxduration\n    Is the maximum recording duration in seconds. If missing or 0 there\n    is no maximum.\noptions\n    a: Append to existing recording rather than replacing.\n\n    n: Do not answer, but record anyway if line not yet answered.\n\n    q: quiet (do not play a beep tone).\n\n    s: skip recording if the line is not yet answered.\n\n    t: use alternate \'*\' terminator key (DTMF) instead of default \'#\'\n\n    x: Ignore all terminator keys (DTMF) and keep recording until hangup.\n\n    k: Keep recorded file upon hangup.\n\n    y: Terminate recording if *any* DTMF digit is received.\n\n\n[See Also]\nNot available\n',2),(115,'RemoveQueueMember','Dynamically removes queue members. ','[Synopsis]\nDynamically removes queue members. \n\n[Description]\nIf the interface is *NOT* in the queue it will return an error.\nThis application sets the following channel variable upon completion:\n${RQMSTATUS}: \n    REMOVED\n    NOTINQUEUE\n    NOSUCHQUEUE\nExample: RemoveQueueMember(techsupport,SIP/3000)\n\n[Syntax]\nRemoveQueueMember(queuename[,interface[,options]])\n\n[Arguments]\nNot available\n\n[See Also]\nQueue(), QueueLog(), AddQueueMember(), RemoveQueueMember(), PauseQueueMember(),UnpauseQueueMember(), QUEUE_VARIABLES, QUEUE_MEMBER, QUEUE_MEMBER_COUNT,QUEUE_EXISTS, QUEUE_WAITING_COUNT, QUEUE_MEMBER_LIST, QUEUE_MEMBER_PENALTY\n',2),(116,'ResetCDR','Resets the Call Data Record. ','[Synopsis]\nResets the Call Data Record. \n\n[Description]\nThis application causes the Call Data Record to be reset.\n\n[Syntax]\nResetCDR([options])\n\n[Arguments]\noptions\n    w: Store the current CDR record before resetting it.\n\n    a: Store any stacked records.\n\n    v: Save CDR variables.\n\n    e: Enable CDR only (negate effects of NoCDR).\n\n\n[See Also]\nForkCDR(), NoCDR()\n',2),(117,'RetryDial','Place a call, retrying on failure allowing an optional exit extension. ','[Synopsis]\nPlace a call, retrying on failure allowing an optional exit extension. \n\n[Description]\nThis application will attempt to place a call using the normal Dial\napplication. If no channel can be reached, the <announce> file will be played.\nThen, it will wait <sleep> number of seconds before retrying the call. After\n<retries> number of attempts, the calling channel will continue at the next\npriority in the dialplan. If the <retries> setting is set to 0, this\napplication will retry endlessly. While waiting to retry a call, a 1 digit\nextension may be dialed. If that extension exists in either the context defined\nin ${EXITCONTEXT} or the current one, The call will jump to that extension\nimmediately. The <dialargs> are specified in the same format that arguments\nare provided to the Dial application.\n\n[Syntax]\nRetryDial(announce,sleep,retries,dialargs)\n\n[Arguments]\nannounce\n    Filename of sound that will be played when no channel can be reached\nsleep\n    Number of seconds to wait after a dial attempt failed before a new\n    attempt is made\nretries\n    Number of retries\n    When this is reached flow will continue at the next priority in the\n    dialplan\ndialargs\n    Same format as arguments provided to the Dial application\n\n[See Also]\nNot available\n',2),(118,'Return','Return from gosub routine. ','[Synopsis]\nReturn from gosub routine. \n\n[Description]\nJumps to the last label on the stack, removing it. The return <value>, if\nany, is saved in the channel variable ${GOSUB_RETVAL}.\n\n[Syntax]\nReturn([value])\n\n[Arguments]\nvalue\n    Return value.\n\n[See Also]\nGosub(), StackPop()\n',2),(119,'Ringing','Indicate ringing tone. ','[Synopsis]\nIndicate ringing tone. \n\n[Description]\nThis application will request that the channel indicate a ringing tone to\nthe user.\n\n[Syntax]\nRinging()\n\n[Arguments]\nNot available\n\n[See Also]\nBusy(), Congestion(), Progress(), Playtones()\n',2),(120,'SayAlpha','Say Alpha. ','[Synopsis]\nSay Alpha. \n\n[Description]\nThis application will play the sounds that correspond to the letters of the\ngiven <string>.\n\n[Syntax]\nSayAlpha(string)\n\n[Arguments]\nNot available\n\n[See Also]\nSayDigits(), SayNumber(), SayPhonetic(), CHANNEL\n',2),(121,'SayDigits','Say Digits. ','[Synopsis]\nSay Digits. \n\n[Description]\nThis application will play the sounds that correspond to the digits of the\ngiven number. This will use the language that is currently set for the\nchannel.\n\n[Syntax]\nSayDigits(digits)\n\n[Arguments]\nNot available\n\n[See Also]\nSayAlpha(), SayNumber(), SayPhonetic(), CHANNEL\n',2),(122,'SayNumber','Say Number. ','[Synopsis]\nSay Number. \n\n[Description]\nThis application will play the sounds that correspond to the given <digits>.\nOptionally, a <gender> may be specified. This will use the language that is\ncurrently set for the channel. See the LANGUAGE() function for more information\non setting the language for the channel.\n\n[Syntax]\nSayNumber(digits[,gender])\n\n[Arguments]\nNot available\n\n[See Also]\nSayAlpha(), SayDigits(), SayPhonetic(), CHANNEL\n',2),(123,'SayPhonetic','Say Phonetic. ','[Synopsis]\nSay Phonetic. \n\n[Description]\nThis application will play the sounds from the phonetic alphabet that\ncorrespond to the letters in the given <string>.\n\n[Syntax]\nSayPhonetic(string)\n\n[Arguments]\nNot available\n\n[See Also]\nSayAlpha(), SayDigits(), SayNumber()\n',2),(124,'SayUnixTime','Says a specified time in a custom format. ','[Synopsis]\nSays a specified time in a custom format. \n\n[Description]\nUses some of the sound files stored in \"/var/lib/asterisk/sounds\" to construct\na phrase  saying the specified date and/or time in the specified format. \n\n[Syntax]\nSayUnixTime([unixtime][,timezone[,format]])\n\n[Arguments]\nunixtime\n    time, in seconds since Jan 1, 1970.  May be negative. Defaults to\n    now.\ntimezone\n    timezone, see \"/usr/share/zoneinfo\" for a list. Defaults to machine\n    default.\nformat\n    a format the time is to be said in.  See \"voicemail.conf\". Defaults\n    to \'ABdY \"digits/at\" IMp\'\n\n[See Also]\nSTRFTIME, STRPTIME, IFTIME\n',2),(125,'SendDTMF','Sends arbitrary DTMF digits ','[Synopsis]\nSends arbitrary DTMF digits \n\n[Description]\nDTMF digits sent to a channel with half second pause\nIt will pass all digits or terminate if it encounters an error.\n\n[Syntax]\nSendDTMF(digits[,timeout_ms[,duration_ms[,channel]]])\n\n[Arguments]\ndigits\n    List of digits 0-9,*#,abcd\ntimeout_ms\n    Amount of time to wait in ms between tones. (defaults to .25s)\nduration_ms\n    Duration of each digit\nchannel\n    Channel where digits will be played\n\n[See Also]\nRead()\n',2),(126,'SendFAX','Send a Fax ','[Synopsis]\nSend a Fax \n\n[Description]\nSend a given TIFF file to the channel as a FAX.\nThis application sets the following channel variables:\n${LOCALSTATIONID}: To identify itself to the remote end\n${LOCALHEADERINFO}: To generate a header line on each page\n${FAXSTATUS}: \n    SUCCESS\n    FAILED\n${FAXERROR}: Cause of failure\n${REMOTESTATIONID}: The CSID of the remote side\n${FAXPAGES}: Number of pages sent\n${FAXBITRATE}: Transmission rate\n${FAXRESOLUTION}: Resolution of sent fax\n\n[Syntax]\nSendFAX(filename[,a])\n\n[Arguments]\nfilename\n    Filename of TIFF file to fax\na\n    Makes the application behave as the answering machine\n    (Default behavior is as calling machine)\n\n[See Also]\nNot available\n',2),(127,'SendImage','Sends an image file. ','[Synopsis]\nSends an image file. \n\n[Description]\nSend an image file on a channel supporting it.\nResult of transmission will be stored in ${SENDIMAGESTATUS}\n${SENDIMAGESTATUS}: \n    SUCCESS: Transmission succeeded.\n    FAILURE: Transmission failed.\n    UNSUPPORTED: Image transmission not supported by channel.\n\n[Syntax]\nSendImage(filename)\n\n[Arguments]\nfilename\n    Path of the filename (image) to send.\n\n[See Also]\nSendText(), SendURL()\n',2),(128,'SendText','Send a Text Message. ','[Synopsis]\nSend a Text Message. \n\n[Description]\nSends <text> to current channel (callee).\nResult of transmission will be stored in the ${SENDTEXTSTATUS}\n${SENDTEXTSTATUS}: \n    SUCCESS: Transmission succeeded.\n    FAILURE: Transmission failed.\n    UNSUPPORTED: Text transmission not supported by channel.\nNOTE: At this moment, text is supposed to be 7 bit ASCII in most channel\ns.\n\n[Syntax]\nSendText(text)\n\n[Arguments]\nNot available\n\n[See Also]\nSendImage(), SendURL()\n',2),(129,'SendURL','Send a URL. ','[Synopsis]\nSend a URL. \n\n[Description]\nRequests client go to <URL> (IAX2) or sends the URL to the client (other\nchannels).\nResult is returned in the ${SENDURLSTATUS} channel variable:\n${SENDURLSTATUS}: \n    SUCCESS: URL successfully sent to client.\n    FAILURE: Failed to send URL.\n    NOLOAD: Client failed to load URL (wait enabled).\n    UNSUPPORTED: Channel does not support URL transport.\nSendURL continues normally if the URL was sent correctly or if the channel\ndoes not support HTML transport.  Otherwise, the channel is hung up.\n\n[Syntax]\nSendURL(URL[,option])\n\n[Arguments]\noption\n    w: Execution will wait for an acknowledgement that the URL has been\n    loaded before continuing.\n\n\n[See Also]\nSendImage(), SendText()\n',2),(130,'Set','Set channel variable or function value. ','[Synopsis]\nSet channel variable or function value. \n\n[Description]\nThis function can be used to set the value of channel variables or dialplan\nfunctions. When setting variables, if the variable name is prefixed with \'_\',\nthe variable will be inherited into channels created from the current channel.\nIf the variable name is prefixed with \'__\', the variable will be inherited\ninto channels created from the current channel and all children channels.\nNOTE: If (and only if), in \"/etc/asterisk/asterisk.conf\", you have a\n\'[compat]\' category, and you have \'app_set = 1.6\' under that,then the behavior\nof this app changes, and does not strip surrounding quotes from the right\nhand side as it did previously in 1.4. The \'app_set = 1.6\' is only inserted\nif \'make samples\' is executed, or if users insert this by hand into the\n\"asterisk.conf\" file. The advantages of not stripping out quoting, and not\ncaring about the separator characters (comma and vertical bar) were sufficient\nto make these changes in 1.6. Confusion about how many backslashes would be\nneeded to properly protect separators and quotes in various database access\nstrings has been greatly reduced by these changes.\n\n[Syntax]\nSet(name=value)\n\n[Arguments]\nNot available\n\n[See Also]\nMSet(), GLOBAL, SET, ENV\n',2),(131,'SetAMAFlags','Set the AMA Flags. ','[Synopsis]\nSet the AMA Flags. \n\n[Description]\nThis application will set the channel\'s AMA Flags for billing purposes.\n\n[Syntax]\nSetAMAFlags([flag])\n\n[Arguments]\nNot available\n\n[See Also]\nCDR\n',2),(132,'SetMusicOnHold','Set default Music On Hold class. ','[Synopsis]\nSet default Music On Hold class. \n\n[Description]\n!!! DEPRECATED. USe Set(CHANNEL(musicclass)=...) instead !!!\nSets the default class for music on hold for a given channel. When music\non hold is activated, this class will be used to select which music is played.\n!!! DEPRECATED. USe Set(CHANNEL(musicclass)=...) instead !!!\n\n[Syntax]\nSetMusicOnHold(class)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(133,'SIPAddHeader','Add a SIP header to the outbound call. ','[Synopsis]\nAdd a SIP header to the outbound call. \n\n[Description]\nAdds a header to a SIP call placed with DIAL.\nRemember to use the X-header if you are adding non-standard SIP headers,\nlike \'X-Asterisk-Accountcode:\'. Use this with care. Adding the wrong headers\nmay jeopardize the SIP dialog.\nAlways returns \'0\'.\n\n[Syntax]\nSIPAddHeader(Header:Content)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(134,'SIPDtmfMode','Change the dtmfmode for a SIP call. ','[Synopsis]\nChange the dtmfmode for a SIP call. \n\n[Description]\nChanges the dtmfmode for a SIP call.\n\n[Syntax]\nSIPDtmfMode(mode)\n\n[Arguments]\nmode\n    inband\n    info\n    rfc2833\n\n[See Also]\nNot available\n',2),(135,'SIPRemoveHeader','Remove SIP headers previously added with SIPAddHeader ','[Synopsis]\nRemove SIP headers previously added with SIPAddHeader \n\n[Description]\nSIPRemoveHeader() allows you to remove headers which were previously added\nwith SIPAddHeader(). If no parameter is supplied, all previously added headers\nwill be removed. If a parameter is supplied, only the matching headers will\nbe removed.\nFor example you have added these 2 headers:\nSIPAddHeader(P-Asserted-Identity: sip:foo@bar);\nSIPAddHeader(P-Preferred-Identity: sip:bar@foo);\n// remove all headers\nSIPRemoveHeader();\n// remove all P- headers\nSIPRemoveHeader(P-);\n// remove only the PAI header (note the : at the end)\nSIPRemoveHeader(P-Asserted-Identity:);\nAlways returns \'0\'.\n\n[Syntax]\nSIPRemoveHeader([Header])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(136,'SLAStation','Shared Line Appearance Station. ','[Synopsis]\nShared Line Appearance Station. \n\n[Description]\nThis application should be executed by an SLA station. The argument depends\non how the call was initiated. If the phone was just taken off hook, then\nthe argument <station> should be just the station name. If the call was\ninitiated by pressing a line key, then the station name should be preceded\nby an underscore and the trunk name associated with that line button.\nFor example: \'station1_line1\'\nOn exit, this application will set the variable ${SLASTATION_STATUS} to one\nof the following values:\n${SLASTATION_STATUS}: \n    FAILURE\n    CONGESTION\n    SUCCESS\n\n[Syntax]\nSLAStation(station)\n\n[Arguments]\nstation\n    Station name\n\n[See Also]\nNot available\n',2),(137,'SLATrunk','Shared Line Appearance Trunk. ','[Synopsis]\nShared Line Appearance Trunk. \n\n[Description]\nThis application should be executed by an SLA trunk on an inbound call. The\nchannel calling this application should correspond to the SLA trunk with the\nname <trunk> that is being passed as an argument.\nOn exit, this application will set the variable ${SLATRUNK_STATUS} to one\nof the following values:\n${SLATRUNK_STATUS}: \n    FAILURE\n    SUCCESS\n    UNANSWERED\n    RINGTIMEOUT\n\n[Syntax]\nSLATrunk(trunk[,options])\n\n[Arguments]\ntrunk\n    Trunk name\noptions\n    M[(class)]: Play back the specified MOH <class> instead of ringing\n\n\n[See Also]\nNot available\n',2),(138,'SMS','Communicates with SMS service centres and SMS capable analogue phones. ','[Synopsis]\nCommunicates with SMS service centres and SMS capable analogue phones. \n\n[Description]\nSMS handles exchange of SMS data with a call to/from SMS capable phone or\nSMS PSTN service center. Can send and/or receive SMS messages. Works to ETSI\nES 201 912; compatible with BT SMS PSTN service in UK and Telecom Italia in\nItaly.\nTypical usage is to use to handle calls from the SMS service centre CLI,\nor to set up a call using \'outgoing\' or manager interface to connect service\ncentre to SMS().\n\"Messages are processed as per text file message queues. smsq (a separate\nsoftware) is a command to generate message queues and send messages.\nNOTE: The protocol has tight delay bounds. Please use short frames and\ndisable/keep short the jitter buffer on the ATA to make sure that respones\n(ACK etc.) are received in time.\n\n[Syntax]\nSMS(name[,options[,addr[,body]]])\n\n[Arguments]\nname\n    The name of the queue used in \"/var/spool/asterisk/sms\"\noptions\n    a: Answer, i.e. send initial FSK packet.\n\n    s: Act as service centre talking to a phone.\n\n    t: Use protocol 2 (default used is protocol 1).\n\n    p: Set the initial delay to N ms (default is \'300\'). addr and body\n    are a deprecated format to send messages out.\n\n    r: Set the Status Report Request (SRR) bit.\n\n    o: The body should be coded as octets not 7-bit symbols.\n\n\n[See Also]\nNot available\n',2),(139,'SoftHangup','Hangs up the requested channel. ','[Synopsis]\nHangs up the requested channel. \n\n[Description]\nHangs up the requested channel.  If there are no channels to  hangup, the\napplication will report it.\n\n[Syntax]\nSoftHangup(Technology/Resource[,options])\n\n[Arguments]\noptions\n    a: Hang up all channels on a specified device instead of a single\n    resource\n\n\n[See Also]\nNot available\n',2),(140,'SpeechActivateGrammar','Activate a grammar. ','[Synopsis]\nActivate a grammar. \n\n[Description]\nThis activates the specified grammar to be recognized by the engine. A grammar\ntells the speech recognition engine what to recognize, and how to portray\nit back to you in the dialplan. The grammar name is the only argument to this\napplication.\n\n[Syntax]\nSpeechActivateGrammar(grammar_name)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(141,'SpeechBackground','Play a sound file and wait for speech to be recognized. ','[Synopsis]\nPlay a sound file and wait for speech to be recognized. \n\n[Description]\nThis application plays a sound file and waits for the person to speak. Once\nthey start speaking playback of the file stops, and silence is heard. Once\nthey stop talking the processing sound is played to indicate the speech\nrecognition engine is working. Once results are available the application\nreturns and results (score and text) are available using dialplan functions.\nThe first text and score are ${SPEECH_TEXT(0)} AND ${SPEECH_SCORE(0)} while\nthe second are ${SPEECH_TEXT(1)} and ${SPEECH_SCORE(1)}.\nThe first argument is the sound file and the second is the timeout integer\nin seconds.\n\n[Syntax]\nSpeechBackground(sound_file[,timeout[,options]])\n\n[Arguments]\ntimeout\n    Timeout integer in seconds. Note the timeout will only start once\n    the sound file has stopped playing.\noptions\n    n: Don\'t answer the channel if it has not already been answered.\n\n\n[See Also]\nNot available\n',2),(142,'SpeechCreate','Create a Speech Structure. ','[Synopsis]\nCreate a Speech Structure. \n\n[Description]\nThis application creates information to be used by all the other applications.\nIt must be called before doing any speech recognition activities such as\nactivating a grammar. It takes the engine name to use as the argument, if\nnot specified the default engine will be used.\n\n[Syntax]\nSpeechCreate(engine_name)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(143,'SpeechDeactivateGrammar','Deactivate a grammar. ','[Synopsis]\nDeactivate a grammar. \n\n[Description]\nThis deactivates the specified grammar so that it is no longer recognized\n.\n\n[Syntax]\nSpeechDeactivateGrammar(grammar_name)\n\n[Arguments]\ngrammar_name\n    The grammar name to deactivate\n\n[See Also]\nNot available\n',2),(144,'SpeechDestroy','End speech recognition. ','[Synopsis]\nEnd speech recognition. \n\n[Description]\nThis destroys the information used by all the other speech recognition\napplications. If you call this application but end up wanting to recognize\nmore speech, you must call SpeechCreate() again before calling any other\napplication.\n\n[Syntax]\nSpeechDestroy()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(145,'SpeechLoadGrammar','Load a grammar. ','[Synopsis]\nLoad a grammar. \n\n[Description]\nLoad a grammar only on the channel, not globally.\n\n[Syntax]\nSpeechLoadGrammar(grammar_name,path)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(146,'SpeechProcessingSound','Change background processing sound. ','[Synopsis]\nChange background processing sound. \n\n[Description]\nThis changes the processing sound that SpeechBackground plays back when the\nspeech recognition engine is processing and working to get results.\n\n[Syntax]\nSpeechProcessingSound(sound_file)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(147,'SpeechStart','Start recognizing voice in the audio stream. ','[Synopsis]\nStart recognizing voice in the audio stream. \n\n[Description]\nTell the speech recognition engine that it should start trying to get results\nfrom audio being fed to it.\n\n[Syntax]\nSpeechStart()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(148,'SpeechUnloadGrammar','Unload a grammar. ','[Synopsis]\nUnload a grammar. \n\n[Description]\nUnload a grammar.\n\n[Syntax]\nSpeechUnloadGrammar(grammar_name)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(149,'StackPop','Remove one address from gosub stack. ','[Synopsis]\nRemove one address from gosub stack. \n\n[Description]\nRemoves last label on the stack, discarding it.\n\n[Syntax]\nStackPop()\n\n[Arguments]\nNot available\n\n[See Also]\nReturn(), Gosub()\n',2),(150,'StartMusicOnHold','Play Music On Hold. ','[Synopsis]\nPlay Music On Hold. \n\n[Description]\nStarts playing music on hold, uses default music class for channel. Starts\nplaying music specified by class. If omitted, the default music source for\nthe channel will be used. Always returns \'0\'.\n\n[Syntax]\nStartMusicOnHold(class)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(151,'StopMixMonitor','Stop recording a call through MixMonitor, and free the recording\'s file handle.','[Synopsis]\nStop recording a call through MixMonitor, and free the recording\'s file handle.\n\n[Description]\nStops the audio recording that was started with a call to \'MixMonitor()\' on\nthe current channel.\n\n[Syntax]\nStopMixMonitor()\n\n[Arguments]\nNot available\n\n[See Also]\nMixMonitor()\n',2),(152,'StopMonitor','Stop monitoring a channel. ','[Synopsis]\nStop monitoring a channel. \n\n[Description]\nStops monitoring a channel. Has no effect if the channel is not monitored\n.\n\n[Syntax]\nStopMonitor()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(153,'StopMusicOnHold','Stop playing Music On Hold. ','[Synopsis]\nStop playing Music On Hold. \n\n[Description]\nStops playing music on hold.\n\n[Syntax]\nStopMusicOnHold()\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(154,'StopPlayTones','Stop playing a tone list. ','[Synopsis]\nStop playing a tone list. \n\n[Description]\nStop playing a tone list, initiated by PlayTones().\n\n[Syntax]\nStopPlayTones()\n\n[Arguments]\nNot available\n\n[See Also]\nPlayTones()\n',2),(155,'System','Execute a system command. ','[Synopsis]\nExecute a system command. \n\n[Description]\nExecutes a command  by  using  system(). If the command fails, the console\nshould report a fallthrough.\nResult of execution is returned in the ${SYSTEMSTATUS} channel variable:\n${SYSTEMSTATUS}: \n    FAILURE: Could not execute the specified command.\n    SUCCESS: Specified command successfully executed.\n\n[Syntax]\nSystem(command)\n\n[Arguments]\ncommand\n    Command to execute\n\n[See Also]\nNot available\n',2),(156,'TestClient','Execute Interface Test Client. ','[Synopsis]\nExecute Interface Test Client. \n\n[Description]\nExecutes test client with given <testid>. Results stored in \"/var/log/ast\nerisk/testreports/<testid>-client.txt\"\n\n[Syntax]\nTestClient(testid)\n\n[Arguments]\ntestid\n    An ID to identify this test.\n\n[See Also]\nTestServer()\n',2),(157,'TestServer','Execute Interface Test Server. ','[Synopsis]\nExecute Interface Test Server. \n\n[Description]\nPerform test server function and write call report. Results stored in\n\"/var/log/asterisk/testreports/<testid>-server.txt\"\n\n[Syntax]\nTestServer()\n\n[Arguments]\nNot available\n\n[See Also]\nTestClient()\n',2),(158,'Transfer','Transfer caller to remote extension. ','[Synopsis]\nTransfer caller to remote extension. \n\n[Description]\nRequests the remote caller be transferred to a given destination. If TECH\n(SIP, IAX2, LOCAL etc) is used, only an incoming call with the same channel\ntechnology will be transfered. Note that for SIP, if you transfer before call\nis setup, a 302 redirect SIP message will be returned to the caller.\nThe result of the application will be reported in the ${TRANSFERSTATUS}\nchannel variable:\n${TRANSFERSTATUS}: \n    SUCCESS: Transfer succeeded.\n    FAILURE: Transfer failed.\n    UNSUPPORTED: Transfer unsupported by channel driver.\n\n[Syntax]\nTransfer([Tech/]destination)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(159,'TryExec','Executes dialplan application, always returning. ','[Synopsis]\nExecutes dialplan application, always returning. \n\n[Description]\nAllows an arbitrary application to be invoked even when not hard coded into\nthe dialplan. To invoke external applications see the application System.\nAlways returns to the dialplan. The channel variable TRYSTATUS will be set\nto one of: \n${TRYSTATUS}: \n    SUCCESS: If the application returned zero.\n    FAILED: If the application returned non-zero.\n    NOAPP: If the application was not found or was not specified.\n\n[Syntax]\nTryExec(appname(arguments))\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(160,'TrySystem','Try executing a system command. ','[Synopsis]\nTry executing a system command. \n\n[Description]\nExecutes a command  by  using  system().\nResult of execution is returned in the ${SYSTEMSTATUS} channel variable:\n${SYSTEMSTATUS}: \n    FAILURE: Could not execute the specified command.\n    SUCCESS: Specified command successfully executed.\n    APPERROR: Specified command successfully executed, but returned error\n    code.\n\n[Syntax]\nTrySystem(command)\n\n[Arguments]\ncommand\n    Command to execute\n\n[See Also]\nNot available\n',2),(161,'UnpauseMonitor','Unpause monitoring of a channel. ','[Synopsis]\nUnpause monitoring of a channel. \n\n[Description]\nUnpauses monitoring of a channel on which monitoring had previously been paused\nwith PauseMonitor.\n\n[Syntax]\nUnpauseMonitor()\n\n[Arguments]\nNot available\n\n[See Also]\nPauseMonitor()\n',2),(162,'UnpauseQueueMember','Unpauses a queue member.		 ','[Synopsis]\nUnpauses a queue member.		 \n\n[Description]\nUnpauses (resumes calls to) a queue member. This is the counterpart to\n\'PauseQueueMember()\' and operates exactly the same way, except it unpauses\ninstead of pausing the given interface.\nThis application sets the following channel variable upon completion:\n${UPQMSTATUS}: The status of the attempt to unpause a queue member as a text\nstring.\n    UNPAUSED\n    NOTFOUND\nExample: UnpauseQueueMember(,SIP/3000)\n\n[Syntax]\nUnpauseQueueMember([queuename],interface[,options[,reason]])\n\n[Arguments]\nreason\n    Is used to add extra information to the appropriate queue_log entries\n    and manager events.\n\n[See Also]\nQueue(), QueueLog(), AddQueueMember(), RemoveQueueMember(), PauseQueueMember(),UnpauseQueueMember(), QUEUE_VARIABLES, QUEUE_MEMBER, QUEUE_MEMBER_COUNT,QUEUE_EXISTS, QUEUE_WAITING_COUNT, QUEUE_MEMBER_LIST, QUEUE_MEMBER_PENALTY\n',2),(163,'UserEvent','Send an arbitrary event to the manager interface. ','[Synopsis]\nSend an arbitrary event to the manager interface. \n\n[Description]\nSends an arbitrary event to the manager interface, with an optional <body>\nrepresenting additional arguments. The <body> may be specified as a \',\'\ndelimited list of headers. Each additional argument will be placed on a new\nline in the event. The format of the event will be:\n    Event: UserEvent\n    UserEvent: <specified event name>\n    [body]\nIf no <body> is specified, only Event and UserEvent headers will be\npresent.\n\n[Syntax]\nUserEvent(eventname[,body])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(164,'Verbose','Send arbitrary text to verbose output. ','[Synopsis]\nSend arbitrary text to verbose output. \n\n[Description]\nSends an arbitrary text message to verbose output.\n\n[Syntax]\nVerbose([level,]message)\n\n[Arguments]\nlevel\n    Must be an integer value.  If not specified, defaults to 0.\nmessage\n    Output text message.\n\n[See Also]\nNot available\n',2),(165,'VMAuthenticate','Authenticate with Voicemail passwords. ','[Synopsis]\nAuthenticate with Voicemail passwords. \n\n[Description]\nThis application behaves the same way as the Authenticate application, but\nthe passwords are taken from \"voicemail.conf\". If the <mailbox> is specified,\nonly that mailbox\'s password will be considered valid. If the <mailbox> is\nnot specified, the channel variable ${AUTH_MAILBOX} will be set with the\nauthenticated mailbox.\nThe VMAuthenticate application will exit if the following DTMF digit is\nentered as Mailbox or Password, and the extension exists:\n    * - Jump to the \'a\' extension in the current dialplan context.\n\n[Syntax]\nVMAuthenticate([mailbox][@context][,options])\n\n[Arguments]\noptions\n    s: Skip playing the initial prompts.\n\n\n[See Also]\nNot available\n',2),(166,'VMSayName','Play the name of a voicemail user ','[Synopsis]\nPlay the name of a voicemail user \n\n[Description]\nThis application will say the recorded name of the voicemail user specified\nas the argument to this application. If no context is provided, \'default\'\nis assumed.\n\n[Syntax]\nVMSayName([mailbox][@context])\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(167,'VoiceMail','Leave a Voicemail message. ','[Synopsis]\nLeave a Voicemail message. \n\n[Description]\nThis application allows the calling party to leave a message for the specified\nlist of mailboxes. When multiple mailboxes are specified, the greeting will\nbe taken from the first mailbox specified. Dialplan execution will stop if\nthe specified mailbox does not exist.\nThe Voicemail application will exit if any of the following DTMF digits are\nreceived:\n    0 - Jump to the \'o\' extension in the current dialplan context.\n    * - Jump to the \'a\' extension in the current dialplan context.\nThis application will set the following channel variable upon completion:\n${VMSTATUS}: This indicates the status of the execution of the VoiceMail\napplication.\n    SUCCESS\n    USEREXIT\n    FAILED\n\n[Syntax]\nVoiceMail(mailbox[@context][&mailbox[@context][&...]][,options])\n\n[Arguments]\noptions\n    b: Play the \'busy\' greeting to the calling party.\n\n    d([c]): Accept digits for a new extension in context <c>, if played\n    during the greeting. Context defaults to the current context.\n\n    g(#): Use the specified amount of gain when recording the voicemail\n    message. The units are whole-number decibels (dB). Only works on supported\n    technologies, which is DAHDI only.\n\n    s: Skip the playback of instructions for leaving a message to the\n    calling party.\n\n    u: Play the \'unavailable\' greeting.\n\n    U: Mark message as \'URGENT\'.\n\n    P: Mark message as \'PRIORITY\'.\n\n\n[See Also]\nVoiceMailMain()\n',2),(168,'VoiceMailMain','Check Voicemail messages. ','[Synopsis]\nCheck Voicemail messages. \n\n[Description]\nThis application allows the calling party to check voicemail messages. A\nspecific <mailbox>, and optional corresponding <context>, may be specified.\nIf a <mailbox> is not provided, the calling party will be prompted to enter\none. If a <context> is not specified, the \'default\' context will be used.\nThe VoiceMailMain application will exit if the following DTMF digit is entered\nas Mailbox or Password, and the extension exists:\n    * - Jump to the \'a\' extension in the current dialplan context.\n\n[Syntax]\nVoiceMailMain([mailbox][@context][,options])\n\n[Arguments]\noptions\n    p: Consider the <mailbox> parameter as a prefix to the mailbox that\n    is entered by the caller.\n\n    g(#): Use the specified amount of gain when recording a voicemail\n    message. The units are whole-number decibels (dB).\n\n    s: Skip checking the passcode for the mailbox.\n\n    a(folder): Skip folder prompt and go directly to <folder> specified.\n    Defaults to \'INBOX\' (or \'0\').\n        0 - INBOX\n        1 - Old\n        2 - Work\n        3 - Family\n        4 - Friends\n        5 - Cust1\n        6 - Cust2\n        7 - Cust3\n        8 - Cust4\n        9 - Cust5\n\n\n[See Also]\nVoiceMail()\n',2),(169,'Wait','Waits for some time. ','[Synopsis]\nWaits for some time. \n\n[Description]\nThis application waits for a specified number of <seconds>.\n\n[Syntax]\nWait(seconds)\n\n[Arguments]\nseconds\n    Can be passed with fractions of a second. For example, \'1.5\' will\n    ask the application to wait for 1.5 seconds.\n\n[See Also]\nNot available\n',2),(170,'WaitExten','Waits for an extension to be entered. ','[Synopsis]\nWaits for an extension to be entered. \n\n[Description]\nThis application waits for the user to enter a new extension for a specified\nnumber of <seconds>.\nWARNING!!!: Use of the application \'WaitExten\' within a macro will not\nfunction as expected. Please use the \'Read\' application in order to read DTMF\nfrom a channel currently executing a macro.\n\n[Syntax]\nWaitExten([seconds][,options])\n\n[Arguments]\nseconds\n    Can be passed with fractions of a second. For example, \'1.5\' will\n    ask the application to wait for 1.5 seconds.\noptions\n    m([x]): Provide music on hold to the caller while waiting for an\n    extension.\n        x - Specify the class for music on hold.\n\n\n[See Also]\nBackground(), TIMEOUT\n',2),(171,'WaitForNoise','Waits for a specified amount of noise. ','[Synopsis]\nWaits for a specified amount of noise. \n\n[Description]\nWaits for up to <noiserequired> milliseconds of noise, <iterations> times.\nAn optional <timeout> specified the number of seconds to return after, even\nif we do not receive the specified amount of noise. Use <timeout> with caution,\nas it may defeat the purpose of this application, which is to wait indefinitely\nuntil noise is detected on the line.\n\n[Syntax]\nWaitForNoise(noiserequired[,iterations[,timeout]])\n\n[Arguments]\niterations\n    If not specified, defaults to \'1\'.\ntimeout\n    Is specified only to avoid an infinite loop in cases where silence\n    is never achieved.\n\n[See Also]\nWaitForSilence()\n',2),(172,'WaitForRing','Wait for Ring Application. ','[Synopsis]\nWait for Ring Application. \n\n[Description]\nReturns \'0\' after waiting at least <timeout> seconds, and only after the next\nring has completed. Returns \'0\' on success or \'-1\' on hangup.\n\n[Syntax]\nWaitForRing(timeout)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(173,'WaitForSilence','Waits for a specified amount of silence. ','[Synopsis]\nWaits for a specified amount of silence. \n\n[Description]\nWaits for up to <silencerequired> milliseconds of silence, <iterations> times.\nAn optional <timeout> specified the number of seconds to return after, even\nif we do not receive the specified amount of silence. Use <timeout> with\ncaution, as it may defeat the purpose of this application, which is to wait\nindefinitely until silence is detected on the line. This is particularly useful\nfor reverse-911-type call broadcast applications where you need to wait for\nan answering machine to complete its spiel before playing a message.\nTypically you will want to include two or more calls to WaitForSilence when\ndealing with an answering machine; first waiting for the spiel to finish,\nthen waiting for the beep, etc.\nExamples:\nWaitForSilence(500,2) will wait for 1/2 second of silence, twice\nWaitForSilence(1000) will wait for 1 second of silence, once\nWaitForSilence(300,3,10) will wait for 300ms silence, 3 times, and returns\nafter 10 sec, even if silence is not detected\nSets the channel variable ${WAITSTATUS} to one of these values:\n${WAITSTATUS}: \n    SILENCE: if exited with silence detected.\n    TIMEOUT: if exited without silence detected after timeout.\n\n[Syntax]\nWaitForSilence(silencerequired[,iterations[,timeout]])\n\n[Arguments]\niterations\n    If not specified, defaults to \'1\'.\ntimeout\n    Is specified only to avoid an infinite loop in cases where silence\n    is never achieved.\n\n[See Also]\nWaitForNoise()\n',2),(174,'WaitMusicOnHold','Wait, playing Music On Hold. ','[Synopsis]\nWait, playing Music On Hold. \n\n[Description]\n !!! DEPRECATED. Use MusicOnHold instead !!!\nPlays hold music specified number of seconds. Returns \'0\' when done, or \'-1\'\non hangup. If no hold music is available, the delay will still occur with\nno sound.\n !!! DEPRECATED. Use MusicOnHold instead !!!\n\n[Syntax]\nWaitMusicOnHold(delay)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(175,'WaitUntil','Wait (sleep) until the current time is the given epoch. ','[Synopsis]\nWait (sleep) until the current time is the given epoch. \n\n[Description]\nWaits until the given <epoch>.\nSets ${WAITUNTILSTATUS} to one of the following values:\n${WAITUNTILSTATUS}: \n    OK: Wait succeeded.\n    FAILURE: Invalid argument.\n    HANGUP: Channel hungup before time elapsed.\n    PAST: Time specified had already past.\n\n[Syntax]\nWaitUntil(epoch)\n\n[Arguments]\nNot available\n\n[See Also]\nNot available\n',2),(176,'While','Start a while loop. ','[Synopsis]\nStart a while loop. \n\n[Description]\nStart a While Loop.  Execution will return to this point when \'EndWhile()\'\nis called until expr is no longer true.\n\n[Syntax]\nWhile(expr)\n\n[Arguments]\nNot available\n\n[See Also]\nEndWhile(), ExitWhile(), ContinueWhile()\n',2),(177,'Zapateller','Block telemarketers with SIT. ','[Synopsis]\nBlock telemarketers with SIT. \n\n[Description]\nGenerates special information tone to block telemarketers from calling you.\nThis application will set the following channel variable upon completion:\n${ZAPATELLERSTATUS}: This will contain the last action accomplished by the\nZapateller application. Possible values include:\n    NOTHING\n    ANSWERED\n    ZAPPED\n\n[Syntax]\nZapateller(options)\n\n[Arguments]\noptions\n    Comma delimited list of options.\n    answer: Causes the line to be answered before playing the tone.\n\n    nocallerid: Causes Zapateller to only play the tone if there is no\n    callerid information available.\n\n\n[See Also]\nNot available\n',2);
/*!40000 ALTER TABLE `support_command` ENABLE KEYS */;
